ນ','block descriptionDisplays a heading that toggles the accordion panel.'=>'ສະແດງຫົວຂໍ້ທີ່ໃຊ້ເປີດ-ປິດແຜງອາຄໍດຽນ.','block titleAccordion Heading'=>'ຫົວຂໍ້ອາຄໍດຽນ','Allow'=>'ອະນຸຍາດ','Optional'=>'ບໍ່ບັງຄັບ','Visible'=>'ສະແດງໃຫ້ເຫັນ','Cannot create a user with an empty nicename.'=>'ບໍ່ສາມາດສ້າງຜູ້ໃຊ້ທີ່ມີຊື່ຫຼິ້ນວ່າງເປົ່າໄດ້.','The user_pass field is required when creating a new user. The user will need to reset their password before logging in.'=>'ຊ່ອງລະຫັດຜ່ານ (user_pass) ແມ່ນຈຳເປັນເມື່ອສ້າງຜູ້ໃຊ້ໃໝ່. ຜູ້ໃຊ້ຈະຕ້ອງຕັ້ງລະຫັດຜ່ານໃໝ່ກ່ອນທີ່ຈະເຂົ້າສູ່ລະບົບ.','Uncaught "%s" thrown:'=>'ກວດພົບຂໍ້ຜິດພາດ "%s" ທີ່ບໍ່ໄດ້ຈັດການ:','User error triggered:'=>'ເກີດຂໍ້ຜິດພາດຈາກຜູ້ໃຊ້:','Sorry, this post type does not support notes.'=>'ຂໍອະໄພ, ປະເພດໂພສນີ້ບໍ່ຮອງຮັບການບັນທຶກ.','Whether to flip in the vertical direction.'=>'ຈະພິກໃນແນວຕັ້ງ ຫຼື ບໍ່.','Whether to flip in the horizontal direction.'=>'ຈະພິກໃນແນວນອນ ຫຼື ບໍ່.','Flip direction.'=>'ທິດທາງການພິກ.','Flip arguments.'=>'ອາກິວເມັນການພິກ.','Flip type.'=>'ປະເພດການພິກ.','Flip'=>'ພິກ','Limit result set to attachments of a particular MIME type or MIME types.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະໄຟລ໌ແນບທີ່ມີປະເພດ MIME ທີ່ກຳນົດ.','Limit result set to attachments of a particular media type or media types.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະໄຟລ໌ແນບທີ່ມີປະເພດສື່ທີ່ກຳນົດ.','Unable to flip this image.'=>'ບໍ່ສາມາດພິກຮູບພາບນີ້ໄດ້.','The result of the ability execution.'=>'ຜົນຂອງການເຮັດວຽກຂອງຄວາມສາມາດ (ability).','Input parameters for the ability execution.'=>'ພາລາມິເຕີຂາເຂົ້າສຳລັບການເຮັດວຽກຂອງຄວາມສາມາດ.','Sorry, you are not allowed to execute this ability.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ໃຊ້ຄວາມສາມາດນີ້.','Abilities that perform destructive actions require DELETE method.'=>'ຄວາມສາມາດທີ່ເຮັດວຽກແບບລຶບລ້າງຂໍ້ມູນຕ້ອງໃຊ້ເມທອດ DELETE.','Read-only abilities require GET method.'=>'ຄວາມສາມາດແບບອ່ານຢ່າງດຽວຕ້ອງໃຊ້ເມທອດ GET.','Abilities that perform updates require POST method.'=>'ຄວາມສາມາດທີ່ເຮັດວຽກແບບອັບເດດຂໍ້ມູນຕ້ອງໃຊ້ເມທອດ POST.','Limit results to abilities in specific ability category.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄວາມສາມາດທີ່ຢູ່ໃນໝວດໝູ່ທີ່ກຳນົດ.','Annotations for the ability.'=>'ຄຳອະທິບາຍປະກອບສຳລັບຄວາມສາມາດ.','Meta information about the ability.'=>'ຂໍ້ມູນເມຕ້າກ່ຽວກັບຄວາມສາມາດ.','JSON Schema for the ability output.'=>'JSON Schema ສຳລັບຜົນການເຮັດວຽກ (output) ຂອງຄວາມສາມາດ.','JSON Schema for the ability input.'=>'JSON Schema ສຳລັບຂໍ້ມູນຂາເຂົ້າ (input) ຂອງຄວາມສາມາດ.','Ability category this ability belongs to.'=>'ໝວດໝູ່ຄວາມສາມາດທີ່ຄວາມສາມາດນີ້ສັງກັດຢູ່.','Description of the ability.'=>'ຄຳອະທິບາຍຂອງຄວາມສາມາດ.','Display label for the ability.'=>'ປ້າຍຊື່ສະແດງຂອງຄວາມສາມາດ.','Ability not found.'=>'ບໍ່ພົບຄວາມສາມາດ.','Unique identifier for the ability.'=>'ຕົວລະບຸສະເພາະ (ID) ຂອງຄວາມສາມາດ.','Meta information about the category.'=>'ຂໍ້ມູນເມຕ້າກ່ຽວກັບໝວດໝູ່.','Description of the category.'=>'ຄຳອະທິບາຍຂອງໝວດໝູ່.','Display label for the category.'=>'ປ້າຍຊື່ສະແດງຂອງໝວດໝູ່.','Ability category not found.'=>'ບໍ່ພົບໝວດໝູ່ຄວາມສາມາດ.','Unique identifier for the ability category.'=>'ຕົວລະບຸສະເພາະ (ID) ຂອງໝວດໝູ່ຄວາມສາມາດ.','The post ID must be greater than 0.'=>'ID ຂອງໂພສຕ້ອງໃຫຍ່ກວ່າ 0.','[%1$s] Note: "%2$s"'=>'[%1$s] ບັນທຶກ: "%2$s"','resolved/reopened'=>'ແກ້ໄຂແລ້ວ/ເປີດຄືນໃໝ່','Note: %s'=>'ບັນທຶກ: %s','New note on your post "%s"'=>'ມີບັນທຶກໃໝ່ໃນໂພສຂອງທ່ານ "%s"','That email address is pending activation and is not available for new registration. If you made a previous attempt with this email address, please check your inbox for an activation email. If left unconfirmed, it will become available in a couple of days.'=>'ທີ່ຢູ່ອີເມລນີ້ກຳລັງລໍຖ້າການເປີດໃຊ້ງານ ແລະ ຍັງບໍ່ສາມາດໃຊ້ໃນການລົງທະບຽນໃໝ່ໄດ້. ຫາກທ່ານເຄີຍລົງທະບຽນດ້ວຍອີເມລນີ້ມາກ່ອນ, ກະລຸນາກວດສອບກ່ອງຈົດໝາຍຂອງທ່ານເພື່ອເບິ່ງອີເມລຢືນຢັນ. ຫາກຍັງບໍ່ມີການຢືນຢັນ, ອີເມລນີ້ຈະກັບມາໃຊ້ໄດ້ອີກພາຍໃນ 2-3 ມື້.','The HTML parameter must be a string.'=>'ພາລາມິເຕີ HTML ຕ້ອງເປັນຂໍ້ຄວາມ (string).','Note resolution status'=>'ສະຖານະການແກ້ໄຂບັນທຶກ','Unable to retrieve the error message from the database server'=>'ບໍ່ສາມາດດຶງຂໍ້ຄວາມແຈ້ງຂໍ້ຜິດພາດຈາກເຊີບເວີຖານຂໍ້ມູນໄດ້','Cannot supply a fetchpriority `%1$s` for script `%2$s` because it is an alias (it lacks a `src` value).'=>'ບໍ່ສາມາດກຳນົດ fetchpriority `%1$s` ໃຫ້ກັບສະຄຣິບ `%2$s` ໄດ້ ເພາະມັນເປັນພຽງຊື່ແທນ (alias) ທີ່ບໍ່ມີຄ່າ `src`.','Invalid fetchpriority: %s'=>'Fetchpriority ບໍ່ຖືກຕ້ອງ: %s','Invalid fetchpriority `%1$s` defined for `%2$s` during script registration.'=>'ມີການກຳນົດ fetchpriority `%1$s` ທີ່ບໍ່ຖືກຕ້ອງສຳລັບ `%2$s` ໃນລະຫວ່າງການລົງທະບຽນສະຄຣິບ.','Non-empty string required for id.'=>'ID ຕ້ອງເປັນຂໍ້ຄວາມທີ່ບໍ່ວ່າງເປົ່າ.','Argument %s is deprecated'=>'ອາກິວເມັນ %s ຖືກຍົກເລີກການໃຊ້ງານແລ້ວ (deprecated)','Using simplified address parser is not recommended. Install the PHP IMAP extension for full RFC822 parsing.'=>'ບໍ່ແນະນຳໃຫ້ໃຊ້ຕົວວິເຄາະທີ່ຢູ່ແບບຫຍໍ້. ກະລຸນາຕິດຕັ້ງສ່ວນຂະຫຍາຍ PHP IMAP ເພື່ອການວິເຄາະຕາມມາດຕະຖານ RFC822 ທີ່ຄົບຖ້ວນ.','Server does not support SMTPUTF8 needed to send to Unicode addresses'=>'ເຊີບເວີບໍ່ຮອງຮັບ SMTPUTF8 ເຊິ່ງຈຳເປັນສຳລັບການສົ່ງໄປຫາທີ່ຢູ່ແບບ Unicode','IE conditional comments are ignored by all supported browsers.'=>'ຄຳອະທິບາຍແບບມີເງື່ອນໄຂຂອງ IE ຈະຖືກເມີນເສີຍໂດຍບຣາວເຊີທັງໝົດທີ່ຮອງຮັບ.','social link block variation nameYouTube'=>'YouTube','social link block variation nameYelp'=>'Yelp','social link block variation nameX'=>'X','social link block variation nameWhatsApp'=>'WhatsApp','social link block variation nameWordPress'=>'WordPress','social link block variation nameVK'=>'VK','social link block variation nameVimeo'=>'Vimeo','social link block variation nameTwitter'=>'Twitter','social link block variation nameTwitch'=>'Twitch','social link block variation nameTumblr'=>'Tumblr','social link block variation nameTikTok'=>'TikTok','social link block variation nameThreads'=>'Threads','social link block variation nameTelegram'=>'Telegram','social link block variation nameSpotify'=>'Spotify','social link block variation nameSoundCloud'=>'SoundCloud','social link block variation nameSnapchat'=>'Snapchat','social link block variation nameSkype'=>'Skype','social link block variation nameShare Icon'=>'ໄອຄອນແບ່ງປັນ','social link block variation nameReddit'=>'Reddit','social link block variation namePocket'=>'Pocket','social link block variation namePinterest'=>'Pinterest','social link block variation namePatreon'=>'Patreon','social link block variation nameMedium'=>'Medium','social link block variation nameMeetup'=>'Meetup','social link block variation nameMastodon'=>'Mastodon','social link block variation nameMail'=>'ອີເມລ','social link block variation nameLinkedIn'=>'LinkedIn','social link block variation nameLast.fm'=>'Last.fm','social link block variation nameInstagram'=>'Instagram','social link block variation nameGravatar'=>'Gravatar','social link block variation nameGitHub'=>'GitHub','social link block variation nameGoogle'=>'Google','social link block variation nameGoodreads'=>'Goodreads','social link block variation nameFoursquare'=>'Foursquare','social link block variation nameFlickr'=>'Flickr','social link block variation nameRSS Feed'=>'RSS Feed','social link block variation nameFacebook'=>'Facebook','social link block variation nameEtsy'=>'Etsy','social link block variation nameDropbox'=>'Dropbox','social link block variation nameDribbble'=>'Dribbble','social link block variation nameDiscord'=>'Discord','social link block variation nameDeviantArt'=>'DeviantArt','social link block variation nameCodePen'=>'CodePen','social link block variation nameLink'=>'ລິ້ງ','social link block variation nameBluesky'=>'Bluesky','social link block variation nameBehance'=>'Behance','social link block variation nameBandcamp'=>'Bandcamp','social link block variation nameAmazon'=>'Amazon','social link block variation name500px'=>'500px','Post Type: "%s"'=>'ປະເພດໂພສ: "%s"','%s character'=>'%s ຕົວອັກສອນ','Range of minutes to read%1$s–%2$s minutes'=>'%1$s–%2$s ນາທີ','%1$s comment<span class="screen-reader-text"> on %2$s</span>'=>'%1$s ຄວາມຄິດເຫັນ<span class="screen-reader-text"> ຕໍ່ %2$s</span>','No comments<span class="screen-reader-text"> on %s</span>'=>'ບໍ່ມີຄວາມຄິດເຫັນ<span class="screen-reader-text"> ຕໍ່ %s</span>','block bindings sourceTerm Data'=>'ຂໍ້ມູນເທີມ','block bindings sourcePost Data'=>'ຂໍ້ມູນໂພສ','The WordPress core version running on this site.'=>'ເວີຊັນຫຼັກຂອງ WordPress ທີ່ກຳລັງໃຊ້ໃນເວັບໄຊນີ້.','The database server vendor and version string reported by the driver.'=>'ຜູ້ໃຫ້ບໍລິການເຊີບເວີຖານຂໍ້ມູນ ແລະ ຂໍ້ມູນເວີຊັນທີ່ລາຍງານໂດຍໄດຣເວີ.','The PHP runtime version executing WordPress.'=>'ເວີຊັນຂອງ PHP runtime ທີ່ໃຊ້ປະມວນຜົນ WordPress.','The site\'s runtime environment classification (can be one of these: production, staging, development, local).'=>'ການຈັດປະເພດສະພາບແວດລ້ອມການເຮັດວຽກຂອງເວັບໄຊ (ເຊັ່ນ: production, staging, development, local).','Returns core details about the site\'s runtime context for diagnostics and compatibility (environment, PHP runtime, database server info, WordPress version).'=>'ສົ່ງຄືນລາຍລະອຽດຫຼັກກ່ຽວກັບສະພາບແວດລ້ອມການເຮັດວຽກຂອງເວັບໄຊ ເພື່ອການວິນິດໄສ ແລະ ຄວາມເຂົ້າກັນໄດ້ (ສະພາບແວດລ້ອມ, PHP runtime, ຂໍ້ມູນເຊີບເວີຖານຂໍ້ມູນ, ເວີຊັນ WordPress).','Get Environment Info'=>'ດຶງຂໍ້ມູນສະພາບແວດລ້ອມ','The locale string for the user, such as en_US.'=>'ລະຫັດພາສາສຳລັບຜູ້ໃຊ້ ເຊັ່ນ en_US.','The roles assigned to the user.'=>'ບົດບາດທີ່ຖືກກຳນົດໃຫ້ກັບຜູ້ໃຊ້.','The login username for the user.'=>'ຊື່ຜູ້ໃຊ້ສຳລັບເຂົ້າສູ່ລະບົບ.','The URL-friendly name for the user.'=>'ຊື່ຜູ້ໃຊ້ໃນຮູບແບບທີ່ເໝາະກັບ URL (slug).','The display name of the user.'=>'ຊື່ສະແດງຂອງຜູ້ໃຊ້.','The user ID.'=>'ID ຜູ້ໃຊ້.','Returns basic profile details for the current authenticated user to support personalization, auditing, and access-aware behavior.'=>'ສົ່ງຄືນລາຍລະອຽດໂປຣໄຟລ໌ພື້ນຖານຂອງຜູ້ໃຊ້ທີ່ເຂົ້າສູ່ລະບົບປັດຈຸບັນ ເພື່ອຮອງຮັບການປັບແຕ່ງສະເພາະບຸກຄົນ, ການກວດສອບ ແລະ ການຄວບຄຸມການເຂົ້າເຖິງ.','Get User Information'=>'ດຶງຂໍ້ມູນຜູ້ໃຊ້','Optional: Limit response to specific fields. If omitted, all fields are returned.'=>'ທາງເລືອກ: ຈຳກັດການຕອບສະໜອງສະເພາະບາງຟີວ. ຫາກເວັ້ນໄວ້, ຈະສົ່ງຄືນທຸກຟີວ.','Returns site information configured in WordPress. By default returns all fields, or optionally a filtered subset.'=>'ສົ່ງຄືນຂໍ້ມູນເວັບໄຊທີ່ຕັ້ງຄ່າໄວ້ໃນ WordPress. ໂດຍເລີ່ມຕົ້ນຈະສົ່ງຄືນທຸກຟີວ ຫຼື ສາມາດເລືອກສະເພາະບາງສ່ວນໄດ້.','Get Site Information'=>'ດຶງຂໍ້ມູນເວັບໄຊ','The WordPress version.'=>'ເວີຊັນຂອງ WordPress.','The site language locale code.'=>'ລະຫັດພາສາຂອງເວັບໄຊ.','The site character encoding.'=>'ການເຂົ້າລະຫັດຕົວອັກສອນຂອງເວັບໄຊ.','The site administrator email address.'=>'ທີ່ຢູ່ອີເມລຂອງຜູ້ດູແລລະບົບເວັບໄຊ.','The WordPress installation URL.'=>'URL ທີ່ຕິດຕັ້ງ WordPress.','The site home URL.'=>'URL ໜ້າຫຼັກຂອງເວັບໄຊ.','The site tagline.'=>'ຄຳຂວັນຂອງເວັບໄຊ.','The site title.'=>'ຫົວຂໍ້ເວັບໄຊ.','Abilities that retrieve or modify user information and settings.'=>'ຄວາມສາມາດໃນການດຶງຂໍ້ມູນ ຫຼື ແກ້ໄຂຂໍ້ມູນ ແລະ ການຕັ້ງຄ່າຂອງຜູ້ໃຊ້.','Abilities that retrieve or modify site information and settings.'=>'ຄວາມສາມາດໃນການດຶງຂໍ້ມູນ ຫຼື ແກ້ໄຂຂໍ້ມູນ ແລະ ການຕັ້ງຄ່າຂອງເວັບໄຊ.','Ability "%s" does not have necessary permission.'=>'ຄວາມສາມາດ "%s" ບໍ່ມີການອະນຸຍາດທີ່ຈຳເປັນ.','Ability "%1$s" has invalid output. Reason: %2$s'=>'ຄວາມສາມາດ "%1$s" ມີຜົນການເຮັດວຽກ (output) ທີ່ບໍ່ຖືກຕ້ອງ. ສາເຫດ: %2$s','Ability "%s" does not have a valid execute callback.'=>'ຄວາມສາມາດ "%s" ບໍ່ມີ execute callback ທີ່ຖືກຕ້ອງ.','Ability "%s" does not have a valid permission callback.'=>'ຄວາມສາມາດ "%s" ບໍ່ມີ permission callback ທີ່ຖືກຕ້ອງ.','Ability "%1$s" has invalid input. Reason: %2$s'=>'ຄວາມສາມາດ "%1$s" ມີຂໍ້ມູນຂາເຂົ້າ (input) ທີ່ບໍ່ຖືກຕ້ອງ. ສາເຫດ: %2$s','Ability "%s" does not define an input schema required to validate the provided input.'=>'ຄວາມສາມາດ "%s" ບໍ່ໄດ້ກຳນົດ input schema ທີ່ຈຳເປັນສຳລັບການກວດສອບຂໍ້ມູນຂາເຂົ້າ.','The ability meta should provide a valid `show_in_rest` boolean.'=>'ຂໍ້ມູນເມຕ້າຂອງຄວາມສາມາດຄວນມີຄ່າ boolean `show_in_rest` ທີ່ຖືກຕ້ອງ.','The ability meta should provide a valid `annotations` array.'=>'ຂໍ້ມູນເມຕ້າຂອງຄວາມສາມາດຄວນມີອາເຣ `annotations` ທີ່ຖືກຕ້ອງ.','The ability properties should provide a valid `meta` array.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຄວນມີອາເຣ `meta` ທີ່ຖືກຕ້ອງ.','The ability properties should provide a valid `output_schema` definition.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຄວນມີການກຳນົດ `output_schema` ທີ່ຖືກຕ້ອງ.','The ability properties should provide a valid `input_schema` definition.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຄວນມີການກຳນົດ `input_schema` ທີ່ຖືກຕ້ອງ.','The ability properties must provide a valid `permission_callback` function.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຕ້ອງມີຟັງຊັນ `permission_callback` ທີ່ຖືກຕ້ອງ.','The ability properties must contain a valid `execute_callback` function.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຕ້ອງມີຟັງຊັນ `execute_callback` ທີ່ຖືກຕ້ອງ.','The ability properties must contain a `category` string.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຕ້ອງມີຂໍ້ຄວາມ `category`.','The ability properties must contain a `description` string.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຕ້ອງມີຂໍ້ຄວາມ `description`.','The ability properties must contain a `label` string.'=>'ຄຸນສົມບັດຂອງຄວາມສາມາດຕ້ອງມີຂໍ້ຄວາມ `label`.','Property "%1$s" is not a valid property for ability "%2$s". Please check the %3$s class for allowed properties.'=>'ຄຸນສົມບັດ "%1$s" ບໍ່ແມ່ນຄຸນສົມບັດທີ່ຖືກຕ້ອງສຳລັບຄວາມສາມາດ "%2$s". ກະລຸນາກວດສອບຄລາສ %3$s ສຳລັບຄຸນສົມບັດທີ່ອະນຸຍາດ.','The ability category properties should provide a valid `meta` array.'=>'ຄຸນສົມບັດຂອງໝວດໝູ່ຄວາມສາມາດຄວນມີອາເຣ `meta` ທີ່ຖືກຕ້ອງ.','The ability category properties must contain a `description` string.'=>'ຄຸນສົມບັດຂອງໝວດໝູ່ຄວາມສາມາດຕ້ອງມີຂໍ້ຄວາມ `description`.','The ability category properties must contain a `label` string.'=>'ຄຸນສົມບັດຂອງໝວດໝູ່ຄວາມສາມາດຕ້ອງມີຂໍ້ຄວາມ `label`.','Property "%1$s" is not a valid property for ability category "%2$s". Please check the %3$s class for allowed properties.'=>'ຄຸນສົມບັດ "%1$s" ບໍ່ແມ່ນຄຸນສົມບັດທີ່ຖືກຕ້ອງສຳລັບໝວດໝູ່ຄວາມສາມາດ "%2$s". ກະລຸນາກວດສອບຄລາສ %3$s ສຳລັບຄຸນສົມບັດທີ່ອະນຸຍາດ.','The ability category slug cannot be empty.'=>'ສະລັກ (slug) ຂອງໝວດໝູ່ຄວາມສາມາດບໍ່ສາມາດວ່າງເປົ່າໄດ້.','Ability category "%s" not found.'=>'ບໍ່ພົບໝວດໝູ່ຄວາມສາມາດ "%s".','Ability category slug must contain only lowercase alphanumeric characters and dashes.'=>'ສະລັກຂອງໝວດໝູ່ຄວາມສາມາດຕ້ອງປະກອບດ້ວຍຕົວອັກສອນພາສາອັງກິດພິມນ້ອຍ, ຕົວເລກ ແລະ ເຄື່ອງໝາຍຂີດກາງເທົ່ານັ້ນ.','Ability category "%s" is already registered.'=>'ໝວດໝູ່ຄວາມສາມາດ "%s" ໄດ້ຖືກລົງທະບຽນແລ້ວ.','Ability API should not be initialized before the %s action has fired.'=>'ບໍ່ຄວນເລີ່ມການເຮັດວຽກຂອງ Ability API ກ່ອນທີ່ແອັກຊັນ %s ຈະເຮັດວຽກ.','Ability "%s" not found.'=>'ບໍ່ພົບຄວາມສາມາດ "%s".','The ability args should provide a valid `ability_class` that extends WP_Ability.'=>'ອາກິວເມັນຂອງຄວາມສາມາດຄວນມີ `ability_class` ທີ່ສືບທອດມາຈາກ WP_Ability ທີ່ຖືກຕ້ອງ.','Ability category "%1$s" is not registered. Please register the ability category before assigning it to ability "%2$s".'=>'ໝວດໝູ່ຄວາມສາມາດ "%1$s" ຍັງບໍ່ໄດ້ລົງທະບຽນ. ກະລຸນາລົງທະບຽນໝວດໝູ່ກ່ອນທີ່ຈະກຳນົດໃຫ້ກັບຄວາມສາມາດ "%2$s".','Ability "%s" is already registered.'=>'ຄວາມສາມາດ "%s" ໄດ້ຖືກລົງທະບຽນແລ້ວ.','Ability name must be a string containing a namespace prefix, i.e. "my-plugin/my-ability". It can only contain lowercase alphanumeric characters, dashes and the forward slash.'=>'ຊື່ຄວາມສາມາດຕ້ອງເປັນຂໍ້ຄວາມທີ່ມີ namespace ນຳໜ້າ ເຊັ່ນ "my-plugin/my-ability". ໂດຍສາມາດມີໄດ້ພຽງຕົວອັກສອນພາສາອັງກິດພິມນ້ອຍ, ຕົວເລກ, ເຄື່ອງໝາຍຂີດກາງ ແລະ ເຄື່ອງໝາຍທັບ.','Ability categories must be registered on the %1$s action. The ability category %2$s was not registered.'=>'ໝວດໝູ່ຄວາມສາມາດຕ້ອງຖືກລົງທະບຽນໃນແອັກຊັນ %1$s. ໝວດໝູ່ຄວາມສາມາດ %2$s ບໍ່ໄດ້ຖືກລົງທະບຽນ.','Abilities must be registered on the %1$s action. The ability %2$s was not registered.'=>'ຄວາມສາມາດຕ່າງໆຕ້ອງຖືກລົງທະບຽນໃນແອັກຊັນ %1$s. ຄວາມສາມາດ %2$s ບໍ່ໄດ້ຖືກລົງທະບຽນ.','Sorry, you are not allowed to edit users.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ແກ້ໄຂຜູ້ໃຊ້.','block keywordcustom post types'=>'ປະເພດໂພສກຳນົດເອງ','block keywordblogs'=>'ບລັອກ','block keywordblog'=>'ບລັອກ','block descriptionDisplay the total number of results in a query.'=>'ສະແດງຈຳນວນຜົນການຄົ້ນຫາທັງໝົດໃນການສອບຖາມ.','block titleQuery Total'=>'ຜົນລວມການສອບຖາມ','nounUpload'=>'ອັບໂຫຼດ','verbUpload'=>'ອັບໂຫຼດ','Email checks are rate limited to once every %s.'=>'ການກວດສອບອີເມວຖືກຈຳກັດໃຫ້ກວດໄດ້ໜຶ່ງຄັ້ງທຸກໆ %s.','This function should not be called before the theme directory is registered.'=>'ຟັງຊັນນີ້ບໍ່ຄວນຖືກເອີ້ນໃຊ້ກ່ອນທີ່ໂຟນເດີທີມຈະຖືກລົງທະບຽນ.','Add Link Category'=>'ເພີ່ມໝວດໝູ່ລິ້ງ','This file cannot be processed by the web server.'=>'ເວັບເຊີເວີບໍ່ສາມາດປະມວນຜົນໄຟລ໌ນີ້ໄດ້.','An error occurred while processing your request. Please try again later.'=>'ເກີດຂໍ້ຜິດພາດຂຶ້ນໃນຂະນະທີ່ກຳລັງປະມວນຜົນຄຳຮ້ອງຂໍຂອງເຈົ້າ. ກະລຸນາລອງໃໝ່ໃນພາຍຫຼັງ.','A list of allowed area values for template parts.'=>'ລາຍຊື່ຄ່າພື້ນທີ່ທີ່ອະນຸຍາດສຳລັບສ່ວນປະກອບເທັມເພລດ.','A list of default template types.'=>'ລາຍຊື່ປະເພດເທັມເພລດເລີ່ມຕົ້ນ.','Templates based on theme files can\'t have revisions.'=>'ເທັມເພລດທີ່ອີງໃສ່ໄຟລ໌ທີມບໍ່ສາມາດມີລຸ້ນການແກ້ໄຂ (revisions) ໄດ້.','Whether to ignore sticky posts or not.'=>'ຈະໃຫ້ລະເວັ້ນໂພສທີ່ປັກໝຸດໄວ້ຫຼືບໍ່.','The web server cannot generate responsive image sizes for this image. Convert it to JPEG or PNG before uploading.'=>'ເວັບເຊີເວີບໍ່ສາມາດສ້າງຂະໜາດຮູບພາບແບບຕອບສະໜອງ (responsive) ສຳລັບຮູບນີ້ໄດ້. ກະລຸນາແປງເປັນ JPEG ຫຼື PNG ກ່ອນທີ່ຈະອັບໂຫຼດ.','The REST route parameter must be a string.'=>'ພາລາມິເຕີ REST route ຕ້ອງເປັນຂໍ້ຄວາມ (string).','Add Template Part'=>'ເພີ່ມສ່ວນປະກອບເທັມເພລດ','Add Template'=>'ເພີ່ມເທັມເພລດ','Add Changeset'=>'ເພີ່ມ Changeset','Add Media File'=>'ເພີ່ມໄຟລ໌ສື່','Invalid password.'=>'ລະຫັດຜ່ານບໍ່ຖືກຕ້ອງ.','Unsupported hashing algorithm: %1$s. Supported algorithms are: %2$s'=>'ບໍ່ຮອງຮັບອັລກໍຣິດທຶມການແຮຊ (hashing): %1$s. ອັລກໍຣິດທຶມທີ່ຮອງຮັບແມ່ນ: %2$s','Cannot set bookmarks on tokens that do no appear in the original HTML text.'=>'ບໍ່ສາມາດຕັ້ງບຸກມາກໃນໂທເຄັນທີ່ບໍ່ປາກົດຢູ່ໃນຂໍ້ຄວາມ HTML ຕົ້ນສະບັບ.','The context element "%s" is not supported.'=>'ບໍ່ຮອງຮັບອົງປະກອບບໍລິບົດ (context element) "%s".','The context element cannot be a void element, found "%s".'=>'ອົງປະກອບບໍລິບົດບໍ່ສາມາດເປັນ void element, ພົບ "%s".','The context element must be a start tag.'=>'ອົງປະກອບບໍລິບົດຕ້ອງເປັນແທັກເລີ່ມຕົ້ນ (start tag).','No valid context element was detected.'=>'ກວດບໍ່ພົບອົງປະກອບບໍລິບົດທີ່ຖືກຕ້ອງ.','The %s parameter must not be empty.'=>'ພາລາມິເຕີ %s ຕ້ອງບໍ່ຫວ່າງເປົ່າ.','Add Image'=>'ເພີ່ມຮູບພາບ','Add Header Image'=>'ເພີ່ມຮູບພາບສ່ວນຫົວ','No posts found or an error occurred while retrieving posts.'=>'ບໍ່ພົບໂພສ ຫຼື ເກີດຂໍ້ຜິດພາດໃນຂະນະທີ່ກຳລັງດຶງຂໍ້ມູນໂພສ.','An error occurred while processing your comment. Please ensure all fields are filled correctly and try again.'=>'ເກີດຂໍ້ຜິດພາດໃນຂະນະທີ່ກຳລັງປະມວນຜົນຄຳເຫັນຂອງເຈົ້າ. ກະລຸນາກວດສອບວ່າໄດ້ປ້ອນຂໍ້ມູນທຸກຫ້ອງຢ່າງຖືກຕ້ອງແລ້ວລອງໃໝ່ອີກຄັ້ງ.','Invalid URL pattern context %s.'=>'ບໍລິບົດຮູບແບບ URL %s ບໍ່ຖືກຕ້ອງ.','Add Category'=>'ເພີ່ມໝວດໝູ່','Add Tag'=>'ເພີ່ມແທັກ','The eagerness value "%s" is forbidden for document-level speculation rules.'=>'ຄ່າຄວາມກະຕືລືລົ້ນ "%s" ແມ່ນຖືກຫ້າມສຳລັບກົດເກນການຄາດເດົາໃນລະດັບເອກະສານ.','The value "%s" is not a valid eagerness for a speculation rule.'=>'ຄ່າ "%s" ບໍ່ແມ່ນຄ່າຄວາມກະຕືລືລົ້ນທີ່ຖືກຕ້ອງສຳລັບກົດເກນການຄາດເດົາ.','A speculation rule of source "%1$s" must not include a "%2$s" key.'=>'ກົດເກນການຄາດເດົາຂອງແຫຼ່ງທີ່ມາ "%1$s" ຕ້ອງບໍ່ມີຄີ "%2$s".','The value "%s" is not a valid source for a speculation rule.'=>'ຄ່າ "%s" ບໍ່ແມ່ນແຫຼ່ງທີ່ມາທີ່ຖືກຕ້ອງສຳລັບກົດເກນການຄາດເດົາ.','A speculation rule must include either a "%1$s" key or a "%2$s" key, but not both.'=>'ກົດເກນການຄາດເດົາຕ້ອງມີຄີ "%1$s" ຫຼື "%2$s", ແຕ່ບໍ່ສາມາດມີທັງສອງຢ່າງໄດ້.','A speculation rule with ID "%s" already exists.'=>'ມີກົດເກນການຄາດເດົາທີ່ມີ ID "%s" ຢູ່ແລ້ວ.','The value "%s" is not a valid ID for a speculation rule.'=>'ຄ່າ "%s" ບໍ່ແມ່ນ ID ທີ່ຖືກຕ້ອງສຳລັບກົດເກນການຄາດເດົາ.','The value "%s" is not a valid speculation rules mode.'=>'ຄ່າ "%s" ບໍ່ແມ່ນໂໝດກົດເກນການຄາດເດົາທີ່ຖືກຕ້ອງ.','Add Page'=>'ເພີ່ມໜ້າ','Add Post'=>'ເພີ່ມໂພສ','Cannot set or reset variable: '=>'ບໍ່ສາມາດກຳນົດ ຫຼື ຕັ້ງຄ່າຕົວປ່ຽນໃໝ່: ','SMTP server error: '=>'ຂໍ້ຜິດພາດຂອງເຊີເວີ SMTP: ','Detail: '=>'ລາຍລະອຽດ: ','SMTP connect() failed.'=>'ການເຊື່ອມຕໍ່ SMTP connect() ລົ້ມເຫຼວ.','Additional SMTP info: '=>'ຂໍ້ມູນ SMTP ເພີ່ມເຕີມ: ','SMTP code: '=>'ລະຫັດ SMTP: ','Signing Error: '=>'ຂໍ້ຜິດພາດໃນການລົງລາຍເຊັນ: ','SMTP Error: The following recipients failed: '=>'ຂໍ້ຜິດພາດ SMTP: ຜູ້ຮັບຕໍ່ໄປນີ້ລົ້ມເຫຼວ: ','You must provide at least one recipient email address.'=>'ເຈົ້າຕ້ອງລະບຸອີເມວຜູ້ຮັບຢ່າງໜ້ອຍໜຶ່ງທີ່ຢູ່.',' mailer is not supported.'=>' ບໍ່ຮອງຮັບຕົວສົ່ງເມວນີ້.','Invalid host: '=>'ໂຮສບໍ່ຖືກຕ້ອງ: ','Invalid host entry: '=>'ລາຍການໂຮສບໍ່ຖືກຕ້ອງ: ','Invalid header name or value'=>'ຊື່ ຫຼື ຄ່າສ່ວນຫົວ (header) ບໍ່ຖືກຕ້ອງ','Invalid address: '=>'ທີ່ຢູ່ບໍ່ຖືກຕ້ອງ: ','Could not instantiate mail function.'=>'ບໍ່ສາມາດສ້າງຟັງຊັນ mail ໄດ້.','The following From address failed: '=>'ທີ່ຢູ່ຜູ້ສົ່ງ (From) ຕໍ່ໄປນີ້ລົ້ມເຫຼວ: ','File Error: Could not open file: '=>'ຂໍ້ຜິດພາດຂອງໄຟລ໌: ບໍ່ສາມາດເປີດໄຟລ໌: ','Could not access file: '=>'ບໍ່ສາມາດເຂົ້າເຖິງໄຟລ໌: ','Extension missing: '=>'ຂາດສ່ວນຂະຫຍາຍ (extension): ','Could not execute: '=>'ບໍ່ສາມາດປະມວນຜົນ: ','Unknown encoding: '=>'ການເຂົ້າລະຫັດທີ່ບໍ່ຮູ້ຈັກ: ','Message body empty'=>'ເນື້ອໃນຂໍ້ຄວາມຫວ່າງເປົ່າ','SMTP Error: Data not accepted.'=>'ຂໍ້ຜິດພາດ SMTP: ຂໍ້ມູນບໍ່ຖືກຍອມຮັບ.','SMTP Error: Could not connect to SMTP host.'=>'ຂໍ້ຜິດພາດ SMTP: ບໍ່ສາມາດເຊື່ອມຕໍ່ກັບໂຮສ SMTP ໄດ້.','Your version of PHP is affected by a bug that may result in corrupted messages. To fix it, switch to sending using SMTP, disable the %1$s option in your %2$s, or switch to MacOS or Linux, or upgrade your PHP version.'=>'PHP ເວີຊັນທີ່ເຈົ້າໃຊ້ຢູ່ໄດ້ຮັບຜົນກະທົບຈາກບັກທີ່ອາດຈະເຮັດໃຫ້ຂໍ້ຄວາມເສຍຫາຍ. ເພື່ອແກ້ໄຂ, ໃຫ້ປ່ຽນໄປໃຊ້ການສົ່ງຜ່ານ SMTP, ປິດໃຊ້ງານຕົວເລືອກ %1$s ໃນ %2$s ຂອງເຈົ້າ, ຫຼື ປ່ຽນໄປໃຊ້ MacOS ຫຼື Linux, ຫຼື ອັບເກຣດ PHP ເວີຊັນໃໝ່.','SMTP Error: Could not authenticate.'=>'ຂໍ້ຜິດພາດ SMTP: ບໍ່ສາມາດຢືນຢັນຕົວຕົນໄດ້.','Name for the Code editor tab (formerly Text)Code'=>'ໂຄ້ດ','The link text cannot be empty.'=>'ຂໍ້ຄວາມລິ້ງຕ້ອງບໍ່ຫວ່າງເປົ່າ.','Please provide a valid link.'=>'ກະລຸນາລະບຸລິ້ງທີ່ຖືກຕ້ອງ.','An error occurred while customizing. Please refresh the page and try again.'=>'ເກີດຂໍ້ຜິດພາດໃນຂະນະທີ່ກຳລັງປັບແຕ່ງ. ກະລຸນາໂຫຼດໜ້າໃໝ່ແລ້ວລອງໃໝ່ອີກຄັ້ງ.','No registered block metadata collection was found for the provided path.'=>'ບໍ່ພົບຄໍເລັກຊັນ metadata ຂອງບລັອກທີ່ລົງທະບຽນໄວ້ສຳລັບເສັ້ນທາງ (path) ທີ່ລະບຸ.','%d result found'=>'ພົບ %d ຜົນລັບ','Displaying %1$s – %2$s of %3$s'=>'ກຳລັງສະແດງ %1$s – %2$s ຈາກທັງໝົດ %3$s','Displaying %1$s of %2$s'=>'ກຳລັງສະແດງ %1$s ຈາກທັງໝົດ %2$s','Enlarge'=>'ຂະຫຍາຍ','This page is blank because the template is empty. You can reset or customize it in the Site Editor.'=>'ໜ້ານີ້ຫວ່າງເປົ່າເນື່ອງຈາກເທັມເພລດບໍ່ມີເນື້ອຫາ. ເເຈົ້າສາມາດຕັ້ງຄ່າໃໝ່ ຫຼື ປັບແຕ່ງມັນໄດ້ໃນຕົວແກ້ໄຂເວັບໄຊ (Site Editor).','Displays the %s post format archive.'=>'ສະແດງຄັງເກັບຂໍ້ມູນຮູບແບບໂພສ %s.','Template namePost Format: %s'=>'ຮູບແບບໂພສ: %s','Bold sections designed to showcase key content.'=>'ສ່ວນທີ່ໂດດເດັ່ນທີ່ຖືກອອກແບບມາເພື່ອສະແດງເນື້ອຫາສຳຄັນ.','Block metadata collections cannot be registered as one of the following directories or their parent directories: %s'=>'ຄໍເລັກຊັນ metadata ຂອງບລັອກບໍ່ສາມາດລົງທະບຽນເປັນໜຶ່ງໃນໂຟນເດີຕໍ່ໄປນີ້ ຫຼື ໂຟນເດີຫຼັກຂອງພວກມັນໄດ້: %s','Shadow nameCrisp'=>'ຄົມຊັດ','Shadow nameOutlined'=>'ມີເສັ້ນຂອບ','Shadow nameSharp'=>'ແຫຼມຄົມ','Shadow nameDeep'=>'ເລິກ','Shadow nameNatural'=>'ທຳມະຊາດ','Aspect ratio nameTall - 9:16'=>'ແນວຕັ້ງ - 9:16','Aspect ratio nameWide - 16:9'=>'ແນວນອນ - 16:9','Aspect ratio nameClassic Portrait - 2:3'=>'ແນວຕັ້ງຄລາສສິກ - 2:3','Aspect ratio nameClassic - 3:2'=>'ຄລາສສິກ - 3:2','Aspect ratio namePortrait - 3:4'=>'ແນວຕັ້ງ - 3:4','Aspect ratio nameStandard - 4:3'=>'ມາດຕະຖານ - 4:3','Aspect ratio nameSquare - 1:1'=>'ສີ່ລ່ຽມຈະຕຸລັດ - 1:1','block descriptionA cloud of popular keywords, each sized by how often it appears.'=>'ກຸ່ມຄຳສັບຍອດນິຍົມ ໂດຍແຕ່ລະຄຳຈະມີຂະໜາດຕາມຄວາມຖີ່ທີ່ປາກົດ.','block descriptionAn organized collection of items displayed in a specific order.'=>'ຊຸດລາຍການທີ່ຈັດລະບຽບໄວ້ ແລະ ສະແດງຕາມລຳດັບທີ່ກຳນົດ.','block descriptionAn individual item within a list.'=>'ລາຍການແຕ່ລະລາຍການພາຍໃນລາຍການລຽງລຳດັບ.','block keywordcategories'=>'ໝວດໝູ່','block descriptionDisplay a list of all terms of a given taxonomy.'=>'ສະແດງລາຍຊື່ທຸກໆຄຳຂອງແຕ່ລະໝວດໝູ່ທີ່ກຳນົດ.','block titleTerms List'=>'ລາຍຊື່ຄຳສັບ (Terms List)','Plugin that registered the template.'=>'ປລັກອິນທີ່ລົງທະບຽນເທັມເພລດນີ້.','Limit result set to items assigned one or more given formats.'=>'ຈຳກັດຜົນລັບໃຫ້ສະແດງສະເພາະລາຍການທີ່ກຳນົດຮູບແບບໄວ້ໜຶ່ງຢ່າງ ຫຼື ຫຼາຍກວ່າ.','How to interpret the search input.'=>'ວິທີແປຄຳຄົ້ນຫາ.','REST API routes must be registered on the %1$s action. Instead route \'%2$s\' with namespace \'%3$s\' was not registered on this action.'=>'REST API routes ຕ້ອງຖືກລົງທະບຽນໃນແອັກຊັນ %1$s. ແຕ່ route \'%2$s\' ທີ່ມີ namespace \'%3$s\' ບໍ່ໄດ້ຖືກລົງທະບຽນໃນແອັກຊັນນີ້.','Namespace must not start or end with a slash. Instead namespace \'%1$s\' for route \'%2$s\' seems to contain a slash.'=>'Namespace ຕ້ອງບໍ່ຂຶ້ນຕົ້ນ ຫຼື ລົງທ້າຍດ້ວຍ slash. ແຕ່ namespace \'%1$s\' ສຳລັບ route \'%2$s\' ເບິ່ງຄືວ່າມີ slash ຢູ່.','Route must be specified. Instead within the namespace \'%1$s\', there seems to be an empty route \'%2$s\'.'=>'ຕ້ອງລະບຸ Route. ແຕ່ໃນ namespace \'%1$s\', ເບິ່ງຄືວ່າມີ route \'%2$s\' ທີ່ຫວ່າງເປົ່າ.','Routes must be namespaced with plugin or theme name and version. Instead there seems to be an empty namespace \'%1$s\' for route \'%2$s\'.'=>'Routes ຕ້ອງມີ namespace ດ້ວຍຊື່ປລັກອິນ ຫຼື ທີມ ແລະ ເວີຊັນ. ແຕ່ເບິ່ງຄືວ່າມີ namespace \'%1$s\' ທີ່ຫວ່າງເປົ່າສຳລັບ route \'%2$s\'.','As an app icon and a browser icon.'=>'ໃຊ້ເປັນໄອຄອນແອັບ ແລະ ໄອຄອນບຣາວເຊີ.','nounSite Icon Preview'=>'ຕົວຢ່າງໄອຄອນເວັບໄຊ','Comments pagination'=>'ການແບ່ງໜ້າຄຳເຫັນ','Posts pagination'=>'ການແບ່ງໜ້າໂພສ','Translation loading for the %1$s domain was triggered too early. This is usually an indicator for some code in the plugin or theme running too early. Translations should be loaded at the %2$s action or later.'=>'ການໂຫຼດຄຳແປສຳລັບໂດເມນ %1$s ຖືກເອີ້ນໃຊ້ໄວເກີນໄປ. ນີ້ມັກຈະເປັນສັນຍານວ່າບາງໂຄ້ດໃນປລັກອິນ ຫຼື ທີມເຮັດວຽກກ່ອນກຳນົດ. ຄຳແປຄວນຖືກໂຫຼດໃນແອັກຊັນ %2$s ຫຼື ຫຼັງຈາກນັ້ນ.','The element can only be read during directive processing.'=>'ອົງປະກອບສາມາດອ່ານໄດ້ສະເພາະໃນລະຫວ່າງການປະມວນຜົນ directive ເທົ່ານັ້ນ.','There has been a critical error on this website. Please check your site admin email inbox for instructions. If you continue to have problems, please try the <a href="%s">support forums</a>.'=>'ເກີດຂໍ້ຜິດພາດຮ້າຍແຮງໃນເວັບໄຊນີ້. ກະລຸນາກວດສອບອີເມວຂອງຜູ້ດູແລລະບົບເພື່ອເບິ່ງຄຳແນະນຳ. ຖ້າຍັງພົບບັນຫາຢູ່, ກະລຸນາລອງໄປທີ່ <a href="%s">ຟໍຣຳຊ່ວຍເຫຼືອ</a>.','Template "%s" is not registered.'=>'ເທັມເພລດ "%s" ບໍ່ໄດ້ຖືກລົງທະບຽນ.','Template "%s" is already registered.'=>'ເທັມເພລດ "%s" ຖືກລົງທະບຽນໄວ້ແລ້ວ.','Template names must contain a namespace prefix. Example: my-plugin//my-custom-template'=>'ຊື່ເທັມເພລດຕ້ອງມີ namespace ນຳໜ້າ. ຕົວຢ່າງ: my-plugin//my-custom-template','Template names must not contain uppercase characters.'=>'ຊື່ເທັມເພລດຕ້ອງບໍ່ມີຕົວອັກສອນພິມໃຫຍ່.','Template names must be strings.'=>'ຊື່ເທັມເພລດຕ້ອງເປັນຂໍ້ຄວາມ (strings).','The specified manifest file does not exist.'=>'ບໍ່ມີໄຟລ໌ manifest ທີ່ລະບຸໄວ້.','block titleWidget Group'=>'ກຸ່ມວິດເຈັດ','Disable'=>'ປິດໃຊ້ງານ','Comment status'=>'ສະຖານະຄຳເຫັນ','Items deleted.'=>'ລຶບລາຍການແລ້ວ.','https://developer.wordpress.org/advanced-administration/wordpress/cookies/#enable-cookies-in-your-browser'=>'https://developer.wordpress.org/advanced-administration/wordpress/cookies/#enable-cookies-in-your-browser','https://developer.wordpress.org/advanced-administration/wordpress/cookies/'=>'https://developer.wordpress.org/advanced-administration/wordpress/cookies/','https://developer.wordpress.org/advanced-administration/wordpress/wp-config/'=>'https://developer.wordpress.org/advanced-administration/wordpress/wp-config/','Custom spacing sizes if defined by the theme.'=>'ຂະໜາດໄລຍະຫ່າງກຳນົດເອງ ຖ້າທີມມີການກຳນົດໄວ້.','taxonomy template name%s Archives'=>'ຄັງເກັບຂໍ້ມູນ %s','The uri for the theme\'s template directory. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet directory.'=>'URI ສຳລັບໂຟນເດີເທັມເພລດຂອງທີມ. ຖ້ານີ້ແມ່ນ Child theme ມັນຈະອ້າງອີງເຖິງ Parent theme, ຖ້າບໍ່ດັ່ງນັ້ນມັນຈະຄືກັນກັບໂຟນເດີ stylesheet ຂອງທີມ.','The uri for the theme\'s stylesheet directory.'=>'URI ສຳລັບໂຟນເດີ stylesheet ຂອງທີມ.','An array of the class names for the post container element.'=>'ອາເຣຂອງຊື່ຄລາດ (class names) ສຳລັບອົງປະກອບສ່ວນບັນຈຸໂພສ.','Override the default excerpt length.'=>'ກຳນົດຄວາມຍາວເນື້ອຫາຫຍໍ້ໃໝ່ ແທນຄ່າມາດຕະຖານ.','The template_lock associated with the post type, or false if none.'=>'The template_lock ທີ່ກ່ຽວຂ້ອງກັບປະເພດໂພສ, ຫຼື false ຖ້າບໍ່ມີ.','The block template associated with the post type.'=>'ເທັມເພລດບລັອກທີ່ກ່ຽວຂ້ອງກັບປະເພດໂພສ.','REST API resource link nameJSON'=>'JSON','Template updated.'=>'ອັບເດດເທັມເພລດແລ້ວ.','https://developer.wordpress.org/advanced-administration/debug/debug-network/'=>'https://developer.wordpress.org/advanced-administration/debug/debug-network/','https://www.w3.org/WAI/tutorials/images/decision-tree/'=>'https://www.w3.org/WAI/tutorials/images/decision-tree/','Uncaught error executing a derived state callback with path "%1$s" and namespace "%2$s".'=>'ພົບຂໍ້ຜິດພາດທີ່ບໍ່ສາມາດຈັດການໄດ້ໃນຂະນະທີ່ປະມວນຜົນ state callback ດ້ວຍເສັ້ນທາງ "%1$s" ແລະ namespace "%2$s".','Namespace or reference path cannot be empty. Directive value referenced: %s'=>'Namespace ຫຼື ເສັ້ນທາງອ້າງອີງຕ້ອງບໍ່ຫວ່າງເປົ່າ. ຄ່າ directive ທີ່ຖືກອ້າງອີງ: %s','Interactivity directives were detected on an incompatible %1$s tag when processing "%2$s". These directives will be ignored in the server side render.'=>'ກວດພົບ Interactivity directives ໃນແທັກ %1$s ທີ່ບໍ່ເຂົ້າກັນໃນຂະນະທີ່ກຳລັງປະມວນຜົນ "%2$s". directives ເຫຼົ່ານີ້ຈະຖືກລະເວັ້ນໃນການປະມວນຜົນຝັ່ງເຊີເວີ.','The context can only be read during directive processing.'=>'ບໍລິບົດ (context) ສາມາດອ່ານໄດ້ສະເພາະໃນລະຫວ່າງການປະມວນຜົນ directive ເທັມນັ້ນ.','The namespace can only be omitted during directive processing.'=>'Namespace ສາມາດລະເວັ້ນໄດ້ສະເພາະໃນລະຫວ່າງການປະມວນຜົນ directive ເທົ່ານັ້ນ.','The namespace should be a non-empty string.'=>'Namespace ຕ້ອງເປັນຂໍ້ຄວາມ (string) ທີ່ບໍ່ຫວ່າງເປົ່າ.','The namespace is required when state data is passed.'=>'ຕ້ອງມີ Namespace ເມື່ອມີການສົ່ງຂໍ້ມູນ state.','Interactivity directives were detected inside an incompatible %1$s tag. These directives will be ignored in the server side render.'=>'ກວດພົບ Interactivity directives ພາຍໃນແທັກ %1$s ທີ່ບໍ່ເຂົ້າກັນ. directives ເຫຼົ່ານີ້ຈະຖືກລະເວັ້ນໃນການປະມວນຜົນຝັ່ງເຊີເວີ.','https://developer.wordpress.org/advanced-administration/security/https/'=>'https://developer.wordpress.org/advanced-administration/security/https/','https://developer.wordpress.org/advanced-administration/debug/debug-wordpress/'=>'https://developer.wordpress.org/advanced-administration/debug/debug-wordpress/','oEmbed resource link nameoEmbed (XML)'=>'oEmbed (XML)','oEmbed resource link nameoEmbed (JSON)'=>'oEmbed (JSON)','Categories dropdown (show_option_none parameter)None'=>'ບໍ່ມີ','Search themes'=>'ຄົ້ນຫາທີມ','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s, level %6$s)'=>'ແກ້ໄຂ %1$s (%2$s, ລາຍການຍ່ອຍທີ %3$d ຈາກ %4$d ພາຍໃຕ້ %5$s, ລະດັບ %6$s)','Loaded version \'%1$s\' incompatible with expected version \'%2$s\'.'=>'ເວີຊັນ \'%1$s\' ທີ່ໂຫຼດມາ ບໍ່ເຂົ້າກັນກັບເວີຊັນ \'%2$s\' ທີ່ຄາດໄວ້.','Missing required inputs to pre-computed WP_Token_Map.'=>'ຂາດຂໍ້ມູນທີ່ຈຳເປັນສຳລັບ WP_Token_Map ທີ່ຄຳນວນໄວ້ລ່ວງໜ້າ.','Token Map tokens and substitutions must all be shorter than %1$d bytes.'=>'ໂທເຄັນ ແລະ ການແທນທີ່ໃນ Token Map ຕ້ອງມີຄວາມຍາວໜ້ອຍກວ່າ %1$d ໄບທ໌.','The %1$s filter must return an integer value greater than 0.'=>'ຟິວເຕີ %1$s ຕ້ອງສົ່ງຄືນຄ່າຕົວເລກຖ້ວນທີ່ຫຼາຍກວ່າ 0.','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s, level %6$d)'=>'ແກ້ໄຂ %1$s (%2$s, ລາຍການຍ່ອຍທີ %3$d ຈາກ %4$d ພາຍໃຕ້ %5$s, ລະດັບ %6$d)','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s)'=>'ແກ້ໄຂ %1$s (%2$s, ລາຍການຍ່ອຍທີ %3$d ຈາກ %4$d ພາຍໃຕ້ %5$s)','Edit %1$s (%2$s, %3$d of %4$d)'=>'ແກ້ໄຂ %1$s (%2$s, ທີ %3$d ຈາກ %4$d)','https://developer.wordpress.org/advanced-administration/wordpress/css/'=>'https://developer.wordpress.org/advanced-administration/wordpress/css/','Block name must be a string or array.'=>'ຊື່ບລັອກຕ້ອງເປັນຂໍ້ຄວາມ (string) ຫຼື ອາເຣ (array).','… <a class="wp-block-latest-posts__read-more" href="%1$s" rel="noopener noreferrer">Read more<span class="screen-reader-text">: %2$s</span></a>'=>'… <a class="wp-block-latest-posts__read-more" href="%1$s" rel="noopener noreferrer">ອ່ານຕໍ່<span class="screen-reader-text">: %2$s</span></a>','`boolean` type for second argument `$settings` is deprecated. Use `array()` instead.'=>'ການໃຊ້ປະເພດ `boolean` ສຳລັບອາຄິວເມນທີສອງ `$settings` ແມ່ນຖືກຍົກເລີກແລ້ວ. ກະລຸນາໃຊ້ `array()` ແທນ.','Use as a `pre_render_block` filter is deprecated. Use with `render_block_data` instead.'=>'ການໃຊ້ເປັນຟິວເຕີ `pre_render_block` ແມ່ນຖືກຍົກເລີກແລ້ວ. ກະລຸນາໃຊ້ກັບ `render_block_data` ແທນ.','block descriptionDisplay footnotes added to the page.'=>'ສະແດງເຊີງອັດ (footnotes) ທີ່ເພີ່ມໄວ້ໃນໜ້າ.','block descriptionReuse this design across your site.'=>'ນຳການອອກແບບນີ້ໄປໃຊ້ຄືນໃນບ່ອນອື່ນໆທົ່ວເວັບໄຊ.','%1$s > %2$s'=>'%1$s > %2$s','Value'=>'ຄ່າ','Invalid term name.'=>'ຊື່ Term ບໍ່ຖືກຕ້ອງ.','View Pattern Category'=>'ເບິ່ງໝວດໝູ່ແພັດເທີນ','Update Pattern Category'=>'ອັບເດດໝວດໝູ່ແພັດເທີນ','Search Pattern Categories'=>'ຄົ້ນຫາໝວດໝູ່ແພັດເທີນ','Popular Pattern Categories'=>'ໝວດໝູ່ແພັດເທີນທີ່ນິຍົມ','No pattern categories found.'=>'ບໍ່ພົບໝວດໝູ່ແພັດເທີນ.','No pattern categories'=>'ບໍ່ມີໝວດໝູ່ແພັດເທີນ','New Pattern Category Name'=>'ຊື່ໝວດໝູ່ແພັດເທີນໃໝ່','Pattern Categories list navigation'=>'ການນຳທາງລາຍການໝວດໝູ່ແພັດເທີນ','Pattern Categories list'=>'ລາຍການໝວດໝູ່ແພັດເທີນ','A link to a pattern category.'=>'ລິ້ງໄປຫາໝວດໝູ່ແພັດເທີນ.','Pattern Category Link'=>'ລິ້ງໝວດໝູ່ແພັດເທີນ','Edit Pattern Category'=>'ແກ້ໄຂໝວດໝູ່ແພັດເທີນ','Choose from the most used pattern categories'=>'ເລືອກຈາກໝວດໝູ່ແພັດເທີນທີ່ຖືກໃຊ້ຫຼາຍທີ່ສຸດ','&larr; Go to Pattern Categories'=>'&larr; ໄປທີ່ໝວດໝູ່ແພັດເທີນ','Add or remove pattern categories'=>'ເພີ່ມ ຫຼື ລຶບໝວດໝູ່ແພັດເທີນ','Function %s used incorrectly in PHP.'=>'ຟັງຊັນ %s ຖືກໃຊ້ບໍ່ຖືກຕ້ອງໃນ PHP.','Where the template originally comes from e.g. \'theme\''=>'ແຫຼ່ງທີ່ມາເດີມຂອງແມ່ແບບ ເຊັ່ນ: \'ທິມ\'','Human readable text for the author.'=>'ຂໍ້ຄວາມທີ່ມະນຸດສາມາດອ່ານໄດ້ສຳລັບຜູ້ຂຽນ.','Unknown author'=>'ບໍ່ຊາບຜູ້ຂຽນ','The revision does not belong to the specified parent with id of "%d"'=>'ສະບັບປັບປຸງນີ້ບໍ່ໄດ້ເປັນຂອງແມ່ທີ່ລະບຸດ້ວຍ ID "%d"','Unique identifier for the global styles revision.'=>'ຕົວລະບຸສະເພາະສຳລັບສະບັບປັບປຸງສະໄຕລ໌ທົ່ວໄປ.','The ID for the parent of the global styles revision.'=>'ID ສຳລັບແມ່ຂອງສະບັບປັບປຸງສະໄຕລ໌ທົ່ວໄປ.','font-family declaration in theme.json format, encoded as a string.'=>'ການປະກາດ font-family ໃນຮູບແບບ theme.json, ທີ່ຖືກເຂົ້າລະຫັດເປັນ string.','URL to a preview image of the font family.'=>'URL ໄປຫາຮູບພາບຕົວຢ່າງຂອງຕະກູນຟອນຕ໌.','Kebab-case unique identifier for the font family preset.'=>'ຕົວລະບຸສະເພາະໃນຮູບແບບ kebab-case ສຳລັບຄ່າທີ່ຕັ້ງໄວ້ກ່ອນຂອງຕະກູນຟອນຕ໌.','Name of the font family preset, translatable.'=>'ຊື່ຂອງຄ່າທີ່ຕັ້ງໄວ້ກ່ອນຂອງຕະກູນຟອນຕ໌, ສາມາດແປໄດ້.','font-face definition in theme.json format.'=>'ຄຳນິຍາມ font-face ໃນຮູບແບບ theme.json.','The IDs of the child font faces in the font family.'=>'ID ຂອງ font face ລູກໃນຕະກູນຟອນຕ໌.','A font family with slug "%s" already exists.'=>'ມີຕະກູນຟອນຕ໌ທີ່ມີສະລັກ "%s" ຢູ່ແລ້ວ.','%s cannot be updated.'=>'%s ບໍ່ສາມາດອັບເດດໄດ້.','%s parameter must be a valid JSON string.'=>'ພາຣາມິເຕີ %s ຕ້ອງເປັນ JSON string ທີ່ຖືກຕ້ອງ.','Sorry, you are not allowed to access this font family.'=>'ຂໍໂທດ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງຕະກູນຟອນຕ໌ນີ້.','Sorry, you are not allowed to access font families.'=>'ຂໍໂທດ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງຕະກູນຟອນຕ໌.','font-face declaration in theme.json format, encoded as a string.'=>'ການປະກາດ font-face ໃນຮູບແບບ theme.json, ທີ່ຖືກເຂົ້າລະຫັດເປັນ string.','URL to a preview image of the font face.'=>'URL ໄປຫາຮູບພາບຕົວຢ່າງຂອງ font face.','CSS unicode-range value.'=>'ຄ່າ unicode-range ຂອງ CSS.','CSS size-adjust value.'=>'ຄ່າ size-adjust ຂອງ CSS.','CSS line-gap-override value.'=>'ຄ່າ line-gap-override ຂອງ CSS.','CSS font-variation-settings value.'=>'ຄ່າ font-variation-settings ຂອງ CSS.','CSS font-feature-settings value.'=>'ຄ່າ font-feature-settings ຂອງ CSS.','CSS font-variant value.'=>'ຄ່າ font-variant ຂອງ CSS.','CSS descent-override value.'=>'ຄ່າ descent-override ຂອງ CSS.','CSS ascent-override value.'=>'ຄ່າ ascent-override ຂອງ CSS.','CSS font-stretch value.'=>'ຄ່າ font-stretch ຂອງ CSS.','Paths or URLs to the font files.'=>'ເສັ້ນທາງ ຫຼື URL ໄປຫາໄຟລ໌ຟອນຕ໌.','CSS font-display value.'=>'ຄ່າ font-display ຂອງ CSS.','List of available font weights, separated by a space.'=>'ລາຍການນ້ຳໜັກຟອນຕ໌ທີ່ມີ, ແຍກດ້ວຍຍະຫວ່າງ.','CSS font-style value.'=>'ຄ່າ font-style ຂອງ CSS.','CSS font-family value.'=>'ຄ່າ font-family ຂອງ CSS.','font-face declaration in theme.json format.'=>'ການປະກາດ font-face ໃນຮູບແບບ theme.json.','Version of the theme.json schema used for the typography settings.'=>'ເວີຊັນຂອງ theme.json schema ທີ່ໃຊ້ສຳລັບການຕັ້ງຄ່າ typography.','Font faces do not support trashing. Set "%s" to delete.'=>'Font faces ບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ. ຕັ້ງ "%s" ເພື່ອລຶບ.','A font face matching those settings already exists.'=>'ມີ font face ທີ່ກົງກັບການຕັ້ງຄ່າເຫຼົ່ານັ້ນຢູ່ແລ້ວ.','The font face does not belong to the specified font family with id of "%d".'=>'Font face ນີ້ບໍ່ໄດ້ເປັນຂອງຕະກູນຟອນຕ໌ທີ່ລະບຸດ້ວຍ ID "%d".','File %1$s must be used in %2$s.'=>'ໄຟລ໌ %1$s ຕ້ອງຖືກໃຊ້ໃນ %2$s.','%1$s value "%2$s" must be a valid URL or file reference.'=>'ຄ່າ %1$s "%2$s" ຕ້ອງເປັນ URL ຫຼື ການອ້າງອີງໄຟລ໌ທີ່ຖືກຕ້ອງ.','%s values must be non-empty strings.'=>'ຄ່າ %s ຕ້ອງເປັນ string ທີ່ບໍ່ວ່າງ.','%s cannot be empty.'=>'%s ບໍ່ສາມາດວ່າງໄດ້.','font_face_settings parameter must be a valid JSON string.'=>'ພາຣາມິເຕີ font_face_settings ຕ້ອງເປັນ JSON string ທີ່ຖືກຕ້ອງ.','Sorry, you are not allowed to access this font face.'=>'ຂໍໂທດ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງ font face ນີ້.','Sorry, you are not allowed to access font faces.'=>'ຂໍໂທດ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງ font faces.','Unique identifier for the font face.'=>'ຕົວລະບຸສະເພາະສຳລັບ font face.','The ID for the parent font family of the font face.'=>'ID ສຳລັບຕະກູນຟອນຕ໌ແມ່ຂອງ font face.','Sorry, you are not allowed to access font collections.'=>'ຂໍໂທດ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງຊຸດສະສົມຟອນຕ໌.','The categories for the font collection.'=>'ໝວດໝູ່ສຳລັບຊຸດສະສົມຟອນຕ໌.','The font families for the font collection.'=>'ຕະກູນຟອນຕ໌ສຳລັບຊຸດສະສົມຟອນຕ໌.','The description for the font collection.'=>'ຄຳອະທິບາຍສຳລັບຊຸດສະສົມຟອນຕ໌.','The name for the font collection.'=>'ຊື່ສຳລັບຊຸດສະສົມຟອນຕ໌.','Unique identifier for the font collection.'=>'ຕົວລະບຸສະເພາະສຳລັບຊຸດສະສົມຟອນຕ໌.','Font collection not found.'=>'ບໍ່ພົບຊຸດສະສົມຟອນຕ໌.','Allowed child block types.'=>'ປະເພດບລັອກລູກທີ່ອະນຸຍາດ.','Public facing script module IDs.'=>'ID ຂອງໂມດູນສະຄຣິບທີ່ສະແດງຕໍ່ສາທາລະນະ.','This site does not support post thumbnails on attachments with MIME type %s.'=>'ເວັບໄຊນີ້ບໍ່ຮອງຮັບຮູບຕົວຢ່າງ (thumbnails) ໃນໄຟລ໌ຄັດຕິດທີ່ມີປະເພດ MIME %s.','Font Face'=>'Font Face','Font Faces'=>'Font Faces','Font Families'=>'ຕະກູນຟອນຕ໌','Font collection "%s" not found.'=>'ບໍ່ພົບຊຸດສະສົມຟອນຕ໌ "%s".','Font collection with slug: "%s" is already registered.'=>'ຊຸດສະສົມຟອນຕ໌ທີ່ມີສະລັກ: "%s" ຖືກລົງທະບຽນແລ້ວ.','Font collection "%1$s" has missing or empty property: "%2$s".'=>'ຊຸດສະສົມຟອນຕ໌ "%1$s" ມີຄຸນສົມບັດທີ່ຂາດຫາຍ ຫຼື ວ່າງ: "%2$s".','Error decoding the font collection data from the HTTP response JSON.'=>'ເກີດຂໍ້ຜິດພາດໃນການຖອດລະຫັດຂໍ້ມູນຊຸດສະສົມຟອນຕ໌ຈາກ HTTP response JSON.','Error fetching the font collection data from "%s".'=>'ເກີດຂໍ້ຜິດພາດໃນການດຶງຂໍ້ມູນຊຸດສະສົມຟອນຕ໌ຈາກ "%s".','Error decoding the font collection JSON file contents.'=>'ເກີດຂໍ້ຜິດພາດໃນການຖອດລະຫັດເນື້ອໃນໄຟລ໌ JSON ຂອງຊຸດສະສົມຟອນຕ໌.','Font collection JSON file is invalid or does not exist.'=>'ໄຟລ໌ JSON ຂອງຊຸດສະສົມຟອນຕ໌ບໍ່ຖືກຕ້ອງ ຫຼື ບໍ່ມີຢູ່.','Font collection slug "%s" is not valid. Slugs must use only alphanumeric characters, dashes, and underscores.'=>'ສະລັກຊຸດສະສົມຟອນຕ໌ "%s" ບໍ່ຖືກຕ້ອງ. ສະລັກຕ້ອງໃຊ້ສະເພາະຕົວອັກສອນ, ຕົວເລກ, ຂີດຕໍ່ (-) ແລະ ຂີດກ້ອງ (_) ເທົ່ານັ້ນ.','font categoryMonospace'=>'Monospace','font categoryHandwriting'=>'ລາຍມື','font categorySerif'=>'Serif','font categoryDisplay'=>'ສະແດງຜົນ','font categorySans Serif'=>'Sans Serif','Install from Google Fonts. Fonts are copied to and served from your site.'=>'ຕິດຕັ້ງຈາກ Google Fonts. ຟອນຕ໌ຈະຖືກຄັດລອກມາ ແລະ ໃຊ້ງານຈາກເວັບໄຊຂອງທ່ານເອງ.','font collection nameGoogle Fonts'=>'Google Fonts','App icon preview: The current image has no alternative text. The file name is: %s'=>'ຕົວຢ່າງໄອຄອນແອັບ: ຮູບພາບປະຈຸບັນບໍ່ມີຂໍ້ຄວາມທາງເລືອກ. ຊື່ໄຟລ໌ຄື: %s','App icon preview: Current image: %s'=>'ຕົວຢ່າງໄອຄອນແອັບ: ຮູບພາບປະຈຸບັນ: %s','Browser icon preview: The current image has no alternative text. The file name is: %s'=>'ຕົວຢ່າງໄອຄອນບຣາວເຊີ: ຮູບພາບປະຈຸບັນບໍ່ມີຂໍ້ຄວາມທາງເລືອກ. ຊື່ໄຟລ໌ຄື: %s','Browser icon preview: Current image: %s'=>'ຕົວຢ່າງໄອຄອນບຣາວເຊີ: ຮູບພາບປະຈຸບັນ: %s','sub item'=>'ລາຍການຍ່ອຍ','Some of the %1$s %2$s values are invalid'=>'ບາງຄ່າຂອງ %1$s %2$s ບໍ່ຖືກຕ້ອງ','Entries in dependencies array must be either strings or arrays with an id key.'=>'ລາຍການໃນ dependencies array ຕ້ອງເປັນ string ຫຼື array ທີ່ມີ id key.','Missing required id key in entry among dependencies array.'=>'ຂາດ id key ທີ່ຈຳເປັນໃນລາຍການຂອງ dependencies array.','All required plugins are installed and activated.'=>'ປລັກອິນທີ່ຈຳເປັນທັງໝົດຖືກຕິດຕັ້ງ ແລະ ເປີດໃຊ້ງານແລ້ວ.','The following plugins must be activated first: %s.'=>'ຕ້ອງເປີດໃຊ້ງານປລັກອິນຕໍ່ໄປນີ້ກ່ອນ: %s.','The plugin has no required plugins.'=>'ປລັກອິນນີ້ບໍ່ມີປລັກອິນທີ່ຈຳເປັນຕ້ອງໃຊ້ຮ່ວມ.','The plugin is not installed.'=>'ປລັກອິນບໍ່ໄດ້ຖືກຕິດຕັ້ງ.','No plugin specified.'=>'ບໍ່ໄດ້ລະບຸປລັກອິນ.','Please contact the plugin authors for more information.'=>'ກະລຸນາຕິດຕໍ່ຜູ້ຂຽນປລັກອິນສຳລັບຂໍ້ມູນເພີ່ມເຕີມ.','These plugins cannot be activated because their requirements are invalid.'=>'ປລັກອິນເຫຼົ່ານີ້ບໍ່ສາມາດເປີດໃຊ້ງານໄດ້ ເພາະຂໍ້ກຳນົດບໍ່ຖືກຕ້ອງ.','The first plugin requires the second plugin.%1$s requires %2$s'=>'%1$s ຕ້ອງການ %2$s','Please contact your network administrator.'=>'ກະລຸນາຕິດຕໍ່ຜູ້ດູແລລະບົບເຄືອຂ່າຍຂອງທ່ານ.','<a href="%s">Manage plugins</a>.'=>'<a href="%s">ຈັດການປລັກອິນ</a>.','Some required plugins are missing or inactive.'=>'ປລັກອິນທີ່ຈຳເປັນບາງອັນຂາດຫາຍ ຫຼື ບໍ່ໄດ້ເປີດໃຊ້ງານ.','"%1$s" in %2$s %3$s is not a hex or rgb string.'=>'"%1$s" ໃນ %2$s %3$s ບໍ່ແມ່ນ hex ຫຼື rgb string.','The Site Icon is what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. It should be square and at least <code>%1$s by %2$s</code> pixels.'=>'ໄອຄອນເວັບໄຊແມ່ນສິ່ງທີ່ທ່ານເຫັນໃນແຖບບຣາວເຊີ, ແຖບບຸກມາກ, ແລະ ພາຍໃນແອັບມືຖື WordPress. ມັນຄວນເປັນຮູບຈັດຕຸລັດ ແລະ ມີຂະໜາດຢ່າງໜ້ອຍ <code>%1$s ຄູນ %2$s</code> ພິກເຊລ.','Block binding "%s" not found.'=>'ບໍ່ພົບການເຊື່ອມໂຍງບລັອກ (Block binding) "%s".','The $source_properties array contains invalid properties.'=>'ອາເຣ $source_properties ບັນຈຸຄຸນສົມບັດທີ່ບໍ່ຖືກຕ້ອງ.','The "uses_context" parameter must be an array.'=>'ພາຣາມິເຕີ "uses_context" ຕ້ອງເປັນ array.','The "get_value_callback" parameter must be a valid callback.'=>'ພາຣາມິເຕີ "get_value_callback" ຕ້ອງເປັນ callback ທີ່ຖືກຕ້ອງ.','The $source_properties must contain a "get_value_callback".'=>'$source_properties ຕ້ອງມີ "get_value_callback".','The $source_properties must contain a "label".'=>'$source_properties ຕ້ອງມີ "label".','Block bindings source "%s" already registered.'=>'ແຫຼ່ງການເຊື່ອມໂຍງບລັອກ "%s" ຖືກລົງທະບຽນແລ້ວ.','Block bindings source names must contain a namespace prefix. Example: my-plugin/my-custom-source'=>'ຊື່ແຫຼ່ງການເຊື່ອມໂຍງບລັອກຕ້ອງມີ namespace ນຳໜ້າ. ຕົວຢ່າງ: my-plugin/my-custom-source','Block bindings source names must not contain uppercase characters.'=>'ຊື່ແຫຼ່ງການເຊື່ອມໂຍງບລັອກຕ້ອງບໍ່ມີຕົວອັກສອນພິມໃຫຍ່.','Block bindings source name must be a string.'=>'ຊື່ແຫຼ່ງການເຊື່ອມໂຍງບລັອກຕ້ອງເປັນ string.','[block rendering halted for pattern "%s"]'=>'[ການສະແດງຜົນບລັອກຢຸດສະງັກສຳລັບແພັດເທີນ "%s"]','Different layouts containing audio.'=>'ການຈັດວາງທີ່ແຕກຕ່າງກັນທີ່ມີສຽງ.','Block pattern categoryAudio'=>'ສຽງ','Different layouts containing videos.'=>'ການຈັດວາງທີ່ແຕກຕ່າງກັນທີ່ມີວິດີໂອ.','Block pattern categoryVideos'=>'ວິດີໂອ','block bindings sourcePost Meta'=>'Post Meta','block bindings sourcePattern Overrides'=>'ການຂຽນທັບແພັດເທີນ','block titleDate'=>'ວັນທີ','block titleContent'=>'ເນື້ອໃນ','block titleAuthor'=>'ຜູ້ຂຽນ','block keywordtoggle'=>'ເປີດປິດ','Export as JSON'=>'ສົ່ງອອກເປັນ JSON','Template part updated.'=>'ອັບເດດສ່ວນປະກອບແມ່ແບບແລ້ວ.','taxonomy singular namePattern Category'=>'ໝວດໝູ່ແພັດເທີນ','taxonomy general namePattern Categories'=>'ໝວດໝູ່ແພັດເທີນ','Expected string to start with script tag (without attributes) and end with script tag, with optional whitespace.'=>'ຄາດຫວັງວ່າ string ຈະເລີ່ມຕົ້ນດ້ວຍແທັກ script (ບໍ່ມີ attributes) ແລະ ສິ້ນສຸດດ້ວຍແທັກ script, ໂດຍອາດມີຍະຫວ່າງ.','%d years'=>'%d ປີ','a year'=>'1 ປີ','%d months'=>'%d ເດືອນ','a month'=>'1 ເດືອນ','%d days'=>'%d ວັນ','a day'=>'1 ວັນ','%d hours'=>'%d ຊົ່ວໂມງ','an hour'=>'1 ຊົ່ວໂມງ','%d minutes'=>'%d ນາທີ','a minute'=>'1 ນາທີ','%d seconds'=>'%d ວິນາທີ','a second'=>'1 ວິນາທີ','Invalid template parent ID.'=>'ID ຂອງແມ່ແບບແມ່ບໍ່ຖືກຕ້ອງ.','There is no autosave revision for this template.'=>'ບໍ່ມີສະບັບບັນທຶກອັດຕະໂນມັດສຳລັບແມ່ແບບນີ້.','This block is automatically inserted near any occurrence of the block types used as keys of this map, into a relative position given by the corresponding value.'=>'ບລັອກນີ້ຈະຖືກແຊກໂດຍອັດຕະໂນມັດໃກ້ກັບບລັອກໃດກໍ່ຕາມທີ່ໃຊ້ເປັນຄີຂອງແຜນຜັງນີ້, ໃນຕຳແໜ່ງທີ່ກຳນົດໂດຍຄ່າທີ່ກົງກັນ.','View Media File'=>'ເບິ່ງໄຟລ໌ສື່','Meta keys cannot enable revisions support unless the object subtype supports revisions.'=>'Meta keys ບໍ່ສາມາດເປີດໃຊ້ການຮອງຮັບສະບັບປັບປຸງໄດ້ ນອກຈາກວ່າປະເພດຍ່ອຍຂອງວັດຖຸນັ້ນຈະຮອງຮັບສະບັບປັບປຸງ.','Meta keys cannot enable revisions support unless the object type supports revisions.'=>'Meta keys ບໍ່ສາມາດເປີດໃຊ້ການຮອງຮັບສະບັບປັບປຸງໄດ້ ນອກຈາກວ່າປະເພດວັດຖຸນັ້ນຈະຮອງຮັບສະບັບປັບປຸງ.','View media file'=>'ເບິ່ງໄຟລ໌ສື່','Please pass a query array to this function.'=>'ກະລຸນາສົ່ງ query array ໄປຫາຟັງຊັນນີ້.','Call %s to create an HTML Processor instead of calling the constructor directly.'=>'ເອີ້ນໃຊ້ %s ເພື່ອສ້າງ HTML Processor ແທນການເອີ້ນໃຊ້ constructor ໂດຍກົງ.','The %s key must be a string without spaces.'=>'ຄີ %s ຕ້ອງເປັນ string ທີ່ບໍ່ມີຍະຫວ່າງ.','Class %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'ຄລາສ %1$s <strong>ຖືກຍົກເລີກແລ້ວ</strong> ຕັ້ງແຕ່ເວີຊັນ %2$s ໂດຍບໍ່ມີທາງເລືອກອື່ນ.','Class %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'ຄລາສ %1$s <strong>ຖືກຍົກເລີກແລ້ວ</strong> ຕັ້ງແຕ່ເວີຊັນ %2$s! ກະລຸນາໃຊ້ %3$s ແທນ.','Font font-weight must be a properly formatted string or integer.'=>'Font font-weight ຕ້ອງເປັນ string ຫຼື ຕົວເລກທີ່ຖືກຕ້ອງຕາມຮູບແບບ.','Each font src must be a non-empty string.'=>'ແຕ່ລະ font src ຕ້ອງເປັນ string ທີ່ບໍ່ວ່າງ.','Font src must be a non-empty string or an array of strings.'=>'Font src ຕ້ອງເປັນ string ທີ່ບໍ່ວ່າງ ຫຼື ເປັນ array ຂອງ string.','Font font-family must be a non-empty string.'=>'Font font-family ຕ້ອງເປັນ string ທີ່ບໍ່ວ່າງ.','Submit Search'=>'ສົ່ງການຄົ້ນຫາ','Page Loaded.'=>'ໂຫຼດໜ້າສຳເລັດ.','Loading page, please wait.'=>'ກຳລັງໂຫຼດໜ້າ, ກະລຸນາລໍຖ້າ.','Display a list of assigned terms from the taxonomy: %s'=>'ສະແດງລາຍການ Terms ທີ່ຖືກກຳນົດຈາກ taxonomy: %s','Enlarged image'=>'ຮູບພາບທີ່ຂະຫຍາຍ','Jump to footnote reference %1$d'=>'ໂດດໄປຫາການອ້າງອີງເຊີງອັດທີ %1$d','Cannot hook block to itself.'=>'ບໍ່ສາມາດ hook ບລັອກເຂົ້າຫາຕົວມັນເອງໄດ້.','Could not register file "%s" as a block pattern as the file does not exist.'=>'ບໍ່ສາມາດລົງທະບຽນໄຟລ໌ "%s" ເປັນແພັດເທີນບລັອກໄດ້ ເພາະບໍ່ມີໄຟລ໌ຢູ່.','Learn WordPress'=>'ຮຽນຮູ້ WordPress','Could not access filesystem.'=>'ບໍ່ສາມາດເຂົ້າເຖິງລະບົບໄຟລ໌.','block descriptionDisplay an image to represent this site. Update this block and the changes apply everywhere.'=>'ສະແດງຮູບພາບເພື່ອເປັນຕົວແທນຂອງເວັບໄຊນີ້. ອັບເດດບລັອກນີ້ແລ້ວການປ່ຽນແປງຈະມີຜົນໃນທຸກໆບ່ອນ.','block titleTitle'=>'ຫົວຂໍ້','block titleExcerpt'=>'ເນື້ອໃນຫຍໍ້','block titlePattern Placeholder'=>'ຕົວກຳນົດຕຳແໜ່ງແພັດເທີນ','block keywordreferences'=>'ການອ້າງອີງ','block titleFootnotes'=>'ເຊີງອັດ','block keywordlist'=>'ລາຍການ','block keywordsummary'=>'ສະຫຼຸບ','block keyworddisclosure'=>'ການເປີດເຜີຍ','block descriptionHide and show additional content.'=>'ເຊື່ອງ ແລະ ສະແດງເນື້ອໃນເພີ່ມເຕີມ.','block titleDetails'=>'ລາຍລະອຽດ','block descriptionAdd an image or video with a text overlay.'=>'ເພີ່ມຮູບພາບ ຫຼື ວິດີໂອ ພ້ອມຂໍ້ຄວາມທັບຊ້ອນ.','block keywordreusable'=>'ໃຊ້ຊ້ຳໄດ້','Allow comments on new posts'=>'ອະນຸຍາດໃຫ້ສະແດງຄວາມຄິດເຫັນໃນໂພສຕ໌ໃໝ່','Maximum posts per page'=>'ຈຳນວນໂພສຕ໌ສູງສຸດຕໍ່ໜ້າ','Last page'=>'ໜ້າສຸດທ້າຍ','paging%1$s of %2$s'=>'%1$s ຈາກ %2$s','First page'=>'ໜ້າທຳອິດ','Continue'=>'ຕໍ່ໄປ','Page'=>'ໜ້າ','Parent'=>'ແມ່','Footnotes'=>'ເຊີງອັດ','Check your inbox at %s and click on the given link.'=>'ກວດສອບກ່ອງຈົດໝາຍຂອງທ່ານທີ່ %s ແລະ ຄລິກລິ້ງທີ່ໄດ້ຮັບ.','Unable to locate WordPress content directory (%s).'=>'ບໍ່ສາມາດຊອກຫາໂຟລເດີເນື້ອໃນ WordPress (%s).','Whether the theme is a block-based theme.'=>'ລະບຸວ່າທິມນີ້ເປັນທິມທີ່ອີງໃສ່ບລັອກ (Block-based) ຫຼື ບໍ່.','The date the template was last modified, in the site\'s timezone.'=>'ວັນທີທີ່ແມ່ແບບຖືກແກ້ໄຂຫຼ້າສຸດ, ຕາມເຂດເວລາຂອງເວັບໄຊ.','The unique identifier for the Navigation Menu.'=>'ຕົວລະບຸສະເພາະສຳລັບເມນູນຳທາງ.','No fallback menu found.'=>'ບໍ່ພົບເມນູສຳຮອງ.','Sorry, you are not allowed to edit Navigation Menus as this user.'=>'ຂໍໂທດ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ແກ້ໄຂເມນູນຳທາງໃນຖານະຜູ້ໃຊ້ນີ້.','Sorry, you are not allowed to create Navigation Menus as this user.'=>'ຂໍໂທດ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ສ້າງເມນູນຳທາງໃນຖານະຜູ້ໃຊ້ນີ້.','Cannot find user global styles revisions.'=>'ບໍ່ພົບສະບັບປັບປຸງສະໄຕລ໌ທົ່ວໄປຂອງຜູ້ໃຊ້.','Custom CSS selectors.'=>'CSS selectors ທີ່ກຳນົດເອງ.','Where the pattern comes from e.g. core'=>'ແຫຼ່ງທີ່ມາຂອງແພັດເທີນ ເຊັ່ນ: core','Pattern updated.'=>'ອັບເດດແພັດເທີນແລ້ວ.','Pattern scheduled.'=>'ກຳນົດເວລາແພັດເທີນແລ້ວ.','Pattern reverted to draft.'=>'ຄືນຄ່າແພັດເທີນເປັນສະບັບຮ່າງແລ້ວ.','Pattern published privately.'=>'ເຜີຍແຜ່ແພັດເທີນແບບສ່ວນຕົວແລ້ວ.','Pattern published.'=>'ເຜີຍແຜ່ແພັດເທີນແລ້ວ.','Patterns list navigation'=>'ການນຳທາງລາຍການແພັດເທີນ','Filter patterns list'=>'ກັ່ນຕອງລາຍການແພັດເທີນ','No patterns found.'=>'ບໍ່ພົບແພັດເທີນ.','Search Patterns'=>'ຄົ້ນຫາແພັດເທີນ','All Patterns'=>'ແພັດເທີນທັງໝົດ','View Patterns'=>'ເບິ່ງແພັດເທີນ','View Pattern'=>'ເບິ່ງແພັດເທີນ','Edit Block Pattern'=>'ແກ້ໄຂແພັດເທີນບລັອກ','New Pattern'=>'ແພັດເທີນໃໝ່','post type singular namePattern'=>'ແພັດເທີນ','post type general namePatterns'=>'ແພັດເທີນ','An image should not be lazy-loaded and marked as high priority at the same time.'=>'ຮູບພາບບໍ່ຄວນເປັນທັງ Lazy-load ແລະ ຖືກໝາຍເປັນລຳດັບຄວາມສຳຄັນສູງໃນເວລາດຽວກັນ.','The Edit Media screen is deprecated as of WordPress 6.3. Please use the Media Library instead.'=>'ໜ້າແກ້ໄຂສື່ (Edit Media) ຖືກຍົກເລີກແລ້ວນັບຕັ້ງແຕ່ WordPress 6.3. ກະລຸນາໃຊ້ຄັງສື່ (Media Library) ແທນ.','Object ID must be an integer, %s given.'=>'Object ID ຕ້ອງເປັນຕົວເລກຖ້ວນ, ແຕ່ໄດ້ຮັບ %s.','Cannot supply a strategy `%1$s` for script `%2$s` because it is an alias (it lacks a `src` value).'=>'ບໍ່ສາມາດໃຊ້ strategy `%1$s` ສຳລັບສະຄຣິບ `%2$s` ໄດ້ ເພາະມັນເປັນນາມແຝງ (ບໍ່ມີຄ່າ `src`).','Invalid strategy `%1$s` defined for `%2$s` during script registration.'=>'Strategy `%1$s` ທີ່ກຳນົດສຳລັບ `%2$s` ໃນລະຫວ່າງການລົງທະບຽນສະຄຣິບບໍ່ຖືກຕ້ອງ.','Page trashed.'=>'ຍ້າຍໜ້າໄປຖັງຂີ້ເຫຍື້ອແລ້ວ.','Post trashed.'=>'ຍ້າຍໂພສຕ໌ໄປຖັງຂີ້ເຫຍື້ອແລ້ວ.','Title of a Navigation menuNavigation'=>'ການນຳທາງ','Unable to convert Classic Menu to blocks.'=>'ບໍ່ສາມາດປ່ຽນ Classic Menu ເປັນບລັອກໄດ້.','No Classic Menus found.'=>'ບໍ່ພົບ Classic Menus.','The duotone id "%1$s" is not registered in %2$s settings'=>'Duotone id "%1$s" ບໍ່ໄດ້ຖືກລົງທະບຽນໃນການຕັ້ງຄ່າ %2$s','The menu provided is not a valid menu.'=>'ເມນູທີ່ລະບຸບໍ່ຖືກຕ້ອງ.','Expand search field'=>'ຂະຫຍາຍຊ່ອງຄົ້ນຫາ','Template namePage: 404'=>'ໜ້າ: 404','Template nameSearch Results'=>'ຜົນການຄົ້ນຫາ','Attachment Pages'=>'ໜ້າໄຟລ໌ຄັດຕິດ','Template nameTag Archives'=>'ຄັງແທັກ','Template nameDate Archives'=>'ຄັງວັນທີ','Template nameCategory Archives'=>'ຄັງໝວດໝູ່','Template nameAuthor Archives'=>'ຄັງຜູ້ຂຽນ','Template nameAll Archives'=>'ຄັງທັງໝົດ','Template nameSingle Entries'=>'ລາຍການດ່ຽວ','Template nameBlog Home'=>'ໜ້າທຳອິດບລັອກ','template part areaFooter'=>'ສ່ວນທ້າຍ (Footer)','template part areaHeader'=>'ສ່ວນຫົວ (Header)','template part areaGeneral'=>'ທົ່ວໄປ','block categoryPatterns'=>'ແພັດເທີນ','custom image headerHeader'=>'ສ່ວນຫົວ','custom backgroundBackground'=>'ພື້ນຫຼັງ','Get Involved'=>'ມີສ່ວນຮ່ວມ','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'ສະແດງເມື່ອຜູ້ເຂົ້າຊົມເບິ່ງໜ້າທີ່ບໍ່ມີຢູ່ ເຊັ່ນ ລິ້ງເສຍ ຫຼື ພິມ URL ຜິດ.','Displays your site\'s Privacy Policy page.'=>'ສະແດງໜ້ານະໂຍບາຍຄວາມເປັນສ່ວນຕົວຂອງເວັບໄຊຂອງທ່ານ.','Displays when a visitor performs a search on your website.'=>'ສະແດງເມື່ອຜູ້ເຂົ້າຊົມເຮັດການຄົ້ນຫາໃນເວັບໄຊຂອງທ່ານ.','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'ສະແດງເມື່ອຜູ້ເຂົ້າຊົມເບິ່ງໜ້າສະເພາະທີ່ມີໄວ້ສຳລັບໄຟລ໌ສື່ຄັດຕິດໃດໆ.','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'ສະແດງຄັງແທັກຂອງໂພສຕ໌. ແມ່ແບບນີ້ຈະເຮັດໜ້າທີ່ເປັນຕົວສຳຮອງເມື່ອບໍ່ພົບແມ່ແບບທີ່ສະເພາະເຈາະຈົງກວ່າ (ເຊັ່ນ ແທັກ: ພິດຊ່າ).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'ສະແດງຄັງໂພສຕ໌ເມື່ອມີການເຂົ້າເບິ່ງວັນທີສະເພາະ (ເຊັ່ນ example.com/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'ສະແດງຄັງ taxonomy ທີ່ກຳນົດເອງ. taxonomy ມີ Terms ທີ່ທ່ານໃຊ້ເພື່ອຈັດແບ່ງສິ່ງຕ່າງໆ ເຊັ່ນດຽວກັບໝວດໝູ່ ແລະ ແທັກ. ຕົວຢ່າງ: taxonomy ທີ່ມີຊື່ວ່າ "ສິລະປະ" ສາມາດມີໄດ້ຫຼາຍ Terms ເຊັ່ນ "ຮ່ວມສະໄໝ" ແລະ "ສະຕະວັດທີ 18". ແມ່ແບບນີ້ຈະເປັນຕົວສຳຮອງເມື່ອບໍ່ພົບແມ່ແບບທີ່ສະເພາະເຈາະຈົງກວ່າ.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'ສະແດງຄັງໝວດໝູ່ຂອງໂພສຕ໌. ແມ່ແບບນີ້ຈະເປັນຕົວສຳຮອງເມື່ອບໍ່ພົບແມ່ແບບທີ່ສະເພາະເຈາະຈົງກວ່າ (ເຊັ່ນ ໝວດໝູ່: ສູດອາຫານ).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'ສະແດງຄັງໂພສຕ໌ຂອງຜູ້ຂຽນຄົນດຽວ. ແມ່ແບບນີ້ຈະເປັນຕົວສຳຮອງເມື່ອບໍ່ພົບແມ່ແບບທີ່ສະເພາະເຈາະຈົງກວ່າ (ເຊັ່ນ ຜູ້ຂຽນ: Admin).','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'ສະແດງຄັງຂໍ້ມູນໃດໆ ຮວມເຖິງໂພສຕ໌ໂດຍຜູ້ຂຽນຄົນດຽວ, ໝວດໝູ່, ແທັກ, taxonomy, ປະເພດໂພສຕ໌ທີ່ກຳນົດເອງ ແລະ ວັນທີ. ແມ່ແບບນີ້ຈະເປັນຕົວສຳຮອງເມື່ອບໍ່ພົບແມ່ແບບທີ່ສະເພາະເຈາະຈົງກວ່າ.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'ສະແດງໜ້າແບບຄົງທີ່ (Static page) ນອກຈາກວ່າໜ້ານັ້ນຈະຖືກໃຊ້ແມ່ແບບທີ່ກຳນົດເອງ ຫຼື ມີແມ່ແບບສະເພາະຢູ່ແລ້ວ.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'ສະແດງໂພສຕ໌ດຽວໃນເວັບໄຊຂອງທ່ານ ນອກຈາກວ່າໂພສຕ໌ນັ້ນຈະຖືກໃຊ້ແມ່ແບບທີ່ກຳນົດເອງ ຫຼື ມີແມ່ແບບສະເພາະຢູ່ແລ້ວ.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'ສະແດງລາຍການດຽວໃດໆ ເຊັ່ນ ໂພສຕ໌ ຫຼື ໜ້າ. ແມ່ແບບນີ້ຈະເປັນຕົວສຳຮອງເມື່ອບໍ່ພົບແມ່ແບບທີ່ສະເພາະເຈາະຈົງກວ່າ.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'ສະແດງໜ້າທຳອິດຂອງເວັບໄຊຂອງທ່ານ ບໍ່ວ່າຈະຕັ້ງຄ່າໃຫ້ສະແດງໂພສຕ໌ຫຼ້າສຸດ ຫຼື ໜ້າແບບຄົງທີ່. ແມ່ແບບ Front Page ຈະມີລຳດັບຄວາມສຳຄັນສູງກວ່າແມ່ແບບອື່ນໆທັງໝົດ.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'ສະແດງໂພສຕ໌ຫຼ້າສຸດເປັນໜ້າທຳອິດຂອງເວັບໄຊ ຫຼື ເປັນ "ໜ້າໂພສຕ໌" ຕາມທີ່ກຳນົດໄວ້ໃນການຕັ້ງຄ່າການອ່ານ. ຖ້າມີແມ່ແບບ Front Page, ມັນຈະຂຽນທັບແມ່ແບບນີ້ເມື່ອສະແດງໂພສຕ໌ໃນໜ້າທຳອິດ.','Used as a fallback template for all pages when a more specific template is not defined.'=>'ໃຊ້ເປັນແມ່ແບບສຳຮອງສຳລັບທຸກໜ້າ ເມື່ອບໍ່ມີການກຳນົດແມ່ແບບທີ່ສະເພາະເຈາະຈົງກວ່າ.','Block pattern categoryAbout'=>'ກ່ຽວກັບ','Block pattern categoryTeam'=>'ທີມງານ','Block pattern categoryPosts'=>'ໂພສຕ໌','Block pattern categoryBanners'=>'ແບນເນີ','block descriptionThe author name.'=>'ຊື່ຜູ້ຂຽນ.','block titleAuthor Name'=>'ຊື່ຜູ້ຂຽນ','block keywordpage'=>'ໜ້າ','block descriptionDisplays a page inside a list of all pages.'=>'ສະແດງໜ້າພາຍໃນລາຍການຂອງໜ້າທັງໝົດ.','block titlePage List Item'=>'ລາຍການໃນລາຍຊື່ໜ້າ','Style Variations'=>'ຮູບແບບຍ່ອຍຂອງສະໄຕລ໌','Position'=>'ຕຳແໜ່ງ','Sticky'=>'ຕິດຄ້າງ','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','Array of column names to be searched.'=>'ອາເຣຂອງຊື່ຄໍລຳທີ່ຈະຄົ້ນຫາ.','The block types which can use this pattern.'=>'ປະເພດບລັອກທີ່ສາມາດໃຊ້ແບບແຜນນີ້ໄດ້.','An array of template types where the pattern fits.'=>'ອາເຣຂອງປະເພດແມ່ແບບທີ່ແບບແຜນນີ້ເໝາະສົມ.','The category description, in human readable format.'=>'ຄຳອະທິບາຍໝວດໝູ່, ໃນຮູບແບບທີ່ຄົນທົ່ວໄປອ່ານເຂົ້າໃຈໄດ້.','Download file'=>'ດາວໂຫຼດໄຟລ໌','Please check that the %s PHP extension is installed and enabled.'=>'ກະລຸນາກວດສອບວ່າໄດ້ຕິດຕັ້ງ ແລະ ເປີດໃຊ້ງານສ່ວນຂະຫຍາຍ %s ຂອງ PHP ແລ້ວ.','When using the %1$s constant, make sure to set these globals to an array: %2$s.'=>'ເມື່ອໃຊ້ຄ່າຄົງທີ່ %1$s, ໃຫ້ແນ່ໃຈວ່າໄດ້ຕັ້ງຄ່າ globals ເຫຼົ່ານີ້ເປັນອາເຣ: %2$s.','The query argument must be an array or a tag name.'=>'ອາຄິວເມນການສອບຖາມຂໍ້ມູນຕ້ອງເປັນອາເຣ ຫຼື ຊື່ແທັກ.','Invalid attribute name.'=>'ຊື່ຄຸນລັກສະນະບໍ່ຖືກຕ້ອງ.','Too many calls to seek() - this can lead to performance issues.'=>'ມີການເອີ້ນໃຊ້ seek() ຫຼາຍເກີນໄປ - ອາດເຮັດໃຫ້ເກີດບັນຫາດ້ານປະສິດທິພາບ.','Unknown bookmark name.'=>'ບໍ່ຮູ້ຈັກຊື່ບຸກມາກ.','Too many bookmarks: cannot create any more.'=>'ມີບຸກມາກຫຼາຍເກີນໄປ: ບໍ່ສາມາດສ້າງເພີ່ມໄດ້ອີກ.','Warning: %1$s expects parameter %2$s (%3$s) to be a %4$s, %5$s given.'=>'ຄຳເຕືອນ: %1$s ຕ້ອງການພາຣາມີເຕີ %2$s (%3$s) ເປັນ %4$s, ແຕ່ໄດ້ຮັບເປັນ %5$s.','https://wordpress.org/documentation/article/manage-wordpress-widgets/'=>'https://wordpress.org/documentation/article/manage-wordpress-widgets/','Sorry, replies to unapproved comments are not allowed.'=>'ຂໍອະໄພ, ບໍ່ອະນຸຍາດໃຫ້ຕອບກັບຄວາມຄິດເຫັນທີ່ຍັງບໍ່ທັນໄດ້ຮັບການອະນຸມັດ.','Arguments cannot be prepared as both an Identifier and Value. Found the following conflicts: %s'=>'ອາຄິວເມນບໍ່ສາມາດຖືກຈັດຕຽມໃຫ້ເປັນທັງ Identifier ແລະ Value ພ້ອມກັນໄດ້. ພົບຂໍ້ຂັດແຍ່ງດັ່ງນີ້: %s','Values for the input array must be either objects or arrays.'=>'ຄ່າສຳລັບອາເຣນຳເຂົ້າຕ້ອງເປັນອັອບເຈັກ ຫຼື ອາເຣ.','The image already has the requested size.'=>'ຮູບພາບມີຂະໜາດຕາມທີ່ຕ້ອງການຢູ່ແລ້ວ.','There&#8217;s no content to show here yet.'=>'ຍັງບໍ່ມີເນື້ອຫາທີ່ຈະສະແດງຢູ່ບ່ອນນີ້ເທື່ອ.',': %s'=>': %s','untitled post %s'=>'ບົດຄວາມທີ່ບໍ່ມີຫົວຂໍ້ %s','Untitled post %d'=>'ບົດຄວາມທີ່ບໍ່ມີຫົວຂໍ້ %d','A variety of header designs displaying your site title and navigation.'=>'ຮູບແບບສ່ວນຫົວທີ່ຫຼາກຫຼາຍ ເຊິ່ງສະແດງຫົວຂໍ້ເວັບໄຊ ແລະ ເມນູນຳທາງຂອງທ່ານ.','A variety of footer designs displaying information and site navigation.'=>'ຮູບແບບສ່ວນທ້າຍທີ່ຫຼາກຫຼາຍ ເຊິ່ງສະແດງຂໍ້ມູນ ແລະ ເມນູນຳທາງຂອງເວັບໄຊ.','Different layouts containing video or audio.'=>'ຮູບແບບຕ່າງໆ ທີ່ມີວິດີໂອ ຫຼື ສຽງ.','Different layouts for displaying images.'=>'ຮູບແບບຕ່າງໆ ສຳລັບການສະແດງຮູບພາບ.','Showcase your latest work.'=>'ສະແດງຜົນງານຫຼ້າສຸດຂອງທ່ານ.','Block pattern categoryPortfolio'=>'ພອດໂຟລິໂອ','Introduce yourself.'=>'ແນະນຳຕົວທ່ານເອງ.','Display your contact information.'=>'ສະແດງຂໍ້ມູນຕິດຕໍ່ຂອງທ່ານ.','Block pattern categoryContact'=>'ຕິດຕໍ່','Briefly describe what your business does and how you can help.'=>'ອະທິບາຍສັ້ນໆ ກ່ຽວກັບທຸລະກິດຂອງທ່ານ ແລະ ສິ່ງທີ່ທ່ານສາມາດຊ່ວຍໄດ້.','Block pattern categoryServices'=>'ການບໍລິການ','Share reviews and feedback about your brand/business.'=>'ແບ່ງປັນການຣີວິວ ແລະ ຄວາມຄິດເຫັນກ່ຽວກັບແບຣນ ຫຼື ທຸລະກິດຂອງທ່ານ.','Block pattern categoryTestimonials'=>'ສຽງຕອບຮັບຈາກລູກຄ້າ','A variety of designs to display your team members.'=>'ຮູບແບບຕ່າງໆ ເພື່ອສະແດງສະມາຊິກໃນທີມຂອງທ່ານ.','Sections whose purpose is to trigger a specific action.'=>'ສ່ວນທີ່ໃຊ້ເພື່ອຈຸດປະສົງໃນການກະຕຸ້ນການກະທຳໃດໜຶ່ງ.','Block pattern categoryCall to action'=>'ກະຕຸ້ນການຕັດສິນໃຈ','A set of high quality curated patterns.'=>'ຊຸດຂອງແບບແຜນທີ່ມີຄຸນນະພາບສູງທີ່ໄດ້ຮັບການຄັດສັນມາແລ້ວ.','Display your latest posts in lists, grids or other layouts.'=>'ສະແດງບົດຄວາມຫຼ້າສຸດຂອງທ່ານໃນແບບລາຍການ, ຕາຕະລາງ ຫຼື ຮູບແບບອື່ນໆ.','Patterns containing mostly text.'=>'ແບບແຜນທີ່ມີເນື້ອຫາເປັນຂໍ້ຄວາມສ່ວນໃຫຍ່.','Multi-column patterns with more complex layouts.'=>'ແບບແຜນຫຼາຍຄໍລຳທີ່ມີຮູບແບບທີ່ຊັບຊ້ອນກວ່າ.','Patterns that contain buttons and call to actions.'=>'ແບບແຜນທີ່ມີປຸ່ມ ແລະ ສ່ວນກະຕຸ້ນການຕັດສິນໃຈ.','https://wordpress.org/documentation/'=>'https://wordpress.org/documentation/','User queries should not be run before the %s hook.'=>'ການສອບຖາມຂໍ້ມູນຜູ້ໃຊ້ບໍ່ຄວນເຮັດວຽກກ່ອນ %s hook.','The %s argument must be a string or a string array.'=>'ອາຄິວເມນ %s ຕ້ອງເປັນຂໍ້ຄວາມ ຫຼື ອາເຣຂອງຂໍ້ຄວາມ.','Sorry, you are not allowed to view terms for this post.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງຄຳສັບສຳລັບບົດຄວາມນີ້.','Raw size value must be a string, integer, or float.'=>'ຄ່າຂະໜາດດິບຕ້ອງເປັນຂໍ້ຄວາມ, ເລກຖ້ວນ ຫຼື ເລກທົດສະນິຍົມ.','block titleList Item'=>'ລາຍການ','block titleComments'=>'ຄວາມຄິດເຫັນ','block titleComments Previous Page'=>'ໜ້າຄວາມຄິດເຫັນກ່ອນໜ້າ','block titleComments Page Numbers'=>'ເລກໜ້າຄວາມຄິດເຫັນ','block titleComments Next Page'=>'ໜ້າຄວາມຄິດເຫັນຖັດໄປ','Single item: %s'=>'ລາຍການດຽວ: %s','Default template'=>'ແມ່ແບບເລີ່ມຕົ້ນ','Edit template'=>'ແກ້ໄຂແມ່ແບບ','%s comment'=>'%s ຄວາມຄິດເຫັນ','Create a site or only a username:'=>'ສ້າງເວັບໄຊ ຫຼື ສ້າງສະເພາະຊື່ຜູ້ໃຊ້:','Site Domain (subdomain only):'=>'ໂດເມນເວັບໄຊ (ສະເພາະໂດເມນຍ່ອຍ):','Site Name (subdirectory only):'=>'ຊື່ເວັບໄຊ (ສະເພາະໂຟນເດີຍ່ອຍ):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'ເບິ່ງຄືວ່າບໍ່ມີໄຟລ໌ %s. ມັນຈຳເປັນຕ້ອງມີກ່ອນທີ່ຈະດຳເນີນການຕິດຕັ້ງຕໍ່ໄປໄດ້.','The date and time the preferences were updated.'=>'ວັນທີ ແລະ ເວລາທີ່ການຕັ້ງຄ່າຖືກອັບເດດ.','Whether the theme disables generated layout styles.'=>'ຫາກວ່າທີມປິດການໃຊ້ງານຮູບແບບເລເອົາທີ່ສ້າງຂຶ້ນ.','Whether a theme uses block-based template parts.'=>'ຫາກວ່າທີມໃຊ້ສ່ວນປະກອບແມ່ແບບທີ່ອີງຕາມບລັອກ.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store ຕ້ອງເປັນ instance ຂອງ WP_Style_Engine_CSS_Rules_Store','Revisions not enabled.'=>'ບໍ່ໄດ້ເປີດໃຊ້ງານລຸ້ນການແກ້ໄຂ.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'ຄຳນຳໜ້າແມ່ແບບສຳລັບແມ່ແບບທີ່ສ້າງຂຶ້ນ. ອັນນີ້ໃຊ້ເພື່ອແຍກປະເພດແມ່ແບບຫຼັກ, ເຊັ່ນ ໃນ `taxonomy-books` ຈະແຍກເອົາ `taxonomy`','Indicates if a template is custom or part of the template hierarchy'=>'ລະບຸວ່າແມ່ແບບນັ້ນເປັນແບບກຳນົດເອງ ຫຼື ເປັນສ່ວນໜຶ່ງຂອງລຳດັບຊັ້ນແມ່ແບບ','The slug of the template to get the fallback for'=>'ສະລັກຂອງແມ່ແບບເພື່ອໃຊ້ໃນກໍລະນີສຳຮອງ','The icon for the post type.'=>'ໄອຄອນສຳລັບປະເພດບົດຄວາມ.','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'ຖ້າຄ່ານັ້ນເປັນຂໍ້ຄວາມ, ຄ່ານັ້ນຈະຖືກໃຊ້ເປັນສະລັກຄັງເກັບ. ຖ້າຄ່າເປັນ false ປະເພດບົດຄວາມນັ້ນຈະບໍ່ມີຄັງເກັບ.','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'Public facing ແລະ editor style handle. ຖືກຍົກເລີກການໃຊ້: ກະລຸນາໃຊ້ `style_handles` ແທນ.','Editor style handle. DEPRECATED: Use `editor_style_handles` instead.'=>'Editor style handle. ຖືກຍົກເລີກການໃຊ້: ກະລຸນາໃຊ້ `editor_style_handles` ແທນ.','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'Public facing script handle. ຖືກຍົກເລີກການໃຊ້: ກະລຸນາໃຊ້ `view_script_handles` ແທນ.','Public facing and editor script handle. DEPRECATED: Use `script_handles` instead.'=>'Public facing ແລະ editor script handle. ຖືກຍົກເລີກການໃຊ້: ກະລຸນາໃຊ້ `script_handles` ແທນ.','Editor script handle. DEPRECATED: Use `editor_script_handles` instead.'=>'Editor script handle. ຖືກຍົກເລີກການໃຊ້: ກະລຸນາໃຊ້ `editor_script_handles` ແທນ.','An array of post types that the pattern is restricted to be used with.'=>'ອາເຣຂອງປະເພດບົດຄວາມທີ່ແບບແຜນນີ້ຖືກຈຳກັດໃຫ້ໃຊ້ຮ່ວມນຳ.','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'REST API %1$s ຄວນເປັນອາເຣຂອງອາເຣ. ກວດພົບຄ່າທີ່ບໍ່ແມ່ນອາເຣສຳລັບ %2$s.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'ຖ້າທ່ານເປັນເຈົ້າຂອງເຄືອຂ່າຍນີ້, ກະລຸນາກວດສອບວ່າເຊີບເວີຖານຂໍ້ມູນຂອງທ່ານເຮັດວຽກຢ່າງຖືກຕ້ອງ ແລະ ທຸກຕາຕະລາງບໍ່ມີຂໍ້ຜິດພາດ.','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>ຄ່າຂັດແຍ່ງກັນສຳລັບຄ່າຄົງທີ່ %1$s ແລະ %2$s.</strong> ຄ່າຂອງ %2$s ຈະຖືກຖືວ່າເປັນການຕັ້ງຄ່າໂດເມນຍ່ອຍຂອງທ່ານ.','*'=>'*','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'ເຂົ້າສູ່ລະບົບໃນຊື່ %1$s. <a href="%2$s">ແກ້ໄຂໂປຣໄຟລ໌ຂອງທ່ານ</a>. <a href="%3$s">ອອກຈາກລະບົບ?</a>','%sX-Large'=>'%sX-Large','%sX-Small'=>'%sX-Small','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'ໄຟລ໌ %1$s ຂອງທ່ານໃຊ້ຄ່າໄດນາມິກ (%2$s) ສຳລັບເສັ້ນທາງທີ່ %3$s. ແຕ່ຄ່າທີ່ %3$s ກໍເປັນຄ່າໄດນາມິກຄືກັນ (ຊີ້ໄປຫາ %4$s) ເຊິ່ງການຊີ້ໄປຫາຄ່າໄດນາມິກອື່ນແມ່ນບໍ່ຮອງຮັບ. ກະລຸນາອັບເດດ %3$s ໃຫ້ຊີ້ໄປຫາ %4$s ໂດຍກົງ.','put your unique phrase here'=>'ໃສ່ຂໍ້ຄວາມທີ່ເປັນເອກະລັກຂອງທ່ານຢູ່ບ່ອນນີ້','Cache key must be an integer or a non-empty string, %s given.'=>'ຄີຂອງແຄຊຕ້ອງເປັນເລກຖ້ວນ ຫຼື ຂໍ້ຄວາມທີ່ບໍ່ວ່າງເປົ່າ, ແຕ່ໄດ້ຮັບເປັນ %s.','Cache key must not be an empty string.'=>'ຄີຂອງແຄຊຕ້ອງບໍ່ເປັນຂໍ້ຄວາມວ່າງເປົ່າ.','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'ເກີດຂໍ້ຜິດພາດຮ້າຍແຮງຂຶ້ນໃນເວັບໄຊນີ້. ກະລຸນາຕິດຕໍ່ຜູ້ດູແລລະບົບເວັບໄຊຂອງທ່ານ ແລະ ແຈ້ງຂໍ້ຜິດພາດນີ້ໃຫ້ເຂົາເຈົ້າຊາບເພື່ອຂໍຄວາມຊ່ວຍເຫຼືອເພີ່ມເຕີມ.','When checking for the %s capability, you must always check it against a specific user.'=>'ເມື່ອກວດສອບສິດ %s, ທ່ານຕ້ອງກວດສອບກັບຜູ້ໃຊ້ສະເພາະໃດໜຶ່ງສະເໝີ.','When checking for the %s capability, you must always check it against a specific term.'=>'ເມື່ອກວດສອບສິດ %s, ທ່ານຕ້ອງກວດສອບກັບຄຳສັບສະເພາະໃດໜຶ່ງສະເໝີ.','When checking for the %s capability, you must always check it against a specific comment.'=>'ເມື່ອກວດສອບສິດ %s, ທ່ານຕ້ອງກວດສອບກັບຄວາມຄິດເຫັນສະເພາະໃດໜຶ່ງສະເໝີ.','When checking for the %s capability, you must always check it against a specific page.'=>'ເມື່ອກວດສອບສິດ %s, ທ່ານຕ້ອງກວດສອບກັບໜ້າສະເພາະໃດໜຶ່ງສະເໝີ.','When checking for the %s capability, you must always check it against a specific post.'=>'ເມື່ອກວດສອບສິດ %s, ທ່ານຕ້ອງກວດສອບກັບບົດຄວາມສະເພາະໃດໜຶ່ງສະເໝີ.','Your object cache implementation does not support flushing individual groups.'=>'ການເຮັດວຽກຂອງແຄຊອັອບເຈັກຂອງທ່ານບໍ່ຮອງຮັບການລ້າງແຕ່ລະກຸ່ມແຍກກັນ.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'ການເຮັດວຽກຂອງແຄຊອັອບເຈັກຂອງທ່ານບໍ່ຮອງຮັບການລ້າງແຄຊໃນໜ່ວຍຄວາມຈຳ.','Deleted author: %s'=>'ຜູ້ຂຽນທີ່ຖືກລຶບ: %s','Template for %s'=>'ແມ່ແບບສຳລັບ %s','Not found: %1$s (%2$s)'=>'ບໍ່ພົບ: %1$s (%2$s)','Block pattern categoryFooters'=>'ສ່ວນທ້າຍ','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'ເກີດຂໍ້ຜິດພາດໃນການຍົກເລີກກຳນົດການ Cron ສຳລັບ hook: %1$s, ລະຫັດຂໍ້ຜິດພາດ: %2$s, ຂໍ້ຄວາມຂໍ້ຜິດພາດ: %3$s, ຂໍ້ມູນ: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'ເກີດຂໍ້ຜິດພາດໃນການກຳນົດການ Cron ໃໝ່ ສຳລັບ hook: %1$s, ລະຫັດຂໍ້ຜິດພາດ: %2$s, ຂໍ້ຄວາມຂໍ້ຜິດພາດ: %3$s, ຂໍ້ມູນ: %4$s','Whether a theme uses block-based templates.'=>'ຫາກວ່າທີມໃຊ້ແມ່ແບບທີ່ອີງຕາມບລັອກ.','The ID of the page that should display the latest posts'=>'ID ຂອງໜ້າທີ່ຄວນສະແດງບົດຄວາມຫຼ້າສຸດ','The ID of the page that should be displayed on the front page'=>'ID ຂອງໜ້າທີ່ຄວນສະແດງຢູ່ໃນໜ້າທຳອິດ','What to show on the front page'=>'ສິ່ງທີ່ຈະສະແດງຢູ່ໃນໜ້າທຳອິດ','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'ໄຟລ໌ %1$s ຖືກ <strong>ຍົກເລີກການໃຊ້</strong> ຕັ້ງແຕ່ເວີຊັນ %2$s ໂດຍບໍ່ມີທາງເລືອກອື່ນແທນ.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'ໄຟລ໌ %1$s ຖືກ <strong>ຍົກເລີກການໃຊ້</strong> ຕັ້ງແຕ່ເວີຊັນ %2$s! ກະລຸນາໃຊ້ %3$s ແທນ.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'ຟັງຊັນ %1$s ຖືກ <strong>ຍົກເລີກການໃຊ້</strong> ຕັ້ງແຕ່ເວີຊັນ %2$s ໂດຍບໍ່ມີທາງເລືອກອື່ນແທນ.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'ຟັງຊັນ %1$s ຖືກ <strong>ຍົກເລີກການໃຊ້</strong> ຕັ້ງແຕ່ເວີຊັນ %2$s! ກະລຸນາໃຊ້ %3$s ແທນ.','block descriptionDisplays the link of a post, page, or any other content-type.'=>'ສະແດງລິ້ງຂອງບົດຄວາມ, ໜ້າ ຫຼື ປະເພດເນື້ອຫາອື່ນໆ.','block titleRead More'=>'ອ່ານເພີ່ມເຕີມ','block descriptionContains the block elements used to render content when no query results are found.'=>'ປະກອບດ້ວຍບລັອກທີ່ໃຊ້ເພື່ອສະແດງເນື້ອຫາເມື່ອບໍ່ພົບຜົນການຄົ້ນຫາ.','block titleNo Results'=>'ບໍ່ມີຜົນການຄົ້ນຫາ','block descriptionDisplay post author details such as name, avatar, and bio.'=>'ສະແດງລາຍລະອຽດຜູ້ຂຽນບົດຄວາມ ເຊັ່ນ ຊື່, ຮູບແທນຕົວ ແລະ ຊີວະປະຫວັດ.','block descriptionThe author biography.'=>'ຊີວະປະຫວັດຜູ້ຂຽນ.','block titleAuthor Biography'=>'ຊີວະປະຫວັດຜູ້ຂຽນ','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'ສ້າງລິ້ງທີ່ຊີ້ໄປຫາໜ້າທຳອິດຂອງເວັບໄຊສະເໝີ. ປົກກະຕິແລ້ວບໍ່ຈຳເປັນຖ້າມີລິ້ງຫົວຂໍ້ເວັບໄຊຢູ່ໃນສ່ວນຫົວແລ້ວ.','block titleHome Link'=>'ລິ້ງໜ້າທຳອິດ','block descriptionGather blocks in a layout container.'=>'ລວມບລັອກເຂົ້າໃນກ່ອງບັນຈຸຮູບແບບ.','block descriptionDisplays a title with the number of comments.'=>'ສະແດງຫົວຂໍ້ພ້ອມກັບຈຳນວນຄວາມຄິດເຫັນ.','block titleComments Title'=>'ຫົວຂໍ້ຄວາມຄິດເຫັນ','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'ບລັອກຂັ້ນສູງທີ່ຊ່ວຍໃຫ້ສະແດງຄວາມຄິດເຫັນຂອງບົດຄວາມໂດຍໃຊ້ການຕັ້ງຄ່າຮູບແບບຕ່າງໆ.','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'ສະແດງແຖບນຳທາງເພື່ອໄປຫາຄວາມຄິດເຫັນຊຸດຖັດໄປ ຫຼື ກ່ອນໜ້າ.','block titleComments Pagination'=>'ການແບ່ງໜ້າຄວາມຄິດເຫັນ','block descriptionDisplays the previous comment\'s page link.'=>'ສະແດງລິ້ງໄປຫາໜ້າຄວາມຄິດເຫັນກ່ອນໜ້າ.','block descriptionDisplays a list of page numbers for comments pagination.'=>'ສະແດງລາຍການເລກໜ້າສຳລັບການແບ່ງໜ້າຄວາມຄິດເຫັນ.','block descriptionDisplays the next comment\'s page link.'=>'ສະແດງລິ້ງໄປຫາໜ້າຄວາມຄິດເຫັນຖັດໄປ.','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'ປະກອບດ້ວຍບລັອກທີ່ໃຊ້ເພື່ອສະແດງຄວາມຄິດເຫັນ ເຊັ່ນ ຫົວຂໍ້, ວັນທີ, ຜູ້ຂຽນ, ຮູບແທນຕົວ ແລະ ອື່ນໆ.','block titleComment Template'=>'ແມ່ແບບຄວາມຄິດເຫັນ','block descriptionDisplays a link to reply to a comment.'=>'ສະແດງລິ້ງເພື່ອຕອບກັບຄວາມຄິດເຫັນ.','block titleComment Reply Link'=>'ລິ້ງຕອບກັບຄວາມຄິດເຫັນ','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'ສະແດງລິ້ງເພື່ອແກ້ໄຂຄວາມຄິດເຫັນໃນ Dashboard ຂອງ WordPress. ລິ້ງນີ້ຈະສະແດງໃຫ້ສະເພາະຜູ້ໃຊ້ທີ່ມີສິດແກ້ໄຂຄວາມຄິດເຫັນເທົ່ານັ້ນ.','block titleComment Edit Link'=>'ລິ້ງແກ້ໄຂຄວາມຄິດເຫັນ','block descriptionDisplays the date on which the comment was posted.'=>'ສະແດງວັນທີທີ່ຄວາມຄິດເຫັນຖືກໂພສ.','block descriptionDisplays the contents of a comment.'=>'ສະແດງເນື້ອຫາຂອງຄວາມຄິດເຫັນ.','block descriptionDisplays the name of the author of the comment.'=>'ສະແດງຊື່ຂອງຜູ້ຂຽນຄວາມຄິດເຫັນ.','block titleComment Author Name'=>'ຊື່ຜູ້ຂຽນຄວາມຄິດເຫັນ','block descriptionAdd a user’s avatar.'=>'ເພີ່ມຮູບແທນຕົວຂອງຜູ້ໃຊ້.','block titleAvatar'=>'ຮູບແທນຕົວ','A WordPress Commenter'=>'ຜູ້ສະແດງຄວາມຄິດເຫັນ WordPress','Responses to %s'=>'ການຕອບຮັບຕໍ່ %s','Response to %s'=>'ການຕອບຮັບຕໍ່ %s','block titleComment Date'=>'ວັນທີສະແດງຄວາມຄິດເຫັນ','block titleComment Content'=>'ເນື້ອຫາຄວາມຄິດເຫັນ','Default Avatar'=>'ຮູບແທນຕົວເລີ່ມຕົ້ນ','Add Pattern'=>'ເພີ່ມແບບແຜນ','Alignment optionNone'=>'ບໍ່ມີ','There is already a ping from that URL for this post.'=>'ມີການປິງ (ping) ຈາກ URL ນັ້ນສຳລັບບົດຄວາມນີ້ແລ້ວ.','The password cannot be a space or all spaces.'=>'ລະຫັດຜ່ານບໍ່ສາມາດເປັນຍະວ່າງ ຫຼື ເປັນຍະວ່າງທັງໝົດໄດ້.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'ຕ້ອງການຄວາມຊ່ວຍເຫຼືອເພີ່ມເຕີມບໍ? <a href="%1$s">ອ່ານບົດຄວາມຊ່ວຍເຫຼືອກ່ຽວກັບ %2$s</a>.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'ສາມາດເຊື່ອມຕໍ່ກັບເຊີບເວີຖານຂໍ້ມູນໄດ້ (ໝາຍຄວາມວ່າຊື່ຜູ້ໃຊ້ ແລະ ລະຫັດຜ່ານຂອງທ່ານຖືກຕ້ອງ) ແຕ່ບໍ່ສາມາດເລືອກຖານຂໍ້ມູນ %s ໄດ້.','Cannot select database'=>'ບໍ່ສາມາດເລືອກຖານຂໍ້ມູນໄດ້','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ບໍ່ພົບໄຟລ໌ນັ້ນ. ກວດສອບ <a href="%s">ຄັງສື່</a> ຂອງທ່ານ ແລະ ໃຫ້ແນ່ໃຈວ່າມັນບໍ່ໄດ້ຖືກລຶບອອກແລ້ວ.','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'ຂໍອະໄພ, ວິດີໂອຕາມ URL ທີ່ໃຫ້ມາບໍ່ສາມາດໂຫຼດໄດ້. ກະລຸນາກວດສອບວ່າ URL ນັ້ນແມ່ນສຳລັບໄຟລ໌ວິດີໂອທີ່ຮອງຮັບ (%s) ຫຼື ສະຕຣີມ (ເຊັ່ນ YouTube ແລະ Vimeo).','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ບໍ່ພົບວິດີໂອນັ້ນ. ກວດສອບ <a href="%s">ຄັງສື່</a> ຂອງທ່ານ ແລະ ໃຫ້ແນ່ໃຈວ່າມັນບໍ່ໄດ້ຖືກລຶບອອກແລ້ວ.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ບໍ່ພົບຮູບພາບນັ້ນ. ກວດສອບ <a href="%s">ຄັງສື່</a> ຂອງທ່ານ ແລະ ໃຫ້ແນ່ໃຈວ່າມັນບໍ່ໄດ້ຖືກລຶບອອກແລ້ວ.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ບໍ່ພົບໄຟລ໌ສຽງນັ້ນ. ກວດສອບ <a href="%s">ຄັງສື່</a> ຂອງທ່ານ ແລະ ໃຫ້ແນ່ໃຈວ່າມັນບໍ່ໄດ້ຖືກລຶບອອກແລ້ວ.','User URL may not be longer than 100 characters.'=>'URL ຜູ້ໃຊ້ຕ້ອງບໍ່ເກີນ 100 ຕົວອັກສອນ.','Unable to pass %s if not using multisite.'=>'ບໍ່ສາມາດສົ່ງຄ່າ %s ໄດ້ ຖ້າບໍ່ໄດ້ໃຊ້ລະບົບຫຼາຍເວັບໄຊ (multisite).','Webfont font weight must be a properly formatted string or integer.'=>'ຄວາມໜາຂອງຟອນເວັບ (Webfont) ຕ້ອງເປັນຂໍ້ຄວາມ ຫຼື ເລກຖ້ວນທີ່ຈັດຮູບແບບຢ່າງຖືກຕ້ອງ.','Each webfont src must be a non-empty string.'=>'ແຫຼ່ງທີ່ມາ (src) ຂອງແຕ່ລະຟອນເວັບຕ້ອງເປັນຂໍ້ຄວາມທີ່ບໍ່ວ່າງເປົ່າ.','Webfont src must be a non-empty string or an array of strings.'=>'ແຫຼ່ງທີ່ມາຂອງຟອນເວັບຕ້ອງເປັນຂໍ້ຄວາມ ຫຼື ອາເຣຂອງຂໍ້ຄວາມທີ່ບໍ່ວ່າງເປົ່າ.','Webfont font family must be a non-empty string.'=>'ຕະກຸນຟອນເວັບຕ້ອງເປັນຂໍ້ຄວາມທີ່ບໍ່ວ່າງເປົ່າ.','Limit results to those matching a pattern (slug).'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະອັນທີ່ກົງກັບແບບແຜນ (ສະລັກ).','Ancestor blocks.'=>'ບລັອກຕົ້ນຕະກຸນ.','Determines whether the pattern is visible in inserter.'=>'ກຳນົດວ່າແບບແຜນນັ້ນຈະສະແດງຢູ່ໃນເຄື່ອງມືແຊກບລັອກຫຼືບໍ່.','The pattern keywords.'=>'ຄຳຄົ້ນຫາຂອງແບບແຜນ.','The pattern category slugs.'=>'ສະລັກໝວດໝູ່ຂອງແບບແຜນ.','Block types that the pattern is intended to be used with.'=>'ປະເພດບລັອກທີ່ແບບແຜນນີ້ຕັ້ງໃຈໃຫ້ໃຊ້ຮ່ວມນຳ.','The pattern viewport width for inserter preview.'=>'ຄວາມກວ້າງຂອງ Viewport ຂອງແບບແຜນສຳລັບການເບິ່ງຕົວຢ່າງໃນເຄື່ອງມືແຊກ.','The pattern detailed description.'=>'ຄຳອະທິບາຍລະອຽດຂອງແບບແຜນ.','The pattern name.'=>'ຊື່ຂອງແບບແຜນ.','Sorry, you are not allowed to view the registered block patterns.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງແບບແຜນບລັອກທີ່ລົງທະບຽນໄວ້.','The category label, in human readable format.'=>'ປ້າຍຊື່ໝວດໝູ່, ໃນຮູບແບບທີ່ຄົນທົ່ວໄປອ່ານເຂົ້າໃຈໄດ້.','The category name.'=>'ຊື່ໝວດໝູ່.','Sorry, you are not allowed to view the registered block pattern categories.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງໝວດໝູ່ແບບແຜນບລັອກທີ່ລົງທະບຽນໄວ້.','Error in deleting the attachment.'=>'ເກີດຂໍ້ຜິດພາດໃນການລຶບໄຟລ໌ຄັດຕິດ.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ນີ້ບໍ່ແມ່ນແມ່ແບບຟີດ (feed) ທີ່ຖືກຕ້ອງ.','unit symbolPB'=>'PB','unit symbolEB'=>'EB','unit symbolZB'=>'ZB','unit symbolYB'=>'YB','The description will be displayed in the menu if the active theme supports it.'=>'ຄຳອະທິບາຍຈະຖືກສະແດງໃນເມນູ ຖ້າທີມທີ່ໃຊ້ງານຢູ່ຮອງຮັບ.','A title on that page cannot be found.'=>'ບໍ່ພົບຫົວຂໍ້ໃນໜ້ານັ້ນ.','color schemeLight'=>'ສະຫວ່າງ','color schemeDark'=>'ມືດ','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ໂຟນເດີທີມວ່າງເປົ່າ ຫຼື ບໍ່ມີຢູ່. ກະລຸນາກວດສອບການຕິດຕັ້ງຂອງທ່ານ.','File does not exist?'=>'ໄຟລ໌ບໍ່ມີຢູ່?','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'ບໍ່ຮອງຮັບການເພີ່ມ RSS ຟີດໃນໜ້າທຳອິດຂອງເວັບໄຊນີ້ ເພາະອາດເຮັດໃຫ້ເກີດການວົນລູບທີ່ເຮັດໃຫ້ເວັບໄຊຂອງທ່ານຊ້າລົງ. ລອງໃຊ້ບລັອກອື່ນ ເຊັ່ນ ບລັອກ <strong>ບົດຄວາມຫຼ້າສຸດ</strong> ເພື່ອສະແດງລາຍການບົດຄວາມຈາກເວັບໄຊ.','Responses'=>'ການຕອບຮັບ','Response'=>'ການຕອບຮັບ','Older Comments'=>'ຄວາມຄິດເຫັນເກົ່າກວ່າ','Newer Comments'=>'ຄວາມຄິດເຫັນໃໝ່ກວ່າ','(%s website link, opens in a new tab)'=>'(ລິ້ງເວັບໄຊຂອງ %s, ເປີດໃນແທັບໃໝ່)','(%s author archive, opens in a new tab)'=>'(ຄັງເກັບຂອງຜູ້ຂຽນ %s, ເປີດໃນແທັບໃໝ່)','%s Avatar'=>'ຮູບແທນຕົວຂອງ %s','Could not register file "%s" as a block pattern ("Title" field missing)'=>'ບໍ່ສາມາດລົງທະບຽນໄຟລ໌ "%s" ເປັນແບບແຜນບລັອກໄດ້ (ຂາດຟີວ "Title")','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'ບໍ່ສາມາດລົງທະບຽນໄຟລ໌ "%1$s" ເປັນແບບແຜນບລັອກໄດ້ (ສະລັກ "%2$s" ບໍ່ຖືກຕ້ອງ)','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'ບໍ່ສາມາດລົງທະບຽນໄຟລ໌ "%s" ເປັນແບບແຜນບລັອກໄດ້ (ຂາດຟີວ "Slug")','Block pattern categoryFeatured'=>'ທີ່ໂດດເດັ່ນ','Use Site Editor'=>'ໃຊ້ຕົວແກ້ໄຂເວັບໄຊ','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'ໄຊໂຍ! ທີມຂອງທ່ານຮອງຮັບການແກ້ໄຂເວັບໄຊດ້ວຍບລັອກ. <a href="%1$s">ບອກຂ້ອຍເພີ່ມເຕີມ</a>. %2$s','Icon'=>'ໄອຄອນ','Site icon.'=>'ໄອຄອນເວັບໄຊ.','Font size nameExtra Large'=>'ໃຫຍ່ພິເສດ','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'ສະແດງຄຳອະທິບາຍຂອງໝວດໝູ່, ແທັກ ແລະ ແທັກໂຊໂນມີກຳນົດເອງເມື່ອເບິ່ງຄັງເກັບ.','block titleTerm Description'=>'ຄຳອະທິບາຍຄຳສັບ','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'ແກ້ໄຂສ່ວນຕ່າງໆ ຂອງເວັບໄຊ ເຊັ່ນ ສ່ວນຫົວ, ສ່ວນທ້າຍ, ແຖບຂ້າງ ຫຼື ສ້າງຂອງສ່ວນຂອງທ່ານເອງ.','block titleTemplate Part'=>'ສ່ວນປະກອບແມ່ແບບ','block descriptionCreate structured content in rows and columns to display information.'=>'ສ້າງເນື້ອຫາທີ່ມີໂຄງສ້າງເປັນແຖວ ແລະ ຄໍລຳເພື່ອສະແດງຂໍ້ມູນ.','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'ສະແດງຊື່ຂອງເວັບໄຊນີ້. ອັບເດດບລັອກນີ້ ແລ້ວການປ່ຽນແປງຈະມີຜົນໃນທຸກບ່ອນທີ່ມັນຖືກໃຊ້. ອັນນີ້ຈະສະແດງຢູ່ໃນແຖບຫົວຂໍ້ບຣາວເຊີ ແລະ ໃນຜົນການຄົ້ນຫາຄືກັນ.','block style labelPlain'=>'ທຳມະດາ','block titlePagination'=>'ການແບ່ງໜ້າ','block titlePrevious Page'=>'ໜ້າກ່ອນໜ້າ','block titlePage Numbers'=>'ເລກໜ້າ','block titleNext Page'=>'ໜ້າຖັດໄປ','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'ສະແດງລິ້ງບົດຄວາມຖັດໄປ ຫຼື ກ່ອນໜ້າທີ່ຢູ່ຕິດກັບບົດຄວາມປັດຈຸບັນ.','block titlePost Navigation Link'=>'ລິ້ງນຳທາງບົດຄວາມ','block descriptionDisplay a post\'s comments form.'=>'ສະແດງແບບຟອມຄວາມຄິດເຫັນຂອງບົດຄວາມ.','block titleComments Form'=>'ແບບຟອມຄວາມຄິດເຫັນ','block descriptionShow a block pattern.'=>'ສະແດງແບບແຜນບລັອກ.','block titlePattern'=>'ແບບແຜນ','block descriptionA collection of blocks that allow visitors to get around your site.'=>'ຊຸດຂອງບລັອກທີ່ຊ່ວຍໃຫ້ຜູ້ເຂົ້າຊົມໄປຫາສ່ວນຕ່າງໆ ຂອງເວັບໄຊຂອງທ່ານໄດ້.','block titleNavigation'=>'ການນຳທາງ','block descriptionAdd a submenu to your navigation.'=>'ເພີ່ມເມນູຍ່ອຍໃນການນຳທາງຂອງທ່ານ.','block titleSubmenu'=>'ເມນູຍ່ອຍ','block descriptionAdd a page, link, or another item to your navigation.'=>'ເພີ່ມໜ້າ, ລິ້ງ ຫຼື ລາຍການອື່ນໆ ໃນການນຳທາງຂອງທ່ານ.','block titleCustom Link'=>'ລິ້ງກຳນົດເອງ','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'ສະແດງເນື້ອຫາໃນຫຼາຍຄໍລຳ, ໂດຍມີບລັອກທີ່ເພີ່ມໃສ່ໃນແຕ່ລະຄໍລຳ.','Preload valueNone'=>'ບໍ່ມີ','No comments'=>'ບໍ່ມີຄວາມຄິດເຫັນ','Media item link optionNone'=>'ບໍ່ມີ','Could not strip invalid text.'=>'ບໍ່ສາມາດລຶບຂໍ້ຄວາມທີ່ບໍ່ຖືກຕ້ອງອອກໄດ້.','Could not retrieve table charset.'=>'ບໍ່ສາມາດດຶງຂໍ້ມູນຊຸດຕົວອັກສອນ (charset) ຂອງຕາຕະລາງໄດ້.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'ຂໍ້ຜິດພາດຂອງຖານຂໍ້ມູນ WordPress: ການປະມວນຜົນຄ່າສຳລັບຟິວຕໍ່ໄປນີ້ຫຼົ້ມເຫຼວ: %s. ຄ່າທີ່ສົ່ງມາອາດຈະຍາວເກີນໄປ ຫຼື ມີຂໍ້ມູນທີ່ບໍ່ຖືກຕ້ອງ.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'ຂໍ້ຜິດພາດຂອງຖານຂໍ້ມູນ WordPress: ການປະມວນຜົນຄ່າສຳລັບຟິວຕໍ່ໄປນີ້ຫຼົ້ມເຫຼວ: %s. ຄ່າທີ່ສົ່ງມາອາດຈະຍາວເກີນໄປ ຫຼື ມີຂໍ້ມູນທີ່ບໍ່ຖືກຕ້ອງ.','WordPress database error: Could not perform query because it contains invalid data.'=>'ຂໍ້ຜິດພາດຂອງຖານຂໍ້ມູນ WordPress: ບໍ່ສາມາດສອບຖາມ (query) ໄດ້ເນື່ອງຈາກມີຂໍ້ມູນທີ່ບໍ່ຖືກຕ້ອງ.','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'ສະໄຕລ໌ "%1$s" ບໍ່ຄວນຖືກເອີ້ນໃຊ້ຮ່ວມກັບຕົວແກ້ໄຂວິດເຈັດໃໝ່ (%2$s ຫຼື %3$s).','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'ສະຄຣິບ "%1$s" ບໍ່ຄວນຖືກເອີ້ນໃຊ້ຮ່ວມກັບຕົວແກ້ໄຂວິດເຈັດໃໝ່ (%2$s ຫຼື %3$s).','The description is not prominent by default; however, some themes may show it.'=>'ໂດຍປົກກະຕິແລ້ວ ຄຳອະທິບາຍຈະບໍ່ສະແດງໃຫ້ເຫັນຢ່າງຈະແຈ້ງ; ແນວໃດກໍຕາມ, ບາງເທັມອາດຈະສະແດງມັນ.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'ກຳນົດໝວດໝູ່ຫຼັກເພື່ອສ້າງລຳດັບຂັ້ນ. ຕົວຢ່າງ: ໝວດໝູ່ Jazz ອາດຈະເປັນຫຼັກຂອງ Bebop ແລະ Big Band.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'&#8220;ສະລັກ&#8221; (slug) ແມ່ນຊື່ໃນຮູບແບບທີ່ເໝາະສົມກັບ URL. ປົກກະຕິຈະເປັນຕົວພິມນ້ອຍທັງໝົດ ແລະ ມີພຽງແຕ່ຕົວອັກສອນ, ຕົວເລກ ແລະ ເຄື່ອງໝາຍຂີດຕໍ່.','The name is how it appears on your site.'=>'ຊື່ນີ້ແມ່ນຊື່ທີ່ຈະປາກົດຢູ່ໃນເວັບໄຊຂອງທ່ານ.','Template Part Area'=>'ພື້ນທີ່ສ່ວນປະກອບເທັມເພຼດ','Template Part Areas'=>'ພື້ນທີ່ສ່ວນປະກອບເທັມເພຼດ','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'ເຊີບເວີບໍ່ສາມາດປະມວນຜົນຮູບພາບໄດ້. ອາດຈະເກີດຈາກເຊີບເວີເຮັດວຽກໜັກ ຫຼື ມີຊັບພະຍາກອນບໍ່ພຽງພໍ. ການອັບໂຫຼດຮູບທີ່ນ້ອຍລົງອາດຊ່ວຍໄດ້. ຂະໜາດສູງສຸດທີ່ແນະນຳແມ່ນ 2560 ພິກເຊວ.','Limit result set to users who have published posts.'=>'ຈຳກັດຜົນລັກສະນະສະເພາະຜູ້ໃຊ້ທີ່ມີການເຜີຍແຜ່ໂພສແລ້ວ.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'ຈຳກັດຜົນລັກສະນະສະເພາະຜູ້ໃຊ້ທີ່ມີຄວາມສາມາດ (capability) ຕົງຕາມທີ່ກຳນົດ.','Sorry, you are not allowed to filter users by capability.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ກັ່ນຕອງຜູ້ໃຊ້ຕາມຄວາມສາມາດ.','Unable to retrieve body from response at this URL.'=>'ບໍ່ສາມາດດຶງເນື້ອຫາ (body) ຈາກການຕອບສະໜອງຂອງ URL ນີ້ໄດ້.','URL not found. Response returned a non-200 status code for this URL.'=>'ບໍ່ພົບ URL. ການຕອບສະໜອງກັບມາດ້ວຍລະຫັດສະຖານະທີ່ບໍ່ແມ່ນ 200.','Sorry, you are not allowed to process remote URLs.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ປະມວນຜົນ URL ຈາກພາຍນອກ.','Invalid URL'=>'URL ບໍ່ຖືກຕ້ອງ','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'ລິ້ງຮູບພາບ Open Graph ຂອງອົງປະກອບ %1$s ຫຼື %2$s ຈາກ URL.','The content of the %s element from the URL.'=>'ເນື້ອຫາຂອງອົງປະກອບ %s ຈາກ URL.','The favicon image link of the %s element from the URL.'=>'ລິ້ງຮູບພາບ favicon ຂອງອົງປະກອບ %s ຈາກ URL.','The contents of the %s element from the URL.'=>'ເນື້ອຫາພາຍໃນຂອງອົງປະກອບ %s ຈາກ URL.','The URL to process.'=>'URL ທີ່ຈະປະມວນຜົນ.','Where the template part is intended for use (header, footer, etc.)'=>'ບ່ອນທີ່ສ່ວນປະກອບເທັມເພຼດນີ້ຖືກກຳນົດໃຫ້ໃຊ້ (ສ່ວນຫົວ, ສ່ວນທ້າຍ, ແລະ ອື່ນໆ)','Whether a template is a custom template.'=>'ເທັມເພຼດນີ້ເປັນເທັມເພຼດທີ່ກຳນົດເອງຫຼືບໍ່.','The ID for the author of the template.'=>'ໄອດີ (ID) ຂອງຜູ້ຂຽນເທັມເພຼດ.','HTML title for the template, transformed for display.'=>'ຊື່ HTML ຂອງເທັມເພຼດ, ທີ່ຖືກແປງເພື່ອສະແດງຜົນ.','Title for the template, as it exists in the database.'=>'ຊື່ຂອງເທັມເພຼດ ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','Version of the content block format used by the template.'=>'ເວີຊັນຂອງຮູບແບບບລັອກເນື້ອຫາທີ່ໃຊ້ໂດຍເທັມເພຼດ.','Content for the template, as it exists in the database.'=>'ເນື້ອຫາສຳລັບເທັມເພຼດ ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','Source of a customized template'=>'ແຫຼ່ງທີ່ມາຂອງເທັມເພຼດທີ່ກຳນົດເອງ','Type of template.'=>'ປະເພດຂອງເທັມເພຼດ.','Post type to get the templates for.'=>'ປະເພດຂອງໂພສທີ່ຈະດຶງເທັມເພຼດມາໃຊ້.','Limit to the specified template part area.'=>'ຈຳກັດສະເພາະພື້ນທີ່ສ່ວນປະກອບເທັມເພຼດທີ່ກຳນົດ.','REST namespace route for the taxonomy.'=>'ເສັ້ນທາງ REST namespace ສຳລັບແທັກໂຊໂນມີ (taxonomy).','Whether to make the post type available for selection in navigation menus.'=>'ກຳນົດວ່າຈະໃຫ້ປະເພດໂພສນີ້ສາມາດເລືອກໄດ້ໃນເມນູນຳຊົມຫຼືບໍ່.','Whether to generate a default UI for managing this post type.'=>'ກຳນົດວ່າຈະສ້າງ UI ເລີ່ມຕົ້ນສຳລັບການຈັດການປະເພດໂພສນີ້ຫຼືບໍ່.','The visibility settings for the post type.'=>'ການຕັ້ງຄ່າການເບິ່ງເຫັນສຳລັບປະເພດໂພສ.','REST route\'s namespace for the post type.'=>'Namespace ຂອງເສັ້ນທາງ REST ສຳລັບປະເພດໂພສ.','Whether to automatically add top level pages to this menu.'=>'ກຳນົດວ່າຈະເພີ່ມໜ້າລະດັບສູງສຸດໃສ່ເມນູນີ້ໂດຍອັດຕະໂນມັດຫຼືບໍ່.','The locations assigned to the menu.'=>'ຕຳແໜ່ງທີ່ຖືກກຳນົດໃຫ້ກັບເມນູ.','The menu cannot be deleted.'=>'ບໍ່ສາມາດລຶບເມນູນີ້ໄດ້.','Menus do not support trashing. Set \'%s\' to delete.'=>'ເມນູບໍ່ຮອງຮັບການຍ້າຍລົງຖັງຂີ້ເຫຍື້ອ. ໃຫ້ຕັ້ງຄ່າ \'%s\' ເພື່ອລຶບຖາວອນ.','Sorry, you are not allowed to view menus.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງເມນູ.','The ID of the assigned menu.'=>'ໄອດີຂອງເມນູທີ່ຖືກກຳນົດ.','The description of the menu location.'=>'ຄຳອະທິບາຍຕຳແໜ່ງຂອງເມນູ.','The name of the menu location.'=>'ຊື່ຕຳແໜ່ງຂອງເມນູ.','Invalid menu location.'=>'ຕຳແໜ່ງເມນູບໍ່ຖືກຕ້ອງ.','Sorry, you are not allowed to view menu locations.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງຕຳແໜ່ງເມນູ.','An alphanumeric identifier for the menu location.'=>'ຕົວລະບຸຕຳແໜ່ງເມນູທີ່ເປັນຕົວອັກສອນ ແລະ ຕົວເລກ.','The terms assigned to the object in the %s taxonomy.'=>'ໝວດໝູ່ທີ່ຖືກກຳນົດໃຫ້ກັບວັດຖຸໃນແທັກໂຊໂນມີ %s.','Whether the menu item represents an object that no longer exists.'=>'ລາຍການເມນູສະແດງເຖິງວັດຖຸທີ່ບໍ່ມີຢູ່ແລ້ວຫຼືບໍ່.','The XFN relationship expressed in the link of this menu item.'=>'ຄວາມສຳພັນ XFN ທີ່ລະບຸໃນລິ້ງຂອງລາຍການເມນູນີ້.','The URL to which this menu item points.'=>'URL ທີ່ລາຍການເມນູນີ້ເຊື່ອມຕໍ່ໄປຫາ.','The singular label used to describe this type of menu item.'=>'ປ້າຍຊື່ຮູບແບບເອກະພົດທີ່ໃຊ້ເພື່ອອະທິບາຍລາຍການເມນູປະເພດນີ້.','The target attribute of the link element for this menu item.'=>'ຄຸນສົມບັດເປົ້າໝາຍ (target) ຂອງອົງປະກອບລິ້ງສຳລັບລາຍການເມນູນີ້.','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'ໄອດີໃນຖານຂໍ້ມູນຂອງວັດຖຸຕົ້ນສະບັບທີ່ລາຍການເມນູນີ້ສະແດງເຖິງ.','The type of object originally represented, such as "category", "post", or "attachment".'=>'ປະເພດຂອງວັດຖຸຕົ້ນສະບັບ ເຊັ່ນ "ໝວດໝູ່", "ໂພສ", ຫຼື "ໄຟລ໌ແນບ".','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'ໄອດີໃນຖານຂໍ້ມູນຂອງລາຍການເມນູຫຼັກ (ຖ້າມີ), ຖ້າບໍ່ມີໃຫ້ເປັນ 0.','The description of this menu item.'=>'ຄຳອະທິບາຍຂອງລາຍການເມນູນີ້.','Class names for the link element of this menu item.'=>'ຊື່ຄລາສ (class names) ສຳລັບອົງປະກອບລິ້ງຂອງລາຍການເມນູນີ້.','Text for the title attribute of the link element for this menu item.'=>'ຂໍ້ຄວາມສຳລັບຄຸນສົມບັດຊື່ (title) ຂອງອົງປະກອບລິ້ງສຳລັບລາຍການເມນູນີ້.','The ID for the parent of the object.'=>'ໄອດີຂອງວັດຖຸຫຼັກ.','A named status for the object.'=>'ສະຖານະຂອງວັດຖຸ.','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'ກຸ່ມຂອງວັດຖຸຕົ້ນສະບັບ ເຊັ່ນ "post_type" ຫຼື "taxonomy".','HTML title for the object, transformed for display.'=>'ຊື່ HTML ຂອງວັດຖຸ, ທີ່ຖືກແປງເພື່ອສະແດງຜົນ.','Title for the object, as it exists in the database.'=>'ຊື່ຂອງວັດຖຸ ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','Get linked object.'=>'ດຶງວັດຖຸທີ່ຖືກລິ້ງ.','The url is required when using a custom menu item type.'=>'ຈຳເປັນຕ້ອງມີ URL ເມື່ອໃຊ້ປະເພດລາຍການເມນູທີ່ກຳນົດເອງ.','The title is required when using a custom menu item type.'=>'ຈຳເປັນຕ້ອງມີຊື່ເມື່ອໃຊ້ປະເພດລາຍການເມນູທີ່ກຳນົດເອງ.','Menu items do not support trashing. Set \'%s\' to delete.'=>'ລາຍການເມນູບໍ່ຮອງຮັບການຍ້າຍລົງຖັງຂີ້ເຫຍື້ອ. ໃຫ້ຕັ້ງຄ່າ \'%s\' ເພື່ອລຶບຖາວອນ.','Sorry, you are not allowed to access the global styles on this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງສະໄຕລ໌ທົ່ວໄປ (global styles) ໃນເວັບໄຊນີ້.','Title for the global styles variation, as it exists in the database.'=>'ຊື່ຂອງຮູບແບບຍ່ອຍສະໄຕລ໌ທົ່ວໄປ ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','Title of the global styles variation.'=>'ຊື່ຂອງຮູບແບບຍ່ອຍສະໄຕລ໌ທົ່ວໄປ.','Global settings.'=>'ການຕັ້ງຄ່າທົ່ວໄປ.','Global styles.'=>'ສະໄຕລ໌ທົ່ວໄປ.','ID of global styles config.'=>'ໄອດີຂອງການຕັ້ງຄ່າສະໄຕລ໌ທົ່ວໄປ.','No global styles config exists with that ID.'=>'ບໍ່ມີການຕັ້ງຄ່າສະໄຕລ໌ທົ່ວໄປທີ່ມີໄອດີນັ້ນ.','Sorry, you are not allowed to view this global style.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງສະໄຕລ໌ທົ່ວໄປນີ້.','Sorry, you are not allowed to edit this global style.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ແກ້ໄຂສະໄຕລ໌ທົ່ວໄປນີ້.','The theme identifier'=>'ຕົວລະບຸເທັມ','Sorry, you are not allowed to export templates and template parts.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ສົ່ງອອກເທັມເພຼດ ແລະ ສ່ວນປະກອບເທັມເພຼດ.','Public facing and editor style handles.'=>'ການຈັດການສະໄຕລ໌ສຳລັບໜ້າເວັບ ແລະ ຕົວແກ້ໄຂ.','Public facing and editor script handles.'=>'ການຈັດການສະຄຣິບສຳລັບໜ້າເວັບ ແລະ ຕົວແກ້ໄຂ.','The date when the block was last updated.'=>'ວັນທີທີ່ມີການອັບເດດບລັອກຄັ້ງລ່າສຸດ.','file type groupVideo'=>'ວິດີໂອ','file type groupAudio'=>'ສຽງ','Navigation menus that can be inserted into your site.'=>'ເມນູນຳຊົມທີ່ສາມາດແຊກເຂົ້າໄປໃນເວັບໄຊຂອງທ່ານໄດ້.','Navigation Menus list'=>'ລາຍການເມນູນຳຊົມ','Navigation Menus list navigation'=>'ການນຳຊົມລາຍການເມນູນຳຊົມ','Filter Navigation Menu list'=>'ກັ່ນຕອງລາຍການເມນູນຳຊົມ','Uploaded to this Navigation Menu'=>'ອັບໂຫຼດລົງໃນເມນູນຳຊົມນີ້','Insert into Navigation Menu'=>'ແຊກເຂົ້າໃນເມນູນຳຊົມ','Navigation Menu archives'=>'ຄັງເກັບເມນູນຳຊົມ','No Navigation Menu found in Trash.'=>'ບໍ່ພົບເມນູນຳຊົມໃນຖັງຂີ້ເຫຍື້ອ.','No Navigation Menu found.'=>'ບໍ່ພົບເມນູນຳຊົມ.','Parent Navigation Menu:'=>'ເມນູນຳຊົມຫຼັກ:','Search Navigation Menus'=>'ຄົ້ນຫາເມນູນຳຊົມ','View Navigation Menu'=>'ເບິ່ງເມນູນຳຊົມ','Edit Navigation Menu'=>'ແກ້ໄຂເມນູນຳຊົມ','New Navigation Menu'=>'ເມນູນຳຊົມໃໝ່','Add Navigation Menu'=>'ເພີ່ມເມນູນຳຊົມ','post type singular nameNavigation Menu'=>'ເມນູນຳຊົມ','post type general nameNavigation Menus'=>'ເມນູນຳຊົມ','Global styles to include in themes.'=>'ສະໄຕລ໌ທົ່ວໄປທີ່ຈະລວມຢູ່ໃນເທັມ.','post type general nameGlobal Styles'=>'ສະໄຕລ໌ທົ່ວໄປ','Template parts to include in your templates.'=>'ສ່ວນປະກອບເທັມເພຼດທີ່ຈະລວມຢູ່ໃນເທັມເພຼດຂອງທ່ານ.','Template parts list'=>'ລາຍການສ່ວນປະກອບເທັມເພຼດ','Template parts list navigation'=>'ການນຳຊົມລາຍການສ່ວນປະກອບເທັມເພຼດ','Filter template parts list'=>'ກັ່ນຕອງລາຍການສ່ວນປະກອບເທັມເພຼດ','Uploaded to this template part'=>'ອັບໂຫຼດລົງໃນສ່ວນປະກອບເທັມເພຼດນີ້','Insert into template part'=>'ແຊກເຂົ້າໃນສ່ວນປະກອບເທັມເພຼດ','Template part archives'=>'ຄັງເກັບສ່ວນປະກອບເທັມເພຼດ','No template parts found in Trash.'=>'ບໍ່ພົບສ່ວນປະກອບເທັມເພຼດໃນຖັງຂີ້ເຫຍື້ອ.','No template parts found.'=>'ບໍ່ພົບສ່ວນປະກອບເທັມເພຼດ.','Parent Template Part:'=>'ສ່ວນປະກອບເທັມເພຼດຫຼັກ:','Search Template Parts'=>'ຄົ້ນຫາສ່ວນປະກອບເທັມເພຼດ','Template Parts'=>'ສ່ວນປະກອບເທັມເພຼດ','View Template Part'=>'ເບິ່ງສ່ວນປະກອບເທັມເພຼດ','Edit Template Part'=>'ແກ້ໄຂສ່ວນປະກອບເທັມເພຼດ','New Template Part'=>'ສ່ວນປະກອບເທັມເພຼດໃໝ່','post type singular nameTemplate Part'=>'ສ່ວນປະກອບເທັມເພຼດ','post type general nameTemplate Parts'=>'ສ່ວນປະກອບເທັມເພຼດ','post type singular nameTemplate'=>'ເທັມເພຼດ','post type general nameTemplates'=>'ເທັມເພຼດ','<strong>Error:</strong> This email address is already registered. <a href="%s">Log in</a> with this address or choose another one.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ທີ່ຢູ່ອີເມວນີ້ຖືກລົງທະບຽນແລ້ວ. <a href="%s">ເຂົ້າສູ່ລະບົບ</a> ດ້ວຍອີເມວນີ້ ຫຼື ເລືອກອີເມວອື່ນ.','media itemsUnattached'=>'ບໍ່ໄດ້ເຊື່ອມໂຍງ','%1$s only accepts a non-empty path string, received %2$s.'=>'%1$s ຮັບສະເພາະຂໍ້ຄວາມເສັ້ນທາງ (path) ທີ່ບໍ່ຫວ່າງເປົ່າເທົ່ານັ້ນ, ແຕ່ໄດ້ຮັບ %2$s.','Error when decoding a JSON file at path %1$s: %2$s'=>'ເກີດຂໍ້ຜິດພາດໃນການຖອດລະຫັດໄຟລ໌ JSON ທີ່ເສັ້ນທາງ %1$s: %2$s','File %s doesn\'t exist!'=>'ບໍ່ມີໄຟລ໌ %s ຢູ່!','Sorry, you are not allowed to upload this file type.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອັບໂຫຼດໄຟລ໌ປະເພດນີ້.','Could not sanitize the %1$s option. Error code: %2$s'=>'ບໍ່ສາມາດກວດສອບຄວາມປອດໄພຂອງຕົວເລືອກ %1$s ໄດ້. ລະຫັດຂໍ້ຜິດພາດ: %2$s','However, you can still <a href="%s">activate this theme</a>, and use the Site Editor to customize it.'=>'ແນວໃດກໍຕາມ, ທ່ານຍັງສາມາດ <a href="%s">ເປີດໃຊ້ເທັມນີ້</a>, ແລະ ໃຊ້ຕົວແກ້ໄຂເວັບໄຊເພື່ອປັບແຕ່ງມັນ.','This theme doesn\'t support Customizer.'=>'ເທັມນີ້ບໍ່ຮອງຮັບຕົວປັບແຕ່ງ (Customizer).','<strong>Error:</strong> Please fill the required fields.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ກະລຸນາຕື່ມຂໍ້ມູນໃນຊ່ອງທີ່ຈຳເປັນ.','Block style name must not contain any spaces.'=>'ຊື່ສະໄຕລ໌ບລັອກຕ້ອງບໍ່ມີຊ່ອງຫວ່າງ.','Template part has been deleted or is unavailable: %s'=>'ສ່ວນປະກອບເທັມເພຼດຖືກລຶບໄປແລ້ວ ຫຼື ບໍ່ສາມາດໃຊ້ງານໄດ້: %s','label before the title of the previous postPrevious:'=>'ກ່ອນໜ້າ:','label before the title of the next postNext:'=>'ຖັດໄປ:','label for previous post linkPrevious'=>'ກ່ອນໜ້າ','label for next post linkNext'=>'ຖັດໄປ','Close menu'=>'ປິດເມນູ','Open menu'=>'ເປີດເມນູ','%s submenu'=>'ເມນູຍ່ອຍ %s','A link to a post format'=>'ລິ້ງໄປຫາຮູບແບບໂພສ','Post Format Link'=>'ລິ້ງຮູບແບບໂພສ','The calendar block is hidden because there are no published posts.'=>'ບລັອກປະຕິທິນຖືກເຊື່ອງໄວ້ເນື່ອງຈາກບໍ່ມີໂພສທີ່ຖືກເຜີຍແຜ່.','Unable to open export file (archive) for writing.'=>'ບໍ່ສາມາດເປີດໄຟລ໌ສົ່ງອອກ (archive) ເພື່ອຂຽນຂໍ້ມູນໄດ້.','Zip Export not supported.'=>'ບໍ່ຮອງຮັບການສົ່ງອອກເປັນ Zip.','"%1$s" is not a supported wp_template_part area value and has been added as "%2$s".'=>'"%1$s" ບໍ່ແມ່ນຄ່າພື້ນທີ່ wp_template_part ທີ່ຮອງຮັບ ແລະ ຖືກເພີ່ມເປັນ "%2$s" ແທນ.','Template nameTaxonomy'=>'ແທັກໂຊໂນມີ (Taxonomy)','Template namePages'=>'ໜ້າທັງໝົດ','Template nameSingle Posts'=>'ໂພສດ່ຽວ','Template nameFront Page'=>'ໜ້າທຳອິດ','Template nameIndex'=>'ດັດຊະນີ','The Footer template defines a page area that typically contains site credits, social links, or any other combination of blocks.'=>'ເທັມເພຼດສ່ວນທ້າຍກຳນົດພື້ນທີ່ຂອງໜ້າທີ່ໂດຍທົ່ວໄປຈະມີເຄຣດິດເວັບໄຊ, ລິ້ງໂຊຊຽວ, ຫຼື ບລັອກອື່ນໆ.','The Header template defines a page area that typically contains a title, logo, and main navigation.'=>'ເທັມເພຼດສ່ວນຫົວກຳນົດພື້ນທີ່ຂອງໜ້າທີ່ໂດຍທົ່ວໄປຈະມີຊື່ເວັບໄຊ, ໂລໂກ້, ແລະ ເມນູນຳຊົມຫຼັກ.','General templates often perform a specific role like displaying post content, and are not tied to any particular area.'=>'ເທັມເພຼດທົ່ວໄປມັກຈະເຮັດໜ້າທີ່ສະເພາະ ເຊັ່ນ ການສະແດງເນື້ອຫາໂພສ, ແລະ ບໍ່ໄດ້ຜູກມັດກັບພື້ນທີ່ໃດໜຶ່ງ.','Duotone nameBlue and orange'=>'ສີນ້ຳເງິນ ແລະ ສົ້ມ','Duotone namePurple and green'=>'ສີມ່ວງ ແລະ ຂຽວ','Duotone nameMagenta and yellow'=>'ສີບົວບານ ແລະ ເຫຼືອງ','Duotone nameMidnight'=>'ມິດໄນ (ທ່ຽງຄືນ)','Duotone nameBlue and red'=>'ສີນ້ຳເງິນ ແລະ ແດງ','Duotone namePurple and yellow'=>'ສີມ່ວງ ແລະ ເຫຼືອງ','Duotone nameGrayscale'=>'ສີຂາວດຳ','Duotone nameDark grayscale'=>'ສີຂາວດຳເຂັ້ມ','Gradient nameMidnight'=>'ມິດໄນ (ທ່ຽງຄືນ)','Gradient nameElectric grass'=>'Electric grass','Gradient namePale ocean'=>'Pale ocean','Gradient nameLuminous dusk'=>'Luminous dusk','Gradient nameBlush bordeaux'=>'Blush bordeaux','Gradient nameBlush light purple'=>'Blush light purple','Gradient nameCool to warm spectrum'=>'Cool to warm spectrum','Gradient nameVery light gray to cyan bluish gray'=>'Very light gray to cyan bluish gray','Gradient nameLuminous vivid orange to vivid red'=>'Luminous vivid orange to vivid red','Gradient nameLuminous vivid amber to luminous vivid orange'=>'Luminous vivid amber to luminous vivid orange','Gradient nameLight green cyan to vivid green cyan'=>'Light green cyan to vivid green cyan','Gradient nameVivid cyan blue to vivid purple'=>'Vivid cyan blue to vivid purple','Color nameVivid purple'=>'ສີມ່ວງສົດ','Color nameVivid cyan blue'=>'ສີນ້ຳເງິນໄຊແອນສົດ','Color namePale cyan blue'=>'ສີນ້ຳເງິນໄຊແອນຈາງ','Color nameVi