trong>Error:</strong> The passwords do not match.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ລະຫັດຜ່ານບໍ່ກົງກັນ.','<strong>Error:</strong> Your password reset link has expired. Please request a new link below.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ລິ້ງຕັ້ງຄ່າລະຫັດຜ່ານໃໝ່ຂອງທ່ານໝົດອາຍຸແລ້ວ. ກະລຸນາຂໍລິ້ງໃໝ່ດ້ານລຸ່ມ.','<strong>Error:</strong> Your password reset link appears to be invalid. Please request a new link below.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ລິ້ງຕັ້ງຄ່າລະຫັດຜ່ານໃໝ່ຂອງທ່ານບໍ່ຖືກຕ້ອງ. ກະລຸນາຂໍລິ້ງໃໝ່ດ້ານລຸ່ມ.','Block HTML:'=>'HTML ຂອງບລັອກ:','A widget containing a block.'=>'ວິດເຈັດທີ່ປະກອບດ້ວຍບລັອກ.','%1$s or %2$s'=>'%1$s ຫຼື %2$s','<strong>Error:</strong> Unknown username. Check again or try your email address.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ບໍ່ຮູ້ຈັກຊື່ຜູ້ໃຊ້. ກະລຸນາກວດສອບອີກຄັ້ງ ຫຼື ລອງໃຊ້ອີເມວຂອງທ່ານ.','<strong>Error:</strong> Unknown email address. Check again or try your username.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ບໍ່ຮູ້ຈັກທີ່ຢູ່ອີເມວ. ກະລຸນາກວດສອບອີກຄັ້ງ ຫຼື ລອງໃຊ້ຊື່ຜູ້ໃຊ້ຂອງທ່ານ.','<strong>Error:</strong> The username <strong>%s</strong> is not registered on this site. If you are unsure of your username, try your email address instead.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ຊື່ຜູ້ໃຊ້ <strong>%s</strong> ບໍ່ໄດ້ລົງທະບຽນໃນເວັບໄຊນີ້. ຖ້າທ່ານບໍ່ແນ່ໃຈ, ໃຫ້ລອງໃຊ້ອີເມວແທນ.','navigation link block descriptionA link to a category.'=>'ລິ້ງໄປຫາໝວດໝູ່.','navigation link block descriptionA link to a tag.'=>'ລິ້ງໄປຫາແທັກ.','navigation link block titleCategory Link'=>'ລິ້ງໝວດໝູ່','navigation link block titleTag Link'=>'ລິ້ງແທັກ','URL-encoded form data from the widget admin form. Used to update a widget that does not support instance. Write only.'=>'ຂໍ້ມູນຟອມທີ່ເຂົ້າລະຫັດ URL ຈາກຟອມຈັດການວິດເຈັດ. ໃຊ້ເພື່ອອັບເດດວິດເຈັດທີ່ບໍ່ຮອງຮັບອິນສະແຕນຊ໌ (instance).','Unencoded instance settings, if supported.'=>'ການຕັ້ງຄ່າອິນສະແຕນຊ໌ທີ່ບໍ່ໄດ້ເຂົ້າລະຫັດ (ຖ້າຮອງຮັບ).','Cryptographic hash of the instance settings.'=>'ຄ່າແຮຊ (hash) ຂອງການຕັ້ງຄ່າອິນສະແຕນຊ໌.','Base64 encoded representation of the instance settings.'=>'ການສະແດງຜົນການຕັ້ງຄ່າອິນສະແຕນຊ໌ໃນຮູບແບບ Base64.','Instance settings of the widget, if supported.'=>'ການຕັ້ງຄ່າອິນສະແຕນຊ໌ຂອງວິດເຈັດ (ຖ້າຮອງຮັບ).','HTML representation of the widget admin form.'=>'ການສະແດງຜົນ HTML ຂອງຟອມຈັດການວິດເຈັດ.','HTML representation of the widget.'=>'ການສະແດງຜົນ HTML ຂອງວິດເຈັດ.','The sidebar the widget belongs to.'=>'ແຖບດ້ານຂ້າງທີ່ວິດເຈັດນີ້ສັງກັດຢູ່.','The type of the widget. Corresponds to ID in widget-types endpoint.'=>'ປະເພດຂອງວິດເຈັດ. ກົງກັບໄອດີໃນຈຸດເຊື່ອມຕໍ່ (endpoint) ປະເພດວິດເຈັດ.','Unique identifier for the widget.'=>'ຕົວລະບຸສະເພາະສຳລັບວິດເຈັດ.','The sidebar to return widgets for.'=>'ແຖບດ້ານຂ້າງທີ່ຈະດຶງວິດເຈັດມາສະແດງ.','The requested widget is invalid.'=>'ວິດເຈັດທີ່ຮຽກໃຊ້ນັ້ນບໍ່ຖືກຕ້ອງ.','The provided instance is invalid. Must contain raw OR encoded and hash.'=>'ອິນສະແຕນຊ໌ທີ່ສົ່ງມາບໍ່ຖືກຕ້ອງ.','Widget type does not support raw instances.'=>'ປະເພດວິດເຈັດບໍ່ຮອງຮັບ raw instances.','Cannot set instance on a widget that does not extend WP_Widget.'=>'ບໍ່ສາມາດຕັ້ງຄ່າອິນສະແຕນຊ໌ໃນວິດເຈັດທີ່ບໍ່ໄດ້ສືບທອດມາຈາກ WP_Widget.','The provided widget type (id_base) cannot be updated.'=>'ປະເພດວິດເຈັດທີ່ລະບຸ (id_base) ບໍ່ສາມາດອັບເດດໄດ້.','Widget type (id_base) is required.'=>'ຈຳເປັນຕ້ອງລະບຸປະເພດວິດເຈັດ (id_base).','No widget was found with that id.'=>'ບໍ່ພົບວິດເຈັດທີ່ມີໄອດີນັ້ນ.','Whether to force removal of the widget, or move it to the inactive sidebar.'=>'ກຳນົດວ່າຈະລຶບວິດເຈັດອອກຖາວອນ ຫຼື ຍ້າຍໄປໄວ້ໃນແຖບດ້ານຂ້າງທີ່ບໍ່ໄດ້ໃຊ້ງານ.','The provided instance is malformed.'=>'ອິນສະແຕນຊ໌ທີ່ສົ່ງມາຢູ່ໃນຮູບແບບທີ່ບໍ່ຖືກຕ້ອງ.','Cannot preview a widget that does not extend WP_Widget.'=>'ບໍ່ສາມາດເບິ່ງຕົວຢ່າງວິດເຈັດທີ່ບໍ່ໄດ້ສືບທອດມາຈາກ WP_Widget.','Class name'=>'ຊື່ຄລາສ (Class name)','Whether the widget supports multiple instances'=>'ວິດເຈັດຮອງຮັບຫຼາຍອິນສະແຕນຊ໌ຫຼືບໍ່','Description of the widget.'=>'ຄຳອະທິບາຍຂອງວິດເຈັດ.','Human-readable name identifying the widget type.'=>'ຊື່ອ່ານງ່າຍທີ່ລະບຸປະເພດຂອງວິດເຈັດ.','Unique slug identifying the widget type.'=>'ສະລັກ (slug) ທີ່ບໍ່ຊ້ຳກັນສຳລັບລະບຸປະເພດວິດເຈັດ.','Invalid widget type.'=>'ປະເພດວິດເຈັດບໍ່ຖືກຕ້ອງ.','Serialized widget form data to encode into instance settings.'=>'ຂໍ້ມູນຟອມວິດເຈັດແບບ serialized ເພື່ອເຂົ້າລະຫັດເຂົ້າໃນການຕັ້ງຄ່າອິນສະແຕນຊ໌.','Current instance settings of the widget.'=>'ການຕັ້ງຄ່າອິນສະແຕນຊ໌ປັດຈຸບັນຂອງວິດເຈັດ.','The widget type id.'=>'ໄອດີປະເພດວິດເຈັດ.','Sort collection by user attribute.'=>'ຮຽງລຳດັບຂໍ້ມູນຕາມຄຸນສົມບັດຂອງຜູ້ໃຊ້.','Theme file exists.'=>'ມີໄຟລ໌ເທັມຢູ່ແລ້ວ.','Post ID.'=>'ໄອດີໂພສ.','Status of template.'=>'ສະຖານະຂອງເທັມເພຼດ.','Description of template.'=>'ຄຳອະທິບາຍຂອງເທັມເພຼດ.','Title of template.'=>'ຊື່ຂອງເທັມເພຼດ.','Content of template.'=>'ເນື້ອຫາຂອງເທັມເພຼດ.','Source of template'=>'ແຫຼ່ງທີ່ມາຂອງເທັມເພຼດ','Theme identifier for the template.'=>'ຕົວລະບຸເທັມສຳລັບເທັມເພຼດ.','Unique slug identifying the template.'=>'ສະລັກທີ່ບໍ່ຊ້ຳກັນສຳລັບລະບຸເທັມເພຼດ.','ID of template.'=>'ໄອດີຂອງເທັມເພຼດ.','Limit to the specified post id.'=>'ຈຳກັດສະເພາະໄອດີໂພສທີ່ກຳນົດ.','The template has already been deleted.'=>'ເທັມເພຼດນີ້ຖືກລຶບໄປແລ້ວ.','Templates based on theme files can\'t be removed.'=>'ເທັມເພຼດທີ່ອີງຕາມໄຟລ໌ເທັມບໍ່ສາມາດລຶບອອກໄດ້.','No templates exist with that id.'=>'ບໍ່ມີເທັມເພຼດທີ່ມີໄອດີນັ້ນ.','Sorry, you are not allowed to access the templates on this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງເທັມເພຼດໃນເວັບໄຊນີ້.','The id of a template'=>'ໄອດີຂອງເທັມເພຼດ','Nested widgets.'=>'ວິດເຈັດແບບຊ້ອນກັນ.','Status of sidebar.'=>'ສະຖານະຂອງແຖບດ້ານຂ້າງ.','HTML content to append to the sidebar title when displayed. Default is a closing h2 element.'=>'ເນື້ອຫາ HTML ທີ່ຈະຕໍ່ທ້າຍຊື່ແຖບດ້ານຂ້າງ. ຄ່າເລີ່ມຕົ້ນແມ່ນແທັກປິດ h2.','HTML content to prepend to the sidebar title when displayed. Default is an opening h2 element.'=>'ເນື້ອຫາ HTML ທີ່ຈະຂຶ້ນຕົ້ນຊື່ແຖບດ້ານຂ້າງ. ຄ່າເລີ່ມຕົ້ນແມ່ນແທັກເປີດ h2.','HTML content to append to each widget\'s HTML output when assigned to this sidebar. Default is a closing list item element.'=>'ເນື້ອຫາ HTML ທີ່ຈະຕໍ່ທ້າຍແຕ່ລະວິດເຈັດໃນແຖບດ້ານຂ້າງນີ້.','HTML content to prepend to each widget\'s HTML output when assigned to this sidebar. Default is an opening list item element.'=>'ເນື້ອຫາ HTML ທີ່ຈະຂຶ້ນຕົ້ນແຕ່ລະວິດເຈັດໃນແຖບດ້ານຂ້າງນີ້.','Extra CSS class to assign to the sidebar in the Widgets interface.'=>'ຄລາສ CSS ເພີ່ມເຕີມສຳລັບແຖບດ້ານຂ້າງໃນໜ້າຈັດການວິດເຈັດ.','Description of sidebar.'=>'ຄຳອະທິບາຍຂອງແຖບດ້ານຂ້າງ.','Unique name identifying the sidebar.'=>'ຊື່ທີ່ບໍ່ຊ້ຳກັນສຳລັບລະບຸແຖບດ້ານຂ້າງ.','ID of sidebar.'=>'ໄອດີຂອງແຖບດ້ານຂ້າງ.','Inactive widgets'=>'ວິດເຈັດທີ່ບໍ່ໄດ້ໃຊ້ງານ','Sorry, you are not allowed to manage widgets on this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຈັດການວິດເຈັດໃນເວັບໄຊນີ້.','No sidebar exists with that id.'=>'ບໍ່ມີແຖບດ້ານຂ້າງທີ່ມີໄອດີນັ້ນ.','The id of a registered sidebar'=>'ໄອດີຂອງແຖບດ້ານຂ້າງທີ່ລົງທະບຽນແລ້ວ','The ID for the author of the revision.'=>'ໄອດີຂອງຜູ້ຂຽນສະບັບແກ້ໄຂ.','Unique identifier for the revision.'=>'ຕົວລະບຸສະເພາະສຳລັບສະບັບແກ້ໄຂ.','Whether items must be assigned all or any of the specified terms.'=>'ກຳນົດວ່າລາຍການຕ່າງໆຕ້ອງຖືກກຳນົດໃຫ້ທຸກໝວດໝູ່ ຫຼື ໝວດໝູ່ໃດໜຶ່ງທີ່ລະບຸ.','Sort collection by post attribute.'=>'ຮຽງລຳດັບຂໍ້ມູນຕາມຄຸນສົມບັດຂອງໂພສ.','The order of the post in relation to other posts.'=>'ລຳດັບຂອງໂພສເມື່ອທຽບກັບໂພສອື່ນໆ.','The title for the post.'=>'ຫົວຂໍ້ສຳລັບໂພສ.','Type of post.'=>'ປະເພດຂອງໂພສ.','URL to the post.'=>'URL ຂອງໂພສ.','Unique identifier for the post.'=>'ລະຫັດລະບຸຕົວຕົນສະເພາະສຳລັບໂພສ.','Limit results to those matching a keyword ID.'=>'ຈຳກັດຜົນລັດໃຫ້ກົງກັບ ID ຂອງຄຳຄົ້ນຫາ.','Limit results to those matching a category ID.'=>'ຈຳກັດຜົນລັດໃຫ້ກົງກັບ ID ຂອງໝວດໝູ່.','The preferred width of the viewport when previewing a pattern, in pixels.'=>'ຄວາມກວ້າງຂອງພື້ນທີ່ສະແດງຜົນທີ່ຕ້ອງການເມື່ອເບິ່ງຕົວຢ່າງແພັດເທີນ, ເປັນພິກເຊວ.','A description of the pattern.'=>'ຄຳອະທິບາຍຂອງແພັດເທີນ.','The pattern\'s keywords.'=>'ຄຳຄົ້ນຫາຂອງແພັດເທີນ.','The pattern\'s category slugs.'=>'ສະລັກໝວດໝູ່ຂອງແພັດເທີນ.','The pattern content.'=>'ເນື້ອໃນຂອງແພັດເທີນ.','The pattern title, in human readable format.'=>'ຫົວຂໍ້ແພັດເທີນ, ໃນຮູບແບບທີ່ອ່ານງ່າຍ.','The pattern ID.'=>'ID ຂອງແພັດເທີນ.','Sorry, you are not allowed to browse the local block pattern directory.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເບິ່ງໄດເຣັກທໍຣີຂອງບລັອກແພັດເທີນໃນເຄື່ອງ.','Sort collection by comment attribute.'=>'ຮຽງລຳດັບຂໍ້ມູນຕາມຄຸນລັກສະນະຂອງຄວາມຄິດເຫັນ.','Type of the comment.'=>'ປະເພດຂອງຄວາມຄິດເຫັນ.','URL to the comment.'=>'URL ຂອງຄວາມຄິດເຫັນ.','Unique identifier for the comment.'=>'ລະຫັດລະບຸຕົວຕົນສະເພາະສຳລັບຄວາມຄິດເຫັນ.','The list of scopes where the variation is applicable. When not provided, it assumes all available scopes.'=>'ລາຍຊື່ຂອບເຂດທີ່ຮູບແບບຍ່ອຍນີ້ສາມາດໃຊ້ໄດ້. ຫາກບໍ່ໄດ້ລະບຸ, ຈະຖືວ່າໃຊ້ໄດ້ກັບທຸກຂອບເຂດທີ່ມີ.','The initial values for attributes.'=>'ຄ່າເລີ່ມຕົ້ນສຳລັບຄຸນລັກສະນະ (attributes).','Indicates whether the current variation is the default one.'=>'ລະບຸວ່າຮູບແບບຍ່ອຍປັດຈຸບັນແມ່ນຄ່າເລີ່ມຕົ້ນຫຼືບໍ່.','A detailed variation description.'=>'ຄຳອະທິບາຍລາຍລະອຽດຂອງຮູບແບບຍ່ອຍ.','A human-readable variation title.'=>'ຫົວຂໍ້ຮູບແບບຍ່ອຍທີ່ອ່ານງ່າຍ.','The unique and machine-readable name.'=>'ຊື່ສະເພາະທີ່ລະບົບສາມາດອ່ານໄດ້.','Block variations.'=>'ຮູບແບບຍ່ອຍຂອງບລັອກ.','The ID for the autosave.'=>'ID ສຳລັບການບັນທຶກອັດຕະໂນມັດ.','Unique identifier for the attachment.'=>'ລະຫັດລະບຸຕົວຕົນສະເພາະສຳລັບໄຟລ໌ແນບ.','Cookie check failed'=>'ການກວດສອບຄຸກກີ້ລົ້ມເຫຼວ','navigation link block descriptionA link to a page.'=>'ລິ້ງໄປຫາໜ້າໃດໜຶ່ງ.','navigation link block descriptionA link to a post.'=>'ລິ້ງໄປຫາໂພສໃດໜຶ່ງ.','navigation link block titlePage Link'=>'ລິ້ງຂອງໜ້າ','navigation link block titlePost Link'=>'ລິ້ງຂອງໂພສ','Templates to include in your theme.'=>'ເທັມເພຼດທີ່ຈະລວມເຂົ້າໃນທິມຂອງທ່ານ.','Templates list'=>'ລາຍຊື່ເທັມເພຼດ','Templates list navigation'=>'ການນຳທາງລາຍຊື່ເທັມເພຼດ','Filter templates list'=>'ກັ່ນຕອງລາຍຊື່ເທັມເພຼດ','Uploaded to this template'=>'ອັບໂຫຼດລົງໃນເທັມເພຼດນີ້','Insert into template'=>'ແຊກເຂົ້າໃນເທັມເພຼດ','Template archives'=>'ຄັງເກັບເທັມເພຼດ','No templates found in Trash.'=>'ບໍ່ພົບເທັມເພຼດໃນຖັງຂີ້ເຫຍື້ອ.','No temp