ມູນສ່ວນຕົວນີ້ໝົດອາຍຸແລ້ວ.','Invalid personal data request.'=>'ການຮ້ອງຂໍຂໍ້ມູນສ່ວນຕົວບໍ່ຖືກຕ້ອງ.','Invalid request status.'=>'ສະຖານະການຮ້ອງຂໍບໍ່ຖືກຕ້ອງ.','It looks like the response did not come from this site.'=>'ເບິ່ງຄືວ່າການຕອບສະໜອງບໍ່ໄດ້ມາຈາກເວັບໄຊນີ້.','%1$s is not one of %2$l.'=>'%1$s ບໍ່ແມ່ນໜຶ່ງໃນ %2$l.','%1$s is not %2$s.'=>'%1$s ບໍ່ແມ່ນ %2$s.','The cron event list could not be saved.'=>'ບໍ່ສາມາດບັນທຶກລາຍຊື່ເຫດການ cron ໄດ້.','A plugin prevented the hook from being cleared.'=>'ມີປລັກອິນປ້ອງກັນບໍ່ໃຫ້ລ້າງ hook.','A plugin prevented the event from being unscheduled.'=>'ມີປລັກອິນປ້ອງກັນບໍ່ໃຫ້ຍົກເລີກກຳນົດການເຫດການ.','A plugin prevented the event from being rescheduled.'=>'ມີປລັກອິນປ້ອງກັນບໍ່ໃຫ້ປ່ຽນກຳນົດການເຫດການ.','Event schedule does not exist.'=>'ບໍ່ມີກຳນົດການເຫດການນີ້.','A plugin disallowed this event.'=>'ມີປລັກອິນບໍ່ອະນຸຍາດເຫດການນີ້.','A duplicate event already exists.'=>'ມີເຫດການທີ່ຊ້ຳກັນຢູ່ແລ້ວ.','A plugin prevented the event from being scheduled.'=>'ມີປລັກອິນປ້ອງກັນບໍ່ໃຫ້ຕັ້ງກຳນົດການເຫດການ.','Event timestamp must be a valid Unix timestamp.'=>'ເວລາຂອງເຫດການຕ້ອງເປັນ Unix timestamp ທີ່ຖືກຕ້ອງ.','As a percentage of the image, the height to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ຄວາມສູງທີ່ຈະຄອບຕັດ ເປັນເປີເຊັນຂອງຮູບພາບ. ບໍ່ແນະນຳໃຫ້ໃຊ້: ໃຫ້ໃຊ້ `modifiers` ແທນ.','As a percentage of the image, the width to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ຄວາມກວ້າງທີ່ຈະຄອບຕັດ ເປັນເປີເຊັນຂອງຮູບພາບ. ບໍ່ແນະນຳໃຫ້ໃຊ້: ໃຫ້ໃຊ້ `modifiers` ແທນ.','As a percentage of the image, the y position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'ຕຳແໜ່ງແກນ y ທີ່ຈະເລີ່ມຄອບຕັດ ເປັນເປີເຊັນຂອງຮູບພາບ. ບໍ່ແນະນຳໃຫ້ໃຊ້: ໃຫ້ໃຊ້ `modifiers` ແທນ.','As a percentage of the image, the x position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'ຕຳແໜ່ງແກນ x ທີ່ຈະເລີ່ມຄອບຕັດ ເປັນເປີເຊັນຂອງຮູບພາບ. ບໍ່ແນະນຳໃຫ້ໃຊ້: ໃຫ້ໃຊ້ `modifiers` ແທນ.','The amount to rotate the image clockwise in degrees. DEPRECATED: Use `modifiers` instead.'=>'ຈຳນວນອົງສາທີ່ຈະໝຸນຮູບຕາມເຂັມໂມງ. ບໍ່ແນະນຳໃຫ້ໃຊ້: ໃຫ້ໃຊ້ `modifiers` ແທນ.','Height of the crop as a percentage of the image height.'=>'ຄວາມສູງຂອງການຄອບຕັດເປັນເປີເຊັນຂອງຄວາມສູງຮູບພາບ.','Width of the crop as a percentage of the image width.'=>'ຄວາມກວ້າງຂອງການຄອບຕັດເປັນເປີເຊັນຂອງຄວາມກວ້າງຮູບພາບ.','Vertical position from the top to begin the crop as a percentage of the image height.'=>'ຕຳແໜ່ງແນວຕັ້ງຈາກດ້ານເທິງເພື່ອເລີ່ມຄອບຕັດເປັນເປີເຊັນຂອງຄວາມສູງຮູບພາບ.','Horizontal position from the left to begin the crop as a percentage of the image width.'=>'ຕຳແໜ່ງແນວນອນຈາກດ້ານຊ້າຍເພື່ອເລີ່ມຄອບຕັດເປັນເປີເຊັນຂອງຄວາມກວ້າງຮູບພາບ.','Crop arguments.'=>'ພາຣາມິເຕີການຄອບຕັດ.','Crop type.'=>'ປະເພດການຄອບຕັດ.','Angle to rotate clockwise in degrees.'=>'ອົງສາທີ່ຈະໝຸນຕາມເຂັມໂມງ.','Rotation arguments.'=>'ພາຣາມິເຕີການໝຸນ.','Rotation type.'=>'ປະເພດການໝຸນ.','Rotation'=>'ການໝຸນ','Image edit.'=>'ການແກ້ໄຂຮູບພາບ.','Array of image edits.'=>'ຊຸດຂໍ້ມູນການແກ້ໄຂຮູບພາບ.','Cannot introspect application password.'=>'ບໍ່ສາມາດກວດສອບລະຫັດຜ່ານແອັບພລິເຄຊັນໄດ້.','The authenticated application password can only be introspected for the current user.'=>'ລະຫັດຜ່ານແອັບພລິເຄຊັນທີ່ຜ່ານການຢືນຢັນແລ້ວ ສາມາດກວດສອບໄດ້ສະເພາະສຳລັບຜູ້ໃຊ້ປັດຈຸບັນເທົ່ານັ້ນ.','Sorry, you are not allowed to delete this application password.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ລຶບລະຫັດຜ່ານແອັບພລິເຄຊັນນີ້.','Sorry, you are not allowed to delete application passwords for this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ລຶບລະຫັດຜ່ານແອັບພລິເຄຊັນສຳລັບຜູ້ໃຊ້ນີ້.','Sorry, you are not allowed to edit this application password.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ແກ້ໄຂລະຫັດຜ່ານແອັບພລິເຄຊັນນີ້.','Sorry, you are not allowed to create application passwords for this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ສ້າງລະຫັດຜ່ານແອັບພລິເຄຊັນສຳລັບຜູ້ໃຊ້ນີ້.','Sorry, you are not allowed to read this application password.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອ່ານລະຫັດຜ່ານແອັບພລິເຄຊັນນີ້.','Sorry, you are not allowed to list application passwords for this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງລາຍຊື່ລະຫັດຜ່ານແອັບພລິເຄຊັນສຳລັບຜູ້ໃຊ້ນີ້.','Limit result set to items with specific terms assigned in the %s taxonomy.'=>'ຈຳກັດຜົນລັດໃຫ້ສະເພາະລາຍການທີ່ມີແທັກ ຫຼື ໝວດໝູ່ທີ່ກຳນົດໃນ %s.','Whether to include child terms in the terms limiting the result set.'=>'ກຳນົດວ່າຈະລວມໝວດໝູ່ຍ່ອຍເຂົ້າໃນການຈຳກັດຜົນລັດຫຼືບໍ່.','Term IDs.'=>'ID ຂອງເທີມ (Term IDs).','Perform an advanced term query.'=>'ດຳເນີນການຄົ້ນຫາເທີມແບບລະອຽດ.','Term ID Taxonomy Query'=>'ການຄົ້ນຫາ Taxonomy ດ້ວຍ Term ID','Match terms with the listed IDs.'=>'ໃຫ້ກົງກັບເທີມທີ່ມີ ID ຕາມລາຍການ.','Term ID List'=>'ລາຍຊື່ Term ID','Limit response to posts modified before a given ISO8601 compliant date.'=>'ຈຳກັດການຕອບສະໜອງໃຫ້ສະເພາະໂພສທີ່ແກ້ໄຂກ່ອນວັນທີທີ່ກຳນົດ (ISO8601).','Limit response to posts modified after a given ISO8601 compliant date.'=>'ຈຳກັດການຕອບສະໜອງໃຫ້ສະເພາະໂພສທີ່ແກ້ໄຂຫຼັງວັນທີທີ່ກຳນົດ (ISO8601).','A named status for the theme.'=>'ຊື່ສະຖານະຂອງທິມ.','Theme not found.'=>'ບໍ່ພົບທິມ.','Sorry, you are not allowed to view the active theme.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງທິມທີ່ໃຊ້ງານຢູ່.','[block rendering halted]'=>'[ການສະແດງຜົນບລັອກຢຸດສະງັກ]','Save Password'=>'ບັນທຶກລະຫັດຜ່ານ','Generate Password'=>'ສ້າງລະຫັດຜ່ານ','Enter your new password below or generate one.'=>'ປ້ອນລະຫັດຜ່ານໃໝ່ຂອງທ່ານຢູ່ລຸ່ມນີ້ ຫຼື ສ້າງຂຶ້ນໃໝ່.','This file is only loaded for backward compatibility with SimplePie 1.2.x. Please consider switching to a recent SimplePie version.'=>'ໄຟລ໌ນີ້ຖືກໂຫຼດຂຶ້ນມາເພື່ອຮອງຮັບ SimplePie 1.2.x ເທົ່ານັ້ນ. ກະລຸນາປ່ຽນໄປໃຊ້ SimplePie ເວີຊັນຫຼ້າສຸດ.','&larr; Go to Tags'=>'&larr; ໄປທີ່ແທັກ','&#8592; Go to library'=>'&#8592; ໄປທີ່ຄັງສື່','Appearance'=>'ຮູບລັກສະນະ','email "From" fieldSite Admin'=>'ຜູ້ດູແລລະບົບ','New site created by %1$s

