ທີ່ຢູ່: %2$s
ຊື່: %3$s','[%s] New Site Created'=>'[%s] ສ້າງເວັບໄຊໃໝ່ແລ້ວ','%s failed while writing image to stream.'=>'%s ລົ້ມເຫຼວຂະນະຂຽນຮູບພາບລົງໃນ stream.','The provided password is an invalid application password.'=>'ລະຫັດຜ່ານທີ່ລະບຸບໍ່ແມ່ນລະຫັດຜ່ານແອັບພລິເຄຊັນທີ່ຖືກຕ້ອງ.','Could not delete application passwords.'=>'ບໍ່ສາມາດລຶບລະຫັດຜ່ານແອັບພລິເຄຊັນໄດ້.','Could not delete application password.'=>'ບໍ່ສາມາດລຶບລະຫັດຜ່ານແອັບພລິເຄຊັນໄດ້.','Could not find an application password with that id.'=>'ບໍ່ພົບລະຫັດຜ່ານແອັບພລິເຄຊັນທີ່ມີ ID ນີ້.','Could not save application password.'=>'ບໍ່ສາມາດບັນທຶກລະຫັດຜ່ານແອັບພລິເຄຊັນໄດ້.','An application name is required to create an application password.'=>'ຕ້ອງມີຊື່ແອັບພລິເຄຊັນເພື່ອສ້າງລະຫັດຜ່ານແອັບພລິເຄຊັນ.','Copy URL to clipboard'=>'ຄັດລອກ URL ໄປຍັງຄລິບພອດ','Used as:'=>'ໃຊ້ເປັນ:','%1$s must be a multiple of %2$s.'=>'%1$s ຕ້ອງເປັນຕົວຄູນຂອງ %2$s.','%1$s must contain at most %2$s property.'=>'%1$s ຕ້ອງມີຄຸນສົມບັດບໍ່ເກີນ %2$s ລາຍການ.','%1$s must contain at least %2$s property.'=>'%1$s ຕ້ອງມີຄຸນສົມບັດຢ່າງໜ້ອຍ %2$s ລາຍການ.','%s matches more than one of the expected formats.'=>'%s ກົງກັບຮູບແບບທີ່ຄາດໄວ້ຫຼາຍກວ່າໜຶ່ງຮູບແບບ.','%1$s matches %2$l, but should match only one.'=>'%1$s ກົງກັບ %2$l, ແຕ່ຄວນຈະກົງກັບພຽງອັນດຽວ.','%s does not match any of the expected formats.'=>'%s ບໍ່ກົງກັບຮູບແບບທີ່ຄາດໄວ້ໃດໆເລີຍ.','%1$s is not a valid %2$l.'=>'%1$s ບໍ່ແມ່ນ %2$l ທີ່ຖືກຕ້ອງ.','%1$s does not match the expected format. Reason: %2$s'=>'%1$s ບໍ່ກົງກັບຮູບແບບທີ່ຄາດໄວ້. ເຫດຜົນ: %2$s','%1$s is not a valid %2$s. Reason: %3$s'=>'%1$s ບໍ່ແມ່ນ %2$s ທີ່ຖືກຕ້ອງ. ເຫດຜົນ: %3$s','The IP address the application password was last used by.'=>'ທີ່ຢູ່ IP ທີ່ໃຊ້ລະຫັດຜ່ານແອັບພລິເຄຊັນຄັ້ງຫຼ້າສຸດ.','The GMT date the application password was last used.'=>'ວັນທີ GMT ທີ່ໃຊ້ລະຫັດຜ່ານແອັບພລິເຄຊັນຄັ້ງຫຼ້າສຸດ.','The GMT date the application password was created.'=>'ວັນທີ GMT ທີ່ສ້າງລະຫັດຜ່ານແອັບພລິເຄຊັນ.','The generated password. Only available after adding an application.'=>'ລະຫັດຜ່ານທີ່ສ້າງຂຶ້ນ. ສາມາດໃຊ້ໄດ້ຫຼັງຈາກເພີ່ມແອັບພລິເຄຊັນເທົ່ານັ້ນ.','The name of the application password.'=>'ຊື່ຂອງລະຫັດຜ່ານແອັບພລິເຄຊັນ.','A UUID provided by the application to uniquely identify it. It is recommended to use an UUID v5 with the URL or DNS namespace.'=>'UUID ທີ່ລະບຸໂດຍແອັບພລິເຄຊັນເພື່ອລະບຸຕົວຕົນສະເພາະ. ແນະນຳໃຫ້ໃຊ້ UUID v5 ຮ່ວມກັບ URL ຫຼື DNS namespace.','The unique identifier for the application password.'=>'ລະຫັດລະບຸຕົວຕົນສະເພາະສຳລັບລະຫັດຜ່ານແອັບພລິເຄຊັນ.','Application password not found.'=>'ບໍ່ພົບລະຫັດຜ່ານແອັບພລິເຄຊັນ.','Application passwords are not available for your account. Please contact the site administrator for assistance.'=>'ບັນຊີຂອງທ່ານບໍ່ສາມາດໃຊ້ລະຫັດຜ່ານແອັບພລິເຄຊັນໄດ້. ກະລຸນາຕິດຕໍ່ຜູ້ດູແລເວັບໄຊເພື່ອຂໍຄວາມຊ່ວຍເຫຼືອ.','Application passwords are not available.'=>'ລະຫັດຜ່ານແອັບພລິເຄຊັນບໍ່ພ້ອມໃຊ້ງານ.','Sorry, you are not allowed to manage application passwords for this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຈັດການລະຫັດຜ່ານແອັບພລິເຄຊັນສຳລັບຜູ້ໃຊ້ນີ້.','HTML containing an action to direct the user to where they can resolve the issue.'=>'HTML ທີ່ປະກອບດ້ວຍຄຳສັ່ງເພື່ອແນະນຳຜູ້ໃຊ້ໄປຫາບ່ອນທີ່ເຂົາເຈົ້າສາມາດແກ້ໄຂບັນຫາໄດ້.','A more descriptive explanation of what the test looks for, and why it is important for the user.'=>'ຄຳອະທິບາຍລະອຽດກ່ຽວກັບສິ່ງທີ່ການທົດສອບກວດສອບ ແລະ ເປັນຫຍັງມັນຈຶ່ງສຳຄັນຕໍ່ຜູ້ໃຊ້.','The category this test is grouped in.'=>'ໝວດໝູ່ທີ່ການທົດສອບນີ້ຖືກຈັດໄວ້.','The status of the test.'=>'ສະຖານະຂອງການທົດສອບ.','A label describing the test.'=>'ປ້າຍກຳກັບທີ່ອະທິບາຍການທົດສອບ.','The name of the test being run.'=>'ຊື່ຂອງການທົດສອບທີ່ກຳລັງເຮັດວຽກ.','Directory sizes could not be returned.'=>'ບໍ່ສາມາດສະແດງຂະໜາດຂອງໄດເຣັກທໍຣີໄດ້.','Version of block API.'=>'ເວີຊັນຂອງ Block API.','Invalid parameters.'=>'ພາຣາມິເຕີບໍ່ຖືກຕ້ອງ.','The requested route does not support batch requests.'=>'ເສັ້ນທາງ (route) ທີ່ຮ້ອງຂໍບໍ່ຮອງຮັບການຮ້ອງຂໍແບບເປັນຊຸດ (batch requests).','Could not parse the path.'=>'ບໍ່ສາມາດວິເຄາະ (parse) ເສັ້ນທາງໄດ້.','The handler for the route is invalid.'=>'ຕົວຈັດການ (handler) ສຳລັບເສັ້ນທາງບໍ່ຖືກຕ້ອງ.','You need to pass an array of post formats.'=>'ທ່ານຕ້ອງສົ່ງອາເຣ (array) ຂອງຮູບແບບໂພສ.','This password reset request originated from the IP address %s.'=>'ການຮ້ອງຂໍຕັ້ງລະຫັດຜ່ານໃໝ່ນີ້ມາຈາກທີ່ຢູ່ IP %s.','Sorry, you are not allowed to comment on this post.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ສະແດງຄວາມຄິດເຫັນໃນໂພສນີ້.','The %s constant is no longer supported.'=>'ຄ່າຄົງທີ່ %s ບໍ່ໄດ້ຮັບການຮອງຮັບອີກຕໍ່ໄປ.','There is a new version of %s available, but it does not work with your version of PHP.'=>'ມີ %s ເວີຊັນໃໝ່ໃຫ້ໃຊ້ງານ, ແຕ່ມັນບໍ່ຮອງຮັບເວີຊັນ PHP ຂອງທ່ານ.','There is a new version of %s available, but it does not work with your version of WordPress.'=>'ມີ %s ເວີຊັນໃໝ່ໃຫ້ໃຊ້ງານ, ແຕ່ມັນບໍ່ຮອງຮັບເວີຊັນ WordPress ຂອງທ່ານ.','There is a new version of %s available, but it does not work with your versions of WordPress and PHP.'=>'ມີ %s ເວີຊັນໃໝ່ໃຫ້ໃຊ້ງານ, ແຕ່ມັນບໍ່ຮອງຮັບເວີຊັນ WordPress ແລະ PHP ຂອງທ່ານ.','This theme does not work with your version of PHP.'=>'ທິມນີ້ບໍ່ຮອງຮັບເວີຊັນ PHP ຂອງທ່ານ.','This theme does not work with your version of WordPress.'=>'ທິມນີ້ບໍ່ຮອງຮັບເວີຊັນ WordPress ຂອງທ່ານ.','<a href="%s">Learn more about updating PHP</a>.'=>'<a href="%s">ສຶກສາເພີ່ມເຕີມກ່ຽວກັບການອັບເດດ PHP</a>.','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">ກະລຸນາອັບເດດ WordPress</a>.','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">ກະລຸນາອັບເດດ WordPress</a>, ແລ້ວ <a href="%2$s">ສຶກສາເພີ່ມເຕີມກ່ຽວກັບການອັບເດດ PHP</a>.','This theme does not work with your versions of WordPress and PHP.'=>'ທິມນີ້ບໍ່ຮອງຮັບເວີຊັນ WordPress ແລະ PHP ຂອງທ່ານ.','Please use %s to add new schema properties.'=>'ກະລຸນາໃຊ້ %s ເພື່ອເພີ່ມຄຸນສົມບັດ Schema ໃໝ່.','The "%s" must be a callable function.'=>'"%s" ຕ້ອງເປັນຟັງຊັນທີ່ສາມາດເອີ້ນໃຊ້ໄດ້ (callable).','Unauthorized. You may remove the %s param to preview as frontend.'=>'ບໍ່ໄດ້ຮັບອະນຸຍາດ. ທ່ານອາດຈະລຶບພາຣາມິເຕີ %s ອອກເພື່ອເບິ່ງຕົວຢ່າງໃນສ່ວນໜ້າເວັບ (frontend).','The "%1$s" option key has been renamed to "%2$s".'=>'ຄີຕົວເລືອກ "%1$s" ຖືກປ່ຽນຊື່ເປັນ "%2$s" ແລ້ວ.','Sorry, you are not allowed to manage network plugins.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຈັດການປລັກອິນເຄືອຂ່າຍ (network plugins).','The REST API route definition for %1$s is missing the required %2$s argument. For REST API routes that are intended to be public, use %3$s as the permission callback.'=>'ການກຳນົດເສັ້ນທາງ REST API ສຳລັບ %1$s ຂາດອາກິວເມນ %2$s ທີ່ຈຳເປັນ. ສຳລັບເສັ້ນທາງທີ່ເປັນສາທາລະນະ, ໃຫ້ໃຊ້ %3$s ເປັນຕົວຢືນຢັນສິດ (permission callback).','Could not update attachment in the database.'=>'ບໍ່ສາມາດອັບເດດໄຟລ໌ແນບໃນຖານຂໍ້ມູນໄດ້.','Sorry, you are not allowed to activate this plugin.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເປີດໃຊ້ປລັກອິນນີ້.','by %s'=>'ໂດຍ %s','An error occurred.'=>'ເກີດຂໍ້ຜິດພາດ.','Menu Item'=>'ລາຍການເມນູ','Comment'=>'ຄວາມຄິດເຫັນ','Site'=>'ເວັບໄຊ','Crop'=>'ຄອບຕັດ','Notifications'=>'ການແຈ້ງເຕືອນ','The file URL has been copied to your clipboard'=>'ຄັດລອກ URL ຂອງໄຟລ໌ໄປຍັງຄລິບພອດແລ້ວ','Embed Handler'=>'ຕົວຈັດການການຝັງ','Read the <a href="%s" target="_blank">Debugging a WordPress Network</a> article. Some of the suggestions there may help you figure out what went wrong.'=>'ອ່ານບົດຄວາມ <a href="%s" target="_blank">ການກວດສອບຂໍ້ຜິດພາດຂອງເຄືອຂ່າຍ WordPress</a>. ຄຳແນະນຳບາງຢ່າງອາດຊ່ວຍໃຫ້ທ່ານຮູ້ວ່າເກີດຫຍັງຂຶ້ນ.','Block pattern category "%s" not found.'=>'ບໍ່ພົບໝວດໝູ່ບລັອກແພັດເທີນ "%s".','Block pattern category name must be a string.'=>'ຊື່ໝວດໝູ່ບລັອກແພັດເທີນຕ້ອງເປັນຂໍ້ຄວາມ (string).','Block pattern categoryText'=>'ຂໍ້ຄວາມ','Block pattern categoryHeaders'=>'ສ່ວນຫົວ','Block pattern categoryGallery'=>'ຄັງຮູບພາບ','Block pattern categoryColumns'=>'ຖັນ','Block pattern categoryButtons'=>'ປຸ່ມ','Return a %1$s or %2$s object from your callback when using the REST API.'=>'ສົ່ງຄືນອອບເຈັກ %1$s ຫຼື %2$s ຈາກ callback ຂອງທ່ານເມື່ອໃຊ້ REST API.','unit symbolB'=>'B','unit symbolKB'=>'KB','unit symbolMB'=>'MB','unit symbolGB'=>'GB','unit symbolTB'=>'TB','admin color schemeModern'=>'ທັນສະໄໝ','archive title%1$s %2$s'=>'%1$s %2$s','taxonomy term archive title prefix%s:'=>'%s:','post type archive title prefixArchives:'=>'ຄັງເກັບ:','date archive title prefixDay:'=>'ວັນທີ:','date archive title prefixMonth:'=>'ເດືອນ:','date archive title prefixYear:'=>'ປີ:','author archive title prefixAuthor:'=>'ຜູ້ຂຽນ:','tag archive title prefixTag:'=>'ແທັກ:','category archive title prefixCategory:'=>'ໝວດໝູ່:','<strong>Error:</strong> There was a problem creating site entry.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ເກີດບັນຫາໃນການສ້າງລາຍການເວັບໄຊ.','<strong>Error:</strong> Site URL you&#8217;ve entered is already taken.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> URL ເວັບໄຊທີ່ທ່ານປ້ອນມີຜູ້ໃຊ້ອື່ນໃຊ້ແລ້ວ.','Pattern "%s" not found.'=>'ບໍ່ພົບແພັດເທີນ "%s".','Pattern content must be a string.'=>'ເນື້ອຫາແພັດເທີນຕ້ອງເປັນຂໍ້ຄວາມ (string).','Pattern title must be a string.'=>'ຫົວຂໍ້ແພັດເທີນຕ້ອງເປັນຂໍ້ຄວາມ (string).','Pattern name must be a string.'=>'ຊື່ແພັດເທີນຕ້ອງເປັນຂໍ້ຄວາມ (string).','Attachment details'=>'ລາຍລະອຽດໄຟລ໌ແນບ','Add media'=>'ເພີ່ມສື່','Could not insert attachment into the database.'=>'ບໍ່ສາມາດແຊກໄຟລ໌ແນບລົງໃນຖານຂໍ້ມູນໄດ້.','Could not update comment in the database.'=>'ບໍ່ສາມາດອັບເດດຄວາມຄິດເຫັນໃນຖານຂໍ້ມູນໄດ້.','File URL:'=>'URL ຂອງໄຟລ໌:','%s is not a valid UUID.'=>'%s ບໍ່ແມ່ນ UUID ທີ່ຖືກຕ້ອງ.','Invalid hex color.'=>'ສີ Hex ບໍ່ຖືກຕ້ອງ.','%1$s does not match pattern %2$s.'=>'%1$s ບໍ່ກົງກັບແພັດເທີນ %2$s.','%1$s must be at most %2$s character long.'=>'%1$s ຕ້ອງມີຄວາມຍາວບໍ່ເກີນ %2$s ຕົວອັກສອນ.','%1$s must be at least %2$s character long.'=>'%1$s ຕ້ອງມີຄວາມຍາວຢ່າງໜ້ອຍ %2$s ຕົວອັກສອນ.','%1$s is a required property of %2$s.'=>'%1$s ເປັນຄຸນສົມບັດທີ່ຈຳເປັນຂອງ %2$s.','%s has duplicate items.'=>'%s ມີລາຍການທີ່ຊ້ຳກັນ.','%1$s must contain at most %2$s item.'=>'%1$s ຕ້ອງມີລາຍການບໍ່ເກີນ %2$s ລາຍການ.','%1$s must contain at least %2$s item.'=>'%1$s ຕ້ອງມີລາຍການຢ່າງໜ້ອຍ %2$s ລາຍການ.','The "type" schema keyword for %1$s can only be one of the built-in types: %2$l.'=>'ຄຳຫຼັກ "type" ໃນ Schema ສຳລັບ %1$s ສາມາດເປັນໄດ້ພຽງໜຶ່ງໃນປະເພດພື້ນຖານ: %2$l.','The "type" schema keyword for %s is required.'=>'ຄຳຫຼັກ "type" ໃນ Schema ສຳລັບ %s ແມ່ນຈຳເປັນ.','Cannot stabilize objects. Convert the object to an array first.'=>'ບໍ່ສາມາດເຮັດໃຫ້ອອບເຈັກຄົງທີ່. ກະລຸນາປ່ຽນອອບເຈັກເປັນອາເຣ (array) ກ່ອນ.','The "type" schema keyword for %1$s can only contain the built-in types: %2$l.'=>'ຄຳຫຼັກ "type" ໃນ Schema ສຳລັບ %1$s ສາມາດປະກອບດ້ວຍປະເພດພື້ນຖານ: %2$l.','%1$s (%2$s)'=>'%1$s (%2$s)','This notice was triggered by the %s handle.'=>'ການແຈ້ງເຕືອນນີ້ຖືກກະຕຸ້ນໂດຍ handle %s.','Please consider writing more inclusive code.'=>'ກະລຸນາພິຈາລະນາຂຽນໂຄ້ດທີ່ຄຳນຶງເຖິງຄວາມຫຼາກຫຼາຍ (inclusive).','URL to the edited image file.'=>'URL ຂອງໄຟລ໌ຮູບພາບທີ່ຖືກແກ້ໄຂ.','Unable to crop this image.'=>'ບໍ່ສາມາດຄອບຕັດຮູບພາບນີ້ໄດ້.','Unable to rotate this image.'=>'ບໍ່ສາມາດໝຸນຮູບພາບນີ້ໄດ້.','Unable to edit this image.'=>'ບໍ່ສາມາດແກ້ໄຂຮູບພາບນີ້ໄດ້.','The image was not edited. Edit the image before applying the changes.'=>'ຮູບພາບບໍ່ໄດ້ຖືກແກ້ໄຂ. ກະລຸນາແກ້ໄຂຮູບພາບກ່ອນນຳໃຊ້ການປ່ຽນແປງ.','This type of file cannot be edited.'=>'ໄຟລ໌ປະເພດນີ້ບໍ່ສາມາດແກ້ໄຂໄດ້.','Unable to get meta information for file.'=>'ບໍ່ສາມາດດຶງຂໍ້ມູນ Meta ຂອງໄຟລ໌ໄດ້.','Limit result set to blocks matching the search term.'=>'ຈຳກັດຜົນລັດໃຫ້ສະເພາະບລັອກທີ່ກົງກັບຄຳຄົ້ນຫາ.','The date when the block was last updated, in human readable format.'=>'ວັນທີທີ່ບລັອກຖືກອັບເດດຄັ້ງຫຼ້າສຸດ, ໃນຮູບແບບທີ່ອ່ານງ່າຍ.','The block icon.'=>'ໄອຄອນຂອງບລັອກ.','The WordPress.org username of the block author.'=>'ຊື່ຜູ້ໃຊ້ WordPress.org ຂອງຜູ້ສ້າງບລັອກ.','The number of blocks published by the same author.'=>'ຈຳນວນບລັອກທີ່ຖືກເຜີຍແຜ່ໂດຍຜູ້ຂຽນຄົນດຽວກັນ.','The average rating of blocks published by the same author.'=>'ຄະແນນສະເລ່ຍຂອງບລັອກທີ່ຖືກເຜີຍແຜ່ໂດຍຜູ້ຂຽນຄົນດຽວກັນ.','The number sites that have activated this block.'=>'ຈຳນວນເວັບໄຊທີ່ເປີດໃຊ້ບລັອກນີ້.','The number of ratings.'=>'ຈຳນວນຄະແນນ.','The star rating of the block.'=>'ຄະແນນດາວຂອງບລັອກ.','The block slug.'=>'ສະລັກຂອງບລັອກ.','A short description of the block, in human readable format.'=>'ຄຳອະທິບາຍສັ້ນໆຂອງບລັອກ, ໃນຮູບແບບທີ່ອ່ານງ່າຍ.','The block title, in human readable format.'=>'ຫົວຂໍ້ບລັອກ, ໃນຮູບແບບທີ່ອ່ານງ່າຍ.','The block name, in namespace/block-name format.'=>'ຊື່ບລັອກ, ໃນຮູບແບບ namespace/block-name.','Sorry, you are not allowed to browse the block directory.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເບິ່ງໄດເຣັກທໍຣີບລັອກ.','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'ຊື່ຜູ້ໃຊ້ນີ້ບໍ່ຖືກຕ້ອງເນື່ອງຈາກມີຕົວອັກສອນທີ່ບໍ່ໄດ້ຮັບອະນຸຍາດ. ກະລຸນາປ້ອນຊື່ຜູ້ໃຊ້ທີ່ຖືກຕ້ອງ.','Limits results to plugins with the given status.'=>'ຈຳກັດຜົນລັດສະເພາະປລັກອິນທີ່ມີສະຖານະທີ່ລະບຸ.','The plugin\'s text domain.'=>'Text Domain ຂອງປລັກອິນ.','Minimum required version of PHP.'=>'ເວີຊັນ PHP ຂັ້ນຕ່ຳທີ່ຕ້ອງການ.','Minimum required version of WordPress.'=>'ເວີຊັນ WordPress ຂັ້ນຕ່ຳທີ່ຕ້ອງການ.','Whether the plugin can only be activated network-wide.'=>'ກຳນົດວ່າປລັກອິນສາມາດເປີດໃຊ້ໄດ້ທົ່ວເຄືອຂ່າຍ (network-wide) ເທົ່ານັ້ນຫຼືບໍ່.','The plugin version number.'=>'ເວີຊັນຂອງປລັກອິນ.','The plugin description formatted for display.'=>'ຄຳອະທິບາຍປລັກອິນທີ່ຈັດຮູບແບບສຳລັບສະແດງຜົນ.','The raw plugin description.'=>'ຄຳອະທິບາຍປລັກອິນແບບດິບ (raw).','The plugin description.'=>'ຄຳອະທິບາຍປລັກອິນ.','Plugin author\'s website address.'=>'ທີ່ຢູ່ເວັບໄຊຂອງຜູ້ຂຽນປລັກອິນ.','The plugin author.'=>'ຜູ້ຂຽນປລັກອິນ.','The plugin\'s website address.'=>'ທີ່ຢູ່ເວັບໄຊຂອງປລັກອິນ.','The plugin name.'=>'ຊື່ປລັກອິນ.','The plugin file.'=>'ໄຟລ໌ປລັກອິນ.','The filesystem is currently unavailable for managing plugins.'=>'ລະບົບໄຟລ໌ບໍ່ພ້ອມໃຊ້ງານສຳລັບການຈັດການປລັກອິນໃນຂະນະນີ້.','Network only plugin must be network activated.'=>'ປລັກອິນສະເພາະເຄືອຂ່າຍຕ້ອງຖືກເປີດໃຊ້ຜ່ານເຄືອຂ່າຍ (network activated).','Sorry, you are not allowed to deactivate this plugin.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ປິດການໃຊ້ງານປລັກອິນນີ້.','Cannot delete an active plugin. Please deactivate it first.'=>'ບໍ່ສາມາດລຶບປລັກອິນທີ່ກຳລັງໃຊ້ງານຢູ່ໄດ້. ກະລຸນາປິດການໃຊ້ງານກ່ອນ.','Sorry, you are not allowed to delete plugins for this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ລຶບປລັກອິນສຳລັບເວັບໄຊນີ້.','Unable to determine what plugin was installed.'=>'ບໍ່ສາມາດລະບຸໄດ້ວ່າປລັກອິນໃດຖືກຕິດຕັ້ງ.','Unable to connect to the filesystem. Please confirm your credentials.'=>'ບໍ່ສາມາດເຊື່ອມຕໍ່ກັບລະບົບໄຟລ໌ໄດ້. ກະລຸນາຢືນຢັນຂໍ້ມູນການເຂົ້າສູ່ລະບົບຂອງທ່ານ.','Sorry, you are not allowed to activate plugins.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເປີດໃຊ້ງານປລັກອິນ.','Sorry, you are not allowed to install plugins on this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຕິດຕັ້ງປລັກອິນໃນເວັບໄຊນີ້.','Plugin not found.'=>'ບໍ່ພົບປລັກອິນ.','Sorry, you are not allowed to manage plugins for this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຈັດການປລັກອິນສຳລັບເວັບໄຊນີ້.','The plugin activation status.'=>'ສະຖານະການເປີດໃຊ້ປລັກອິນ.','WordPress.org plugin directory slug.'=>'ສະລັກຂອງປລັກອິນໃນໄດເຣັກທໍຣີ WordPress.org.','The theme\'s current version.'=>'ເວີຊັນປັດຈຸບັນຂອງທິມ.','The URI of the theme\'s webpage, transformed for display.'=>'URI ຂອງເວັບໄຊທິມ, ຈັດຮູບແບບສຳລັບສະແດງຜົນ.','The URI of the theme\'s webpage, as found in the theme header.'=>'URI ຂອງເວັບໄຊທິມ, ຕາມທີ່ພົບໃນສ່ວນຫົວຂອງທິມ.','The URI of the theme\'s webpage.'=>'URI ຂອງເວັບໄຊທິມ.','The theme\'s text domain.'=>'Text Domain ຂອງທິມ.','The theme tags, transformed for display.'=>'ແທັກຂອງທິມ, ຈັດຮູບແບບສຳລັບສະແດງຜົນ.','The theme tags, as found in the theme header.'=>'ແທັກຂອງທິມ, ຕາມທີ່ພົບໃນສ່ວນຫົວຂອງທິມ.','Tags indicating styles and features of the theme.'=>'ແທັກທີ່ລະບຸຮູບແບບ ແລະ ຄຸນສົມບັດຂອງທິມ.','The theme\'s screenshot URL.'=>'URL ຂອງຮູບຕົວຢ່າງທິມ.','The minimum WordPress version required for the theme to work.'=>'ເວີຊັນ WordPress ຂັ້ນຕ່ຳທີ່ທິມນີ້ຕ້ອງການ.','The minimum PHP version required for the theme to work.'=>'ເວີຊັນ PHP ຂັ້ນຕ່ຳທີ່ທິມນີ້ຕ້ອງການ.','The theme name, transformed for display.'=>'ຊື່ທິມ, ຈັດຮູບແບບສຳລັບສະແດງຜົນ.','The theme name, as found in the theme header.'=>'ຊື່ທິມ, ຕາມທີ່ພົບໃນສ່ວນຫົວຂອງທິມ.','The name of the theme.'=>'ຊື່ຂອງທິມ.','The theme description, transformed for display.'=>'ຄຳອະທິບາຍທິມ, ຈັດຮູບແບບສຳລັບສະແດງຜົນ.','The theme description, as found in the theme header.'=>'ຄຳອະທິບາຍທິມ, ຕາມທີ່ພົບໃນສ່ວນຫົວຂອງທິມ.','A description of the theme.'=>'ຄຳອະທິບາຍຂອງທິມ.','The website of the theme author, transformed for display.'=>'ເວັບໄຊຂອງຜູ້ຂຽນທິມ, ຈັດຮູບແບບສຳລັບສະແດງຜົນ.','The website of the theme author, as found in the theme header.'=>'ເວັບໄຊຂອງຜູ້ຂຽນທິມ, ຕາມທີ່ພົບໃນສ່ວນຫົວຂອງທິມ.','The website of the theme author.'=>'ເວັບໄຊຂອງຜູ້ຂຽນທິມ.','HTML for the theme author, transformed for display.'=>'HTML ສຳລັບຜູ້ຂຽນທິມ, ຈັດຮູບແບບສຳລັບສະແດງຜົນ.','The theme author\'s name, as found in the theme header.'=>'ຊື່ຜູ້ຂຽນທິມ, ຕາມທີ່ພົບໃນສ່ວນຫົວຂອງທິມ.','The theme author.'=>'ຜູ້ຂຽນທິມ.','The theme\'s template. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet.'=>'ເທັມເພຼດຂອງທິມ. ຫາກເປັນທິມລູກ (child theme), ສ່ວນນີ້ຈະອ້າງອີງເຖິງທິມຫຼັກ, ບໍ່ດັ່ງນັ້ນຈະເປັນອັນດຽວກັບ stylesheet ຂອງທິມ.','The theme\'s stylesheet. This uniquely identifies the theme.'=>'Stylesheet ຂອງທິມ. ສ່ວນນີ້ໃຊ້ລະບຸຕົວຕົນຂອງທິມ.','Block namespace.'=>'Namespace ຂອງບລັອກ.','A list of the inner block\'s own inner blocks. This is a recursive definition following the parent innerBlocks schema.'=>'ລາຍຊື່ບລັອກຍ່ອຍຂອງບລັອກຍ່ອຍອີກຊັ້ນໜຶ່ງ. ນີ້ແມ່ນການກຳນົດແບບວົນຊ້ຳຕາມ innerBlocks Schema ຂອງບລັອກຫຼັກ.','The attributes of the inner block.'=>'ຄຸນລັກສະນະ (attributes) ຂອງບລັອກຍ່ອຍ.','The name of the inner block.'=>'ຊື່ຂອງບລັອກຍ່ອຍ.','The list of inner blocks used in the example.'=>'ລາຍຊື່ບລັອກຍ່ອຍທີ່ໃຊ້ໃນຕົວຢ່າງ.','The attributes used in the example.'=>'ຄຸນລັກສະນະທີ່ໃຊ້ໃນຕົວຢ່າງ.','Block example.'=>'ຕົວຢ່າງບລັອກ.','Block keywords.'=>'ຄຳຄົ້ນຫາຂອງບລັອກ.','Parent blocks.'=>'ບລັອກຫຼັກ (Parent blocks).','Public text domain.'=>'Text Domain ສາທາລະນະ.','Contains the handle that defines the block style.'=>'ປະກອບດ້ວຍ handle ທີ່ກຳນົດຮູບແບບຂອງບລັອກ.','Inline CSS code that registers the CSS class required for the style.'=>'ໂຄ້ດ Inline CSS ທີ່ລົງທະບຽນ CSS class ທີ່ຈຳເປັນສຳລັບຮູບແບບນີ້.','The human-readable label for the style.'=>'ປ້າຍກຳກັບຮູບແບບທີ່ອ່ານງ່າຍ.','Unique name identifying the style.'=>'ຊື່ສະເພາະທີ່ໃຊ້ລະບຸຮູບແບບ.','Block style variations.'=>'ຮູບແບບຍ່ອຍຂອງບລັອກ.','Public facing style handles.'=>'Handle ຂອງຮູບແບບສຳລັບໜ້າເວັບ (frontend).','Editor style handles.'=>'Handle ຂອງຮູບແບບສຳລັບເຄື່ອງມືແກ້ໄຂ (editor).','Public facing script handles.'=>'Handle ຂອງສະຄຣິບສຳລັບໜ້າເວັບ (frontend).','Editor script handles.'=>'Handle ຂອງສະຄຣິບສຳລັບເຄື່ອງມືແກ້ໄຂ (editor).','Is the block dynamically rendered.'=>'ບລັອກນີ້ຖືກສະແດງຜົນແບບໄດນາມິກ (dynamic) ຫຼືບໍ່.','Block category.'=>'ໝວດໝູ່ຂອງບລັອກ.','Block supports.'=>'ການຮອງຮັບຂອງບລັອກ.','Context values inherited by blocks of this type.'=>'ຄ່າ Context ທີ່ສືບທອດໂດຍບລັອກປະເພດນີ້.','Context provided by blocks of this type.'=>'Context ທີ່ຖືກລະບຸໂດຍບລັອກປະເພດນີ້.','Block attributes.'=>'ຄຸນລັກສະນະຂອງບລັອກ.','Icon of block type.'=>'ໄອຄອນຂອງປະເພດບລັອກ.','Description of block type.'=>'ຄຳອະທິບາຍຂອງປະເພດບລັອກ.','Unique name identifying the block type.'=>'ຊື່ສະເພາະທີ່ໃຊ້ລະບຸປະເພດບລັອກ.','Title of block type.'=>'ຫົວຂໍ້ຂອງປະເພດບລັອກ.','Invalid block type.'=>'ປະເພດບລັອກບໍ່ຖືກຕ້ອງ.','Sorry, you are not allowed to manage block types.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຈັດການປະເພດບລັອກ.','Block name.'=>'ຊື່ບລັອກ.','When registering a default meta value the data must match the type provided.'=>'ເມື່ອລົງທະບຽນຄ່າ Meta ເລີ່ມຕົ້ນ, ຂໍ້ມູນຕ້ອງກົງກັບປະເພດທີ່ລະບຸ.','RSS Feed'=>'RSS ຟີດ','The post types that support thumbnails or true if all post types are supported.'=>'ປະເພດໂພສທີ່ຮອງຮັບຮູບຕົວຢ່າງ ຫຼື ເປັນ true ຫາກຮອງຮັບທຸກປະເພດໂພສ.','When registering an "object" feature, the feature\'s schema must include the "properties" keyword.'=>'ເມື່ອລົງທະບຽນຄຸນສົມບັດແບບ "object", Schema ຂອງຄຸນສົມບັດນັ້ນຕ້ອງປະກອບດ້ວຍຄຳຫຼັກ "properties".','When registering an "array" feature, the feature\'s schema must include the "items" keyword.'=>'ເມື່ອລົງທະບຽນຄຸນສົມບັດແບບ "array", Schema ຂອງຄຸນສົມບັດນັ້ນຕ້ອງປະກອບດ້ວຍຄຳຫຼັກ "items".','When registering an "array" or "object" feature to show in the REST API, the feature\'s schema must also be defined.'=>'ເມື່ອລົງທະບຽນຄຸນສົມບັດແບບ "array" ຫຼື "object" ເພື່ອສະແດງໃນ REST API, ຕ້ອງມີການກຳນົດ Schema ຂອງຄຸນສົມບັດນັ້ນນຳ.','When registering a "variadic" theme feature, the "type" must be an "array".'=>'ເມື່ອລົງທະບຽນຄຸນສົມບັດທິມແບບ "variadic", "type" ຕ້ອງເປັນ "array".','The feature "type" is not valid JSON Schema type.'=>'ຄຸນສົມບັດ "type" ບໍ່ແມ່ນປະເພດ JSON Schema ທີ່ຖືກຕ້ອງ.','theme<strong>Error:</strong> Current WordPress version does not meet minimum requirements for %s.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ເວີຊັນ WordPress ປັດຈຸບັນບໍ່ຮອງຮັບຄວາມຕ້ອງການຂັ້ນຕ່ຳສຳລັບ %s.','theme<strong>Error:</strong> Current PHP version does not meet minimum requirements for %s.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ເວີຊັນ PHP ປັດຈຸບັນບໍ່ຮອງຮັບຄວາມຕ້ອງການຂັ້ນຕ່ຳສຳລັບ %s.','theme<strong>Error:</strong> Current WordPress and PHP versions do not meet minimum requirements for %s.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ເວີຊັນ WordPress ແລະ PHP ປັດຈຸບັນບໍ່ຮອງຮັບຄວາມຕ້ອງການຂັ້ນຕ່ຳສຳລັບ %s.','This image cannot be displayed in a web browser. For best results convert it to JPEG before uploading.'=>'ຮູບພາບນີ້ບໍ່ສາມາດສະແດງໃນເວັບບຣາວເຊີໄດ້. ເພື່ອຜົນລັດທີ່ດີທີ່ສຸດ, ກະລຸນາປ່ຽນເປັນ JPEG ກ່ອນອັບໂຫຼດ.','Edit Profile'=>'ແກ້ໄຂໂປຣໄຟລ໌','Priority'=>'ຄວາມສຳຄັນ (Priority)','Change Frequency'=>'ຄວາມຖີ່ໃນການປ່ຽນແປງ','Last Modified'=>'ແກ້ໄຂຫຼ້າສຸດ','Number of URLs in this XML Sitemap: %s.'=>'ຈຳນວນ URL ໃນແຜນຜັງເວັບໄຊ XML ນີ້: %s.','Learn more about XML sitemaps.'=>'ສຶກສາເພີ່ມເຕີມກ່ຽວກັບແຜນຜັງເວັບໄຊ XML.','https://www.sitemaps.org/'=>'https://www.sitemaps.org/','This XML Sitemap is generated by WordPress to make your content more visible for search engines.'=>'ແຜນຜັງເວັບໄຊ XML ນີ້ຖືກສ້າງໂດຍ WordPress ເພື່ອຊ່ວຍໃຫ້ເນື້ອຫາຂອງທ່ານຖືກຄົ້ນຫາໄດ້ງ່າຍຂຶ້ນໂດຍ Search Engine.','XML Sitemap'=>'ແຜນຜັງເວັບໄຊ XML','Could not generate XML sitemap due to missing %s extension'=>'ບໍ່ສາມາດສ້າງແຜນຜັງເວັບໄຊ XML ໄດ້ເນື່ອງຈາກຂາດສ່ວນຂະຫຍາຍ %s','Fields other than %s are not currently supported for sitemaps.'=>'ຟິລອື່ນໆນອກຈາກ %s ຍັງບໍ່ໄດ້ຮັບການຮອງຮັບສຳລັບແຜນຜັງເວັບໄຊ.','Fields other than %s are not currently supported for the sitemap index.'=>'ຟິລອື່ນໆນອກຈາກ %s ຍັງບໍ່ໄດ້ຮັບການຮອງຮັບສຳລັບດັດຊະນີແຜນຜັງເວັບໄຊ.','Check your email'=>'ກວດສອບອີເມວຂອງທ່ານ','Registration complete. Please check your email, then visit the <a href="%s">login page</a>.'=>'ລົງທະບຽນສຳເລັດແລ້ວ. ກະລຸນາກວດສອບອີເມວຂອງທ່ານ, ແລ້ວໄປທີ່ <a href="%s">ໜ້າເຂົ້າສູ່ລະບົບ</a>.','Check your email for the confirmation link, then visit the <a href="%s">login page</a>.'=>'ກະລຸນາກວດສອບອີເມວເພື່ອຄລິກລິ້ງຢືນຢັນ, ແລ້ວໄປທີ່ <a href="%s">ໜ້າເຂົ້າສູ່ລະບົບ</a>.','Password protected'=>'ຖືກປ້ອງກັນດ້ວຍລະຫັດຜ່ານ','Sorry, the category could not be created.'=>'ຂໍອະໄພ, ບໍ່ສາມາດສ້າງໝວດໝູ່ໄດ້.','Sorry, the post could not be deleted.'=>'ຂໍອະໄພ, ບໍ່ສາມາດລຶບໂພສໄດ້.','Sorry, the post could not be updated.'=>'ຂໍອະໄພ, ບໍ່ສາມາດອັບເດດໂພສໄດ້.','block keywordlinks'=>'ລິ້ງ','Select poster image'=>'ເລືອກຮູບພາບຕົວຢ່າງວິດີໂອ (Poster image)','Matt Mullenweg'=>'Matt Mullenweg','View post'=>'ເບິ່ງໂພສ','Slug'=>'ສະລັກ (Slug)','Small'=>'ນ້ອຍ','The post status %1$s is not registered, so it may not be reliable to check the capability %2$s against a post with that status.'=>'ສະຖານະໂພສ %1$s ບໍ່ໄດ້ຖືກລົງທະບຽນ, ດັ່ງນັ້ນມັນອາດຈະບໍ່ໜ້າເຊື່ອຖືໃນການກວດສອບສິດ %2$s ກັບໂພສທີ່ມີສະຖານະນັ້ນ.','In reply to %s.'=>'ຕອບກັບ %s.','Previous and next months'=>'ເດືອນກ່ອນໜ້າ ແລະ ເດືອນຖັດໄປ','When registering an "array" setting to show in the REST API, you must specify the schema for each array item in "show_in_rest.schema.items".'=>'ເມື່ອລົງທະບຽນການຕັ້ງຄ່າ "array" ເພື່ອສະແດງໃນ REST API, ເຈົ້າຕ້ອງລະບຸ schema ສຳລັບແຕ່ລະລາຍການ array ໃນ "show_in_rest.schema.items".','User&#8217;s Session Tokens data.'=>'ຂໍ້ມູນ Session Tokens ຂອງຜູ້ໃຊ້.','Session Tokens'=>'Session Tokens','Last Login'=>'ເຂົ້າລະບົບຄັ້ງສຸດທ້າຍ','User Agent'=>'User Agent','Expiration'=>'ໝົດອາຍຸ','User&#8217;s location data used for the Community Events in the WordPress Events and News dashboard widget.'=>'ຂໍ້ມູນສະຖານທີ່ຂອງຜູ້ໃຊ້ທີ່ໃຊ້ສຳລັບ Community Events ໃນວິດເຈັດໜ້າຕ່າງ WordPress Events and News.','Community Events Location'=>'ສະຖານທີ່ຈັດກິດຈະກຳຊຸມຊົນ','IP'=>'IP','Longitude'=>'ເສັ້ນແວງ (Longitude)','Latitude'=>'ເສັ້ນຂະໜານ (Latitude)','Country'=>'ປະເທດ','City'=>'ເມືອງ','Filter %s returned items with reserved names.'=>'ຕົວຕອງ %s ສົ່ງຄືນລາຍການທີ່ມີຊື່ທີ່ສະຫງວນໄວ້.','Original image:'=>'ຮູບພາບຕົ້ນສະບັບ:','Once Weekly'=>'ອາທິດລະຄັ້ງ','In reply to: %s'=>'ຕອບກັບ: %s','HTTP redirect status code must be a redirection code, 3xx.'=>'ລະຫັດສະຖານະ HTTP redirect ຕ້ອງເປັນລະຫັດການປ່ຽນທິດທາງ, 3xx.','Limit result set based on relationship between multiple taxonomies.'=>'ຈຳກັດຊຸດຜົນລັບໂດຍອີງໃສ່ຄວາມສຳພັນລະຫວ່າງຫຼາຍ Taxonomy.','The "%1$s" taxonomy "%2$s" property (%3$s) conflicts with an existing property on the REST API Posts Controller. Specify a custom "rest_base" when registering the taxonomy to avoid this error.'=>'ຄຸນສົມບັດ "%2$s" (%3$s) ຂອງ taxonomy "%1$s" ຂັດແຍ້ງກັບຄຸນສົມບັດທີ່ມີຢູ່ແລ້ວໃນ REST API Posts Controller. ກະລຸນາລະບຸ "rest_base" ທີ່ກຳນົດເອງເມື່ອລົງທະບຽນ taxonomy ເພື່ອຫຼີກເວັ້ນຂໍ້ຜິດພາດນີ້.','Whether theme opts in to default WordPress block styles for viewing.'=>'ກຳນົດວ່າທີມຈະເລືອກໃຊ້ຮູບແບບບລັອກມາດຕະຖານຂອງ WordPress ສຳລັບການເບິ່ງຫຼືບໍ່.','Whether the theme can manage the document title tag.'=>'ກຳນົດວ່າທີມສາມາດຈັດການແທັກຫົວຂໍ້ເອກະສານໄດ້ຫຼືບໍ່.','Allows use of HTML5 markup for search forms, comment forms, comment lists, gallery, and caption.'=>'ອະນຸຍາດໃຫ້ໃຊ້ markup HTML5 ສຳລັບຟອມຄົ້ນຫາ, ຟອມຄຳເຫັນ, ລາຍການຄຳເຫັນ, ຄັງຮູບພາບ ແລະ ຄຳອະທິບາຍພາບ.','Whether theme opts in to the editor styles CSS wrapper.'=>'ກຳນົດວ່າທີມຈະເລືອກໃຊ້ CSS wrapper ຂອງຮູບແບບຕົວແກ້ໄຂຫຼືບໍ່.','Custom gradient presets if defined by the theme.'=>'ຄ່າສີໄລ່ລະດັບທີ່ກຳນົດເອງ ຖ້າທີມມີການລະບຸໄວ້.','Custom font sizes if defined by the theme.'=>'ຂະໜາດຕົວອັກສອນທີ່ກຳນົດເອງ ຖ້າທີມມີການລະບຸໄວ້.','Custom color palette if defined by the theme.'=>'ຈານສີທີ່ກຳນົດເອງ ຖ້າທີມມີການລະບຸໄວ້.','Whether the theme disables custom gradients.'=>'ກຳນົດວ່າທີມຈະປິດການໃຊ້ງານສີໄລ່ລະດັບທີ່ກຳນົດເອງຫຼືບໍ່.','Whether the theme disables custom font sizes.'=>'ກຳນົດວ່າທີມຈະປິດການໃຊ້ງານຂະໜາດຕົວອັກສອນທີ່ກຳນົດເອງຫຼືບໍ່.','Whether the theme disables custom colors.'=>'ກຳນົດວ່າທີມຈະປິດການໃຊ້ງານສີທີ່ກຳນົດເອງຫຼືບໍ່.','Whether theme opts in to the dark editor style UI.'=>'ກຳນົດວ່າທີມຈະເລືອກໃຊ້ UI ຕົວແກ້ໄຂແບບໂໝດມືດຫຼືບໍ່.','Whether the theme enables Selective Refresh for Widgets being managed with the Customizer.'=>'ກຳນົດວ່າທີມຈະເປີດໃຊ້ Selective Refresh ສຳລັບວິດເຈັດທີ່ຖືກຈັດການດ້ວຍ Customizer ຫຼືບໍ່.','Custom logo if defined by the theme.'=>'ໂລໂກ້ທີ່ກຳນົດເອງ ຖ້າທີມມີການລະບຸໄວ້.','Custom background if defined by the theme.'=>'ພື້ນຫຼັງທີ່ກຳນົດເອງ ຖ້າທີມມີການລະບຸໄວ້.','Custom header if defined by the theme.'=>'ສ່ວນຫົວທີ່ກຳນົດເອງ ຖ້າທີມມີການລະບຸໄວ້.','Whether posts and comments RSS feed links are added to head.'=>'ກຳນົດວ່າຈະເພີ່ມລິ້ງ RSS feed ຂອງໂພສ ແລະ ຄຳເຫັນເຂົ້າໃນສ່ວນ head ຫຼືບໍ່.','Whether theme opts in to wide alignment CSS class.'=>'ກຳນົດວ່າທີມຈະເລືອກໃຊ້ຄລາສ CSS ສຳລັບການຈັດວາງແບບກວ້າງ (wide alignment) ຫຼືບໍ່.','Sorry, this method is not supported.'=>'ຂໍອະໄພ, ວິທີການນີ້ບໍ່ໄດ້ຮັບການສະໜັບສະໜູນ.','Sorry, the post could not be created.'=>'ຂໍອະໄພ, ບໍ່ສາມາດສ້າງໂພສໄດ້.','minimum input length for searching post links3'=>'3','Please enter your username or email address. You will receive an email message with instructions on how to reset your password.'=>'ກະລຸນາປ້ອນຊື່ຜູ້ໃຊ້ ຫຼື ທີ່ຢູ່ອີເມລ໌ຂອງເຈົ້າ. ເຈົ້າຈະໄດ້ຮັບຂໍ້ຄວາມອີເມລ໌ພ້ອມຄຳແນະນຳກ່ຽວກັບວິທີຕັ້ງລະຫັດຜ່ານໃໝ່.','Selected media actions'=>'ການຈັດການສື່ທີ່ເລືອກ','media modal menuMenu'=>'ເມນູ','media modal menu actionsActions'=>'ການຈັດການ','file type groupArchives'=>'ຄັງເກັບມ້ຽນ','List of the missing image sizes of the attachment.'=>'ລາຍການຂະໜາດຮູບພາບທີ່ຂາດຫາຍໄປຂອງໄຟລ໌ແນບ.','Unknown email address. Check again or try your username.'=>'ທີ່ຢູ່ອີເມລ໌ທີ່ບໍ່ຮູ້ຈັກ. ກວດສອບອີກຄັ້ງ ຫຼື ລອງໃຊ້ຊື່ຜູ້ໃຊ້ຂອງເຈົ້າ.','Media list'=>'ລາຍການສື່','Filter media'=>'ກັ່ນຕອງສື່','Grid view'=>'ມຸມເບິ່ງແບບຕາຕະລາງ','List view'=>'ມຸມເບິ່ງແບບລາຍການ','Restore the backup'=>'ກູ້ຄືນຂໍ້ມູນສຳຮອງ','The backup of this post in your browser is different from the version below.'=>'ຂໍ້ມູນສຳຮອງຂອງໂພສນີ້ໃນບຣາວເຊີຂອງເຈົ້າແຕກຕ່າງຈາກເວີຊັນລຸ່ມນີ້.','Nav menu locations must be strings.'=>'ຕຳແໜ່ງເມນູນຳທາງຕ້ອງເປັນຂໍ້ຄວາມ (strings).','PHP version %s'=>'ເວີຊັນ PHP %s','Current plugin: %1$s (version %2$s)'=>'ປລັກອິນປະຈຸບັນ: %1$s (ເວີຊັນ %2$s)','Active theme: %1$s (version %2$s)'=>'ທີມທີ່ໃຊ້ງານຢູ່: %1$s (ເວີຊັນ %2$s)','WordPress version %s'=>'ເວີຊັນ WordPress %s','https://wordpress.org/documentation/article/customize-permalinks/#choosing-your-permalink-structure'=>'https://wordpress.org/documentation/article/customize-permalinks/#choosing-your-permalink-structure','Posts'=>'ໂພສ','Your timezone is set to %1$s (Coordinated Universal Time %2$s).'=>'ເຂດເວລາຂອງເຈົ້າຖືກຕັ້ງເປັນ %1$s (ເວລາສາກົນ %2$s).','Your timezone is set to %1$s (%2$s), currently %3$s (Coordinated Universal Time %4$s).'=>'ເຂດເວລາຂອງເຈົ້າຖືກຕັ້ງເປັນ %1$s (%2$s), ປະຈຸບັນແມ່ນ %3$s (ເວລາສາກົນ %4$s).','Block "%1$s" does not contain a style named "%2$s".'=>'ບລັອກ "%1$s" ບໍ່ມີຮູບແບບທີ່ຊື່ວ່າ "%2$s".','Block style name must be a string.'=>'ຊື່ຮູບແບບບລັອກຕ້ອງເປັນຂໍ້ຄວາມ (string).','There has been a critical error on this website.'=>'ມີຂໍ້ຜິດພາດຮ້າຍແຮງເກີດຂຶ້ນຢູ່ໃນເວັບໄຊນີ້.','There has been a critical error on this website, putting it in recovery mode. Please check the Themes and Plugins screens for more details. If you just installed or updated a theme or plugin, check the relevant page for that first.'=>'ມີຂໍ້ຜິດພາດຮ້າຍແຮງເກີດຂຶ້ນຢູ່ໃນເວັບໄຊນີ້, ເຮັດໃຫ້ມັນເຂົ້າສູ່ໂໝດກູ້ຄືນ (recovery mode). ກະລຸນາກວດສອບໜ້າຈໍທີມ ແລະ ປລັກອິນສຳລັບລາຍລະອຽດເພີ່ມເຕີມ. ຖ້າເຈົ້າຫາກໍ່ຕິດຕັ້ງ ຫຼື ອັບເດດທີມ ຫຼື ປລັກອິນ, ໃຫ້ກວດສອບໜ້າທີ່ກ່ຽວຂ້ອງນັ້ນກ່ອນ.','The image cannot be rotated because the embedded meta data cannot be updated.'=>'ຮູບພາບບໍ່ສາມາດໝຸນໄດ້ເນື່ອງຈາກຂໍ້ມູນ Meta ທີ່ຝັງຢູ່ນັ້ນບໍ່ສາມາດອັບເດດໄດ້.','User&#8217;s profile data.'=>'ຂໍ້ມູນໂປຣໄຟລ໌ຂອງຜູ້ໃຊ້.','Not enough data to create this user.'=>'ຂໍ້ມູນບໍ່ພຽງພໍທີ່ຈະສ້າງຜູ້ໃຊ້ນີ້.','Sorry, marking a user as spam is only supported on Multisite.'=>'ຂໍອະໄພ, ການໝາຍຜູ້ໃຊ້ວ່າເປັນສະແປມແມ່ນຮອງຮັບສະເພາະໃນ Multisite ເທົັ້ນັ້ນ.','User&#8217;s media data.'=>'ຂໍ້ມູນສື່ຂອງຜູ້ໃຊ້.','No media items found. Try a different search.'=>'ບໍ່ພົບລາຍການສື່. ລອງຄົ້ນຫາດ້ວຍຄຳອື່ນ.','Number of media items found: %d'=>'ຈຳນວນລາຍການສື່ທີ່ພົບ: %d','Archive <span class="count">(%s)</span>'=>'ຄັງເກັບມ້ຽນ <span class="count">(%s)</span>','Manage Archives'=>'ຈັດການຄັງເກັບມ້ຽນ','Spreadsheet <span class="count">(%s)</span>'=>'ສະເປຣດຊີດ <span class="count">(%s)</span>','Manage Spreadsheets'=>'ຈັດການສະເປຣດຊີດ','Spreadsheets'=>'ສະເປຣດຊີດ','Manage Documents'=>'ຈັດການເອກະສານ','Documents'=>'ເອກະສານ','Requirements Not Met'=>'ຄຸນສົມບັດບໍ່ກົງຕາມຄວາມຕ້ອງການ','The %1$s, %2$s, and %3$s values can be edited to set the video track language and kind.'=>'ຄ່າ %1$s, %2$s, ແລະ %3$s ສາມາດແກ້ໄຂໄດ້ເພື່ອຕັ້ງຄ່າພາສາ ແລະ ປະເພດຂອງແທຣັກວິດີໂອ.','User&#8217;s comment data.'=>'ຂໍ້ມູນຄຳເຫັນຂອງຜູ້ໃຊ້.','Unchanged:'=>'ບໍ່ມີການປ່ຽນແປງ:','Added:'=>'ເພີ່ມແລ້ວ:','Whether posts of this status may have floating published dates.'=>'ກຳນົດວ່າໂພສທີ່ມີສະຖານະນີື່ອາດຈະມີວັນທີເຜີຍແຜ່ແບບປ່ຽນແປງໄດ້ຫຼືບໍ່.','Sorry, you are not allowed to delete revisions of this post.'=>'ຂໍອະໄພ, ເຈົ້າບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ລຶບເວີຊັນເກົ່າ (revisions) ຂອງໂພສນີ້.','Could not update the meta value of %s in database.'=>'ບໍ່ສາມາດອັບເດດຄ່າ meta ຂອງ %s ໃນຖານຂໍ້ມູນ.','When registering an "array" meta type to show in the REST API, you must specify the schema for each array item in "show_in_rest.schema.items".'=>'ເມື່ອລົງທະບຽນປະເພດ meta ແບບ "array" ເພື່ອສະແດງໃນ REST API, ເຈົ້າຕ້ອງລະບຸ schema ສຳລັບແຕ່ລະລາຍການ array ໃນ "show_in_rest.schema.items".','Comments feed'=>'RSS ຟີດຂອງຄຳເຫັນ','Entries feed'=>'RSS ຟີດຂອງເນື້ອຫາ','Unexpected response from the server. The file may have been uploaded successfully. Check in the Media Library or reload the page.'=>'ການຕອບສະໜອງທີ່ບໍ່ຄາດຄິດຈາກເຊີເວີ. ໄຟລ໌ອາດຈະຖືກອັບໂຫຼດສຳເລັດແລ້ວ. ກວດສອບໃນຄັງສື່ ຫຼື ໂຫຼດໜ້າໃໝ່.','Remind me later'=>'ເຕືອນຂ້ອຍພາຍຫຼັງ','The email is correct'=>'ອີເມລ໌ນີ້ຖືກຕ້ອງແລ້ວ','This email may be different from your personal email address.'=>'ອີເມລ໌ນີ້ອາດຈະແຕກຕ່າງຈາກທີ່ຢູ່ອີເມລ໌ສ່ວນຕົວຂອງເຈົ້າ.','Current administration email: %s'=>'ອີເມລ໌ຜູ້ດູແລລະບົບປະຈຸບັນ: %s','Why is this important?'=>'ເປັນຫຍັງສິ່ງນີ້ຈຶ່ງສຳຄັນ?','https://wordpress.org/documentation/article/settings-general-screen/#email-address'=>'https://wordpress.org/documentation/article/settings-general-screen/#email-address','Please verify that the <strong>administration email</strong> for this website is still correct.'=>'ກະລຸນາກວດສອບວ່າ <strong>ອີເມລ໌ຜູ້ດູແລລະບົບ</strong> ສຳລັບເວັບໄຊນີ້ຍັງຖືກຕ້ອງຢູ່.','Administration email verification'=>'ການກວດສອບອີເມລ໌ຜູ້ດູແລລະບົບ','Confirm your administration email'=>'ຢືນຢັນອີເມລ໌ຜູ້ດູແລລະບົບຂອງເຈົ້າ','excerpt_length55'=>'55','Original SizeOriginal'=>'ຕົ້ນສະບັບ','comment_excerpt_length20'=>'20','Cannot resize the image. Both width and height are not set.'=>'ບໍ່ສາມາດປ່ຽນຂະໜາດຮູບພາບໄດ້. ທັງຄວາມກວ້າງ ແລະ ຄວາມສູງບໍ່ໄດ້ຖືກກຳນົດ.','Image size in pixels'=>'ຂະໜາດຮູບພາບເປັນພິກເຊລ','Media title&hellip;'=>'ຫົວຂໍ້ສື່&hellip;','Media title'=>'ຫົວຂໍ້ສື່','Audio title&hellip;'=>'ຫົວຂໍ້ສຽງ&hellip;','Audio title'=>'ຫົວຂໍ້ສຽງ','Video title&hellip;'=>'ຫົວຂໍ້ວິດີໂອ&hellip;','Video title'=>'ຫົວຂໍ້ວິດີໂອ','Caption&hellip;'=>'ຄຳອະທິບາຍພາບ&hellip;','Details'=>'ລາຍລະອຽດ','Attachment Preview'=>'ຕົວຢ່າງໄຟລ໌ແນບ','Your browser cannot upload files'=>'ບຣາວເຊີຂອງເຈົ້າບໍ່ສາມາດອັບໂຫຼດໄຟລ໌ໄດ້','Allow people to submit comments on new posts.'=>'ອະນຸຍາດໃຫ້ຄົນອື່ນສົ່ງຄຳເຫັນໃນໂພສໃໝ່.','<strong>Error:</strong> The email could not be sent. Your site may not be correctly configured to send emails. <a href="%s">Get support for resetting your password</a>.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ບໍ່ສາມາດສົ່ງອີເມລ໌ໄດ້. ເວັບໄຊຂອງເຈົ້າອາດຈະບໍ່ໄດ້ຕັ້ງຄ່າໃຫ້ສົ່ງອີເມລ໌ຢ່າງຖືກຕ້ອງ. <a href="%s">ຂໍຄວາມຊ່ວຍເຫຼືອໃນການຕັ້ງລະຫັດຜ່ານໃໝ່</a>.','New version available.'=>'ມີເວີຊັນໃໝ່ໃຫ້ໃຊ້ງານແລ້ວ.','Could not insert term taxonomy into the database.'=>'ບໍ່ສາມາດເພີ່ມ term taxonomy ເຂົ້າໃນຖານຂໍ້ມູນ.','<a href="%1$s" %2$s>Learn how to describe the purpose of the image%3$s</a>. Leave empty if the image is purely decorative.'=>'<a href="%1$s" %2$s>ຮຽນຮູ້ວິທີອະທິບາຍຈຸດປະສົງຂອງຮູບພາບ%3$s</a>. ປະໄວ້ໃຫ້ວ່າງຖ້າຮູບພາບນັ້ນມີໄວ້ເພື່ອຄວາມສວຍງາມເທົ່ານັ້ນ.','In this case, WordPress caught an error with your theme, %s.'=>'ໃນກໍລະນີນີີ້, WordPress ພົບຂໍ້ຜິດພາດກັບທີມຂອງເຈົ້າ, %s.','In this case, WordPress caught an error with one of your plugins, %s.'=>'ໃນກໍລະນີນີີ້, WordPress ພົບຂໍ້ຜິດພາດກັບໜຶ່ງໃນປລັກອິນຂອງເຈົ້າ, %s.','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'ສະບາຍດີ!

WordPress ມີຟີເຈີທີ່ຊ່ວຍກວດຈັບເມື່ອປລັກອິນ ຫຼື ທີມ ເຮັດໃຫ້ເກີດຂໍ້ຜິດພາດຮ້າຍແຮງໃນເວັບໄຊຂອງເຈົ້າ ແລະ ແຈ້ງເຕືອນເຈົ້າດ້ວຍອີເມລ໌ອັດຕະໂນມັດນີ້.
###CAUSE###
ທຳອິດ, ໃຫ້ເຂົ້າໄປເບິ່ງເວັບໄຊຂອງເຈົ້າ (###SITEURL###) ແລະ ກວດສອບບັນຫາທີ່ເຫັນໄດ້. ຖັດໄປ, ໃຫ້ເຂົ້າໄປເບິ່ງໜ້າທີ່ເກີດຂໍ້ຜິດພາດ (###PAGEURL###) ແລະ ກວດສອບບັນຫາ.

###SUPPORT###

ຖ້າເວັບໄຊຂອງເຈົ້າໃຊ້ງານບໍ່ໄດ້ ແລະ ເຈົ້າບໍ່ສາມາດເຂົ້າແຜງຄວບຄຸມໄດ້ຕາມປົກກະຕິ, WordPress ມີ "ໂໝດກູ້ຄືນ" ພິເສດ. ສິ່ງນີ້ຊ່ວຍໃຫ້ເຈົ້າເຂົ້າລະບົບແຜງຄວບຄຸມໄດ້ຢ່າງປອດໄພເພື່ອມາກວດສອບຕື່ມ.

###LINK###

ເພື່ອຄວາມປອດໄພຂອງເວັບໄຊ, ລິ້ງນີ້ຈະໝົດອາຍຸໃນ ###EXPIRES###. ແຕ່ບໍ່ຕ້ອງກັງວົນ: ລິ້ງໃໝ່ຈະຖືກສົ່ງໃຫ້ເຈົ້າທາງອີເມລ໌ ຖ້າເກີດຂໍ້ຜິດພາດຂຶ້ນອີກຫຼັງຈາກລິ້ງໝົດອາຍຸ.

ເມື່ອຕ້ອງການຄວາມຊ່ວຍເຫຼືອກ່ຽວກັບບັນຫານີ້, ເຈົ້າອາດຈະຖືກຖາມຂໍ້ມູນດັ່ງຕໍ່ໄປນີ້:
###DEBUG###

###DETAILS###','Please contact your host for assistance with investigating this issue further.'=>'ກະລຸນາຕິດຕໍ່ຜູ້ໃຫ້ບໍລິການໂຮສຕິງຂອງເຈົ້າເພື່ອຂໍຄວາມຊ່ວຍເຫຼືອໃນການກວດສອບບັນຫານີ້ຕື່ມ.','Error occurred on a non-protected endpoint.'=>'ເກີດຂໍ້ຜິດພາດໃນ endpoint ທີ່ບໍ່ໄດ້ຮັບການປົກປ້ອງ.','Recovery Mode &#8212; %s'=>'ໂໝດກູ້ຄືນ &#8212; %s','[%s] Login Details'=>'[%s] ລາຍລະອຽດການເຂົ້າລະບົບ','Move to Trash'=>'ຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ','Restore from Trash'=>'ກູ້ຄືນຈາກຖັງຂີ້ເຫຍື້ອ','https://wordpress.org/support/forums/'=>'https://wordpress.org/support/forums/','Support'=>'ຊ່ວຍເຫຼືອ','[%s] Network Admin Email Changed'=>'[%s] ອີເມລ໌ຜູ້ດູແລເຄືອຂ່າຍຖືກປ່ຽນແປງແລ້ວ','[%s] Network Admin Email Change Request'=>'[%s] ຄຳຮ້ອງຂໍປ່ຽນອີເມລ໌ຜູ້ດູແລເຄືອຂ່າຍ','[%s] Admin Email Changed'=>'[%s] ອີເມລ໌ຜູ້ດູແລລະບົບຖືກປ່ຽນແປງແລ້ວ','[%s] Email Change Request'=>'[%s] ຄຳຮ້ອງຂໍປ່ຽນອີເມລ໌','[%s] Email Changed'=>'[%s] ອີເມລ໌ຖືກປ່ຽນແປງແລ້ວ','A calendar of your site’s posts.'=>'ປະຕິທິນໂພສໃນເວັບໄຊຂອງເຈົ້າ.','Edit gallery'=>'ແກ້ໄຂຄັງຮູບພາບ','Custom Colors'=>'ສີທີ່ກຳນົດເອງ','Failed to exit recovery mode. Please try again later.'=>'ບໍ່ສາມາດອອກຈາກໂໝດກູ້ຄືນໄດ້. ກະລຸນາລອງໃໝ່ພາຍຫຼັງ.','Exit recovery mode link expired.'=>'ລິ້ງອອກຈາກໂໝດກູ້ຄືນໝົດອາຍຸແລ້ວ.','Failed to store the error.'=>'ບໍ່ສາມາດບັນທຶກຂໍ້ຜິດພາດໄດ້.','Error not caused by a plugin or theme.'=>'ຂໍ້ຜິດພາດບໍ່ໄດ້ເກີດຈາກປລັກອິນ ຫຼື ທີມ.','[%s] Your Site is Experiencing a Technical Issue'=>'[%s] ເວັບໄຊຂອງເຈົ້າກຳລັງປະສົບບັນຫາທາງເຕັກນິກ','Error Details'=>'ລາຍລະອຽດຂໍ້ຜິດພາດ','A recovery link was already sent %1$s ago. Please wait another %2$s before requesting a new email.'=>'ລິ້ງກູ້ຄືນໄດ້ຖືກສົ່ງໄປແລ້ວເມື່ອ %1$s ກ່ອນ. ກະລຸນາລໍຖ້າອີກ %2$s ກ່ອນທີ່ຈະຂໍອີເມລ໌ໃໝ່.','The email could not be sent. Possible reason: your host may have disabled the %s function.'=>'ບໍ່ສາມາດສົ່ງອີເມລ໌ໄດ້. ເຫດຜົນທີ່ເປັນໄປໄດ້: ໂຮສຂອງເຈົ້າອາດຈະປິດການໃຊ້ງານຟັງຊັນ %s.','Could not update the email last sent time.'=>'ບໍ່ສາມາດອັບເດດເວລາສົ່ງອີເມລ໌ຄັ້ງສຸດທ້າຍໄດ້.','Recovery key expired.'=>'ລະຫັດກູ້ຄືນໝົດອາຍຸແລ້ວ.','Invalid recovery key.'=>'ລະຫັດກູ້ຄືນບໍ່ຖືກຕ້ອງ.','Invalid recovery key format.'=>'ຮູບແບບລະຫັດກູ້ຄືນບໍ່ຖືກຕ້ອງ.','Recovery Mode not initialized.'=>'ໂໝດກູ້ຄືນຍັງບໍ່ໄດ້ຖືກເລີ່ມຕົ້ນ.','User roleSubscriber'=>'ຜູ້ຕິດຕາມ (Subscriber)','User roleContributor'=>'ຜູ້ຮ່ວມຂຽນ (Contributor)','User roleAuthor'=>'ນັກຂຽນ (Author)','User roleEditor'=>'ບັນນາທິການ (Editor)','User roleAdministrator'=>'ຜູ້ດູແລລະບົບ (Administrator)','Select Site Icon'=>'ເລືອກໄອຄອນເວັບໄຊ','An incomplete personal data request for this email address already exists.'=>'ມີຄຳຮ້ອງຂໍຂໍ້ມູນສ່ວນຕົວທີ່ຍັງບໍ່ສຳເລັດສຳລັບທີ່ຢູ່ອີເມລ໌ນີ້ຢູ່ແລ້ວ.','Keep widget settings and move it to the inactive widgets'=>'ເກັບການຕັ້ງຄ່າວິດເຈັດໄວ້ ແລະ ຍ້າຍມັນໄປທີ່ວິດເຈັດທີ່ບໍ່ໄດ້ໃຊ້ງານ','Invalid cookie.'=>'ຄຸກກີ້ບໍ່ຖືກຕ້ອງ.','Cookie expired.'=>'ຄຸກກີ້ໝົດອາຍຸແລ້ວ.','Invalid cookie format.'=>'ຮູບແບບຄຸກກີ້ບໍ່ຖືກຕ້ອງ.','No cookie present.'=>'ບໍ່ພົບຄຸກກີ້.','An error of type %1$s was caused in line %2$s of the file %3$s. Error message: %4$s'=>'ຂໍ້ຜິດພາດປະເພດ %1$s ເກີດຂຶ້ນໃນແຖວທີ %2$s ຂອງໄຟລ໌ %3$s. ຂໍ້ຄວາມຜິດພາດ: %4$s','https://developer.wordpress.org/themes/advanced-topics/child-themes/'=>'https://developer.wordpress.org/themes/advanced-topics/child-themes/','Additional images added to this gallery: %s'=>'ຮູບພາບເພີ່ມເຕີມທີ່ເພີ່ມເຂົ້າໃນຄັງຮູບນີ້: %s','The current image has no alternative text. The file name is: %s'=>'ຮູບພາບໃນປະຈຸບັນບໍ່ມີຂໍ້ຄວາມສຳຮອງ (alt text). ຊື່ໄຟລ໌ແມ່ນ: %s','Exit Recovery Mode'=>'ອອກຈາກໂໝດກູ້ຄືນ','%s Comment in moderation'=>'%s ຄຳເຫັນທີ່ລໍຖ້າການກວດສອບ','Quote from Hello Dolly song, by Jerry Herman:'=>'ຄຳຄົມຈາກເພງ Hello Dolly, ໂດຍ Jerry Herman:','Recovery Mode Initialized. Please log in to continue.'=>'ໂໝດກູ້ຄືນເລີ່ມຕົ້ນແລ້ວ. ກະລຸນາເຂົ້າລະບົບເພື່ອດຳເນີນການຕໍ່.','Missing confirm key.'=>'ຂາດລະຫັດຢືນຢັນ.','Missing request ID.'=>'ຂາດ ID ຄຳຮ້ອງຂໍ.','Usage of the title attribute on the login logo is not recommended for accessibility reasons. Use the link text instead.'=>'ບໍ່ແນະນຳໃຫ້ໃຊ້ຄຸນລັກສະນະ title ໃນໂລໂກ້ການເຂົ້າລະບົບຍ້ອນເຫດຜົນດ້ານການເຂົ້າເຖິງ. ໃຫ້ໃຊ້ຂໍ້ຄວາມລິ້ງແທນ.','Update PHP'=>'ອັບເດດ PHP','Could not retrieve site data.'=>'ບໍ່ສາມາດດຶງຂໍ້ມູນເວັບໄຊໄດ້.','%1$s, and %2$s'=>'%1$s, ແລະ %2$s','Failed <span class="count">(%s)</span>'=>'ລົ້ມເຫຼວ <span class="count">(%s)</span>','Your comment is awaiting moderation. This is a preview; your comment will be visible after it has been approved.'=>'ຄຳເຫັນຂອງເຈົ້າກຳລັງລໍຖ້າການກວດສອບ. ນີ້ແມ່ນຕົວຢ່າງ; ຄຳເຫັນຂອງເຈົ້າຈະປາກົດໃຫ້ເຫັນຫຼັງຈາກທີ່ໄດ້ຮັບການອະນຸມັດແລ້ວ.','The %s table is not installed. Please run the network database upgrade.'=>'ຕາຕະລາງ %s ຍັງບໍ່ໄດ້ຖືກຕິດຕັ້ງ. ກະລຸນາດຳເນີນການອັບເກຣດຖານຂໍ້ມູນເຄືອຂ່າຍ.','The site appears to be already uninitialized.'=>'ເວັບໄຊເບິ່ງຄືວ່າໄດ້ຖືກຍົກເລີກການເລີ່ມຕົ້ນແລ້ວ.','Site %d'=>'ເວັບໄຊ %d','The site appears to be already initialized.'=>'ເວັບໄຊເບິ່ງຄືວ່າໄດ້ຖືກເລີ່ມຕົ້ນແລ້ວ.','Site with the ID does not exist.'=>'ເວັບໄຊທີ່ມີ ID ນີ້ບໍ່ມີຢູ່.','Both registration and last updated dates must be valid dates.'=>'ທັງວັນທີລົງທະບຽນ ແລະ ວັນທີອັບເດດຫຼ້າສຸດຕ້ອງເປັນວັນທີທີ່ຖືກຕ້ອງ.','Both registration and last updated dates must be provided.'=>'ຕ້ອງລະບຸທັງວັນທີລົງທະບຽນ ແລະ ວັນທີອັບເດດຫຼ້າສຸດ.','Site network ID must be provided.'=>'ຕ້ອງລະບຸ ID ເຄືອຂ່າຍເວັບໄຊ.','Site path must not be empty.'=>'ເສັ້ນທາງເວັບໄຊ (Site path) ຕ້ອງບໍ່ວ່າງ.','Site domain must not be empty.'=>'ໂດເມນເວັບໄຊຕ້ອງບໍ່ວ່າງ.','Could not delete site from the database.'=>'ບໍ່ສາມາດລຶບເວັບໄຊອອກຈາກຖານຂໍ້ມູນ.','Could not update site in the database.'=>'ບໍ່ສາມາດອັບເດດເວັບໄຊໃນຖານຂໍ້ມູນ.','Site does not exist.'=>'ເວັບໄຊບໍ່ມີຢູ່.','Site ID must not be empty.'=>'ID ເວັບໄຊຕ້ອງບໍ່ວ່າງ.','Could not insert site into the database.'=>'ບໍ່ສາມາດເພີ່ມເວັບໄຊເຂົ້າໃນຖານຂໍ້ມູນ.','Unable to submit this form, please try again.'=>'ບໍ່ສາມາດສົ່ງຟອມນີ້ໄດ້, ກະລຸນາລອງໃໝ່ອີກຄັ້ງ.','post formatFormats'=>'ຮູບແບບ','%1$s, %2$s'=>'%1$s, %2$s','This resource is provided by your web host, and is specific to your site. For more information, <a href="%s" target="_blank">see the official WordPress documentation</a>.'=>'ຊັບພະຍາກອນນີີ້ແມ່ນສະໜອງໃຫ້ໂດຍຜູ້ໃຫ້ບໍລິການເວັບໂຮສຂອງເຈົ້າ ແລະ ເປັນຂໍ້ມູນສະເພາະສຳລັບເວັບໄຊຂອງເຈົ້າ. ສຳລັບຂໍ້ມູນເພີ່ມເຕີມ, <a href="%s" target="_blank">ເບິ່ງເອກະສານທາງການຂອງ WordPress</a>.','localized PHP upgrade information pagehttps://wordpress.org/support/update-php/'=>'https://wordpress.org/support/update-php/','%s second'=>'%s ວິນາທີ','%s minute'=>'%s ນາທີ','%1$s by %2$s pixels'=>'%1$s ຄູນ %2$s ພິກເຊລ','This theme failed to load properly and was paused within the admin backend.'=>'ທີມນີີ້ບໍ່ສາມາດໂຫຼດໄດ້ຢ່າງຖືກຕ້ອງ ແລະ ຖືກຢຸດໄວ້ຊົ່ວຄາວໃນສ່ວນຫຼັງຂອງຜູ້ດູແລລະບົບ.','Whether to show the taxonomy in the quick/bulk edit panel.'=>'ກຳນົດວ່າຈະສະແດງ taxonomy ໃນແຜງແກ້ໄຂດ່ວນ/ແກ້ໄຂຫຼາຍລາຍການຫຼືບໍ່.','Whether to make the taxonomy available for selection in navigation menus.'=>'ກຳນົດວ່າຈະໃຫ້ taxonomy ນີີ້ມີໃຫ້ເລືອກໃນເມນູນຳທາງຫຼືບໍ່.','Whether to allow automatic creation of taxonomy columns on associated post-types table.'=>'ກຳນົດວ່າຈະອະນຸຍາດໃຫ້ສ້າງຄໍລຳ taxonomy ໂດຍອັດຕະໂນມັດໃນຕາຕະລາງປະເພດໂພສທີ່ກ່ຽວຂ້ອງຫຼືບໍ່.','Whether to generate a default UI for managing this taxonomy.'=>'ກຳນົດວ່າຈະສ້າງ UI ມາດຕະຖານສຳລັບການຈັດການ taxonomy ນີີ້ຫຼືບໍ່.','Whether the taxonomy is publicly queryable.'=>'ກຳນົດວ່າ taxonomy ນີີ້ສາມາດຖືກສອບຖາມ (query) ໄດ້ໂດຍສາທາລະນະຫຼືບໍ່.','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users.'=>'ກຳນົດວ່າ taxonomy ນີີ້ມີຈຸດປະສົງເພື່ອໃຊ້ເປັນສາທາລະນະ ບໍ່ວ່າຈະຜ່ານອິນເຕີເຟສຜູ້ດູແລລະບົບ ຫຼື ໂດຍຜູ້ໃຊ້ທົ່ວໄປຫຼືບໍ່.','<strong>Error:</strong> There is no account with that username or email address.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ບໍ່ມີບັນຊີທີ່ມີຊື່ຜູ້ໃຊ້ ຫຼື ທີ່ຢູ່ອີເມລ໌ນັ້ນ.','A variable mismatch has been detected.'=>'ກວດພົບຄວາມບໍ່ກົງກັນຂອງຕົວປ່ຽນ (variable mismatch).','A key value mismatch has been detected. Please follow the link provided in your activation email.'=>'ກວດພົບຄວາມບໍ່ກົງກັນຂອງຄ່າຄີ (key value mismatch). ກະລຸນາເຂົ້າເບິ່ງລິ້ງທີ່ໃຫ້ໄວ້ໃນອີເມລ໌ຢືນຢັນຕົວຕົນຂອງເຈົ້າ.','%s word'=>'%s ຄຳ','Classic Block Keyboard Shortcuts'=>'ປຸ່ມລັດຄີບອດຂອງບລັອກແບບຄລາສສິກ','Sorry, you are not allowed to view autosaves of this post.'=>'ຂໍອະໄພ, ເຈົ້າບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງຂໍ້ມູນທີ່ບັນທຶກອັດຕະໂນມັດ (autosaves) ຂອງໂພສນີ້.','Scheduled'=>'ຕັ້ງເວລາໄວ້','Create'=>'ສ້າງ','block descriptionGive quoted text visual emphasis. "In quoting others, we cite ourselves." — Julio Cortázar'=>'ເນັ້ນຂໍ້ຄວາມຄຳຄົມໃຫ້ເຫັນຢ່າງຊັດເຈນ. "ໃນການອ້າງອີງຄົນອື່ນ, ພວກເຮົາກຳລັງອ້າງອີງເຖິງຕົວເຮົາເອງ." — ຄູລິໂອ ກໍຕາຊາ (Julio Cortázar)','Pagination'=>'ການແບ່ງໜ້າ','Edit image'=>'ແກ້ໄຂຮູບພາບ','block descriptionIntroduce new sections and organize content to help visitors (and search engines) understand the structure of your content.'=>'ແນະນຳພາກສ່ວນໃໝ່ ແລະ ຈັດລະບຽບເນື້ອໃນເພື່ອຊ່ວຍໃຫ້ຜູ້ເຂົ້າຊົມ (ແລະ ເຄື່ອງມືຄົ້ນຫາ) ເຂົ້າໃຈໂຄງສ້າງຂອງເນື້ອໃນເຈົ້າ.','Copy URL'=>'ຄັດລອກ URL','block descriptionAdd a block that displays content pulled from other sites, like Twitter or YouTube.'=>'ເພີ່ມບລັອກທີ່ສະແດງເນື້ອໃນທີ່ດຶງມາຈາກເວັບໄຊອື່ນ ເຊັ່ນ Twitter ຫຼື YouTube.','block titleEmbed'=>'ຝັງ (Embed)','block titleClassic'=>'ຄລາສສິກ','Embeds'=>'ການຝັງ (Embeds)','Discussion'=>'ການສົນທະນາ','Add title'=>'ເພີ່ມຫົວຂໍ້','Visibility:'=>'ການເບິ່ງເຫັນ:','Copied!'=>'ຄັດລອກແລ້ວ!','Submit for Review'=>'ສົ່ງເພື່ອໃຫ້ກວດສອບ','Permalink:'=>'ລິ້ງຖາວອນ:','Replace image'=>'ປ່ຽນຮູບພາບ','Order'=>'ລຳດັບ','Item added.'=>'ເພີ່ມລາຍການແລ້ວ.','(opens in a new tab)'=>'(ເປີດໃນແທັບໃໝ່)','M j, Y g:i a'=>'j M Y, g:i a','The rendered block.'=>'ບລັອກທີ່ຖືກສະແດງຜົນແລ້ວ.','Invalid block.'=>'ບລັອກບໍ່ຖືກຕ້ອງ.','Sorry, you are not allowed to read blocks as this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອ່ານບລັອກໃນນາມຜູ້ໃຊ້ນີ້.','Sorry, you are not allowed to read blocks of this post.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອ່ານບລັອກຂອງໂພສນີ້.','ID of the post context.'=>'ID ຂອງເນື້ອໃນໂພສ.','Attributes for the block.'=>'ຄຸນລັກສະນະຂອງບລັອກ.','Unique registered name for the block.'=>'ຊື່ທີ່ລົງທະບຽນສະເພາະສຳລັບບລັອກ.','Whether the theme supports responsive embedded content.'=>'ທີມນີ້ຮອງຮັບເນື້ອໃນຝັງຕົວແບບປັບຂະໜາດຕາມໜ້າຈໍ (Responsive) ຫຼື ບໍ່.','%s from now'=>'ອີກ %s ຕໍ່ຈາກນີ້','Limit result set to themes assigned one or more statuses.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະທີມທີ່ມີສະຖານະໃດໜຶ່ງ ຫຼື ຫຼາຍສະຖານະ.','Post formats supported.'=>'ຮູບແບບໂພສທີ່ຮອງຮັບ.','Features supported by this theme.'=>'ຄຸນສົມບັດທີ່ຮອງຮັບໂດຍທີມນີ້.','The visibility settings for the taxonomy.'=>'ການຕັ້ງຄ່າການເບິ່ງເຫັນສຳລັບ Taxonomy (ໝວດໝູ່/ແທັກ).','Invalid type parameter.'=>'ພາລາມິເຕີປະເພດບໍ່ຖືກຕ້ອງ.','Limit results to items of one or more object subtypes.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະລາຍການທີ່ມີປະເພດຍ່ອຍຂອງວັດຖຸໃດໜຶ່ງ.','Limit results to items of an object type.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະລາຍການຂອງປະເພດວັດຖຸໃດໜຶ່ງ.','Object subtype.'=>'ປະເພດຍ່ອຍຂອງວັດຖຸ.','Object type.'=>'ປະເພດວັດຖຸ.','Internal search handler error.'=>'ເກີດຂໍ້ຜິດພາດໃນຕົວຈັດການການຄົ້ນຫາພາຍໃນ.','REST search handlers must extend the %s class.'=>'ຕົວຈັດການການຄົ້ນຫາ REST ຕ້ອງຂະຫຍາຍ (Extend) ຄລາສ %s.','The current user can post unfiltered HTML markup and JavaScript.'=>'ຜູ້ໃຊ້ປັດຈຸບັນສາມາດໂພສ HTML markup ແລະ JavaScript ທີ່ບໍ່ໄດ້ຜ່ານການກອງ.','Version of the content block format used by the post.'=>'ເວີຊັນຂອງຮູບແບບບລັອກເນື້ອໃນທີ່ໃຊ້ໂດຍໂພສ.','Slug automatically generated from the post title.'=>'Slug ທີ່ຖືກສ້າງຂຶ້ນອັດຕະໂນມັດຈາກຫົວຂໍ້ໂພສ.','Permalink template for the post.'=>'ແມ່ແບບລິ້ງຖາວອນສຳລັບໂພສ.','Preview link for the post.'=>'ລິ້ງເບິ່ງຕົວຢ່າງສຳລັບໂພສ.','There is no autosave revision for this post.'=>'ບໍ່ມີເວີຊັນການບັນທຶກອັດຕະໂນມັດສຳລັບໂພສນີ້.','Page updated.'=>'ອັບເດດໜ້າເວັບແລ້ວ.','Post updated.'=>'ອັບເດດໂພສແລ້ວ.','Page scheduled.'=>'ກຳນົດເວລາເຜີຍແຜ່ໜ້າເວັບແລ້ວ.','Post scheduled.'=>'ກຳນົດເວລາເຜີຍແຜ່ໂພສແລ້ວ.','Page reverted to draft.'=>'ປ່ຽນໜ້າເວັບກັບເປັນສະບັບຮ່າງແລ້ວ.','Post reverted to draft.'=>'ປ່ຽນໂພສກັບເປັນສະບັບຮ່າງແລ້ວ.','Page published privately.'=>'ເຜີຍແຜ່ໜ້າເວັບແບບສ່ວນຕົວແລ້ວ.','Post published privately.'=>'ເຜີຍແຜ່ໂພສແບບສ່ວນຕົວແລ້ວ.','Page published.'=>'ເຜີຍແຜ່ໜ້າເວັບແລ້ວ.','Post published.'=>'ເຜີຍແຜ່ໂພສແລ້ວ.','Block type "%s" is not registered.'=>'ປະເພດບລັອກ "%s" ບໍ່ໄດ້ຖືກລົງທະບຽນ.','Block type "%s" is already registered.'=>'ປະເພດບລັອກ "%s" ໄດ້ຖືກລົງທະບຽນແລ້ວ.','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'ຊື່ປະເພດບລັອກຕ້ອງມີ Namespace ເປັນຄຳນຳໜ້າ. ຕົວຢ່າງ: my-plugin/my-custom-block-type','Block type names must not contain uppercase characters.'=>'ຊື່ປະເພດບລັອກຕ້ອງບໍ່ມີຕົວອັກສອນພິມໃຫຍ່.','Block type names must be strings.'=>'ຊື່ປະເພດບລັອກຕ້ອງເປັນຂໍ້ຄວາມ (String).','No comments to show.'=>'ບໍ່ມີຄວາມຄິດເຫັນທີ່ຈະສະແດງ.','%1$s on %2$s'=>'%1$s ໃນ %2$s','No archives to show.'=>'ບໍ່ມີບົດຄວາມເກົ່າ (Archives) ທີ່ຈະສະແດງ.','The offset number requested is larger than or equal to the number of available revisions.'=>'ຈຳນວນ Offset ທີ່ຮ້ອງຂໍມີຄ່າຫຼາຍກວ່າ ຫຼື ເທົ່າກັບຈຳນວນເວີຊັນການແກ້ໄຂທີ່ມີຢູ່.','Unable to send personal data export confirmation email.'=>'ບໍ່ສາມາດສົ່ງອີເມລຢືນຢັນການສົ່ງອອກຂໍ້ມູນສ່ວນຕົວໄດ້.','[%1$s] Action Confirmed: %2$s'=>'[%1$s] ຢືນຢັນການດຳເນີນການ: %2$s','The current user can create terms in the %s taxonomy.'=>'ຜູ້ໃຊ້ປັດຈຸບັນສາມາດສ້າງຄຳສັບໃນ Taxonomy %s ໄດ້.','The current user can assign terms in the %s taxonomy.'=>'ຜູ້ໃຊ້ປັດຈຸບັນສາມາດກຳນົດຄຳສັບໃນ Taxonomy %s ໄດ້.','The current user can change the author on this post.'=>'ຜູ້ໃຊ້ປັດຈຸບັນສາມາດປ່ຽນແປງຜູ້ຂຽນໃນໂພສນີ້ໄດ້.','The current user can sticky this post.'=>'ຜູ້ໃຊ້ປັດຈຸບັນສາມາດປັກໝຸດໂພສນີ້ໄດ້.','The current user can publish this post.'=>'ຜູ້ໃຊ້ປັດຈຸບັນສາມາດເຜີຍແຜ່ໂພສນີ້ໄດ້.','You have used your space quota. Please delete files before uploading.'=>'ທ່ານໄດ້ໃຊ້ພື້ນທີ່ຈັດເກັບເຕັມໂຄຕ້າແລ້ວ. ກະລຸນາລຶບໄຟລ໌ບາງສ່ວນອອກກ່ອນຈະອັບໂຫຼດໃໝ່.','Not enough space to upload. %s KB needed.'=>'ພື້ນທີ່ບໍ່ພຽງພໍສຳລັບການອັບໂຫຼດ. ຕ້ອງການອີກ %s KB.','The site administrator has been notified. You will receive an email confirmation when they erase your data.'=>'ຜູ້ດູແລລະບົບໄດ້ຮັບການແຈ້ງເຕືອນແລ້ວ. ທ່ານຈະໄດ້ຮັບອີເມລຢືນຢັນເມື່ອພວກເຂົາລຶບຂໍ້ມູນຂອງທ່ານສຳເລັດ.','Thanks for confirming your erasure request.'=>'ຂອບໃຈສຳລັບການຢືນຢັນການຮ້ອງຂໍລຶບຂໍ້ມູນ.','The site administrator has been notified. You will receive a link to download your export via email when they fulfill your request.'=>'ຜູ້ດູແລລະບົບໄດ້ຮັບການແຈ້ງເຕືອນແລ້ວ. ທ່ານຈະໄດ້ຮັບລິ້ງເພື່ອດາວໂຫຼດຂໍ້ມູນຂອງທ່ານຜ່ານທາງອີເມລເມື່ອພວກເຂົາດຳເນີນການຕາມຄຳຮ້ອງຂໍສຳເລັດ.','Thanks for confirming your export request.'=>'ຂອບໃຈສຳລັບການຢືນຢັນການຮ້ອງຂໍສົ່ງອອກຂໍ້ມູນ.','Howdy,

