a valid property of Object.'=>'%1$s ບໍ່ແມ່ນຄຸນສົມບັດທີ່ຖືກຕ້ອງຂອງວັດຖຸ (Object).','You will not be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'ທ່ານຍັງບໍ່ສາມາດຕິດຕັ້ງທີມໃໝ່ຈາກບ່ອນນີ້ໄດ້ ເນື່ອງຈາກການຕິດຕັ້ງຂອງທ່ານຕ້ອງການຂໍ້ມູນ SFTP. ສຳລັບຕອນນີ້, ກະລຸນາ <a href="%s">ເພີ່ມທີມໃນສ່ວນຜູ້ດູແລ</a>.','categoriesMost Used'=>'ໃຊ້ຫຼາຍທີ່ສຸດ','tagsMost Used'=>'ໃຊ້ຫຼາຍທີ່ສຸດ','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'ກົດ &#8220;ຕໍ່ໄປ&#8221; ເພື່ອເລີ່ມເພີ່ມລິ້ງໃສ່ເມນູໃໝ່ຂອງທ່ານ.','customizer changeset action/button labelSchedule'=>'ກຳນົດເວລາ','+ Create New Menu'=>'+ ສ້າງເມນູໃໝ່','Create a menu for this location'=>'ສ້າງເມນູສຳລັບຕຳແໜ່ງນີ້','Could not open handle for %1$s to %2$s.'=>'ບໍ່ສາມາດເປີດ Handle ສຳລັບ %1$s ໄປຫາ %2$s ໄດ້.','Add a navigation menu to your sidebar.'=>'ເພີ່ມເມນູນຳທາງໃສ່ແຖບຂ້າງຂອງທ່ານ.','%s has taken over and is currently customizing.'=>'%s ໄດ້ເຂົ້າແກ້ໄຂແທນ ແລະ ກຳລັງປັບແຕ່ງຢູ່ໃນຂະນະນີ້.','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'ເບິ່ງຄືວ່າມີບາງຢ່າງຜິດພາດ. ກະລຸນາລໍຖ້າຈັກຄາວ ແລ້ວລອງໃໝ່ອີກຄັ້ງ.','Take over'=>'ເຂົ້າແກ້ໄຂແທນ','Go back'=>'ກັບຄືນ','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s ກຳລັງປັບແຕ່ງເວັບໄຊນີ້ຢູ່. ກະລຸນາລໍຖ້າຈົນກວ່າພວກເຂົາຈະເຮັດສຳເລັດກ່ອນຈະເລີ່ມປັບແຕ່ງ. ການປ່ຽນແປງຫຼ້າສຸດຂອງທ່ານໄດ້ຖືກບັນທຶກອັດຕະໂນມັດແລ້ວ.','%s is already customizing this site. Do you want to take over?'=>'%s ກຳລັງປັບແຕ່ງເວັບໄຊນີ້ຢູ່. ທ່ານຕ້ອງການເຂົ້າແກ້ໄຂແທນ (Take over) ຫຼື ບໍ່?','Sorry, you are not allowed to take over.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າແກ້ໄຂແທນ.','No changeset found to take over'=>'ບໍ່ພົບລາຍການການປ່ຽນແປງທີ່ຈະເຂົ້າແກ້ໄຂແທນ','Security check failed.'=>'ການກວດສອບຄວາມປອດໄພລົ້ມເຫຼວ.','Changeset is being edited by other user.'=>'ລາຍການການປ່ຽນແປງກຳລັງຖືກແກ້ໄຂໂດຍຜູ້ໃຊ້ອື່ນ.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'ນີ້ແມ່ນບ່ອນທີ່ເມນູນີ້ຈະສະແດງຜົນ. ຫາກທ່ານຕ້ອງການປ່ຽນແປງ, ກະລຸນາເລືອກຕຳແໜ່ງອື່ນ.','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(ຫາກທ່ານວາງແຜນຈະໃຊ້ <a href="%1$s" %2$s>ວິດເຈັດ%3$s</a> ເມນູ, ສາມາດຂ້າມຂັ້ນຕອນນີ້ໄດ້.)','menu locationsWhere do you want this menu to appear?'=>'ທ່ານຕ້ອງການໃຫ້ເມນູນີ້ສະແດງຢູ່ໃສ?','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'ທ່ານຈະໄດ້ສ້າງເມນູ, ກຳນົດຕຳແໜ່ງ, ແລະ ເພີ່ມລາຍການເມນູ ເຊັ່ນ ລິ້ງໄປຫາໜ້າເວັບ ແລະ ໝວດໝູ່. ຫາກທີມຂອງທ່ານມີພື້ນທີ່ເມນູຫຼາຍບ່ອນ, ທ່ານອາດຈະຕ້ອງສ້າງຫຼາຍກວ່າໜຶ່ງເມນູ.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'ເບິ່ງຄືວ່າເວັບໄຊຂອງທ່ານຍັງບໍ່ທັນມີເມນູເທື່ອ. ຕ້ອງການສ້າງບໍ່? ກົດປຸ່ມເພື່ອເລີ່ມຕົ້ນ.','menu locationsView All Locations'=>'ເບິ່ງຕຳແໜ່ງທັງໝົດ','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'ໃນຂະນະທີ່ເບິ່ງຕົວຢ່າງທີມໃໝ່, ທ່ານສາມາດປັບແຕ່ງສິ່ງຕ່າງໆ ເຊັ່ນ ວິດເຈັດ ແລະ ເມນູ ຕໍ່ໄປໄດ້, ລວມທັງສຳຫຼວດຕົວເລືອກສະເພາະຂອງທີມນັ້ນໆ.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'ກຳລັງຊອກຫາທີມຢູ່ບໍ? ທ່ານສາມາດຄົ້ນຫາ ຫຼື ເລືອກເບິ່ງໃນໄດເຣັກທໍຣີທີມຂອງ WordPress.org, ຕິດຕັ້ງ ແລະ ເບິ່ງຕົວຢ່າງທີມ, ຈາກນັ້ນກໍເປີດໃຊ້ງານໄດ້ທັນທີທີ່ນີ້.','menu locationsView Location'=>'ເບິ່ງຕຳແໜ່ງ','No themes found. Try a different search.'=>'ບໍ່ພົບທີມ. ກະລຸນາລອງຄົ້ນຫາດ້ວຍຄຳສັບອື່ນ.','Your theme can display menus in one location. Select which menu you would like to use.'=>'ທີມຂອງທ່ານສາມາດສະແດງເມນູໄດ້ໃນຕຳແໜ່ງດຽວ. ກະລຸນາເລືອກເມນູທີ່ທ່ານຕ້ອງການໃຊ້.','Site Name: %s'=>'ຊື່ເວັບໄຊ: %s','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaquo; %2$s &#8212; WordPress','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'ການສອບຖາມ (Query) ມີຈຳນວນບ່ອນວາງ (Placeholder) (%1$d) ບໍ່ກົງກັບຈຳນວນອາກິວເມັນທີ່ສົ່ງມາ (%2$d).','Unsupported value type (%s).'=>'ບໍ່ຮອງຮັບປະເພດຄ່າ (%s).','Widgets need to be registered using %s, before they can be displayed.'=>'ວິດເຈັດຈຳເປັນຕ້ອງໄດ້ລົງທະບຽນໂດຍໃຊ້ %s ກ່ອນທີ່ຈະສາມາດສະແດງຜົນໄດ້.','Link to:'=>'ລິ້ງໄປຫາ:','No images selected'=>'ບໍ່ໄດ້ເລືອກຮູບພາບ','Displays an image gallery.'=>'ສະແດງຄັງຮູບພາບ (Gallery).','Gallery'=>'ຄັງຮູບພາບ','Custom HTML Widget'=>'ວິດເຈັດ HTML ກຳນົດເອງ','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'ໃຊ້ວິດເຈັດ HTML ກຳນົດເອງ ເພື່ອເພີ່ມໂຄ້ດ HTML ໃດໜຶ່ງໃສ່ໃນພື້ນທີ່ວິດເຈັດຂອງທ່ານ.','Your email address has not been updated yet. Please check your inbox at %s for a confirmation email.'=>'ທີ່ຢູ່ອີເມລຂອງທ່ານຍັງບໍ່ທັນໄດ້ຮັບການອັບເດດເທື່ອ. ກະລຸນາກວດສອບກ່ອງຈົດໝາຍຂອງທ່ານທີ່ %s ເພື່ອເບິ່ງອີເມລຢືນຢັນ.','Howdy ###USERNAME###,

