###SITEURL###','<strong>Error:</strong> The email address is already used.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ທີ່ຢູ່ອີເມລນີ້ຖືກໃຊ້ແລ້ວ.','&larr; Go to Categories'=>'&larr; ໄປທີ່ໝວດໝູ່','&larr; Go to Link Categories'=>'&larr; ໄປທີ່ໝວດໝູ່ຂອງລິ້ງ','Sorry, you cannot preview new themes when you have changes scheduled or saved as a draft. Please publish your changes, or wait until they publish to preview new themes.'=>'ຂໍອະໄພ, ທ່ານບໍ່ສາມາດເບິ່ງຕົວຢ່າງທີມໃໝ່ໄດ້ໃນຂະນະທີ່ມີການປ່ຽນແປງທີ່ກຳນົດເວລາໄວ້ ຫຼື ບັນທຶກເປັນສະບັບຮ່າງ. ກະລຸນາເຜີຍແຜ່ການປ່ຽນແປງຂອງທ່ານກ່ອນ, ຫຼື ລໍຖ້າຈົນກວ່າພວກມັນຈະຖືກເຜີຍແຜ່ ເພື່ອເບິ່ງຕົວຢ່າງທີມໃໝ່.','Schedule your customization changes to publish ("go live") at a future date.'=>'ກຳນົດເວລາການປ່ຽນແປງການປັບແຕ່ງຂອງທ່ານ ເພື່ອເຜີຍແຜ່ ("go live") ໃນວັນທີທີ່ຕ້ອງການໃນອະນາຄົດ.','Homepage and posts page must be different.'=>'ໜ້າຫຼັກ ແລະ ໜ້າໂພສບົດຄວາມຕ້ອງເປັນຄົນລະໜ້າກັນ.','There is %d error which must be fixed before you can save.'=>'ມີ %d ຂໍ້ຜິດພາດທີ່ຕ້ອງໄດ້ຮັບການແກ້ໄຂກ່ອນທີ່ທ່ານຈະສາມາດບັນທຶກໄດ້.','There is a more recent autosave of your changes than the one you are previewing. <a href="%s">Restore the autosave</a>'=>'ມີການບັນທຶກອັດຕະໂນມັດຂອງການປ່ຽນແປງຂອງທ່ານທີ່ໃໝ່ກວ່າອັນທີ່ທ່ານກຳລັງເບິ່ງຕົວຢ່າງຢູ່. <a href="%s">ກູ້ຄືນການບັນທຶກອັດຕະໂນມັດ</a>','Are you sure you want to discard your unpublished changes?'=>'ທ່ານແນ່ໃຈບໍ່ວ່າຕ້ອງການຍົກເລີກການປ່ຽນແປງທີ່ຍັງບໍ່ໄດ້ເຜີຍແຜ່ຂອງທ່ານ?','Reverting unpublished changes&hellip;'=>'ກຳລັງປ່ຽນຄືນການປ່ຽນແປງທີ່ຍັງບໍ່ໄດ້ເຜີຍແຜ່&hellip;','Setting up your live preview. This may take a bit.'=>'ກຳລັງຕັ້ງຄ່າການເບິ່ງຕົວຢ່າງສົດຂອງທ່ານ. ອາດຈະໃຊ້ເວລາຈັກຄາວ.','Downloading your new theme&hellip;'=>'ກຳລັງດາວໂຫຼດທີມໃໝ່ຂອງທ່ານ&hellip;','Discard changes'=>'ຍົກເລີກການປ່ຽນແປງ','Please save your changes in order to share the preview.'=>'ກະລຸນາບັນທຶກການປ່ຽນແປງຂອງທ່ານກ່ອນ ເພື່ອທີ່ຈະແບ່ງປັນການເບິ່ງຕົວຢ່າງໄດ້.','Updating'=>'ກຳລັງອັບເດດ','Draft Saved'=>'ບັນທຶກສະບັບຮ່າງແລ້ວ','Activate &amp; Publish'=>'ເປີດໃຊ້ງານ ແລະ ເຜີຍແຜ່','Yiddish'=>'ຢິດດິສ','Welsh'=>'ເວລ','Vietnamese'=>'ຫວຽດນາມ','Ukrainian'=>'ອູແກຣນ','Turkish'=>'ຕຸລະກີ','Thai'=>'ໄທ','Tagalog'=>'ຕາກາລັອກ','Swedish'=>'ສະວີເດນ','Swahili'=>'ສະວາຮີລີ','Spanish'=>'ສະເປນ','Slovenian'=>'ສະໂລເວນີ','Slovak'=>'ສະໂລວັກ','Serbian'=>'ເຊີເບຍ','Russian'=>'ຣັດເຊຍ','Romanian'=>'ໂຣມາເນຍ','Portuguese'=>'ປອກຕຸຍການ','Polish'=>'ໂປແລນ','Persian'=>'ເປີເຊຍ','Norwegian'=>'ນໍເວ','Maltese'=>'ມານຕາ','Malay'=>'ມາເລ','Macedonian'=>'ມາເຊໂດເນຍ','Lithuanian'=>'ລິທົວເນຍ','Latvian'=>'ລັດເວຍ','Korean'=>'ເກົາຫຼີ','Japanese'=>'ຍີ່ປຸ່ນ','Italian'=>'ອິຕາລີ','Irish'=>'ໄອຣິສ','Indonesian'=>'ອິນໂດເນເຊຍ','Icelandic'=>'ໄອສແລນ','Hungarian'=>'ຮັງກາຣີ','Hindi'=>'ຮິນດູ','Hebrew'=>'ຮີບຣູ','Haitian Creole'=>'ໄຮຕິ ຄຣີໂອນ','Greek'=>'ເກຣັກ','German'=>'ເຢຍລະມັນ','Galician'=>'ກາລິຊຽນ','French'=>'ຝຣັ່ງ','Filipino'=>'ຟີລິບປິນ','Estonian'=>'ເອສໂຕເນຍ','English'=>'ອັງກິດ','Dutch'=>'ດັດຊ໌','Danish'=>'ເດນມາກ','Czech'=>'ເຊັກ','Croatian'=>'ໂຄຣເອເຊຍ','Chinese (Traditional)'=>'ຈີນ (ດັ້ງເດີມ)','Chinese (Simplified)'=>'ຈີນ (ຕົວຫຍໍ້)','Chinese'=>'ຈີນ','Catalan'=>'ກາຕາລັນ','Bulgarian'=>'ບູນກາຣີ','Belarusian'=>'ເບລາຣຸດ','Arabic'=>'ອາຣັບ','Albanian'=>'ອານບານີ','Afrikaans'=>'ອາຟຣິການ','Live Broadcast'=>'ຖ່າຍທອດສົດ','Chapters'=>'ບົດ','You are using a browser that does not have Flash player enabled or installed. Please turn on your Flash player plugin or download the latest version from https://get.adobe.com/flashplayer/'=>'ທ່ານກຳລັງໃຊ້ບຣາວເຊີທີ່ບໍ່ໄດ້ເປີດໃຊ້ງານ ຫຼື ບໍ່ໄດ້ຕິດຕັ້ງ Flash player. ກະລຸນາເປີດປລັກອິນ Flash player ຂອງທ່ານ ຫຼື ດາວໂຫຼດເວີຊັນຫຼ້າສຸດໄດ້ທີ່ https://get.adobe.com/flashplayer/','Method \'%s\' must be overridden.'=>'ເມທອດ \'%s\' ຕ້ອງໄດ້ຮັບການຂຽນທັບ (Overridden).','oEmbed Response'=>'ການຕອບສະໜອງ oEmbed','oEmbed Responses'=>'ການຕອບສະໜອງ oEmbed ທັງໝົດ','Post custom field name%s:'=>'%s:','Author: %1$s (IP address: %2$s, %3$s)'=>'ຜູ້ຂຽນ: %1$s (ທີ່ຢູ່ IP: %2$s, %3$s)','Website: %1$s (IP address: %2$s, %3$s)'=>'ເວັບໄຊ: %1$s (ທີ່ຢູ່ IP: %2$s, %3$s)','Hi,

