###SITEURL###','Only UUID V4 is supported at this time.'=>'ໃນເວລານີ້ຮອງຮັບພຽງແຕ່ UUID V4 ເທົ່ານັ້ນ.','The Press This plugin is required.'=>'ຈຳເປັນຕ້ອງໃຊ້ປລັກອິນ Press This.','%s themes'=>'%s ທີມ','Filter themes (%s)'=>'ກອງທີມ (%s)','Go to theme sources'=>'ໄປທີ່ແຫຼ່ງທີ່ມາຂອງທີມ','Search WordPress.org themes'=>'ຄົ້ນຫາທີມໃນ WordPress.org','Install &amp; Preview'=>'ຕິດຕັ້ງ ແລະ ເບິ່ງຕົວຢ່າງ','Invalid URL.'=>'URL ບໍ່ຖືກຕ້ອງ.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'ໄດ້ເວລາເພີ່ມລິ້ງແລ້ວ! ກົດ &#8220;%s&#8221; ເພື່ອເລີ່ມເພີ່ມໜ້າເວັບ, ໝວດໝູ່, ແລະ ລິ້ງກຳນົດເອງໃສ່ໃນເມນູຂອງທ່ານ. ທ່ານສາມາດເພີ່ມລາຍການໄດ້ຫຼາຍຕາມທີ່ຕ້ອງການ.','Choose image'=>'ເລືອກຮູບພາບ','Choose audio'=>'ເລືອກສຽງ','Change audio'=>'ປ່ຽນສຽງ','Select audio'=>'ເລືອກສຽງ','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ກົດ &#8220;ເພີ່ມຮູບພາບ&#8221; ເພື່ອອັບໂຫຼດໄຟລ໌ຮູບພາບຈາກຄອມພິວເຕີຂອງທ່ານ. ທີມຂອງທ່ານຈະສະແດງຜົນໄດ້ດີທີ່ສຸດກັບຮູບພາບທີ່ມີຄວາມສູງຂອງສ່ວນຫົວ %s ພິກເຊວ &#8212; ທ່ານສາມາດຕັດຮູບ (Crop) ໄດ້ຫຼັງຈາກອັບໂຫຼດເພື່ອໃຫ້ພໍດີກັບພື້ນທີ່.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ກົດ &#8220;ເພີ່ມຮູບພາບ&#8221; ເພື່ອອັບໂຫຼດໄຟລ໌ຮູບພາບຈາກຄອມພິວເຕີຂອງທ່ານ. ທີມຂອງທ່ານຈະສະແດງຜົນໄດ້ດີທີ່ສຸດກັບຮູບພາບທີ່ມີຄວາມກວ້າງຂອງສ່ວນຫົວ %s ພິກເຊວ &#8212; ທ່ານສາມາດຕັດຮູບ (Crop) ໄດ້ຫຼັງຈາກອັບໂຫຼດເພື່ອໃຫ້ພໍດີກັບພື້ນທີ່.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ກົດ &#8220;ເພີ່ມຮູບພາບ&#8221; ເພື່ອອັບໂຫຼດໄຟລ໌ຮູບພາບຈາກຄອມພິວເຕີຂອງທ່ານ. ທີມຂອງທ່ານຈະສະແດງຜົນໄດ້ດີທີ່ສຸດກັບຮູບພາບທີ່ມີຂະໜາດສ່ວນຫົວ %s ພິກເຊວ &#8212; ທ່ານສາມາດຕັດຮູບ (Crop) ໄດ້ຫຼັງຈາກອັບໂຫຼດເພື່ອໃຫ້ພໍດີກັບພື້ນທີ່.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ກົດ &#8220;ເພີ່ມຮູບພາບ&#8221; ເພື່ອອັບໂຫຼດໄຟລ໌ຮູບພາບຈາກຄອມພິວເຕີຂອງທ່ານ. ທີມຂອງທ່ານຈະສະແດງຜົນໄດ້ດີທີ່ສຸດກັບຮູບພາບທີ່ມີຂະໜາດກົງກັບວິດີໂອຂອງທ່ານ &#8212; ທ່ານສາມາດຕັດຮູບ (Crop) ໄດ້ຫຼັງຈາກອັບໂຫຼດເພື່ອໃຫ້ພໍດີກັບພື້ນທີ່.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'ບອກເວລາ (AM/PM)','Minute'=>'ນາທີ','Hour'=>'ຊົ່ວໂມງ','Time'=>'ເວລາ','Day'=>'ວັນ','Month'=>'ເດືອນ','Date'=>'ວັນທີ','Usage of user levels is deprecated. Use capabilities instead.'=>'ການໃຊ້ລະດັບຜູ້ໃຊ້ (User levels) ຖືກຍົກເລີກແລ້ວ. ກະລຸນາໃຊ້ການກຳນົດສິດ (Capabilities) ແທນ.','The theme defines itself as its parent theme. Please check the %s header.'=>'ທີມນີ້ກຳນົດຕົວເອງເປັນທີມຫຼັກ (Parent theme). ກະລຸນາກວດສອບສ່ວນຫົວ %s.','Name for the Visual editor tabVisual'=>'ແບບເບິ່ງເຫັນພາບ','Create New Menu'=>'ສ້າງເມນູໃໝ່','New Menu'=>'ເມນູໃໝ່','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'ຫາກທີມຂອງທ່ານມີພື້ນທີ່ວິດເຈັດ, ທ່ານຍັງສາມາດເພີ່ມເມນູໃສ່ບ່ອນນັ້ນໄດ້. ໄປທີ່ <a href="%s">ແຖບວິດເຈັດ</a> ແລະ ເພີ່ມ &#8220;ວິດເຈັດເມນູນຳທາງ&#8221; ເພື່ອສະແດງເມນູໃນແຖບຂ້າງ ຫຼື ສ່ວນທ້າຍເວັບ.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'ຫາກທີມຂອງທ່ານມີຫຼາຍເມນູ, ການຕັ້ງຊື່ໃຫ້ຊັດເຈນຈະຊ່ວຍໃຫ້ທ່ານຈັດການພວກມັນໄດ້ງ່າຍຂຶ້ນ.','Your theme can display menus in %s location.'=>'ທີມຂອງທ່ານສາມາດສະແດງເມນູໄດ້ໃນ %s ຕຳແໜ່ງ.','Your theme can display menus in one location.'=>'ທີມຂອງທ່ານສາມາດສະແດງເມນູໄດ້ໃນຕຳແໜ່ງດຽວ.','CSS code'=>'ໂຄ້ດ CSS','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'ຊ່ອງແກ້ໄຂຈະເນັ້ນໄວຍາກອນໂຄ້ດໃຫ້ໂດຍອັດຕະໂນມັດ. ທ່ານສາມາດປິດການໃຊ້ງານນີ້ໄດ້ໃນ <a href="%1$s" %2$s>ໂປຣໄຟລ໌ຜູ້ໃຊ້%3$s</a> ຂອງທ່ານ ເພື່ອເຮັດວຽກໃນຮູບແບບຂໍ້ຄວາມທຳມະດາ.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'ສຳລັບຜູ້ໃຊ້ເຄື່ອງອ່ານໜ້າຈໍ (Screen reader): ເມື່ອຢູ່ໃນໂໝດແບບຟອມ, ທ່ານອາດຈະຕ້ອງກົດປຸ່ມ Esc ສອງຄັ້ງ.','To move away from this area, press the Esc key followed by the Tab key.'=>'ເພື່ອອອກຈາກພື້ນທີ່ນີ້, ໃຫ້ກົດປຸ່ມ Esc ແລ້ວຕາມດ້ວຍປຸ່ມ Tab.','In the editing area, the Tab key enters a tab character.'=>'ໃນພື້ນທີ່ແກ້ໄຂ, ປຸ່ມ Tab ຈະເປັນການຍໍ້ໜ້າ (Tab character).','When using a keyboard to navigate:'=>'ເມື່ອໃຊ້ຄີບອດໃນການນຳທາງ:','Add your own CSS code here to customize the appearance and layout of your site.'=>'ເພີ່ມໂຄ້ດ CSS ຂອງທ່ານເອງຢູ່ບ່ອນນີ້ ເພື່ອປັບແຕ່ງຮູບລັກສະນະ ແລະ ການຈັດວາງຂອງເວັບໄຊ.','Your homepage displays'=>'ໜ້າຫຼັກຂອງທ່ານຈະສະແດງ','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'ທ່ານສາມາດເລືອກສິ່ງທີ່ຈະສະແດງໃນໜ້າຫຼັກຂອງເວັບໄຊໄດ້. ມັນອາດຈະເປັນໂພສບົດຄວາມທີ່ລຽງຕາມລຳດັບເວລາ (ບລັອກແບບຄລາສສິກ), ຫຼື ເປັນໜ້າເວັບທີ່ຄົງທີ່ (Static page). ເພື່ອຕັ້ງໜ້າຫຼັກແບບຄົງທີ່, ກ່ອນອື່ນທ່ານຕ້ອງສ້າງສອງໜ້າເວັບ: ໜ້າໜຶ່ງຈະກາຍເປັນໜ້າຫຼັກ, ແລະ ອີກໜ້າໜຶ່ງຈະເປັນບ່ອນສະແດງໂພສບົດຄວາມຂອງທ່ານ.','Homepage Settings'=>'ການຕັ້ງຄ່າໜ້າຫຼັກ','WordPress.org themes'=>'ທີມຈາກ WordPress.org','Installed themes'=>'ທີມທີ່ຕິດຕັ້ງແລ້ວ','Publish Settings'=>'ການຕັ້ງຄ່າການເຜີຍແຜ່','Copied'=>'ຄັດລອກແລ້ວ','Preview Link'=>'ລິ້ງເບິ່ງຕົວຢ່າງ','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'ເບິ່ງວ່າການປ່ຽນແປງຈະເປັນແນວໃດໃນເວັບໄຊແທ້ຂອງທ່ານ, ແລະ ແບ່ງປັນການເບິ່ງຕົວຢ່າງໃຫ້ກັບຜູ້ທີ່ບໍ່ສາມາດເຂົ້າເຖິງສ່ວນປັບແຕ່ງ (Customizer) ໄດ້.','Share Preview Link'=>'ແບ່ງປັນລິ້ງເບິ່ງຕົວຢ່າງ','Changes trashed successfully.'=>'ຍ້າຍການປ່ຽນແປງໄປຖັງຂີ້ເຫຍື້ອສຳເລັດແລ້ວ.','Changes have already been trashed.'=>'ການປ່ຽນແປງໄດ້ຖືກຍ້າຍໄປຖັງຂີ້ເຫຍື້ອແລ້ວ.','Unable to trash changes.'=>'ບໍ່ສາມາດຍ້າຍການປ່ຽນແປງໄປຖັງຂີ້ເຫຍື້ອໄດ້.','No changes saved yet, so there is nothing to trash.'=>'ຍັງບໍ່ມີການປ່ຽນແປງທີ່ຖືກບັນທຶກເທື່ອ, ຈຶ່ງບໍ່ມີຫຍັງໃຫ້ລຶບ.','There was an authentication problem. Please reload and try again.'=>'ເກີດບັນຫາໃນການຢືນຢັນຕົວຕົນ. ກະລຸນາໂຫຼດໜ້າໃໝ່ ແລ້ວລອງອີກຄັ້ງ.','Unable to save due to %s invalid setting.'=>'ບໍ່ສາມາດບັນທຶກໄດ້ເນື່ອງຈາກມີ %s ການຕັ້ງຄ່າທີ່ບໍ່ຖືກຕ້ອງ.','You must supply a future date to schedule.'=>'ທ່ານຕ້ອງລະບຸວັນທີໃນອະນາຄົດສຳລັບການກຳນົດເວລາ.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'ການປ່ຽນແປງກ່ອນໜ້ານີ້ໄດ້ຖືກເຜີຍແຜ່ແລ້ວ. ກະລຸນາລອງບັນທຶກການປ່ຽນແປງປັດຈຸບັນຂອງທ່ານອີກຄັ້ງ.','Edit User'=>'ແກ້ໄຂຜູ້ໃຊ້','View User'=>'ເບິ່ງຜູ້ໃຊ້','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'ວິດເຈັດນີ້ອາດມີໂຄ້ດທີ່ເຮັດວຽກໄດ້ດີກວ່າໃນວິດເຈັດ &#8220;HTML ກຳນົດເອງ&#8221;. ຫາກທ່ານຍັງບໍ່ໄດ້ລອງ, ໃຫ້ລອງໃຊ້ວິດເຈັດນັ້ນແທນເບິ່ງບໍ?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Code&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'ເບິ່ງຄືວ່າທ່ານຫາກໍ່ວາງ HTML ໃສ່ໃນແທັບ &#8220;ແບບເບິ່ງເຫັນພາບ&#8221; ຂອງວິດເຈັດຂໍ້ຄວາມ. ທ່ານອາດຈະຕ້ອງວາງໂຄ້ດໃນແທັບ &#8220;ໂຄ້ດ&#8221; ແທນ. ຫຼື ອີກທາງເລືອກໜຶ່ງ, ລອງໃຊ້ວິດເຈັດໃໝ່ &#8220;HTML ກຳນົດເອງ&#8221;!','Did you just paste HTML?'=>'ທ່ານຫາກໍ່ວາງ HTML ບໍ່?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'ທ່ານຮູ້ບໍ່ວ່າມີວິດເຈັດ &#8220;HTML ກຳນົດເອງ&#8221; ແລ້ວໃນຕອນນີ້? ທ່ານສາມາດຊອກຫາມັນໄດ້ໃນລາຍການວິດເຈັດທີ່ມີໃຫ້ໃນໜ້ານີ້. ລອງໃຊ້ເບິ່ງເພື່ອເພີ່ມໂຄ້ດກຳນົດເອງໃສ່ເວັບໄຊຂອງທ່ານ!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'ທ່ານຮູ້ບໍ່ວ່າມີວິດເຈັດ &#8220;HTML ກຳນົດເອງ&#8221; ແລ້ວໃນຕອນນີ້? ທ່ານສາມາດຊອກຫາມັນໄດ້ໂດຍການກົດປຸ່ມ &#8220;<a class="add-widget" href="#">ເພີ່ມວິດເຈັດ</a>&#8221; ແລະ ຄົ້ນຫາຄຳວ່າ &#8220;HTML&#8221;. ລອງໃຊ້ເບິ່ງເພື່ອເພີ່ມໂຄ້ດກຳນົດເອງໃສ່ເວັບໄຊຂອງທ່ານ!','New Custom HTML Widget'=>'ວິດເຈັດ HTML ກຳນົດເອງໃໝ່','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'ວິດເຈັດນີ້ອາດມີໂຄ້ດທີ່ເຮັດວຽກໄດ້ດີກວ່າໃນວິດເຈັດ &#8220;HTML ກຳນົດເອງ&#8221;. ລອງໃຊ້ວິດເຈັດນັ້ນແທນເບິ່ງບໍ?','Arbitrary text.'=>'ຂໍ້ຄວາມທົ່ວໄປ.','Some HTML tags are not permitted, including:'=>'ແທັກ HTML ບາງອັນບໍ່ໄດ້ຮັບອະນຸຍາດ, ລວມທັງ:','Custom HTML'=>'HTML ກຳນົດເອງ','Arbitrary HTML code.'=>'ໂຄ້ດ HTML ທົ່ວໄປ.','Show tag counts'=>'ສະແດງຈຳນວນແທັກ','%s item'=>'%s ລາຍການ','label for button in the media widgetAdd Media'=>'ເພີ່ມສື່','label for button in the video widgetAdd Video'=>'ເພີ່ມວິດີໂອ','label for button in the image widgetAdd Image'=>'ເພີ່ມຮູບພາບ','label for button in the audio widgetAdd Audio'=>'ເພີ່ມສຽງ','(no author)'=>'(ບໍ່ມີຜູ້ຂຽນ)','An error occurred. Please try again later.'=>'ເກີດຂໍ້ຜິດພາດ. ກະລຸນາລອງໃໝ່ອີກຄັ້ງໃນພາຍຫຼັງ.','To change or disable registration go to your <a href="%s">Options page</a>.'=>'ເພື່ອປ່ຽນແປງ ຫຼື ປິດການລົງທະບຽນ, ໃຫ້ໄປທີ່ <a href="%s">ໜ້າຕົວເລືອກ</a> ຂອງທ່ານ.','The network currently allows both site and user registrations.'=>'ເຄືອຂ່າຍໃນປັດຈຸບັນອະນຸຍາດໃຫ້ລົງທະບຽນທັງເວັບໄຊ ແລະ ຜູ້ໃຊ້.','The network currently allows user registrations.'=>'ເຄືອຂ່າຍໃນປັດຈຸບັນອະນຸຍາດໃຫ້ລົງທະບຽນຜູ້ໃຊ້.','The network currently allows site registrations.'=>'ເຄືອຂ່າຍໃນປັດຈຸບັນອະນຸຍາດໃຫ້ລົງທະບຽນເວັບໄຊ.','The network currently disallows registrations.'=>'ເຄືອຂ່າຍໃນປັດຈຸບັນບໍ່ອະນຸຍາດໃຫ້ລົງທະບຽນ.','Greetings Network Administrator!'=>'ສະບາຍດີ ຜູ້ດູແລເຄືອຂ່າຍ!','Title for the widget'=>'ຫົວຂໍ້ສຳລັບວິດເຈັດ','URL to the media file'=>'URL ຂອງໄຟລ໌ສື່','Attachment post ID'=>'ID ຂອງໄຟລ໌ແນບ','Looks like this is not the correct kind of file. Please link to an appropriate file instead.'=>'ເບິ່ງຄືວ່າໄຟລ໌ນີ້ບໍ່ຖືກປະເພດ. ກະລຸນາໃຊ້ລິ້ງໄປຫາໄຟລ໌ທີ່ເໝາະສົມແທນ.','Media Widget'=>'ວິດເຈັດສື່','Media Widget (%d)'=>'ວິດເຈັດສື່ (%d)','Add to Widget'=>'ເພີ່ມໃສ່ວິດເຈັດ','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'ແກ້ໄຂສື່','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'ປ່ຽນສື່','No media selected'=>'ບໍ່ໄດ້ເລືອກສື່','A media item.'=>'ລາຍການສື່.','URL to the %s video source file'=>'URL ຂອງໄຟລ໌ວິດີໂອ %s','Video Widget'=>'ວິດເຈັດວິດີໂອ','Video Widget (%d)'=>'ວິດເຈັດວິດີໂອ (%d)','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'ແກ້ໄຂວິດີໂອ','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'ປ່ຽນວິດີໂອ','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'ເພີ່ມຮູບພາບ','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'ສະແດງວິດີໂອຈາກຄັງສື່ ຫຼື ຈາກ YouTube, Vimeo, ຫຼື ຜູ້ໃຫ້ບໍລິການອື່ນໆ.','Image Widget'=>'ວິດເຈັດຮູບພາບ','Image Widget (%d)'=>'ວິດເຈັດຮູບພາບ (%d)','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'ແກ້ໄຂຮູບພາບ','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'ປ່ຽນຮູບພາບ','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'ແກ້ໄຂຄັງຮູບພາບ','Displays an image.'=>'ສະແດງຮູບພາບ.','Unable to preview media due to an unknown error.'=>'ບໍ່ສາມາດເບິ່ງຕົວຢ່າງສື່ໄດ້ເນື່ອງຈາກຂໍ້ຜິດພາດທີ່ບໍ່ຮູ້ສາເຫດ.','URL to the %s audio source file'=>'URL ຂອງໄຟລ໌ສຽງ %s','Looks like this is not the correct kind of file. Please link to an audio file instead.'=>'ເບິ່ງຄືວ່າໄຟລ໌ນີ້ບໍ່ຖືກປະເພດ. ກະລຸນາໃຊ້ລິ້ງໄປຫາໄຟລ໌ສຽງແທນ.','Audio Widget'=>'ວິດເຈັດສຽງ','Audio Widget (%d)'=>'ວິດເຈັດສຽງ (%d)','label for button in the audio widget; should preferably not be longer than ~13 characters longEdit Audio'=>'ແກ້ໄຂສຽງ','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'ປ່ຽນສຽງ','No audio selected'=>'ບໍ່ໄດ້ເລືອກສຽງ','Displays an audio player.'=>'ສະແດງເຄື່ອງຫຼິ້ນສຽງ.','%1$s must be less than or equal to %2$d'=>'%1$s ຕ້ອງນ້ອຍກວ່າ ຫຼື ເທົ່າກັບ %2$d','%1$s must be less than %2$d'=>'%1$s ຕ້ອງນ້ອຍກວ່າ %2$d','%1$s must be greater than or equal to %2$d'=>'%1$s ຕ້ອງຫຼາຍກວ່າ ຫຼື ເທົ່າກັບ %2$d','%1$s must be greater than %2$d'=>'%1$s ຕ້ອງຫຼາຍກວ່າ %2$d','Limit result set to users with one or more specific slugs.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຜູ້ໃຊ້ທີ່ມີ Slug ໃດໜຶ່ງ.','Limit result set to terms with one or more specific slugs.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳສັບທີ່ມີ Slug ໃດໜຶ່ງ.','The page number requested is larger than the number of pages available.'=>'ເລກໜ້າທີ່ຮ້ອງຂໍມີຄ່າຫຼາຍກວ່າຈຳນວນໜ້າທີ່ມີຢູ່.','You need to define an include parameter to order by include.'=>'ທ່ານຕ້ອງກຳນົດພາລາມິເຕີ Include ເພື່ອຈັດລຽງຕາມລາຍການທີ່ລວມເຂົ້າ.','All features, supported by the post type.'=>'ຄຸນສົມບັດທັງໝົດທີ່ຮອງຮັບໂດຍປະເພດໂພສນີ້.','The password for the parent post of the comment (if the post is password protected).'=>'ລະຫັດຜ່ານສຳລັບໂພສຫຼັກຂອງຄວາມຄິດເຫັນ (ຫາກໂພສນັ້ນຖືກປ້ອງກັນດ້ວຍລະຫັດຜ່ານ).','pageUse as featured image'=>'ໃຊ້ເປັນຮູບພາບເດັ່ນ','postUse as featured image'=>'ໃຊ້ເປັນຮູບພາບເດັ່ນ','pageRemove featured image'=>'ລຶບຮູບພາບເດັ່ນອອກ','postRemove featured image'=>'ລຶບຮູບພາບເດັ່ນອອກ','pageSet featured image'=>'ຕັ້ງຮູບພາບເດັ່ນ','postSet featured image'=>'ຕັ້ງຮູບພາບເດັ່ນ','pageFeatured image'=>'ຮູບພາບເດັ່ນ','postFeatured image'=>'ຮູບພາບເດັ່ນ','%1$s is deprecated. The callback from %2$s is used instead.'=>'%1$s ຖືກຍົກເລີກແລ້ວ. ໃຫ້ໃຊ້ Callback ຈາກ %2$s ແທນ.','You are about to permanently delete these items from your site.
