ການດຳເນີນການນີ້ບໍ່ສາມາດປ່ຽນຄືນໄດ້.
 ກົດ \'Cancel\' ເພື່ອຢຸດ, \'OK\' ເພື່ອລຶບ.','Suggested image dimensions: %1$s by %2$s pixels.'=>'ຂະໜາດຮູບພາບທີ່ແນະນຳ: %1$s ຄູນ %2$s ພິກເຊວ.','Sorry, comments are not allowed for this item.'=>'ຂໍອະໄພ, ບໍ່ອະນຸຍາດໃຫ້ສະແດງຄວາມຄິດເຫັນສຳລັບລາຍການນີ້.','Sorry, you are not allowed to make proxied oEmbed requests.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຮ້ອງຂໍ oEmbed ຜ່ານພຣັອກຊີ (Proxy).','Whether to perform an oEmbed discovery request for unsanctioned providers.'=>'ຕ້ອງການດຳເນີນການຮ້ອງຂໍຄົ້ນຫາ oEmbed ສຳລັບຜູ້ໃຫ້ບໍລິການທີ່ບໍ່ໄດ້ຮັບການຮັບຮອງ ຫຼື ບໍ່.','The maximum height of the embed frame in pixels.'=>'ຄວາມສູງສູງສຸດຂອງເຟຣມຝັງຕົວ (Embed frame) ເປັນພິກເຊວ.','The maximum width of the embed frame in pixels.'=>'ຄວາມກວ້າງສູງສຸດຂອງເຟຣມຝັງຕົວ (Embed frame) ເປັນພິກເຊວ.','The oEmbed format to use.'=>'ຮູບແບບ oEmbed ທີ່ຈະໃຊ້.','The URL of the resource for which to fetch oEmbed data.'=>'URL ຂອງແຫຼ່ງຂໍ້ມູນທີ່ຈະດຶງຂໍ້ມູນ oEmbed.','Short for blue in RGBB'=>'B','Short for green in RGBG'=>'G','Short for red in RGBR'=>'R','Insert/edit media'=>'ແຊກ/ແກ້ໄຂສື່','Insert/edit code sample'=>'ແຊກ/ແກ້ໄຂຕົວຢ່າງໂຄ້ດ','Table of Contents'=>'ສາລະບານ','Date/time'=>'ວັນທີ/ເວລາ','Id for link anchor (TinyMCE)Id'=>'ID','Id should start with a letter, followed only by letters, numbers, dashes, dots, colons or underscores.'=>'ID ຄວນເລີ່ມຕົ້ນດ້ວຍຕົວອັກສອນ, ຕາມດ້ວຍຕົວອັກສອນ, ຕົວເລກ, ຂີດຕໍ່ (-), ຈຸດ (.), ຈໍ້າສອງເມັດ (:) ຫຼື ຂີດກ້ອງ (_) ເທົ່ານັ້ນ.','You can navigate to other pages on your site while using the Customizer to view and edit the widgets displayed on those pages.'=>'ທ່ານສາມາດນຳທາງໄປຫາໜ້າອື່ນໆໃນເວັບໄຊຂອງທ່ານ ໃນຂະນະທີ່ໃຊ້ສ່ວນປັບແຕ່ງ (Customizer) ເພື່ອເບິ່ງ ແລະ ແກ້ໄຂວິດເຈັດທີ່ສະແດງໃນໜ້າເຫຼົ່ານັ້ນ.','Your theme has %s widget area, but this particular page does not display it.'=>'ທີມຂອງທ່ານມີພື້ນທີ່ວິດເຈັດ %s ບ່ອນ, ແຕ່ໜ້ານີ້ບໍ່ໄດ້ສະແດງພວກມັນ.','Your theme has 1 widget area, but this particular page does not display it.'=>'ທີມຂອງທ່ານມີພື້ນທີ່ວິດເຈັດ 1 ບ່ອນ, ແຕ່ໜ້ານີ້ບໍ່ໄດ້ສະແດງມັນ.','Your theme has %s other widget area, but this particular page does not display it.'=>'ທີມຂອງທ່ານມີພື້ນທີ່ວິດເຈັດອື່ນໆອີກ %s ບ່ອນ, ແຕ່ໜ້ານີ້ບໍ່ໄດ້ສະແດງພວກມັນ.','Your theme has 1 other widget area, but this particular page does not display it.'=>'ທີມຂອງທ່ານມີພື້ນທີ່ວິດເຈັດອື່ນອີກ 1 ບ່ອນ, ແຕ່ໜ້ານີ້ບໍ່ໄດ້ສະແດງມັນ.','This address is used for admin purposes, like new user notification.'=>'ທີ່ຢູ່ນີ້ໃຊ້ສຳລັບວຽກງານຜູ້ດູແລລະບົບ ເຊັ່ນ ການແຈ້ງເຕືອນຜູ້ໃຊ້ໃໝ່.','Unique identifier for the term.'=>'ຕົວລະບຸສະເພາະສຳລັບຄຳສັບ.','Required to be true, as terms do not support trashing.'=>'ຕ້ອງເປັນຈິງ (True), ເນື່ອງຈາກຄຳສັບບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ.','An alphanumeric identifier for the taxonomy.'=>'ຕົວລະບຸແບບຕົວອັກສອນ ແລະ ຕົວເລກສຳລັບ Taxonomy.','Required to be true, as revisions do not support trashing.'=>'ຕ້ອງເປັນຈິງ (True), ເນື່ອງຈາກເວີຊັນການແກ້ໄຂບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ.','REST base route for the post type.'=>'ເສັ້ນທາງພື້ນຖານ (Base route) ຂອງ REST ສຳລັບປະເພດໂພສ.','An alphanumeric identifier for the post type.'=>'ຕົວລະບຸແບບຕົວອັກສອນ ແລະ ຕົວເລກສຳລັບປະເພດໂພສ.','Human-readable labels for the post type for various contexts.'=>'ປ້າຍຊື່ທີ່ອ່ານງ່າຍສຳລັບປະເພດໂພສໃນເນື້ອໃນຕ່າງໆ.','Whether or not the post type should have children.'=>'ປະເພດໂພສຄວນຈະມີລາຍການຍ່ອຍ (Children) ຫຼື ບໍ່.','A human-readable description of the post type.'=>'ຄຳອະທິບາຍປະເພດໂພສທີ່ອ່ານເຂົ້າໃຈງ່າຍ.','All capabilities used by the post type.'=>'ສິດການໃຊ້ງານທັງໝົດທີ່ໃຊ້ໂດຍປະເພດໂພສ.','An alphanumeric identifier for the status.'=>'ຕົວລະບຸແບບຕົວອັກສອນ ແລະ ຕົວເລກສຳລັບສະຖານະ.','Limit response to comments published before a given ISO8601 compliant date.'=>'ຈຳກັດການຕອບສະໜອງສະເພາະຄວາມຄິດເຫັນທີ່ເຜີຍແຜ່ກ່ອນວັນທີທີ່ກຳນົດຕາມມາດຕະຖານ ISO8601.','Limit response to comments published after a given ISO8601 compliant date.'=>'ຈຳກັດການຕອບສະໜອງສະເພາະຄວາມຄິດເຫັນທີ່ເຜີຍແຜ່ຫຼັງວັນທີທີ່ກຳນົດຕາມມາດຕະຖານ ISO8601.','Avatar URLs for the user.'=>'URL ຮູບແທນຕົວ (Avatar) ຂອງຜູ້ໃຊ້.','Roles assigned to the user.'=>'ບົດບາດທີ່ມອບໝາຍໃຫ້ກັບຜູ້ໃຊ້.','The nickname for the user.'=>'ຊື່ຫຼິ້ນຂອງຜູ້ໃຊ້.','Locale for the user.'=>'ພາສາທ້ອງຖິ່ນ (Locale) ຂອງຜູ້ໃຊ້.','Author URL of the user.'=>'URL ຜູ້ຂຽນຂອງຜູ້ໃຊ້.','Description of the user.'=>'ຄຳອະທິບາຍຂອງຜູ້ໃຊ້.','URL of the user.'=>'URL ຂອງຜູ້ໃຊ້.','Last name for the user.'=>'ນາມສະກຸນຂອງຜູ້ໃຊ້.','First name for the user.'=>'ຊື່ຂອງຜູ້ໃຊ້.','Display name for the user.'=>'ຊື່ທີ່ສະແດງຂອງຜູ້ໃຊ້.','Login name for the user.'=>'ຊື່ເຂົ້າລະບົບຂອງຜູ້ໃຊ້.','The user cannot be deleted.'=>'ບໍ່ສາມາດລຶບຜູ້ໃຊ້ນີ້ໄດ້.','Error creating new user.'=>'ເກີດຂໍ້ຜິດພາດໃນການສ້າງຜູ້ໃຊ້ໃໝ່.','The parent term ID.'=>'ID ຂອງຄຳສັບຫຼັກ.','HTML title for the term.'=>'ຫົວຂໍ້ HTML ສຳລັບຄຳສັບ.','URL of the term.'=>'URL ຂອງຄຳສັບ.','The term cannot be deleted.'=>'ບໍ່ສາມາດລຶບຄຳສັບນີ້ໄດ້.','Sorry, you are not allowed to view themes.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເບິ່ງທີມ.','Cannot set parent term, taxonomy is not hierarchical.'=>'ບໍ່ສາມາດຕັ້ງຄຳສັບຫຼັກໄດ້ ເນື່ອງຈາກ Taxonomy ນີ້ບໍ່ໄດ້ຈັດລຳດັບຊັ້ນ.','Term does not exist.'=>'ຄຳສັບນີ້ບໍ່ມີຢູ່ໃນລະບົບ.','Types associated with the taxonomy.'=>'ປະເພດທີ່ກ່ຽວຂ້ອງກັບ Taxonomy.','The title for the taxonomy.'=>'ຫົວຂໍ້ສຳລັບ Taxonomy.','The title for the post type.'=>'ຫົວຂໍ້ສຳລັບປະເພດໂພສ.','Cannot view post type.'=>'ບໍ່ສາມາດເບິ່ງປະເພດໂພສໄດ້.','The title for the status.'=>'ຫົວຂໍ້ສຳລັບສະຖານະ.','Cannot view status.'=>'ບໍ່ສາມາດເບິ່ງສະຖານະໄດ້.','Invalid status.'=>'ສະຖານະບໍ່ຖືກຕ້ອງ.','URL to the original attachment file.'=>'URL ຂອງໄຟລ໌ແນບຕົ້ນສະບັບ.','The attachment MIME type.'=>'ປະເພດ MIME ຂອງໄຟລ໌ແນບ.','Attachment type.'=>'ປະເພດໄຟລ໌ແນບ.','The attachment description.'=>'ຄຳອະທິບາຍໄຟລ໌ແນບ.','The attachment caption.'=>'ຄຳບັນຍາຍໄຟລ໌ແນບ.','Default post category.'=>'ໝວດໝູ່ໂພສເລີ່ມຕົ້ນ.','Site tagline.'=>'ຄຳຂວັນຂອງເວັບໄຊ (Tagline).','theme authorBy %s'=>'ໂດຍ %s','New user notification email subject[%1$s] Activate %2$s'=>'[%1$s] ເປີດໃຊ້ງານ %2$s','New site notification email subject[%1$s] Activate %2$s'=>'[%1$s] ເປີດໃຊ້ງານ %2$s','RSS Error:'=>'ຂໍ້ຜິດພາດ RSS:','Cannot create a comment with that type.'=>'ບໍ່ສາມາດສ້າງຄວາມຄິດເຫັນດ້ວຍປະເພດນັ້ນໄດ້.','Invalid slug.'=>'Slug ບໍ່ຖືກຕ້ອງ.','Invalid email address.'=>'ທີ່ຢູ່ອີເມລບໍ່ຖືກຕ້ອງ.','Invalid comment content.'=>'ເນື້ອໃນຄວາມຄິດເຫັນບໍ່ຖືກຕ້ອງ.','Invalid JSONP callback function.'=>'ຟັງຊັນ JSONP callback ບໍ່ຖືກຕ້ອງ.','Invalid page template.'=>'ແມ່ແບບໜ້າເວັບບໍ່ຖືກຕ້ອງ.','Invalid date.'=>'ວັນທີບໍ່ຖືກຕ້ອງ.','Video is playing.'=>'ວິດີໂອກຳລັງຫຼິ້ນ.','Video is paused.'=>'ວິດີໂອຖືກຢຸດຊົ່ວຄາວ.','Theme starter contentArchives'=>'ຄັງເກັບ','Theme starter contentThis is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.'=>'ນີ້ແມ່ນຕົວຢ່າງຂອງສ່ວນໜ້າຫຼັກ. ສ່ວນໜ້າຫຼັກສາມາດເປັນໜ້າໃດກໍໄດ້ນອກຈາກໜ້າຫຼັກເອງ, ລວມທັງໜ້າທີ່ສະແດງບົດຄວາມບລັອກຫຼ້າສຸດຂອງທ່ານ.','Theme starter contentNews'=>'ຂ່າວສານ','Theme starter contentThis is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.'=>'ນີ້ແມ່ນໜ້າທີ່ມີຂໍ້ມູນການຕິດຕໍ່ພື້ນຖານ ເຊັ່ນ: ທີ່ຢູ່ ແລະ ເບີໂທລະສັບ. ທ່ານຍັງສາມາດລອງໃຊ້ປລັກອິນເພື່ອເພີ່ມຟອມການຕິດຕໍ່ໄດ້.','Theme starter contentYou might be an artist who would like to introduce yourself and your work here or maybe you are a business with a mission to describe.'=>'ທ່ານອາດຈະເປັນສິນລະປິນທີ່ຢາກແນະນຳຕົວເອງ ແລະ ຜົນງານຂອງທ່ານຢູ່ທີ່ນີ້ ຫຼື ບາງທີທ່ານອາດຈະເປັນທຸລະກິດທີ່ມີພາລະກິດທີ່ຕ້ອງການອະທິບາຍ.','Theme starter contentWelcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.'=>'ຍິນດີຕ້ອນຮັບເຂົ້າສູ່ເວັບໄຊຂອງທ່ານ! ນີ້ແມ່ນໜ້າຫຼັກຂອງທ່ານ, ເຊິ່ງແມ່ນສິ່ງທີ່ຜູ້ເຂົ້າຊົມສ່ວນໃຫຍ່ຈະເຫັນເມື່ອພວກເຂົາມາທີ່ເວັບໄຊຂອງທ່ານເປັນຄັ້ງທຳອິດ.','Theme starter contentRecent Posts'=>'ບົດຄວາມໃໝ່ໆ','Theme starter contentRecent Comments'=>'ຄຳເຫັນໃໝ່ໆ','Theme starter contentMeta'=>'ເມຕາ','Theme starter contentCalendar'=>'ປະຕິທິນ','Sorry, you are not allowed to change the comment type.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ປ່ຽນປະເພດຄຳເຫັນ.','Sorry, you are no