gth constraintsHide Controls'=>'ເຊື່ອງການຄວບຄຸມ','Document Preview'=>'ເບິ່ງຕົວຢ່າງເອກະສານ','Header Media'=>'ສື່ສ່ວນຫົວ','REST base route for the taxonomy.'=>'REST base route ສຳລັບ Taxonomy.','+ %s'=>'+ %s','default site languageSite Default'=>'ຄ່າເລີ່ມຕົ້ນຂອງເວັບໄຊ','HTML description for the attachment, transformed for display.'=>'ຄຳອະທິບາຍ HTML ສຳລັບໄຟລ໌ແນບ, ຖືກແປງເພື່ອສະແດງຜົນ.','Description for the attachment, as it exists in the database.'=>'ຄຳອະທິບາຍສຳລັບໄຟລ໌ແນບ, ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','HTML caption for the attachment, transformed for display.'=>'ຄຳບັນຍາຍ HTML ສຳລັບໄຟລ໌ແນບ, ຖືກແປງເພື່ອສະແດງຜົນ.','Caption for the attachment, as it exists in the database.'=>'ຄຳບັນຍາຍສຳລັບໄຟລ໌ແນບ, ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','Please enter a valid YouTube URL.'=>'ກະລຸນາປ້ອນ URL ຂອງ YouTube ທີ່ຖືກຕ້ອງ.','Users do not support trashing. Set \'%s\' to delete.'=>'ຜູ້ໃຊ້ບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ. ຕັ້ງຄ່າ \'%s\' ເພື່ອລຶບ.','Terms do not support trashing. Set \'%s\' to delete.'=>'ຄຳສັບບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ. ຕັ້ງຄ່າ \'%s\' ເພື່ອລຶບ.','Revisions do not support trashing. Set \'%s\' to delete.'=>'ລຸ້ນການແກ້ໄຂບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ. ຕັ້ງຄ່າ \'%s\' ເພື່ອລຶບ.','The post does not support trashing. Set \'%s\' to delete.'=>'ບົດຄວາມບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ. ຕັ້ງຄ່າ \'%s\' ເພື່ອລຶບ.','The comment does not support trashing. Set \'%s\' to delete.'=>'ຄຳເຫັນບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ. ຕັ້ງຄ່າ \'%s\' ເພື່ອລຶບ.','Or, enter a YouTube URL:'=>'ຫຼື, ປ້ອນ URL ຂອງ YouTube:','Invalid JSON body passed.'=>'JSON body ທີ່ສົ່ງມາບໍ່ຖືກຕ້ອງ.','Limit result set to posts assigned one or more statuses.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະບົດຄວາມທີ່ມີໜຶ່ງ ຫຼື ຫຼາຍສະຖານະ.','Comment field exceeds maximum length allowed.'=>'ຊ່ອງຄຳເຫັນຍາວເກີນກຳນົດ.','Taxonomies associated with post type.'=>'Taxonomies ທີ່ກ່ຽວຂ້ອງກັບປະເພດບົດຄວາມ.','Limit result set to posts with one or more specific slugs.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະບົດຄວາມທີ່ມີ slug ສະເພາະໜຶ່ງ ຫຼື ຫຼາຍອັນ.','Comment is required.'=>'ຈຳເປັນຕ້ອງມີຄຳເຫັນ.','Empty title.'=>'ຫົວຂໍ້ຫວ່າງເປົ່າ.','Sorry, trackbacks are closed for this item.'=>'ຂໍອະໄພ, trackbacks ຖືກປິດສຳລັບລາຍການນີ້.','I really need an ID for this to work.'=>'ຈຳເປັນຕ້ອງມີ ID ເພື່ອໃຫ້ສິ່ງນີ້ເຮັດວຽກ.','Homepage'=>'ໜ້າຫຼັກ','%1$s must be between %2$d (inclusive) and %3$d (inclusive)'=>'%1$s ຕ້ອງຢູ່ລະຫວ່າງ %2$d (ລວມ) ແລະ %3$d (ລວມ)','%1$s must be between %2$d (exclusive) and %3$d (inclusive)'=>'%1$s ຕ້ອງຢູ່ລະຫວ່າງ %2$d (ບໍ່ລວມ) ແລະ %3$d (ລວມ)','%1$s must be between %2$d (inclusive) and %3$d (exclusive)'=>'%1$s ຕ້ອງຢູ່ລະຫວ່າງ %2$d (ລວມ) ແລະ %3$d (ບໍ່ລວມ)','%1$s must be between %2$d (exclusive) and %3$d (exclusive)'=>'%1$s ຕ້ອງຢູ່ລະຫວ່າງ %2$d (ບໍ່ລວມ) ແລະ %3$d (ບໍ່ລວມ)','%s is not a valid IP address.'=>'%s ບໍ່ແມ່ນທີ່ຢູ່ IP ທີ່ຖືກຕ້ອງ.','%1$s is not of type %2$s.'=>'%1$s ບໍ່ແມ່ນປະເພດ %2$s.','%1$s is not one of %2$s.'=>'%1$s ບໍ່ແມ່ນໜຶ່ງໃນ %2$s.','Meta fields.'=>'ຟິວເມຕາ.','Could not delete meta value from database.'=>'ບໍ່ສາມາດລຶບຄ່າເມຕາຈາກຖານຂໍ້ມູນ.','Limit result set to users matching at least one specific role provided. Accepts csv list or single role.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຜູ້ໃຊ້ທີ່ມີບົດບາດຢ່າງໜ້ອຍໜຶ່ງອັນທີ່ລະບຸໄວ້. ຮອງຮັບລາຍການແບບ csv ຫຼື ບົດບາດດຽວ.','Any extra capabilities assigned to the user.'=>'ຄວາມສາມາດເພີ່ມເຕີມໃດໆ ທີ່ມອບໝາຍໃຫ້ກັບຜູ້ໃຊ້.','All capabilities assigned to the user.'=>'ຄວາມສາມາດທັງໝົດທີ່ມອບໝາຍໃຫ້ກັບຜູ້ໃຊ້.','Password for the user (never included).'=>'ລະຫັດຜ່ານສຳລັບຜູ້ໃຊ້ (ບໍ່ເຄີຍຖືກລວມເຂົ້າ).','Registration date for the user.'=>'ວັນທີລົງທະບຽນຂອງຜູ້ໃຊ້.','The email address for the user.'=>'ທີ່ຢູ່ອີເມວຂອງຜູ້ໃຊ້.','The role %s does not exist.'=>'ບົດບາດ %s ບໍ່ມີ.','Invalid user ID for reassignment.'=>'ໄອດີຜູ້ໃຊ້ບໍ່ຖືກຕ້ອງສຳລັບການມອບໝາຍໃໝ່.','Sorry, you are not allowed to delete this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ລຶບຜູ້ໃຊ້ນີ້.','Username is not editable.'=>'ຊື່ຜູ້ໃຊ້ບໍ່ສາມາດແກ້ໄຂໄດ້.','Sorry, you are not allowed to edit roles of this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ແກ້ໄຂບົດບາດຂອງຜູ້ໃຊ້ນີ້.','Sorry, you are not allowed to delete this revision.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ລຶບລຸ້ນການແກ້ໄຂນີ້.','Cannot create existing user.'=>'ບໍ່ສາມາດສ້າງຜູ້ໃຊ້ທີ່ມີຢູ່ແລ້ວ.','You are not currently logged in.'=>'ທ່ານຍັງບໍ່ໄດ້ເຂົ້າສູ່ລະບົບ.','Limit result set to terms assigned to a specific post.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳສັບທີ່ຖືກກຳນົດໃຫ້ກັບບົດຄວາມໃດໜຶ່ງ.','Limit result set to terms assigned to a specific parent.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳສັບທີ່ຖືກກຳນົດໃຫ້ກັບຕົວຫຼັກໃດໜຶ່ງ.','Whether to hide terms not assigned to any posts.'=>'ກຳນົດວ່າຈະເຊື່ອງຄຳສັບທີ່ບໍ່ໄດ້ຖືກກຳນົດໃຫ້ກັບບົດຄວາມໃດໆ ຫຼື ບໍ່.','Sort collection by term attribute.'=>'ຈັດລຽງຕາມຄຸນລັກສະນະຂອງຄຳສັບ.','The ID for the parent of the revision.'=>'ໄອດີຂອງຕົວຫຼັກຂອງລຸ້ນການແກ້ໄຂ.','Type attribution for the term.'=>'ກຳນົດປະເພດສຳລັບຄຳສັບ.','An alphanumeric identifier for the term unique to its type.'=>'ຕົວລະບຸຕົວອັກສອນ ແລະ ຕົວເລກສຳລັບຄຳສັບທີ່ບໍ່ຊໍ້າກັນໃນປະເພດນັ້ນໆ.','HTML description of the term.'=>'ຄຳອະທິບາຍ HTML ຂອງຄຳສັບ.','Number of published posts for the term.'=>'ຈຳນວນບົດຄວາມທີ່ເຜີຍແຜ່ສຳລັບຄຳສັບນີ້.','Unique identifier for the user.'=>'ຕົວລະບຸສະເພາະສຳລັບຜູ້ໃຊ້.','The template cannot be deleted.'=>'ແມ່ແບບບໍ່ສາມາດລຶບໄດ້.','Required to be true, as users do not support trashing.'=>'ຈຳເປັນຕ້ອງເປັນ true, ເນື່ອງຈາກຜູ້ໃຊ້ບໍ່ຮອງຮັບການຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ.','Limit results to taxonomies associated with a specific post type.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະ Taxonomies ທີ່ກ່ຽວຂ້ອງກັບປະເພດບົດຄວາມໃດໜຶ່ງ.','Whether or not the term cloud should be displayed.'=>'ກຳນົດວ່າຈະສະແດງ Term cloud ຫຼື ບໍ່.','The %s property has an invalid stored value, and cannot be updated to null.'=>'ຄຸນສົມບັດ %s ມີຄ່າທີ່ບັນທຶກໄວ້ບໍ່ຖືກຕ້ອງ ແລະ ບໍ່ສາມາດອັບເດດເປັນ null ໄດ້.','Invalid revision ID.'=>'ໄອດີລຸ້ນການແກ້ໄຂບໍ່ຖືກຕ້ອງ.','Status is forbidden.'=>'ສະຖານະຖືກຫ້າມ.','Limit result set to items that are sticky.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະລາຍການທີ່ຖືກປັກໝຸດ.','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'ຈຳກັດຜົນການຄົ້ນຫາທຸກລາຍການ ຍົກເວັ້ນລາຍການທີ່ມີຄຳສັບສະເພາະໃນ taxonomy %s.','Limit result set to all items except those of a particular parent ID.'=>'ຈຳກັດຜົນການຄົ້ນຫາທຸກລາຍການ ຍົກເວັ້ນລາຍການທີ່ມີໄອດີຕົວຫຼັກສະເພາະ.','Limit result set to items with particular parent IDs.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະລາຍການທີ່ມີໄອດີຕົວຫຼັກທີ່ລະບຸ.','Offset the result set by a specific number of items.'=>'ກຳນົດການເລີ່ມຕົ້ນຂອງຜົນການຄົ້ນຫາຕາມຈຳນວນລາຍການທີ່ລະບຸ.','Limit result set to posts with a specific menu_order value.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະບົດຄວາມທີ່ມີຄ່າ menu_order ທີ່ລະບຸ.','Ensure result set excludes posts assigned to specific authors.'=>'ຮັບປະກັນວ່າຜົນການຄົ້ນຫາບໍ່ລວມບົດຄວາມທີ່ມອບໝາຍໃຫ້ຜູ້ຂຽນສະເພາະ.','Limit result set to posts assigned to specific authors.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະບົດຄວາມທີ່ມອບໝາຍໃຫ້ຜູ້ຂຽນສະເພາະ.','The terms assigned to the post in the %s taxonomy.'=>'ຄຳສັບທີ່ຖືກມອບໝາຍໃຫ້ກັບບົດຄວາມໃນ taxonomy %s.','The theme file to use to display the post.'=>'ໄຟລ໌ທິມທີ່ຈະໃຊ້ເພື່ອສະແດງບົດຄວາມ.','A password to protect access to the content and excerpt.'=>'ລະຫັດຜ່ານເພື່ອປົກປ້ອງການເຂົ້າເຖິງເນື້ອຫາ ແລະ ບົດຄັດຫຍໍ້.','Whether or not the post should be treated as sticky.'=>'ກຳນົດວ່າບົດຄວາມຄວນຖືກປັກໝຸດ ຫຼື ບໍ່.','The format for the post.'=>'ຮູບແບບຂອງບົດຄວາມ.','Whether or not the post can be pinged.'=>'ກຳນົດວ່າບົດຄວາມສາມາດຖືກ ping ໄດ້ ຫຼື ບໍ່.','Whether or not comments are open on the post.'=>'ກຳນົດວ່າຈະເປີດໃຫ້ສະແດງຄຳເຫັນໃນບົດຄວາມ ຫຼື ບໍ່.','The ID of the featured media for the post.'=>'ໄອດີຂອງສື່ເດັ່ນສຳລັບບົດຄວາມ.','Whether the excerpt is protected with a password.'=>'ກຳນົດວ່າບົດຄັດຫຍໍ້ຖືກປົກປ້ອງດ້ວຍລະຫັດຜ່ານ ຫຼື ບໍ່.','HTML excerpt for the post, transformed for display.'=>'ບົດຄັດຫຍໍ້ HTML ສຳລັບບົດຄວາມ, ຖືກແປງເພື່ອສະແດງຜົນ.','Excerpt for the post, as it exists in the database.'=>'ບົດຄັດຫຍໍ້ສຳລັບບົດຄວາມ, ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','The excerpt for the post.'=>'ບົດຄັດຫຍໍ້ສຳລັບບົດຄວາມ.','The ID for the author of the post.'=>'ໄອດີຂອງຜູ້ຂຽນບົດຄວາມ.','Whether the content is protected with a password.'=>'ກຳນົດວ່າເນື້ອຫາຖືກປົກປ້ອງດ້ວຍລະຫັດຜ່ານ ຫຼື ບໍ່.','HTML title for the post, transformed for display.'=>'ຫົວຂໍ້ HTML ສຳລັບບົດຄວາມ, ຖືກແປງເພື່ອສະແດງຜົນ.','Title for the post, as it exists in the database.'=>'ຫົວຂໍ້ບົດຄວາມ, ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','The title for the object.'=>'ຫົວຂໍ້ສຳລັບວັດຖຸ.','A named status for the post.'=>'ຊື່ສະຖານະສຳລັບບົດຄວາມ.','An alphanumeric identifier for the revision unique to its type.'=>'ຕົວລະບຸຕົວອັກສອນ ແລະ ຕົວເລກສຳລັບລຸ້ນການແກ້ໄຂທີ່ບໍ່ຊໍ້າກັນໃນປະເພດນັ້ນໆ.','The date the revision was last modified, as GMT.'=>'ວັນທີທີ່ລຸ້ນການແກ້ໄຂຖືກແກ້ໄຂຫຼ້າສຸດ, ໃນຮູບແບບ GMT.','The date the revision was last modified, in the site\'s timezone.'=>'ວັນທີທີ່ລຸ້ນການແກ້ໄຂຖືກແກ້ໄຂຫຼ້າສຸດ, ໃນເຂດເວລາຂອງເວັບໄຊ.','GUID for the post, transformed for display.'=>'GUID ສຳລັບບົດຄວາມ, ຖືກແປງເພື່ອສະແດງຜົນ.','GUID for the revision, as it exists in the database.'=>'GUID ສຳລັບລຸ້ນການແກ້ໄຂ, ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','The globally unique identifier for the post.'=>'ຕົວລະບຸສະເພາະທົ່ວໂລກສຳລັບບົດຄວາມ.','The date the revision was published, as GMT.'=>'ວັນທີທີ່ລຸ້ນການແກ້ໄຂຖືກເຜີຍແຜ່, ໃນຮູບແບບ GMT.','The date the revision was published, in the site\'s timezone.'=>'ວັນທີທີ່ລຸ້ນການແກ້ໄຂຖືກເຜີຍແຜ່, ໃນເຂດເວລາຂອງເວັບໄຊ.','Invalid featured media ID.'=>'ໄອດີສື່ເດັ່ນບໍ່ຖືກຕ້ອງ.','Invalid post parent ID.'=>'ໄອດີຕົວຫຼັກຂອງບົດຄວາມບໍ່ຖືກຕ້ອງ.','A password protected post can not be set to sticky.'=>'ບົດຄວາມທີ່ປົກປ້ອງດ້ວຍລະຫັດຜ່ານບໍ່ສາມາດຕັ້ງເປັນປັກໝຸດໄດ້.','A sticky post can not be password protected.'=>'ບົດຄວາມທີ່ປັກໝຸດບໍ່ສາມາດປົກປ້ອງດ້ວຍລະຫັດຜ່ານໄດ້.','A post can not be sticky and have a password.'=>'ບົດຄວາມບໍ່ສາມາດປັກໝຸດ ແລະ ມີລະຫັດຜ່ານພ້ອມກັນໄດ້.','The post has already been deleted.'=>'ບົດຄວາມຖືກລຶບແລ້ວ.','Sorry, you are not allowed to edit comments.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ແກ້ໄຂຄຳເຫັນ.','Sorry, you are not allowed to manage this plugin.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຈັດການປລັກອິນນີ້.','Cannot create existing post.'=>'ບໍ່ສາມາດສ້າງບົດຄວາມທີ່ມີຢູ່ແລ້ວ.','Sorry, you are not allowed to create new users.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ສ້າງຜູ້ໃຊ້ໃໝ່.','Incorrect post password.'=>'ລະຫັດຜ່ານບົດຄວາມບໍ່ຖືກຕ້ອງ.','You need to define a search term to order by relevance.'=>'ທ່ານຕ້ອງລະບຸຄຳຄົ້ນຫາເພື່ອຈັດລຽງຕາມຄວາມກ່ຽວຂ້ອງ.','The password for the post if it is password protected.'=>'ລະຫັດຜ່ານສຳລັບບົດຄວາມ ຫາກບົດຄວາມນັ້ນຖືກປົກປ້ອງດ້ວຍລະຫັດຜ່ານ.','Human-readable labels for the taxonomy for various contexts.'=>'ປ້າຍຊື່ຂອງ taxonomy ທີ່ມະນຸດສາມາດອ່ານເຂົ້າໃຈໄດ້ສຳລັບບໍລິບົດຕ່າງໆ.','Whether or not the taxonomy should have children.'=>'ກຳນົດວ່າ taxonomy ຄວນມີຕົວລູກ ຫຼື ບໍ່.','A human-readable description of the taxonomy.'=>'ຄຳອະທິບາຍຂອງ taxonomy ທີ່ມະນຸດສາມາດອ່ານເຂົ້າໃຈໄດ້.','All capabilities used by the taxonomy.'=>'ຄວາມສາມາດທັງໝົດທີ່ໃຊ້ໂດຍ taxonomy.','Sorry, you are not allowed to manage post statuses.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ຈັດການສະຖານະບົດຄວາມ.','An alphanumeric identifier for the user.'=>'ຕົວລະບຸຕົວອັກສອນ ແລະ ຕົວເລກສຳລັບຜູ້ໃຊ້.','Whether to include posts in the edit listing for their post type.'=>'ກຳນົດວ່າຈະລວມບົດຄວາມໃນລາຍການແກ້ໄຂສຳລັບປະເພດບົດຄວາມນັ້ນໆ ຫຼື ບໍ່.','Whether posts with this status should be publicly-queryable.'=>'ກຳນົດວ່າບົດຄວາມທີ່ມີສະຖານະນີ້ຄວນຈະສາມາດສອບຖາມໄດ້ຢ່າງສາທາລະນະ ຫຼື ບໍ່.','Whether posts of this status should be shown in the front end of the site.'=>'ກຳນົດວ່າບົດຄວາມທີ່ມີສະຖານະນີ້ຄວນສະແດງຢູ່ໃນໜ້າເວັບໄຊ ຫຼື ບໍ່.','Whether posts with this status should be protected.'=>'ກຳນົດວ່າບົດຄວາມທີ່ມີສະຖານະນີ້ຄວນຖືກປົກປ້ອງ ຫຼື ບໍ່.','Whether posts with this status should be private.'=>'ກຳນົດວ່າບົດຄວາມທີ່ມີສະຖານະນີ້ຄວນເປັນສ່ວນຕົວ ຫຼື ບໍ່.','Scope under which the request is made; determines fields present in response.'=>'ຂອບເຂດທີ່ຄຳຮ້ອງຂໍຖືກສ້າງຂຶ້ນ; ເຊິ່ງຈະກຳນົດຟິວທີ່ຈະສະແດງໃນຜົນຕອບຮັບ.','Limit results to those matching a string.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະສິ່ງທີ່ກົງກັບຂໍ້ຄວາມ.','Maximum number of items to be returned in result set.'=>'ຈຳນວນລາຍການສູງສຸດທີ່ຈະສົ່ງຄືນໃນຜົນການຄົ້ນຫາ.','Current page of the collection.'=>'ໜ້າປັດຈຸບັນຂອງຄໍເລັກຊັນ.','Method \'%s\' not implemented. Must be overridden in subclass.'=>'Method \'%s\' ຍັງບໍ່ໄດ້ຮັບການຕິດຕັ້ງ. ຕ້ອງໄດ້ຮັບການ override ໃນ subclass.','Limit result set to comments assigned a specific type. Requires authorization.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳເຫັນທີ່ມີປະເພດສະເພາະ. ຕ້ອງການການຢືນຢັນຕົວຕົນ.','Limit result set to comments assigned a specific status. Requires authorization.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳເຫັນທີ່ມີສະຖານະສະເພາະ. ຕ້ອງການການຢືນຢັນຕົວຕົນ.','Limit result set to comments assigned to specific post IDs.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳເຫັນທີ່ຖືກມອບໝາຍໃຫ້ກັບໄອດີບົດຄວາມສະເພາະ.','Ensure result set excludes specific parent IDs.'=>'ຮັບປະກັນວ່າຜົນການຄົ້ນຫາບໍ່ລວມໄອດີຕົວຫຼັກສະເພາະ.','Limit result set to comments of specific parent IDs.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳເຫັນຂອງໄອດີຕົວຫຼັກສະເພາະ.','Sort collection by object attribute.'=>'ຈັດລຽງຄໍເລັກຊັນຕາມຄຸນລັກສະນະຂອງວັດຖຸ.','Order sort attribute ascending or descending.'=>'ຈັດລຽງຄຸນລັກສະນະຈາກໜ້ອຍໄປຫາຫຼາຍ ຫຼື ຈາກຫຼາຍໄປຫາໜ້ອຍ.','Limit result set to specific IDs.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະໄອດີທີ່ລະບຸ.','Ensure result set excludes specific IDs.'=>'ຮັບປະກັນວ່າຜົນການຄົ້ນຫາບໍ່ລວມໄອດີສະເພາະ.','Limit response to posts published before a given ISO8601 compliant date.'=>'ຈຳກັດຜົນຕອບຮັບສະເພາະບົດຄວາມທີ່ເຜີຍແຜ່ກ່ອນວັນທີທີ່ລະບຸໃນຮູບແບບ ISO8601.','Limit result set to that from a specific author email. Requires authorization.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳເຫັນຈາກອີເມວຜູ້ຂຽນສະເພາະ. ຕ້ອງການການຢືນຢັນຕົວຕົນ.','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'ຮັບປະກັນວ່າຜົນການຄົ້ນຫາບໍ່ລວມຄຳເຫັນທີ່ມອບໝາຍໃຫ້ກັບໄອດີຜູ້ໃຊ້ສະເພາະ. ຕ້ອງການການຢືນຢັນຕົວຕົນ.','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'ຈຳກັດຜົນການຄົ້ນຫາສະເພາະຄຳເຫັນທີ່ມອບໝາຍໃຫ້ກັບໄອດີຜູ້ໃຊ້ສະເພາະ. ຕ້ອງການການຢືນຢັນຕົວຕົນ.','Limit response to posts published after a given ISO8601 compliant date.'=>'ຈຳກັດຜົນຕອບຮັບສະເພາະບົດຄວາມທີ່ເຜີຍແຜ່ຫຼັງວັນທີທີ່ລະບຸໃນຮູບແບບ ISO8601.','Avatar URLs for the comment author.'=>'URL ຂອງຮູບແທນຕົວສຳລັບຜູ້ຂຽນຄຳເຫັນ.','Avatar URL with image size of %d pixels.'=>'URL ຂອງຮູບແທນຕົວທີ່ມີຂະໜາດ %d ພິກເຊວ.','State of the comment.'=>'ສະຖານະຂອງຄຳເຫັນ.','The ID of the associated post object.'=>'ໄອດີຂອງວັດຖຸບົດຄວາມທີ່ກ່ຽວຂ້ອງ.','The ID for the parent of the post.'=>'ໄອດີຂອງຕົວຫຼັກຂອງບົດຄວາມ.','URL to the object.'=>'URL ໄປຫາວັດຖຸ.','The date the post was published, as GMT.'=>'ວັນທີທີ່ບົດຄວາມຖືກເຜີຍແຜ່, ໃນຮູບແບບ GMT.','HTML content for the post, transformed for display.'=>'ເນື້ອຫາ HTML ສຳລັບບົດຄວາມ, ຖືກແປງເພື່ອສະແດງຜົນ.','Content for the post, as it exists in the database.'=>'ເນື້ອຫາສຳລັບບົດຄວາມ, ຕາມທີ່ມີຢູ່ໃນຖານຂໍ້ມູນ.','The content for the post.'=>'ເນື້ອຫາສຳລັບບົດຄວາມ.','User agent for the comment author.'=>'User agent ຂອງຜູ້ຂຽນຄຳເຫັນ.','URL for the comment author.'=>'URL ຂອງຜູ້ຂຽນຄຳເຫັນ.','Display name for the comment author.'=>'ຊື່ທີ່ສະແດງຂອງຜູ້ຂຽນຄຳເຫັນ.','IP address for the comment author.'=>'ທີ່ຢູ່ IP ຂອງຜູ້ຂຽນຄຳເຫັນ.','Email address for the comment author.'=>'ທີ່ຢູ່ອີເມວຂອງຜູ້ຂຽນຄຳເຫັນ.','The ID of the user object, if author was a user.'=>'ໄອດີຂອງວັດຖຸຜູ້ໃຊ້, ຫາກຜູ້ຂຽນເປັນຜູ້ໃຊ້ໃນລະບົບ.','Unique identifier for the object.'=>'ຕົວລະບຸສະເພາະສຳລັບວັດຖຸ.','Invalid comment author ID.'=>'ໄອດີຜູ້ຂຽນຄຳເຫັນບໍ່ຖືກຕ້ອງ.','The comment cannot be deleted.'=>'ຄຳເຫັນບໍ່ສາມາດລຶບໄດ້.','The comment has already been trashed.'=>'ຄຳເຫັນຖືກຍ້າຍໄປຖັງຂີ້ເຫຍື້ອແລ້ວ.','Updating comment failed.'=>'ການອັບເດດຄຳເຫັນຫຼົ້ມເຫຼວ.','Updating comment status failed.'=>'ການອັບເດດສະຖານະຄຳເຫັນຫຼົ້ມເຫຼວ.','Creating comment failed.'=>'ການສ້າງຄຳເຫັນຫຼົ້ມເຫຼວ.','Creating a comment requires valid author name and email values.'=>'ການສ້າງຄຳເຫັນຕ້ອງມີຊື່ຜູ້ຂຽນ ແລະ ອີເມວທີ່ຖືກຕ້ອງ.','Cannot create existing comment.'=>'ບໍ່ສາມາດສ້າງຄຳເຫັນທີ່ມີຢູ່ແລ້ວ.','Sorry, you must be logged in to comment.'=>'ຂໍອະໄພ, ທ່ານຕ້ອງເຂົ້າສູ່ລະບົບກ່ອນເພື່ອສະແດງຄຳເຫັນ.','Query parameter not permitted: %s'=>'ພາລາມິເຕີຄຳສັ່ງບໍ່ໄດ້ຮັບອະນຸຍາດ: %s','Whether to bypass Trash and force deletion.'=>'ກຳນົດວ່າຈະຂ້າມຖັງຂີ້ເຫຍື້ອ ແລະ ບັງຄັບລຶບຖາວອນ ຫຼື ບໍ່.','Could not open file handle.'=>'ບໍ່ສາມາດເປີດ file handle ໄດ້.','Content hash did not match expected.'=>'Content hash ບໍ່ກົງກັບທີ່ຄາດໄວ້.','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'Content-Disposition ທີ່ລະບຸບໍ່ຖືກຕ້ອງ. Content-Disposition ຕ້ອງຢູ່ໃນຮູບແບບ `attachment; filename="image.png"` ຫຼື ທີ່ຄ້າຍຄືກັນ.','No Content-Disposition supplied.'=>'ບໍ່ມີການລະບຸ Content-Disposition.','No Content-Type supplied.'=>'ບໍ່ມີການລະບຸ Content-Type.','No data supplied.'=>'ບໍ່ມີການສົ່ງຂໍ້ມູນມາ.','The ID for the associated post of the attachment.'=>'ໄອດີຂອງບົດຄວາມທີ່ກ່ຽວຂ້ອງກັບໄຟລ໌ແນບ.','Details about the media file, specific to its type.'=>'ລາຍລະອຽດກ່ຽວກັບໄຟລ໌ສື່, ສະເພາະຕາມປະເພດຂອງມັນ.','Alternative text to display when attachment is not displayed.'=>'ຂໍ້ຄວາມທົດແທນທີ່ຈະສະແດງເມື່ອໄຟລ໌ແນບບໍ່ສະແດງຜົນ.','Invalid parent type.'=>'ປະເພດຕົວຫຼັກບໍ່ຖືກຕ້ອງ.','Sorry, you are not allowed to upload media to this post.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອັບໂຫຼດສື່ໄປຫາບົດຄວາມນີ້.','Sorry, you are not allowed to upload media on this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອັບໂຫຼດສື່ໃນເວັບໄຊນີ້.','The REST API can no longer be completely disabled, the %s filter can be used to restrict access to the API, instead.'=>'REST API ບໍ່ສາມາດຖືກປິດໃຊ້ງານໄດ້ທັງໝົດອີກຕໍ່ໄປ, ແຕ່ສາມາດໃຊ້ຕົວຂໍ້ມູນ %s ເພື່ອຈຳກັດການເຂົ້າເຖິງ API ແທນ.','Page Attributes'=>'ຄຸນສົມບັດຂອງໜ້າ','Post Attributes'=>'ຄຸນສົມບັດຂອງບົດຄວາມ','View Pages'=>'ເບິ່ງໜ້າຕ່າງໆ','View Posts'=>'ເບິ່ງບົດຄວາມ','No changesets found in Trash.'=>'ບໍ່ພົບ Changesets ໃນຖັງຂີ້ເຫຍື້ອ.','No changesets found.'=>'ບໍ່ພົບ Changesets.','Search Changesets'=>'ຄົ້ນຫາ Changesets','All Changesets'=>'Changesets ທັງໝົດ','View Changeset'=>'ເບິ່ງ Changeset','Edit Changeset'=>'ແກ້ໄຂ Changeset','New Changeset'=>'ສ້າງ Changeset ໃໝ່','post type singular nameChangeset'=>'Changeset','post type general nameChangesets'=>'Changesets','Custom CSS'=>'CSS ທີ່ກຳນົດເອງ','Attachment Attributes'=>'ຄຸນສົມບັດຂອງໄຟລ໌ແນບ','%1$s %2$s, %3$s ago (%4$s)'=>'%1$s %2$s, %3$s ຜ່ານມາ (%4$s)','The "%s" options group has been removed. Use another settings group.'=>'ກຸ່ມຕົວເລືອກ "%s" ຖືກຍ້າຍອອກແລ້ວ. ກະລຸນາໃຊ້ກຸ່ມການຕັ້ງຄ່າອື່ນ.','Allow link notifications from other blogs (pingbacks and trackbacks) on new articles.'=>'ອະນຸຍາດໃຫ້ມີການແຈ້ງເຕືອນລິ້ງຈາກບລັອກອື່ນໆ (pingbacks ແລະ trackbacks) ໃນບົດຄວາມໃໝ່.','Blog pages show at most.'=>'ໜ້າບລັອກສະແດງຜົນສູງສຸດ.','Default post format.'=>'ຮູບແບບບົດຄວາມເລີ່ມຕົ້ນ.','Convert emoticons like :-) and :-P to graphics on display.'=>'ປ່ຽນອີໂມຈິ ເຊັ່ນ :-) ແລະ :-P ໃຫ້ເປັນຮູບພາບເມື່ອສະແດງຜົນ.','WordPress locale code.'=>'ລະຫັດທ້ອງຖິ່ນຂອງ WordPress.','A day number of the week that the week should start on.'=>'ກຳນົດວັນເລີ່ມຕົ້ນຂອງອາທິດ.','A time format for all time strings.'=>'ຮູບແບບເວລາສຳລັບຂໍ້ຄວາມເວລາທັງໝົດ.','A date format for all date strings.'=>'ຮູບແບບວັນທີສຳລັບຂໍ້ຄວາມວັນທີທັງໝົດ.','A city in the same timezone as you.'=>'ເມືອງທີ່ຢູ່ໃນເຂດເວລາດຽວກັນກັບທ່ານ.','Site title.'=>'ຫົວຂໍ້ເວັບໄຊ.','Search media items...'=>'ຄົ້ນຫາລາຍການສື່...','next set of postsNext'=>'ຖັດໄປ','previous set of postsPrevious'=>'ກ່ອນໜ້າ','Username or Email Address'=>'ຊື່ຜູ້ໃຊ້ ຫຼື ທີ່ຢູ່ອີເມວ','No themes found. Try a different search, or %s.'=>'ບໍ່ພົບທິມ. ກະລຸນາລອງຄົ້ນຫາໃໝ່ ຫຼື %s.','You are browsing %s'=>'ທ່ານກຳລັງເບິ່ງ %s','Filter themes'=>'ກອງທິມ','Change theme'=>'ປ່ຽນທິມ','Update now'=>'ອັບເດດຕອນນີ້','New version available. %s'=>'ມີລຸ້ນໃໝ່ພ້ອມໃຊ້ງານ. %s','Install and preview theme: %s'=>'ຕິດຕັ້ງ ແລະ ເບິ່ງຕົວຢ່າງທິມ: %s','Live preview theme: %s'=>'ເບິ່ງຕົວຢ່າງທິມແບບສົດ: %s','Customize theme: %s'=>'ປັບແຕ່ງທິມ: %s','Details for theme: %s'=>'ລາຍລະອຽດສຳລັບທິມ: %s','Click to edit this element.'=>'ຄລິກເພື່ອແກ້ໄຂອົງປະກອບນີ້.','Click to edit the site title.'=>'ຄລິກເພື່ອແກ້ໄຂຫົວຂໍ້ເວັບໄຊ.','Click to edit this widget.'=>'ຄລິກເພື່ອແກ້ໄຂວິດເຈັດນີ້.','Click to edit this menu.'=>'ຄລິກເພື່ອແກ້ໄຂເມນູນີ້.','Markup is not allowed in CSS.'=>'ບໍ່ອະນຸຍາດໃຫ້ໃຊ້ Markup ໃນ CSS.','Sorry, the comment could not be updated.'