(or array), but not both.'=>'Partial render ຕ້ອງ echo ເນື້ອຫາ ຫຼື return string (ຫຼື array), ບໍ່ສາມາດເຮັດທັງສອງຢ່າງໄດ້.','<strong>Error:</strong> Your comment is too long.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ຄຳເຫັນຂອງທ່ານຍາວເກີນໄປ.','<strong>Error:</strong> Your URL is too long.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> URL ຂອງທ່ານຍາວເກີນໄປ.','<strong>Error:</strong> Your email address is too long.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ທີ່ຢູ່ອີເມວຂອງທ່ານຍາວເກີນໄປ.','<strong>Error:</strong> Your name is too long.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ຊື່ຂອງທ່ານຍາວເກີນໄປ.','comment statusTrash'=>'ຖັງຂີ້ເຫຍື້ອ','comment statusSpam'=>'ສະແປມ','comment statusApproved'=>'ອະນຸມັດແລ້ວ','Template is missing. Standalone themes need to have a %1$s or %2$s template file. <a href="%3$s">Child themes</a> need to have a %4$s header in the %5$s stylesheet.'=>'ແມ່ແບບຫາຍໄປ. ທິມທົ່ວໄປຕ້ອງມີໄຟລ໌ %1$s ຫຼື %2$s. <a href="%3$s">Child themes</a> ຕ້ອງມີສ່ວນຫົວ %4$s ໃນໄຟລ໌ %5$s.','Invalid object type.'=>'ປະເພດວັດຖຸບໍ່ຖືກຕ້ອງ.','Paste URL or type to search'=>'ວາງ URL ຫຼື ພິມເພື່ອຄົ້ນຫາ','Logo'=>'ໂລໂກ້','Display Site Title and Tagline'=>'ສະແດງຫົວຂໍ້ເວັບໄຊ ແລະ ຄຳຂວັນ','Enter mobile preview mode'=>'ເຂົ້າສູ່ໂໝດເບິ່ງຕົວຢ່າງຜ່ານມືຖື','Enter tablet preview mode'=>'ເຂົ້າສູ່ໂໝດເບິ່ງຕົວຢ່າງຜ່ານແທັບເລັດ','Enter desktop preview mode'=>'ເຂົ້າສູ່ໂໝດເບິ່ງຕົວຢ່າງຜ່ານຄອມພິວເຕີ','Shift-click to edit this element.'=>'Shift-ຄລິກ ເພື່ອແກ້ໄຂອົງປະກອບນີ້.','Comment Submission Failure'=>'ການສົ່ງຄຳເຫັນຫຼົ້ມເຫຼວ','<strong>Error:</strong> Sorry, that username is not allowed.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ຂໍອະໄພ, ບໍ່ອະນຸຍາດໃຫ້ໃຊ້ຊື່ຜູ້ໃຊ້ນີ້.','Invalid parameter.'=>'ພາລາມິເຕີບໍ່ຖືກຕ້ອງ.','menu location(Current: %s)'=>'(ປັດຈຸບັນ: %s)','menu(Currently set to: %s)'=>'(ຕັ້ງຄ່າເປັນ: %s)','Please see <a href="%s">Debugging in WordPress</a> for more information.'=>'ກະລຸນາເບິ່ງ <a href="%s">Debugging in WordPress</a> ສຳລັບຂໍ້ມູນເພີ່ມເຕີມ.','<strong>Error:</strong> %1$s in %2$s can only contain numbers, letters, and underscores.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> %1$s ໃນ %2$s ສາມາດມີໄດ້ສະເພາະຕົວເລກ, ຕົວອັກສອນ ແລະ ເຄື່ອງໝາຍຂີດກ້ອງເທົ່ານັ້ນ.','Use %s instead.'=>'ໃຫ້ໃຊ້ %s ແທນ.','Use %s instead if you do not want the value echoed.'=>'ໃຫ້ໃຊ້ %s ແທນ ຫາກທ່ານບໍ່ຕ້ອງການໃຫ້ສະແດງຄ່າອອກມາ.','Term ID is shared between multiple taxonomies'=>'ໄອດີຄຳສັບຖືກໃຊ້ຮ່ວມກັນໃນຫຼາຍ taxonomies','Term meta cannot be added to terms that are shared between taxonomies.'=>'ບໍ່ສາມາດເພີ່ມ Term meta ໃຫ້ກັບຄຳສັບທີ່ຖືກໃຊ້ຮ່ວມກັນໃນຫຼາຍ taxonomies ໄດ້.','genitiveDecember'=>'ທັນວາ','genitiveNovember'=>'ພະຈິກ','genitiveOctober'=>'ຕຸລາ','genitiveSeptember'=>'ກັນຍາ','genitiveAugust'=>'ສິງຫາ','genitiveJuly'=>'ກໍລະກົດ','genitiveJune'=>'ມິຖຸນາ','genitiveMay'=>'ພຶດສະພາ','genitiveApril'=>'ເມສາ','genitiveMarch'=>'ມີນາ','genitiveFebruary'=>'ກຸມພາ','genitiveJanuary'=>'ມັງກອນ','Sharing options'=>'ຕົວເລືອກການແບ່ງປັນ','Medium-Large size image height'=>'ຄວາມສູງຂອງຮູບຂະໜາດກາງ-ໃຫຍ່','Medium-Large size image width'=>'ຄວາມກວ້າງຂອງຮູບຂະໜາດກາງ-ໃຫຍ່','You are currently browsing the %s blog archives.'=>'ທ່ານກຳລັງເບິ່ງຄັງເກັບບລັອກຂອງ %s.','You are currently browsing the %1$s blog archives for the year %2$s.'=>'ທ່ານກຳລັງເບິ່ງຄັງເກັບບລັອກຂອງ %1$s ສຳລັບປີ %2$s.','You are currently browsing the %1$s blog archives for %2$s.'=>'ທ່ານກຳລັງເບິ່ງຄັງເກັບບລັອກຂອງ %1$s ສຳລັບ %2$s.','You are currently browsing the %1$s blog archives for the day %2$s.'=>'ທ່ານກຳລັງເບິ່ງຄັງເກັບບລັອກຂອງ %1$s ສຳລັບວັນທີ %2$s.','This site has not been activated yet. If you are having problems activating your site, please contact %s.'=>'ເວັບໄຊນີ້ຍັງບໍ່ໄດ້ເປີດໃຊ້ງານ. ຫາກທ່ານມີບັນຫາໃນການເປີດໃຊ້ງານ, ກະລຸນາຕິດຕໍ່ %s.','The menu name %s conflicts with another menu name. Please try another.'=>'ຊື່ເມນູ %s ຊໍ້າກັບຊື່ເມນູອື່ນ. ກະລຸນາລອງໃຊ້ຊື່ອື່ນ.','The site you were looking for, %s, does not exist.'=>'ເວັບໄຊ %s ທີ່ທ່ານກຳລັງຊອກຫາ ບໍ່ມີຢູ່.','It looks like nothing was found at this location. Maybe try visiting %s directly?'=>'ເບິ່ງຄືວ່າບໍ່ພົບຫຍັງໃນຕຳແໜ່ງນີ້. ລອງໄປທີ່ %s ໂດຍກົງເບິ່ງບໍ່?','Oops! That embed cannot be found.'=>'ຂໍອະໄພ! ບໍ່ພົບສິ່ງທີ່ຝັງໄວ້ນີ້.','Continue reading %s'=>'ອ່ານຕໍ່ %s','Site Language:'=>'ພາສາເວັບໄຊ:','Mission complete. Message %s deleted.'=>'ພາລະກິດສຳເລັດ. ລຶບຂໍ້ຄວາມ %s ແລ້ວ.','Posted title:'=>'ຫົວຂໍ້ທີ່ໂພສ:','Author:'=>'ຜູ້ຂຽນ:','Are you sure the database server is not under particularly heavy load?'=>'ທ່ານແນ່ໃຈຫຼືບໍ່ວ່າເຊີບເວີຖານຂໍ້ມູນບໍ່ໄດ້ເຮັດວຽກໜັກເກີນໄປ?','This means that the contact with the database server at %s was lost. This could mean your host&#8217;s database server is down.'=>'ນີ້ໝາຍຄວາມວ່າການເຊື່ອມຕໍ່ກັບເຊີບເວີຖານຂໍ້ມູນທີ່ %s ຂາດຫາຍໄປ. ອາດເປັນຍ້ອນເຊີບເວີຖານຂໍ້ມູນຂອງໂຮສຕິງທ່ານໃຊ້ງານບໍ່ໄດ້.','Error reconnecting to the database'=>'ເກີດຂໍ້ຜິດພາດໃນການເຊື່ອມຕໍ່ກັບຖານຂໍ້ມູນໃໝ່','If you are unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress support forums</a>.'=>'ຫາກທ່ານບໍ່ແນ່ໃຈວ່າຄຳສັບເຫຼົ່ານີ້ໝາຍເຖິງຫຍັງ ທ່ານຄວນຕິດຕໍ່ຜູ້ໃຫ້ບໍລິການໂຮສຕິງຂອງທ່ານ. ຫາກຍັງຕ້ອງການຄວາມຊ່ວຍເຫຼືອ ທ່ານສາມາດໄປທີ່ <a href="%s">ຟໍຣຳຊ່ວຍເຫຼືອຂອງ WordPress</a>.','Are you sure the database server is running?'=>'ທ່ານແນ່ໃຈຫຼືບໍ່ວ່າເຊີບເວີຖານຂໍ້ມູນກຳລັງເຮັດວຽກຢູ່?','Are you sure you have typed the correct hostname?'=>'ທ່ານແນ່ໃຈຫຼືບໍ່ວ່າພິມ hostname ຖືກຕ້ອງແລ້ວ?','Are you sure you have the correct username and password?'=>'ທ່ານແນ່ໃຈຫຼືບໍ່ວ່າໃຊ້ຊື່ຜູ້ໃຊ້ ແລະ ລະຫັດຜ່ານທີ່ຖືກຕ້ອງ?','This either means that the username and password information in your %1$s file is incorrect or that contact with the database server at %2$s could not be established. This could mean your host&#8217;s database server is down.'=>'ນີ້ອາດໝາຍຄວາມວ່າຂໍ້ມູນຊື່ຜູ້ໃຊ້ ແລະ ລະຫັດຜ່ານໃນໄຟລ໌ %1$s ຂອງທ່ານບໍ່ຖືກຕ້ອງ ຫຼື ບໍ່ສາມາດເຊື່ອມຕໍ່ກັບເຊີບເວີຖານຂໍ້ມູນທີ່ %2$s ໄດ້.','If you do not know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress support forums</a>.'=>'ຫາກທ່ານບໍ່ຮູ້ວິທີການຕັ້ງຄ່າຖານຂໍ້ມູນ ທ່ານຄວນ <strong>ຕິດຕໍ່ຜູ້ໃຫ້ບໍລິການໂຮສຕິງຂອງທ່ານ</strong>.','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'ໃນບາງລະບົບ ຊື່ຖານຂໍ້ມູນຂອງທ່ານຈະຖືກນຳໜ້າດ້ວຍຊື່ຜູ້ໃຊ້ ເຊັ່ນ <code>username_%1$s</code>. ນີ້ອາດເປັນບັນຫາຫຼືບໍ່?','Does the user %1$s have permission to use the %2$s database?'=>'ຜູ້ໃຊ້ %1$s ມີສິດໃຊ້ງານຖານຂໍ້ມູນ %2$s ຫຼືບໍ່?','Are you sure it exists?'=>'ທ່ານແນ່ໃຈຫຼືບໍ່ວ່າມັນມີຢູ່ແທ້?','The tag cloud will not be displayed since there are no taxonomies that support the tag cloud widget.'=>'Tag cloud ຈະບໍ່ສະແດງຜົນ ເນື່ອງຈາກບໍ່ມີ taxonomies ທີ່ຮອງຮັບວິດເຈັດ tag cloud.','Nicename may not be longer than 50 characters.'=>'ຊື່ທີ່ໃຊ້ (Nicename) ຕ້ອງບໍ່ຍາວເກີນ 50 ຕົວອັກສອນ.','<strong>Error:</strong> The password you entered for the username %s is incorrect.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ລະຫັດຜ່ານທີ່ທ່ານປ້ອນສຳລັບຊື່ຜູ້ໃຊ້ %s ບໍ່ຖືກຕ້ອງ.','Categories list'=>'ລາຍການໝວດໝູ່','Tags list'=>'ລາຍການແທັກ','Categories list navigation'=>'ການນຳທາງລາຍການໝວດໝູ່','Tags list navigation'=>'ການນຳທາງລາຍການແທັກ','Invalid shortcode name: %1$s. Do not use spaces or reserved characters: %2$s'=>'ຊື່ shortcode ບໍ່ຖືກຕ້ອງ: %1$s. ຫ້າມໃຊ້ຊ່ອງຫວ່າງ ຫຼື ຕົວອັກສອນສະເພາະ: %2$s','Invalid shortcode name: Empty name given.'=>'ຊື່ shortcode ບໍ່ຖືກຕ້ອງ: ຊື່ທີ່ລະບຸຫວ່າງເປົ່າ.','%1$s (since %2$s; %3$s)'=>'%1$s (ຕັ້ງແຕ່ %2$s; %3$s)','%1$s (since %2$s; no alternative available)'=>'%1$s (ຕັ້ງແຕ່ %2$s; ບໍ່ມີທາງເລືອກອື່ນ)','%1$s (since %2$s; use %3$s instead)'=>'%1$s (ຕັ້ງແຕ່ %2$s; ໃຫ້ໃຊ້ %3$s ແທນ)','The specified namespace could not be found.'=>'ບໍ່ພົບ namespace ທີ່ລະບຸ.','No route was found matching the URL and request method.'=>'ບໍ່ພົບ route ທີ່ກົງກັບ URL ແລະ ວິທີການຮ້ອງຂໍ.','The handler for the route is invalid'=>'Handler ສຳລັບ route ນີ້ບໍ່ຖືກຕ້ອງ','JSONP support is disabled on this site.'=>'ການຮອງຮັບ JSONP ຖືກປິດໃຊ້ງານໃນເວັບໄຊນີ້.','Invalid parameter(s): %s'=>'ພາລາມິເຕີບໍ່ຖືກຕ້ອງ: %s','Missing parameter(s): %s'=>'ພາລາມິເຕີທີ່ຂາດຫາຍໄປ: %s','In %1$s, use the %2$s method, not the %3$s function. See %4$s.'=>'ໃນ %1$s, ໃຫ້ໃຊ້ວິທີ %2$s, ບໍ່ແມ່ນຟັງຊັນ %3$s. ເບິ່ງ %4$s.','Pages list'=>'ລາຍການໜ້າ','Posts list'=>'ລາຍການບົດຄວາມ','Pages list navigation'=>'ການນຳທາງລາຍການໜ້າ','Posts list navigation'=>'ການນຳທາງລາຍການບົດຄວາມ','Filter pages list'=>'ກອງລາຍການໜ້າ','Filter posts list'=>'ກອງລາຍການບົດຄວາມ','Page Archives'=>'ຄັງເກັບໜ້າ','Post Archives'=>'ຄັງເກັບບົດຄວາມ','Post Type Archive'=>'ຄັງເກັບປະເພດບົດຄວາມ','Site names can only contain lowercase letters (a-z) and numbers.'=>'ຊື່ເວັບໄຊສາມາດມີໄດ້ສະເພາະຕົວອັກສອນພາສາອັງກິດໂຕພິມນ້ອຍ (a-z) ແລະ ຕົວເລກ.','Sorry, that username is not allowed.'=>'ຂໍອະໄພ, ບໍ່ອະນຸຍາດໃຫ້ໃຊ້ຊື່ຜູ້ໃຊ້ນັ້ນ.','Usernames can only contain lowercase letters (a-z) and numbers.'=>'ຊື່ຜູ້ໃຊ້ສາມາດມີໄດ້ສະເພາະຕົວອັກສອນພາສາອັງກິດໂຕພິມນ້ອຍ (a-z) ແລະ ຕົວເລກ.','playlist item title&#8220;%s&#8221;'=>'&#8220;%s&#8221;','December abbreviationDec'=>'ທ.ວ.','November abbreviationNov'=>'ພ.ຈ.','October abbreviationOct'=>'ຕ.ລ.','September abbreviationSep'=>'ກ.ຍ.','August abbreviationAug'=>'ສ.ຫ.','July abbreviationJul'=>'ກ.ກ.','June abbreviationJun'=>'ມ.ຖ.','May abbreviationMay'=>'ພ.ພ.','April abbreviationApr'=>'ມ.ສ.','March abbreviationMar'=>'ມ.ນ.','February abbreviationFeb'=>'ກ.ພ.','January abbreviationJan'=>'ມ.ກ.','Saturday initialS'=>'ສ','Friday initialF'=>'ສຸ','Thursday initialT'=>'ພຫ','Wednesday initialW'=>'ພ','Tuesday initialT'=>'ອ','Monday initialM'=>'ຈ','Sunday initialS'=>'ອາ','Newer comments'=>'ຄຳເຫັນໃໝ່ກວ່າ','Older comments'=>'ຄຳເຫັນເກົ່າກວ່າ','Posts published on %s'=>'ບົດຄວາມທີ່ເຜີຍແຜ່ເມື່ອ %s','Use the %s filter instead.'=>'ໃຫ້ໃຊ້ຕົວຂໍ້ມູນ %s ແທນ.','Close sharing dialog'=>'ປິດໜ້າຕ່າງການແບ່ງປັນ','Copy and paste this code into your site to embed'=>'ຄັດລອກ ແລະ ວາງໂຄດນີ້ລົງໃນເວັບໄຊຂອງທ່ານເພື່ອຝັງ','Copy and paste this URL into your WordPress site to embed'=>'ຄັດລອກ ແລະ ວາງ URL ນີ້ລົງໃນເວັບໄຊ WordPress ຂອງທ່ານເພື່ອຝັງ','HTML Embed'=>'ຝັງ HTML','WordPress Embed'=>'ຝັງ WordPress','Open sharing dialog'=>'ເປີດໜ້າຕ່າງການແບ່ງປັນ','%s <span class="screen-reader-text">Comment</span>'=>'%s <span class="screen-reader-text">ຄຳເຫັນ</span>','Read more'=>'ອ່ານເພີ່ມເຕີມ','When in reorder mode, additional controls to reorder widgets will be available in the widgets list above.'=>'ເມື່ອຢູ່ໃນໂໝດການຈັດລຽງໃໝ່, ປຸ່ມຄວບຄຸມເພີ່ມເຕີມສຳລັບການຈັດລຽງວິດເຈັດຈະມີໃຫ້ໃຊ້ໃນລາຍການວິດເຈັດຂ້າງເທິງ.','Sorry, you are not allowed to moderate or edit this comment.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ກວດສອບ ຫຼື ແກ້ໄຂຄຳເຫັນນີ້.','Reorder widgets'=>'ຈັດລຽງວິດເຈັດໃໝ່','Live Preview: %s'=>'ເບິ່ງຕົວຢ່າງສົດ: %s','The requested theme does not exist.'=>'ທິມທີ່ຮ້ອງຂໍບໍ່ມີຢູ່.','Sorry, you are not allowed to edit theme options on this site.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ແກ້ໄຂຕົວເລືອກທິມໃນເວັບໄຊນີ້.','%1$s is deprecated. Use %2$s instead.'=>'%1$s ຖືກຍົກເລີກແລ້ວ. ໃຫ້ໃຊ້ %2$s ແທນ.','The post type %1$s is not registered, so it may not be reliable to check the capability %2$s against a post of that type.'=>'ປະເພດບົດຄວາມ %1$s ຍັງບໍ່ໄດ້ລົງທະບຽນ, ດັ່ງນັ້ນການກວດສອບຄວາມສາມາດ %2$s ສຳລັບບົດຄວາມປະເພດນັ້ນອາດບໍ່ໜ້າເຊື່ອຖື.','Clear Results'=>'ລ້າງຜົນການຄົ້ນຫາ','The following formatting shortcuts are replaced when pressing Enter. Press Escape or the Undo button to undo.'=>'ທາງລັດການຈັດຮູບແບບຕໍ່ໄປນີ້ຈະຖືກແທນທີ່ເມື່ອກົດ Enter. ກົດ Escape ຫຼື ປຸ່ມ Undo ເພື່ອຍົກເລີກ.','Remove Menu Item: %1$s (%2$s)'=>'ລຶບລາຍການເມນູ: %1$s (%2$s)','Hide password'=>'ເຊື່ອງລະຫັດຜ່ານ','Show password'=>'ສະແດງລະຫັດຜ່ານ','Menu Name'=>'ຊື່ເມນູ','Preview as an app icon'=>'ເບິ່ງຕົວຢ່າງເປັນໄອຄອນແອັບ','Preview as a browser icon'=>'ເບິ່ງຕົວຢ່າງເປັນໄອຄອນບຣາວເຊີ','No items'=>'ບໍ່ມີລາຍການ','Registration confirmation will be emailed to you.'=>'ການຢືນຢັນການລົງທະບຽນຈະຖືກສົ່ງໃຫ້ທ່ານຜ່ານອີເມວ.','Hide'=>'ເຊື່ອງ','Show'=>'ສະແດງ','password mismatchMismatch'=>'ບໍ່ກົງກັນ','password strengthStrong'=>'ແຂງແຮງ','password strengthWeak'=>'ອ່ອນແອ','password strengthVery weak'=>'ອ່ອນແອຫຼາຍ','Hide image'=>'ເຊື່ອງຮູບພາບ','Hide header image'=>'ເຊື່ອງຮູບສ່ວນຫົວ','Site Icon'=>'ໄອຄອນເວັບໄຊ','Sit