cuts,'=>'ທາງລັດເລີ່ມຕົ້ນ,','Customizing'=>'ກຳລັງປັບແຕ່ງ','Menu Options'=>'ຕົວເລືອກເມນູ','Add to Menu'=>'ເພີ່ມໃສ່ເມນູ','Custom Links'=>'ລິ້ງປັບແຕ່ງ','The search results will be updated as you type.'=>'ຜົນການຄົ້ນຫາຈະອັບເດດໃນຂະນະທີ່ທ່ານພິມ.','Search Menu Items'=>'ຄົ້ນຫາລາຍການເມນູ','Add Menu Items'=>'ເພີ່ມລາຍການເມນູ','Customizing &#9656; %s'=>'ກຳລັງປັບແຕ່ງ &#9656; %s','Move one level down'=>'ຍ້າຍລົງໜຶ່ງລະດັບ','Move one level up'=>'ຍ້າຍຂຶ້ນໜຶ່ງລະດັບ','Menu Locations'=>'ຕຳແໜ່ງເມນູ','Your theme can display menus in %s location. Select which menu you would like to use.'=>'ທິມຂອງທ່ານສາມາດສະແດງເມນູໄດ້ໃນ %s ຕຳແໜ່ງ. ເລືອກເມນູທີ່ທ່ານຕ້ອງການສະແດງໃນແຕ່ລະຕຳແໜ່ງ.','This panel is used for managing navigation menus for content you have already published on your site. You can create menus and add items for existing content such as pages, posts, categories, tags, formats, or custom links.'=>'ແຜງນີ້ໃຊ້ສຳລັບຈັດການເມນູນຳທາງສຳລັບເນື້ອຫາທີ່ທ່ານໄດ້ເຜີຍແຜ່ແລ້ວໃນເວັບໄຊຂອງທ່ານ. ທ່ານສາມາດສ້າງເມນູ ແລະ ເພີ່ມລາຍການສຳລັບເນື້ອຫາທີ່ມີຢູ່ ເຊັ່ນ: ໜ້າ, ເລື່ອງ, ໝວດໝູ່, ປ້າຍກຳກັບ, ຮູບແບບ ຫຼື ລິ້ງປັບແຕ່ງ.','Out from under %s'=>'ເອົາອອກຈາກພາຍໃຕ້ %s','Under %s'=>'ພາຍໃຕ້ %s','Move out from under %s'=>'ຍ້າຍອອກຈາກພາຍໃຕ້ %s','Move under %s'=>'ຍ້າຍໄປໄວ້ພາຍໃຕ້ %s','Move to the top'=>'ຍ້າຍໄປໄວ້ເທິງສຸດ','Move down one'=>'ຍ້າຍລົງໜຶ່ງລຳດັບ','Move up one'=>'ຍ້າຍຂຶ້ນໜຶ່ງລຳດັບ','Loading more results... please wait.'=>'ກຳລັງໂຫຼດຜົນລັດເພີ່ມເຕີມ... ກະລຸນາລໍຖ້າ.','Additional items found: %d'=>'ພົບລາຍການເພີ່ມເຕີມ: %d','Number of items found: %d'=>'ຈຳນວນລາຍການທີ່ພົບ: %d','%s (Pending)'=>'%s (ກຳລັງລໍຖ້າ)','%s (Invalid)'=>'%s (ບໍ່ຖືກຕ້ອງ)','Menu item is now a sub-item'=>'ລາຍການເມນູກາຍເປັນລາຍການຍ່ອຍແລ້ວ','Menu item moved out of submenu'=>'ລາຍການເມນູຖືກຍ້າຍອອກຈາກເມນູຍ່ອຍແລ້ວ','Menu item moved down'=>'ຍ້າຍລາຍການເມນູລົງ','Menu item moved up'=>'ຍ້າຍລາຍການເມນູຂຶ້ນ','Menu deleted'=>'ລຶບເມນູແລ້ວ','Menu created'=>'ສ້າງເມນູແລ້ວ','Menu item deleted'=>'ລຶບລາຍການເມນູແລ້ວ','Menu item added'=>'ເພີ່ມລາຍການເມນູແລ້ວ','nav menu home labelHome'=>'ໜ້