xt Area. Press Alt-Shift-H for help.'=>'ພື້ນທີ່ຂໍ້ຄວາມແບບ Rich Text. ກົດ Alt-Shift-H ເພື່ອຂໍຄວາມຊ່ວຍເຫຼືອ.','The following values do not describe a valid date: month %1$s, day %2$s.'=>'ຄ່າຕໍ່ໄປນີ້ບໍ່ແມ່ນວັນທີທີ່ຖືກຕ້ອງ: ເດືອນ %1$s, ວັນ %2$s.','%s must set a database connection for use with escaping.'=>'%s ຕ້ອງຕັ້ງຄ່າການເຊື່ອມຕໍ່ຖານຂໍ້ມູນເພື່ອໃຊ້ງານກັບການເອສເຄບ (escaping).','You need to pass an array of types.'=>'ທ່ານຕ້ອງສົ່ງຄ່າອາເຣ (array) ຂອງປະເພດຕ່າງໆ.','A term with the name provided already exists in this taxonomy.'=>'ມີຊື່ຄຳສັບນີ້ຢູ່ໃນລຳດັບຂັ້ນການຈັດກຸ່ມນີ້ແລ້ວ.','You can see all comments on this post here:'=>'ທ່ານສາມາດເບິ່ງຄວາມເຫັນທັງໝົດໃນເລື່ອງນີ້ໄດ້ທີ່ນີ້:','You can see all pingbacks on this post here:'=>'ທ່ານສາມາດເບິ່ງ pingbacks ທັງໝົດໃນເລື່ອງນີ້ໄດ້ທີ່ນີ້:','You can see all trackbacks on this post here:'=>'ທ່ານສາມາດເບິ່ງ trackbacks ທັງໝົດໃນເລື່ອງນີ້ໄດ້ທີ່ນີ້:','Comment: %s'=>'ຄວາມເຫັນ: %s','URL: %s'=>'URL: %s','nounTrash'=>'ຖັງຂີ້ເຫຍື້ອ','Edit Selection'=>'ແກ້ໄຂລາຍການທີ່ເລືອກ','verbTrash'=>'ຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ','Previous'=>'ກ່ອນໜ້າ','Posts navigation'=>'ການນຳທາງເລື່ອງ','Newer posts'=>'ເລື່ອງໃໝ່ກວ່າ','Older posts'=>'ເລື່ອງເກົ່າກວ່າ','translationsAvailable'=>'ພ້ອມໃຊ້ງານ','translationsInstalled'=>'ຕິດຕັ້ງແລ້ວ','post format archive titleChats'=>'ສົນທະນາ','post format archive titleAudio'=>'ສຽງ','post format archive titleStatuses'=>'ສະຖານະ','post format archive titleLinks'=>'ລິ້ງ','post format archive titleQuotes'=>'ຄຳຄົມ','post format archive titleVideos'=>'ວິດີໂອ','post format archive titleImages'=>'ຮູບພາບ','post format archive titleGalleries'=>'ຄັງຮູບພາບ','post format archive titleAsides'=>'ເລື່ອງສັ້ນ','daily archives date formatF j, Y'=>'j F Y','Author: %s'=>'ຜູ້ຂຽນ: %s','The following values do not describe a valid date: year %1$s, month %2$s, day %3$s.'=>'ຄ່າຕໍ່ໄປນີ້ບໍ່ແມ່ນວັນທີທີ່ຖືກຕ້ອງ: ປີ %1$s, ເດືອນ %2$s, ວັນ %3$s.','Invalid value %1$s for %2$s. Expected value should be between %3$s and %4$s.'=>'ຄ່າ %1$s ບໍ່ຖືກຕ້ອງສຳລັບ %2$s. ຄ່າທີ່ຄາດຫວັງຄ