ຫຼັງຈາກທ່ານເປີດໃຊ້ງານແລ້ວ, ທ່ານຈະໄດ້ຮັບ *ອີເມວອີກສະບັບໜຶ່ງ* ພ້ອມກັບຂໍ້ມູນການເຂົ້າສູ່ລະບົບ.

ຫຼັງຈາກທ່ານເປີດໃຊ້ງານແລ້ວ, ທ່ານສາມາດເຂົ້າເບິ່ງເວັບໄຊໄດ້ທີ່ນີ້:

%2$s','That site is currently reserved but may be available in a couple days.'=>'ເວັບໄຊນັ້ນຖືກສະຫງວນໄວ້ໃນຂະນະນີ້ ແຕ່ອາດຈະພ້ອມໃຊ້ງານໃນອີກບໍ່ກີ່ມື້.','Sorry, that site is reserved!'=>'ຂໍອະໄພ, ເວັບໄຊນັ້ນຖືກສະຫງວນໄວ້!','Sorry, that site already exists!'=>'ຂໍອະໄພ, ເວັບໄຊນັ້ນມີຢູ່ແລ້ວ!','Please enter an item title'=>'ກະລຸນາປ້ອນຫົວຂໍ້ລາຍການ','Sorry, site names must have letters too!'=>'ຂໍອະໄພ, ຊື່ເວັບໄຊຕ້ອງມີຕົວອັກສອນນຳ!','Sorry, you may not use that site name.'=>'ຂໍອະໄພ, ທ່ານບໍ່ສາມາດໃຊ້ຊື່ເວັບໄຊນັ້ນໄດ້.','This site has been archived or suspended.'=>'ເວັບໄຊນີ້ຖືກເກັບເຂົ້າຄັງ ຫຼື ຖືກລະງັບການໃຊ້ງານ.','The site you have requested is not installed properly. Please contact the system administrator.'=>'ເວັບໄຊທີ່ທ່ານຮ້ອງຂໍບໍ່ໄດ້ຖືກຕິດຕັ້ງຢ່າງຖືກຕ້ອງ. ກະລຸນາຕິດຕໍ່ຜູ້ດູແລລະບົບ.','The given object ID is not that of a menu item.'=>'ID ຂອງວັດຖຸທີ່ລະບຸບໍ່ແມ່ນຂອງລາຍການເມນູ.','The Site address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'ທີ່ຢູ່ເວັບໄຊທີ່ທ່ານປ້ອນເບິ່ງຄືວ່າບໍ່ແມ່ນ URL ທີ່ຖືກຕ້ອງ. ກະລຸນາປ້ອນ URL ທີ່ຖືກຕ້ອງ.','The WordPress address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'ທີ່ຢູ່ WordPress ທີ່ທ່ານປ້ອນເບິ່ງຄືວ່າບໍ່ແມ່ນ URL ທີ່ຖືກຕ້ອງ. ກະລຸນາປ້ອນ URL ທີ່ຖືກຕ້ອງ.','The email address entered did not appear to be a valid email address. Please enter a valid email address.'=>'ທີ່ຢູ່ອີເມວທີ່ທ່ານປ້ອນເບິ່ງຄືວ່າບໍ່ຖືກຕ້ອງ. ກະລຸນາປ້ອນທີ່ຢູ່ອີເມວທີ່ຖືກຕ້ອງ.','A term with the name provided already exists with this parent.'=>'ມີເງື່ອນໄຂທີ່ມີຊື່ນີ້ຢູ່ແລ້ວພາຍໃຕ້ລຳດັບຫຼັກນີ້.','An error occurred adding you to this site. Go to the <a href="%s">homepage</a>.'=>'ເກີດຂໍ້ຜິດພາດໃນການເພີ່ມທ່ານເຂົ້າໃນເວັບໄຊນີ້. ໄປທີ່ <a href="%s">ໜ້າທຳອິດ</a>.','Your email address will not be published.'=>'ທີ່ຢູ່ອີເມວຂອງທ່ານຈະບໍ່ຖືກເຜີຍແຜ່.','A valid URL was not provided.'=>'ບໍ່ໄດ້ລະບຸ URL ທີ່ຖືກຕ້ອງ.','Could not calculate resized image dimensions'=>'ບໍ່ສາມາດຄຳນວນຂະໜາດຂອງຮູບພາບທີ່ປ່ຽນຂະໜາດໃໝ່ໄດ້','Completed <span class="count">(%s)</span>'=>'ສຳເລັດແລ້ວ <span class="count">(%s)</span>','You are logged in already. No need to register again!'=>'ທ່ານເຂົ້າສູ່ລະບົບແລ້ວ. ບໍ່ຈຳເປັນຕ້ອງລົງທະບຽນໃໝ່!','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'ທ່ານຕ້ອງ <a href="%s">ເຂົ້າສູ່ລະບົບ</a> ກ່ອນ ຈຶ່ງຈະສາມາດສ້າງເວັບໄຊໃໝ່ໄດ້.','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'ຍິນດີຕ້ອນຮັບກັບມາ, %s. ທ່ານສາມາດ <strong>ເພີ່ມເວັບໄຊອື່ນເຂົ້າໃນບັນຊີຂອງທ່ານ</strong> ໂດຍການຕື່ມແບບຟອມລຸ່ມນີ້. ທ່ານສາມາດສ້າງເວັບໄຊໄດ້ບໍ່ຈຳກັດ, ແຕ່ກະລຸນາຂຽນເນື້ອຫາຢ່າງມີຄວາມຮັບຜິດຊອບ!','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'ຕ້ອງມີຢ່າງໜ້ອຍ 4 ຕົວອັກສອນ, ປະກອບດ້ວຍຕົວອັກສອນ ແລະ ຕົວເລກເທົ່ານັ້ນ. ບໍ່ສາມາດປ່ຽນແປງໄດ້ໃນພາຍຫຼັງ, ກະລຸນາເລືອກຢ່າງລະມັດລະວັງ!','This action has been disabled by the administrator.'=>'ການດຳເນີນການນີ້ຖືກປິດໃຊ້ງານໂດຍຜູ້ດູແລລະບົບ.','Page %s'=>'ໜ້າ %s','Briefly unavailable for scheduled maintenance. Check back in a minute.'=>'ບໍ່ສາມາດໃຊ້ງານໄດ້ຊົ່ວຄາວເນື່ອງຈາກການບຳລຸງຮັກສາຕາມກຳນົດເວລາ. ກະລຸນາກວດເບິ່ງໃໝ່ໃນອີກຈັກໜ້ອຍ.','Maintenance'=>'ການບຳລຸງຮັກສາ','Navigation Menus'=>'ເມນູນຳທາງ','Navigation Menu Item'=>'ລາຍການເມນູນຳທາງ','Navigation Menu Items'=>'ລາຍການເມນູນຳທາງ','Links for %s'=>'ລິ້ງສຳລັບ %s','No menus have been created yet. <a href="%s">Create some</a>.'=>'ຍັງບໍ່ໄດ້ສ້າງເມນູໃດໆ. <a href="%s">ສ້າງເມນູ</a>.','This is the short link.'=>'ນີ້ແມ່ນລິ້ງສັ້ນ.','%d Theme Update'=>'ອັບເດດທີມ %d ລາຍການ','%d Plugin Update'=>'ອັບເດດປລັກອິນ %d ລາຍການ','%d WordPress Update'=>'ອັບເດດ WordPress %d ລາຍການ','Site registration has been disabled.'=>'ການລົງທະບຽນເວັບໄຊຖືກປິດໃຊ້ງານ.','If you do not activate your site within two days, you will have to sign up again.'=>'ຫາກທ່ານບໍ່ເປີດໃຊ້ງານເວັບໄຊຂອງທ່ານພາຍໃນສອງມື້, ທ່ານຈະຕ້ອງລົງທະບຽນໃໝ່.','But, before you can start using your site, <strong>you must activate it</strong>.'=>'ແຕ່ກ່ອນທີ່ທ່ານຈະເລີ່ມໃຊ້ເວັບໄຊໄດ້, <strong>ທ່ານຕ້ອງເປີດໃຊ້ງານມັນກ່ອນ</strong>.','Congratulations! Your new site, %s, is almost ready.'=>'ຂໍສະແດງຄວາມຍິນດີ! ເວັບໄຊໃໝ່ຂອງທ່ານ (%s) ໃກ້ຈະພ້ອມແລ້ວ.','Gimme a site!'=>'ຂໍເວັບໄຊໃຫ້ຂ້ອຍແດ່!','The site %s is yours.'=>'ເວັບໄຊ %s ເປັນຂອງທ່ານແລ້ວ.','Create Site'=>'ສ້າງເວັບໄຊ','If you are not going to use a great site domain, leave it for a new user. Now have at it!'=>'ຖ້າທ່ານບໍ່ຕັ້ງໃຈຈະໃຊ້ໂດເມນເວັບໄຊທີ່ດີນີ້, ກະລຸນາປະມັນໄວ້ໃຫ້ຜູ້ໃຊ້ໃໝ່. ຕອນນີ້ເລີ່ມໄດ້ເລີຍ!','Sites you are already a member of:'=>'ເວັບໄຊທີ່ທ່ານເປັນສະມາຊິກຢູ່ແລ້ວ:','Get <em>another</em> %s site in seconds'=>'ສ້າງເວັບໄຊ %s <em>ອື່ນ</em> ໃນບໍ່ກີ່ວິນາທີ','Site Title:'=>'ຊື່ເວັບໄຊ:','sitename'=>'ຊື່ເວັບໄຊ','File canceled.'=>'ຍົກເລີກໄຟລ໌ແລ້ວ.','A new comment on the post "%s" is waiting for your approval'=>'ມີຄວາມເຫັນໃໝ່ໃນບົດຄວາມ "%s" ກຳລັງລໍຖ້າການອະນຸມັດ','A new pingback on the post "%s" is waiting for your approval'=>'ມີ pingback ໃໝ່ໃນບົດຄວາມ "%s" ກຳລັງລໍຖ້າການອະນຸມັດ','A new trackback on the post "%s" is waiting for your approval'=>'ມີ trackback ໃໝ່ໃນບົດຄວາມ "%s" ກຳລັງລໍຖ້າການອະນຸມັດ','New pingback on your post "%s"'=>'ມີ pingback ໃໝ່ໃນບົດຄວາມ "%s" ຂອງທ່ານ','New trackback on your post "%s"'=>'ມີ trackback ໃໝ່ໃນບົດຄວາມ "%s" ຂອງທ່ານ','New comment on your post "%s"'=>'ມີຄວາມເຫັນໃໝ່ໃນບົດຄວາມ "%s" ຂອງທ່ານ','If your site does not display, please contact the owner of this network.'=>'ຫາກເວັບໄຊຂອງທ່ານບໍ່ສະແດງຜົນ, ກະລຸນາຕິດຕໍ່ເຈົ້າຂອງເຄືອຂ່າຍນີ້.','Select Menu:'=>'ເລືອກເມນູ:','Navigation Menu'=>'ເມນູນຳທາງ','Taxonomy:'=>'Taxonomy:','Search results for: "%s"'=>'ຜົນການຄົ້ນຫາສຳລັບ: "%s"','One response to %s'=>'ໜຶ່ງການຕອບກັບໃນ %s','Menus'=>'ເມນູ','Your PHP installation appears to be missing the MySQL extension which is required by WordPress.'=>'ເບິ່ງຄືວ່າ PHP ຂອງທ່ານບໍ່ໄດ້ຕິດຕັ້ງສ່ວນເສີມ MySQL ທີ່ຈຳເປັນສຳລັບ WordPress.','The specified target URL does not exist.'=>'URL ເປົ້າໝາຍທີ່ລະບຸບໍ່ມີຢູ່.','Pingback from %1$s to %2$s registered. Keep the web talking! :-)'=>'Pingback ຈາກ %1$s ໄປຫາ %2$s ຖືກລົງທະບຽນແລ້ວ.','The source URL does not contain a link to the target URL, and so cannot be used as a source.'=>'URL ຕົ້ນທາງບໍ່ມີລິ້ງໄປຫາ URL ເປົ້າໝາຍ ຈຶ່ງບໍ່ສາມາດໃຊ້ເປັນຕົ້ນທາງໄດ້.','The source URL does not exist.'=>'URL ຕົ້ນທາງບໍ່ມີຢູ່.','The pingback has already been registered.'=>'Pingback ນີ້ຖືກລົງທະບຽນຢູ່ແລ້ວ.','The source URL and the target URL cannot both point to the same resource.'=>'URL ຕົ້ນທາງ ແລະ URL ເປົ້າໝາຍບໍ່ສາມາດຊີ້ໄປຫາແຫຼ່ງຂໍ້ມູນດຽວກັນໄດ້.','The specified target URL cannot be used as a target. It either does not exist, or it is not a pingback-enabled resource.'=>'URL ເປົ້າໝາຍທີ່ລະບຸບໍ່ສາມາດໃຊ້ໄດ້. ມັນອາດຈະບໍ່ມີຢູ່ ຫຼື ບໍ່ຮອງຮັບ pingback.','Is there no link to us?'=>'ບໍ່ມີລິ້ງມາຫາພວກເຮົາບໍ?','Could not write file %1$s (%2$s).'=>'ບໍ່ສາມາດຂຽນໄຟລ໌ %1$s ໄດ້ (%2$s).','Sorry, you are not allowed to change the page author as this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ປ່ຽນຜູ້ຂຽນໜ້າໃນນາມຜູ້ໃຊ້ນີ້.','Sorry, you are not allowed to change the post author as this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ປ່ຽນຜູ້ຂຽນບົດຄວາມໃນນາມຜູ້ໃຊ້ນີ້.','Sorry, you are not allowed to update posts as this user.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອັບເດດບົດຄວາມໃນນາມຜູ້ໃຊ້ນີ້.','Invalid post type.'=>'ປະເພດບົດຄວາມບໍ່ຖືກຕ້ອງ.','Sorry, you are not allowed to publish posts in this post type.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຜີຍແຜ່ບົດຄວາມໃນປະເພດບົດຄວາມນີ້.','Sorry, no such post.'=>'ຂໍອະໄພ, ບໍ່ມີບົດຄວາມນີ້.','Sorry, you are not allowed to publish this post.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຜີຍແຜ່ບົດຄວາມນີ້.','Sorry, you are not allowed to update options.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ອັບເດດຕົວເລືອກຕ່າງໆ.','Sorry, you are not allowed to access details of this post.'=>'ຂໍອະໄພ, ທ່ານບໍ່ໄດ້ຮັບອະນຸຍາດໃຫ້ເຂົ້າເຖິງລາຍລະອຽດຂອງບົດຄວາມນີ້.','A valid email address is required.'=>'ຈຳເປັນຕ້ອງມີທີ່ຢູ່ອີເມວທີ່ຖືກຕ້ອງ.','Comment author name and email are required.'=>'ຈຳເປັນຕ້ອງມີຊື່ຜູ້ຂຽນ ແລະ ອີເມວສຳລັບຄວາມເຫັນ.','Invalid post ID.'=>'ID ບົດຄວາມບໍ່ຖືກຕ້ອງ.','Invalid comment status.'=>'ສະຖານະຄວາມເຫັນບໍ່ຖືກຕ້ອງ.','Invalid comment ID.'=>'ID ຄວາມເຫັນບໍ່ຖືກຕ້ອງ.','Failed to delete the page.'=>'ລຶບໜ້າບໍ່ສຳເລັດ.','Sorry, no such page.'=>'ຂໍອະໄພ, ບໍ່ມີໜ້ານີ້.','Allow new users to sign up'=>'ອະນຸຍາດໃຫ້ຜູ້ໃຊ້ໃໝ່ລົງທະບຽນ','Time Zone'=>'ເຂດເວລາ','Software Version'=>'ເວີຊັນຊອບແວ','Software Name'=>'ຊື່ຊອບແວ','User registration has been disabled.'=>'ການລົງທະບຽນຜູ້ໃຊ້ຖືກປິດໃຊ້ງານ.','Registration has been disabled.'=>'ການລົງທະບຽນຖືກປິດໃຊ້ງານ.','If you have not received your email yet, there are a number of things you can do:'=>'ຫາກທ່ານຍັງບໍ່ໄດ້ຮັບອີເມວ, ນີ້ແມ່ນບາງສິ່ງທີ່ທ່ານສາມາດເຮັດໄດ້:','Still waiting for your email?'=>'ຍັງລໍຖ້າອີເມວຂອງທ່ານຢູ່ບໍ?','Sign up'=>'ລົງທະບຽນ','If you do not activate your username within two days, you will have to sign up again.'=>'ຫາກທ່ານບໍ່ເປີດໃຊ້ງານຊື່ຜູ້ໃຊ້ພາຍໃນສອງມື້, ທ່ານຈະຕ້ອງລົງທະບຽນໃໝ່.','But, before you can start using your new username, <strong>you must activate it</strong>.'=>'ແຕ່ກ່ອນທີ່ຈະເລີ່ມໃຊ້ຊື່ຜູ້ໃຊ້ໃໝ່ໄດ້, <strong>ທ່ານຕ້ອງເປີດໃຊ້ງານມັນກ່ອນ</strong>.','%s is your new username'=>'%s ແມ່ນຊື່ຜູ້ໃຊ້ໃໝ່ຂອງທ່ານ','Next'=>'ຖັດໄປ','Just a username, please.'=>'ຂໍພຽງແຕ່ຊື່ຜູ້ໃຊ້ເທົ່ານັ້ນ.','Get your own %s account in seconds'=>'ສ້າງບັນຊີ %s ຂອງທ່ານເອງໃນບໍ່ກີ່ວິນາທີ','There was a problem, please correct the form below and try again.'=>'ເກີດບັນຫາ, ກະລຸນາແກ້ໄຂແບບຟອມລຸ່ມນີ້ແລ້ວລອງໃໝ່.','Email&nbsp;Address:'=>'ທີ່ຢູ່ອີເມວ:','(Must be at least 4 characters, lowercase letters and numbers only.)'=>'(ຕ້ອງມີຢ່າງໜ້ອຍ 4 ຕົວອັກສອນ, ປະກອບດ້ວຍຕົວອັກສອນພິມນ້ອຍ ແລະ ຕົວເລກເທົ່ານັ້ນ.)','Privacy:'=>'ຄວາມເປັນສ່ວນຕົວ:','Oops: %s'=>'ຂໍ້ຜິດພາດ: %s','There does not seem to be any new mail.'=>'ເບິ່ງຄືວ່າບໍ່ມີອີເມວໃໝ່.','Slow down, no need to check for new mails so often!'=>'ກະລຸນາລໍຖ້າ, ບໍ່ຈຳເປັນຕ້ອງກວດເບິ່ງອີເມວໃໝ່ເລື້ອຍໆປານນັ້ນ!','You are now logged out.'=>'ທ່ານອອກຈາກລະບົບແລ້ວ.','You have logged in successfully.'=>'ທ່ານເຂົ້າສູ່ລະບົບສຳເລັດແລ້ວ.','Lost your password?'=>'ລືມລະຫັດຜ່ານບໍ?','Register For This Site'=>'ລົງທະບຽນສຳລັບເວັບໄຊນີ້','Registration Form'=>'ແບບຟອມລົງທະບຽນ','Get New Password'=>'ຂໍລະຫັດຜ່ານໃໝ່','Lost Password'=>'ລືມລະຫັດຜ່ານ','<strong>Error:</strong> The email address is not correct.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ທີ່ຢູ່ອີເມວບໍ່ຖືກຕ້ອງ.','<strong>Error:</strong> Please type your email address.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ກະລຸນາພິມທີ່ຢູ່ອີເມວຂອງທ່ານ.','Invalid key.'=>'ຄີ (Key) ບໍ່ຖືກຕ້ອງ.','[%s] Password Reset'=>'[%s] ການຕັ້ງລະຫັດຜ່ານໃໝ່','Password reset is not allowed for this user'=>'ບໍ່ອະນຸຍາດໃຫ້ຕັ້ງລະຫັດຜ່ານໃໝ່ສຳລັບຜູ້ໃຊ້ນີ້','<strong>Error:</strong> Please enter a username or email address.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ກະລຸນາປ້ອນຊື່ຜູ້ໃຊ້ ຫຼື ທີ່ຢູ່ອີເມວ.','Powered by WordPress'=>'ຂັບເຄື່ອນໂດຍ WordPress','<strong>Error:</strong> WordPress %1$s requires MySQL %2$s or higher'=>'<strong>ຂໍ້ຜິດພາດ:</strong> WordPress %1$s ຕ້ອງການ MySQL %2$s ຫຼື ສູງກວ່າ','Sidebar %d'=>'ແຖບຂ້າງ %d','Please log in again.'=>'ກະລຸນາເຂົ້າສູ່ລະບົບໃໝ່ອີກຄັ້ງ.','<strong>Error:</strong> Your account has been marked as a spammer.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ບັນຊີຂອງທ່ານຖືກໝາຍວ່າເປັນຜູ້ສົ່ງສະແປມ.','<strong>Error:</strong> The password field is empty.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ຊ່ອງລະຫັດຜ່ານວ່າງເປົ່າ.','<strong>Error:</strong> The username field is empty.'=>'<strong>ຂໍ້ຜິດພາດ:</strong> ຊ່ອງຊື່ຜູ້ໃຊ້ວ່າງເປົ່າ.','Stylesheet is missing.'=>'ບໍ່ພົບ Stylesheet.','The parent theme is missing. Please install the "%s" parent theme.'=>'ບໍ່ພົບທີມຫຼັກ. ກະລຸນາຕິດຕັ້ງທີມຫຼັກ "%s".','Invalid object ID.'=>'ID ວັດຖຸບໍ່ຖືກຕ້ອງ.','The slug &#8220;%s&#8221; is already in use by another term.'=>'Slug &#8220;%s&#8221; ຖືກໃຊ້ໂດຍເງື່ອນໄຂອື່ນແລ້ວ.','Could not insert term into the database.'=>'ບໍ່ສາມາດເພີ່ມເງື່ອນໄຂເຂົ້າໃນຖານຂໍ້ມູນ.','Invalid item ID.'=>'ID ລາຍການບໍ່ຖືກຕ້ອງ.','Empty Term.'=>'ເງື່ອນໄຂວ່າງເປົ່າ.','password strengthMedium'=>'ປານກາງ','Separate pattern categories with commas'=>'ແຍກໝວດໝູ່ຮູບແບບດ້ວຍຈຸດ','moved to the Trash.'=>'ຍ້າຍໄປທີ່ຖັງຂີ້ເຫຍື້ອແລ້ວ.','Crunching&hellip;'=>'ກຳລັງປະມວນຜົນ&hellip;','Upload stopped.'=>'ການອັບໂຫຼດຖືກຢຸດ.','Security error.'=>'ຂໍ້ຜິດພາດດ້ານຄວາມປອດໄພ.','IO error.'=>'IO ຜິດພາດ.','Upload failed.'=>'ການອັບໂຫຼດບໍ່ສຳເລັດ.','You may only upload 1 file.'=>'ທ່ານສາມາດອັບໂຫຼດໄດ້ພຽງ 1 ໄຟລ໌ເທົ່ານັ້ນ.','There was a configuration error. Please contact the server administrator.'=>'ເກີດຂໍ້ຜິດພາດໃນການກຳນົດຄ່າ. ກະລຸນາຕິດຕໍ່ຜູ້ດູແລເຊີບເວີ.','An error occurred in the upload. Please try again later.'=>'ເກີດຂໍ້ຜິດພາດໃນການອັບໂຫຼດ. ກະລຸນາລອງໃໝ່ພາຍຫຼັງ.','This file is empty. Please try another.'=>'ໄຟລ໌ນີ້ວ່າງເປົ່າ. ກະລຸນາລອງໄຟລ໌ອື່ນ.','You have attempted to queue too many files.'=>'ທ່ານພະຍາຍາມອັບໂຫຼດໄຟລ໌ຫຼາຍເກີນໄປ.','This feature requires inline frames. You have iframes disabled or your browser does not support them.'=>'ຄຸນສົມບັດນີ້ຕ້ອງການ inline frames. ທ່ານໄດ້ປິດການໃຊ້ງານ iframe ຫຼື ບຣາວເຊີຂອງທ່ານບໍ່ຮອງຮັບ.','of'=>'ຈາກ','Image'=>'ຮູບພາບ','&lt; Prev'=>'&lt; ກ່ອນໜ້າ','Next &gt;'=>'ຖັດໄປ &gt;','Enter a description of the image'=>'ປ້ອນຄຳອະທິບາຍຂອງຮູບພາບ','Enter the URL of the image'=>'ປ້ອນ URL ຂອງຮູບພາບ','Enter the URL'=>'ປ້ອນ URL','close tags'=>'ປິດແທັກ','Close all open tags'=>'ປິດແທັກທັງໝົດທີ່ເປີດຢູ່','An error has occurred, which probably means the feed is down. Try again later.'=>'ເກີດຂໍ້ຜິດພາດ, ເຊິ່ງອາດຈະໝາຍຄວາມວ່າຟີດ (Feed) ປິດຢູ່. ກະລຸນາລອງໃໝ່ພາຍຫຼັງ.','Cannot create a user with an empty login name.'=>'ບໍ່ສາມາດສ້າງຜູ້ໃຊ້ໂດຍບໍ່ມີຊື່ເຂົ້າສູ່ລະບົບໄດ້.','Cannot create a revision of a revision'=>'ບໍ່ສາມາດສ້າງລຸ້ນແກ້ໄຂຊ້ອນລຸ້ນແກ້ໄຂໄດ້.','Could not insert post into the database.'=>'ບໍ່ສາມາດເພີ່ມບົດຄວາມເຂົ້າໃນຖານຂໍ້ມູນ.','Could not update post in the database.'=>'ບໍ່ສາມາດອັບເດດບົດຄວາມໃນຖານຂໍ້ມູນ.','Content, title, and excerpt are empty.'=>'ເນື້ອຫາ, ຫົວຂໍ້ ແລະ ບົດຄັດຫຍໍ້ວ່າງເປົ່າ.','Document <span class="count">(%s)</span>'=>'ເອກະສານ <span class="count">(%s)</span>','Trash <span class="count">(%s)</span>'=>'ຖັງຂີ້ເຫຍື້ອ <span class="count">(%s)</span>','Private <span class="count">(%s)</span>'=>'ສ່ວນຕົວ <span class="count">(%s)</span>','Pending <span class="count">(%s)</span>'=>'ລໍຖ້າການກວດສອບ <span class="count">(%s)</span>','Draft <span class="count">(%s)</span>'=>'ສະບັບຮ່າງ <span class="count">(%s)</span>','Scheduled <span class="count">(%s)</span>'=>'ຕັ້ງເວລາໄວ້ <span class="count">(%s)</span>','Published <span class="count">(%s)</span>'=>'ເຜີຍແຜ່ແລ້ວ <span class="count">(%s)</span>','Revision'=>'ລຸ້ນແກ້ໄຂ','%s [Current Revision]'=>'%s [ລຸ້ນປັດຈຸບັນ]','%s [Autosave]'=>'%s [ບັນທຶກອັດຕະໂນມັດ]','Home'=>'ໜ້າທຳອິດ','Previous page'=>'ໜ້າກ່ອນໜ້າ','Next page'=>'ໜ້າຖັດໄປ','There is no excerpt because this is a protected post.'=>'ບໍ່ມີບົດຄັດຫຍໍ້ເນື່ອງຈາກບົດຄວາມນີ້ຖືກປ້ອງກັນໄວ້.','Private: %s'=>'ສ່ວນຕົວ: %s','Protected: %s'=>'ຖືກປ້ອງກັນ: %s','[%s] New User Registration'=>'[%s] ການລົງທະບຽນຜູ້ໃຊ້ໃໝ່','Username: %s'=>'ຊື່ຜູ້ໃຊ້: %s','[%1$s] Please moderate: "%2$s"'=>'[%1$s] ກະລຸນາກວດສອບຄວາມເຫັນ: "%2$s"','Currently %s comment is waiting for approval. Please visit the moderation panel:'=>'ຕອນນີ້ມີ %s ຄວາມເຫັນກຳລັງລໍຖ້າການອະນຸມັດ. ກະລຸນາເຂົ້າໄປທີ່ແຜງຈັດການ:','Approve it: %s'=>'ອະນຸມັດ: %s','Pingback excerpt: '=>'ບົດຄັດຫຍໍ້ Pingback: ','Trackback excerpt: '=>'ບົດຄັດຫຍໍ້ Trackback: ','Spam it: %s'=>'ໝາຍວ່າເປັນສະແປມ: %s','Delete it: %s'=>'ລຶບຖິ້ມ: %s','Trash it: %s'=>'ຍ້າຍໄປຖັງຂີ້ເຫຍື້ອ: %s','[%1$s] Pingback: "%2$s"'=>'[%1$s] Pingback: "%2$s"','[%1$s] Trackback: "%2$s"'=>'[%1$s] Trackback: "%2$s"','[%1$s] Comment: "%2$s"'=>'[%1$s] ຄວາມເຫັນ: "%2$s"','You can see all notes on this post here:'=>'ທ່ານສາມາດເບິ່ງບັນທຶກທັງໝົດໃນບົດຄວາມນີ້ໄດ້ທີ່ນີ້:','If you are still stuck with this message, then check that your database contains the following tables:'=>'ຫາກທ່ານຍັງຄົງຕິດຢູ່ກັບຂໍ້ຄວາມນີ້, ກະລຸນາກວດສອບວ່າຖານຂໍ້ມູນຂອງທ່ານມີຕາຕະລາງຕໍ່ໄປນີ້ຫຼືບໍ່:','What do I do now?'=>'ຂ້ອຍຄວນເຮັດແນວໃດຕໍ່?','This file is too big. Files must be less than %s KB in size.'=>'ໄຟລ໌ນີ້ໃຫຍ່ເກີນໄປ. ໄຟລ໌ຕ້ອງມີຂະໜາດນ້ອຍກວ່າ %s KB.','Sorry, you have used your space allocation of %s. Please delete some files to upload more files.'=>'ຂໍອະໄພ, ທ່ານໄດ້ໃຊ້ພື້ນທີ່ທີ່ໄດ້ຮັບການຈັດສັນ %s ຄົບແລ້ວ. ກະລຸນາລຶບໄຟລ໌ບາງສ່ວນອອກເພື່ອອັບໂຫຼດໄຟລ໌ເພີ່ມເຕີມ.','New %1$s User: %2$s'=>'ຜູ້ໃຊ້ %1$s ໃໝ່: %2$s','New User Registration: %s'=>'ການລົງທະບຽນຜູ້ໃຊ້ໃໝ່: %s','That username is already activated.'=>'ຊື່ຜູ້ໃຊ້ນີ້ຖືກເປີດໃຊ້ງານຢູ່ແລ້ວ.','Could not create user'=>'ບໍ່ສາມາດສ້າງຜູ້ໃຊ້ໄດ້','Invalid activation key.'=>'ຄີສຳລັບເປີດໃຊ້ງານ (Activation key) ບໍ່ຖືກຕ້ອງ.','Please enter a page title'=>'ກະລຸນາປ້ອນຫົວຂໍ້ໜ້າ','That username is currently reserved but may be available in a couple of days.'=>'ຊື່ຜູ້ໃຊ້ນີ້ຖືກສະຫງວນໄວ້ໃນຂະນະນີ້ ແຕ່ອາດຈະພ້ອມໃຊ້ງານໃນອີກບໍ່ກີ່ມື້.','Sorry, that email address is already used!'=>'ຂໍອະໄພ, ທີ່ຢູ່ອີເມວນີ້ຖືກໃຊ້ແລ້ວ!','Sorry, that username already exists!'=>'ຂໍອະໄພ, ຊື່ຜູ້ໃຊ້ນີ້ມີຢູ່ແລ້ວ!','Sorry, that email address is not allowed!'=>'ຂໍອະໄພ, ທີ່ຢູ່ອີເມວນີ້ບໍ່ໄດ້ຮັບອະນຸຍາດ!','Sorry, usernames must have letters too!'=>'ຂໍອະໄພ, ຊື່ຜູ້ໃຊ້ຕ້ອງມີຕົວອັກສອນນຳ!','You cannot use that email address to signup. There are problems with them blocking some emails from WordPress. Please use another email provider.'=>'ທ່ານບໍ່ສາມາດໃຊ້ທີ່ຢູ່ອີເມວນັ້ນເພື່ອລົງທະບຽນໄດ້. ມີບັນຫາໃນການປິດກັ້ນບາງອີເມວຈາກ WordPress. ກະລຸນາໃຊ້ຜູ້ໃຫ້ບໍລິການອີເມວອື່ນ.','That user does not exist.'=>'ບໍ່ມີຜູ້ໃຊ້ນີ້ຢູ່.','PM'=>'PM','AM'=>'AM','pm'=>'pm','am'=>'am','&laquo; Older Comments'=>'&laquo; ຄວາມເຫັນເກົ່າກວ່າ','Newer Comments &raquo;'=>'ຄວາມເຫັນໃໝ່ກວ່າ &raquo;','Last Post'=>'ບົດຄວາມຫຼ້າສຸດ','Next Post'=>'ບົດຄວາມຖັດໄປ','Previous Post'=>'ບົດຄວາມກ່ອນໜ້າ','Comments Feed'=>'ຟີດຄວາມເຫັນ','Insert Page Break tag'=>'ເພີ່ມແທັກຕັດໜ້າ (Page Break)','Fill Screen'=>'ເຕັມຈໍພາບ','Remove link'=>'ລຶບລິ້ງອອກ','Insert link'=>'ແຊກລິ້ງ','Check Spelling'=>'ກວດການສະກົດຄຳ','Select all'=>'ເລືອກທັງໝົດ','Action'=>'ການກະທຳ','Letter'=>'ຕົວອັກສອນ','Link Rel'=>'ລິ້ງ Rel','Source'=>'ແຫຼ່ງທີ່ມາ','Bottom Right'=>'ລຸ່ມຂວາ','Bottom Left'=>'ລຸ່ມຊ້າຍ','Top Right'=>'ເທິງຂວາ','Top Left'=>'ເທິງຊ້າຍ','Mute'=>'ປິດສຽງ','Fullscreen'=>'ເຕັມຈໍ','Align'=>'ຈັດວາງ','Loop'=>'ຫຼິ້ນຊ້ຳ (Loop)','Type'=>'ປະເພດ','Constrain proportions'=>'ຄົງອັດຕາສ່ວນໄວ້','General'=>'ທົ່ວໄປ','The URL you entered seems to be an external link. Do you want to add the required http:// prefix?'=>'URL ທີ່ທ່ານປ້ອນເບິ່ງຄືວ່າເປັນລິ້ງພາຍນອກ. ທ່ານຕ້ອງການເພີ່ມຄຳນຳໜ້າ http:// ທີ່ຈຳເປັນຫຼືບໍ່?','The URL you entered seems to be an email address. Do you want to add the required mailto: prefix?'=>'URL ທີ່ທ່ານປ້ອນເບິ່ງຄືວ່າເປັນທີ່ຢູ່ອີເມວ. ທ່ານຕ້ອງການເພີ່ມຄຳນຳໜ້າ mailto: ທີ່ຈຳເປັນຫຼືບໍ່?','Bottom'=>'ທາງລຸ່ມ','Middle'=>'ທາງກາງ','Top'=>'ທາງເທິງ','Horizontal space'=>'ໄລຍະຫ່າງແນວນອນ','Vertical space'=>'ໄລຍະຫ່າງແນວຕັ້ງ','Dimensions'=>'ຂະໜາດ','Border'=>'ຂອບ','Image description'=>'ຄຳອະທິບາຍຮູບພາບ','New document'=>'ເອກະສານໃໝ່','Paste'=>'ວາງ','Copy'=>'ສຳເນົາ','Cut'=>'ຕັດ','Superscript'=>'ຕົວຂຶ້ນ (Superscript)','Subscript'=>'ຕົວຫ້ອຍ (Subscript)','Strikethrough'=>'ຂີດຂ້າ','Underline'=>'ຂີດກ້ອງ','Italic'=>'ຕົວອຽງ','Bold'=>'ຕົວເຂັ້ມ','Code'=>'ໂຄ້ດ','Blockquote'=>'ຄຳອ້າງອີງ (Blockquote)','Heading 6'=>'ຫົວຂໍ້ 6','Heading 5'=>'ຫົວຂໍ້ 5','Heading 4'=>'ຫົວຂໍ້ 4','Heading 3'=>'ຫົວຂໍ້ 3','Heading 2'=>'ຫົວຂໍ້ 2','Heading 1'=>'ຫົວຂໍ້ 1','Paragraph'=>'ຫຍໍ້ໜ້າ','Language'=>'ພາສາ','Document properties'=>'ຄຸນສົມບັດຂອງເອກະສານ','The changes you made will be lost if you navigate away from this page.'=>'ການປ່ຽນແປງທີ່ທ່ານເຮັດຈະສູນຫາຍໄປ ຫາກທ່ານອອກຈາກໜ້ານີ້.','Column'=>'ຖັນ','Row'=>'ແຖວ','Delete table'=>'ລຶບຕາຕະລາງ','Copy table row'=>'ສຳເນົາແຖວຕາຕະລາງ','Cut table row'=>'ຕັດແຖວຕາຕະລາງ','Paste table row after'=>'ວາງແຖວຕາຕະລາງທາງຫຼັງ','Paste table row before'=>'ວາງແຖວຕາຕະລາງທາງໜ້າ','Table properties'=>'ຄຸນສົມບັດຂອງຕາຕະລາງ','Table cell properties'=>'ຄຸນສົມບັດຂອງຫ້ອງຕາຕະລາງ','Table row properties'=>'ຄຸນສົມບັດຂອງແຖວຕາຕະລາງ','Merge table cells'=>'ລວມຫ້ອງຕາຕະລາງ','Insert column after'=>'ແຊກຖັນທາງຫຼັງ','Insert column before'=>'ແຊກຖັນທາງໜ້າ','Delete row'=>'ລຶບແຖວ','Insert row after'=>'ແຊກແຖວທາງຫຼັງ','Insert row before'=>'ແຊກແຖວທາງໜ້າ','Insert/edit link'=>'ແຊກ/ແກ້ໄຂລິ້ງ','Insert/edit image'=>'ແຊກ/ແກ້ໄຂຮູບພາບ','Print'=>'ພິມ','Sat'=>'ເສົາ','Fri'=>'ສຸກ','Thu'=>'ພະຫັດ','Wed'=>'ພຸດ','Tue'=>'ອັງຄານ','Mon'